package du.bible;

public class dubible19 {

public dubible19() {

putmapbible19_1();
putmapbible19_2();

}

private void putmapbible19_1() {

dusuperobject.biblemap.put("b19_1_1", new dusuperobject(19,1,1,"Welgelukzalig is de man, die niet wandelt in de raad der goddelozen, noch staat op den weg der zondaren, noch zit in het gestoelte der spotters;"));
dusuperobject.biblemap.put("b19_1_2", new dusuperobject(19,1,2,"Maar zijn lust is in des HEEREN wet, en hij overdenkt Zijn wet dag en nacht."));
dusuperobject.biblemap.put("b19_1_3", new dusuperobject(19,1,3,"Want hij zal zijn als een boom, geplant aan waterbeken, die zijn vrucht geeft op zijn tijd, en welks blad niet afvalt; en al wat hij doet, zal wel gelukken."));
dusuperobject.biblemap.put("b19_1_4", new dusuperobject(19,1,4,"Alzo zijn de goddelozen niet, maar als het kaf, dat de wind henendrijft."));
dusuperobject.biblemap.put("b19_1_5", new dusuperobject(19,1,5,"Daarom zullen de goddelozen niet bestaan in het gericht, noch de zondaars in de vergadering der rechtvaardigen."));
dusuperobject.biblemap.put("b19_1_6", new dusuperobject(19,1,6,"Want de HEERE kent den weg der rechtvaardigen; maar de weg der goddelozen zal vergaan."));
dusuperobject.biblemap.put("b19_2_1", new dusuperobject(19,2,1,"Waarom woeden de heidenen, en bedenken de volken ijdelheid?"));
dusuperobject.biblemap.put("b19_2_2", new dusuperobject(19,2,2,"De koningen der aarde stellen zich op, en de vorsten beraadslagen te zamen tegen den HEERE, en tegen Zijn Gezalfde, zeggende:"));
dusuperobject.biblemap.put("b19_2_3", new dusuperobject(19,2,3,"Laat ons hun banden verscheuren, en hun touwen van ons werpen."));
dusuperobject.biblemap.put("b19_2_4", new dusuperobject(19,2,4,"Die in den hemel woont, zal lachen; de HEERE zal hen bespotten."));
dusuperobject.biblemap.put("b19_2_5", new dusuperobject(19,2,5,"Dan zal Hij tot hen spreken in Zijn toorn, en in Zijn grimmigheid zal Hij hen verschrikken."));
dusuperobject.biblemap.put("b19_2_6", new dusuperobject(19,2,6,"Ik toch heb Mijn Koning gezalfd over Sion, den berg Mijner heiligheid."));
dusuperobject.biblemap.put("b19_2_7", new dusuperobject(19,2,7,"Ik zal van het besluit verhalen: de HEERE heeft tot Mij gezegd: Gij zijt Mijn Zoon, heden heb Ik U gegenereerd."));
dusuperobject.biblemap.put("b19_2_8", new dusuperobject(19,2,8,"Eis van Mij, en Ik zal de heidenen geven tot Uw erfdeel, en de einden der aarde tot Uw bezitting."));
dusuperobject.biblemap.put("b19_2_9", new dusuperobject(19,2,9,"Gij zult hen verpletteren met een ijzeren scepter; Gij zult hen in stukken slaan als een pottenbakkersvat."));
dusuperobject.biblemap.put("b19_2_10", new dusuperobject(19,2,10,"Nu dan, gij koningen, handelt verstandiglijk; laat u tuchtigen, gij rechters der aarde!"));
dusuperobject.biblemap.put("b19_2_11", new dusuperobject(19,2,11,"Dient den HEERE met vreze, en verheugt u met beving."));
dusuperobject.biblemap.put("b19_2_12", new dusuperobject(19,2,12,"Kust den Zoon, opdat Hij niet toorne, en gij op den weg vergaat, wanneer Zijn toorn maar een weinig zou ontbranden. Welgelukzalig zijn allen, die op Hem betrouwen."));
dusuperobject.biblemap.put("b19_3_1", new dusuperobject(19,3,1,"Een psalm van David, als hij vlood voor het aangezicht van zijn zoon Absalom."));
dusuperobject.biblemap.put("b19_3_2", new dusuperobject(19,3,2,"O HEERE! hoe zijn mijn tegenpartijders vermenigvuldigd; velen staan tegen mij op."));
dusuperobject.biblemap.put("b19_3_3", new dusuperobject(19,3,3,"Velen zeggen van mijn ziel: Hij heeft geen heil bij God. Sela."));
dusuperobject.biblemap.put("b19_3_4", new dusuperobject(19,3,4,"Doch Gij, HEERE! zijt een Schild voor mij, mijn eer, en Die mijn hoofd opheft."));
dusuperobject.biblemap.put("b19_3_5", new dusuperobject(19,3,5,"Ik riep met mijn stem tot den HEERE, en Hij verhoorde mij van den berg Zijner heiligheid. Sela."));
dusuperobject.biblemap.put("b19_3_6", new dusuperobject(19,3,6,"Ik lag neder en sliep; ik ontwaakte, want de HEERE ondersteunde mij."));
dusuperobject.biblemap.put("b19_3_7", new dusuperobject(19,3,7,"Ik zal niet vrezen voor tienduizenden des volks, die zich rondom tegen mij zetten."));
dusuperobject.biblemap.put("b19_3_8", new dusuperobject(19,3,8,"Sta op, HEERE, verlos mij, mijn God; want Gij hebt al mijn vijanden op het kinnebakken geslagen; de tanden der goddelozen hebt Gij verbroken. [ (Psalms 3:9) Het heil is des HEEREN; Uw zegen is over Uw volk. Sela. ]"));
dusuperobject.biblemap.put("b19_4_1", new dusuperobject(19,4,1,"Een psalm van David, voor den opperzangmeester, op de Neginoth."));
dusuperobject.biblemap.put("b19_4_2", new dusuperobject(19,4,2,"Als ik roep, verhoor mij, o God mijner gerechtigheid! In benauwdheid hebt Gij mij ruimte gemaakt; wees mij genadig, en hoor mijn gebed."));
dusuperobject.biblemap.put("b19_4_3", new dusuperobject(19,4,3,"Gij, mannen, hoe lang zal mijn eer tot schande zijn? Hoe lang zult gij de ijdelheid beminnen, de leugen zoeken? Sela."));
dusuperobject.biblemap.put("b19_4_4", new dusuperobject(19,4,4,"Weet toch, dat de HEERE Zich een gunstgenoot heeft afgezonderd; de HEERE zal horen, als ik tot Hem roep."));
dusuperobject.biblemap.put("b19_4_5", new dusuperobject(19,4,5,"Zijt beroerd, en zondigt niet; spreekt in ulieder hart op uw leger, en zijt stil. Sela."));
dusuperobject.biblemap.put("b19_4_6", new dusuperobject(19,4,6,"Offert offeranden der gerechtigheid, en vertrouwt op den HEERE."));
dusuperobject.biblemap.put("b19_4_7", new dusuperobject(19,4,7,"Velen zeggen: Wie zal ons het goede doen zien? Verhef Gij over ons het licht Uws aanschijns, o HEERE!"));
dusuperobject.biblemap.put("b19_4_8", new dusuperobject(19,4,8,"Gij hebt vreugde in mijn hart gegeven, meer dan ter tijd, als hun koren en hun most vermenigvuldigd zijn. [ (Psalms 4:9) Ik zal in vrede te zamen nederliggen en slapen; want Gij, o HEERE! alleen zult mij doen zeker wonen. ]"));
dusuperobject.biblemap.put("b19_5_1", new dusuperobject(19,5,1,"Een psalm van David, voor den opperzangmeester, op de Nechiloth."));
dusuperobject.biblemap.put("b19_5_2", new dusuperobject(19,5,2,"O HEERE, neem mijn redenen ter ore; versta mijn overdenking."));
dusuperobject.biblemap.put("b19_5_3", new dusuperobject(19,5,3,"Merk op de stem mijns geroeps, o mijn Koning en mijn God! Want tot U zal ik bidden."));
dusuperobject.biblemap.put("b19_5_4", new dusuperobject(19,5,4,"Des morgens, HEERE, zult Gij mijn stem horen; des morgens zal ik mij tot U schikken, en wacht houden."));
dusuperobject.biblemap.put("b19_5_5", new dusuperobject(19,5,5,"Want Gij zijt geen God, Die lust heeft aan goddeloosheid; de boze zal bij U niet verkeren."));
dusuperobject.biblemap.put("b19_5_6", new dusuperobject(19,5,6,"De onzinnigen zullen voor Uw ogen niet bestaan; Gij haat alle werkers der ongerechtigheid."));
dusuperobject.biblemap.put("b19_5_7", new dusuperobject(19,5,7,"Gij zult de leugensprekers verdoen; van den man des bloeds en des bedrogs heeft de HEERE een gruwel."));
dusuperobject.biblemap.put("b19_5_8", new dusuperobject(19,5,8,"Maar ik zal door de grootheid Uwer goedertierenheid in Uw huis ingaan; ik zal mij buigen naar het paleis Uwer heiligheid, in Uw vreze."));
dusuperobject.biblemap.put("b19_5_9", new dusuperobject(19,5,9,"HEERE! Leid mij in Uw gerechtigheid, om mijner verspieders wil; richt Uw weg voor mijn aangezicht."));
dusuperobject.biblemap.put("b19_5_10", new dusuperobject(19,5,10,"Want in hun mond is niets rechts, hun binnenste is enkel verderving, hun keel is een open graf, met hun tong vleien zij."));
dusuperobject.biblemap.put("b19_5_11", new dusuperobject(19,5,11,"Verklaar hen schuldig, o God; laat hen vervallen van hun raadslagen; drijf hen henen om de veelheid hunner overtredingen, want zij zijn wederspannig tegen U."));
dusuperobject.biblemap.put("b19_5_12", new dusuperobject(19,5,12,"Maar laat verblijd zijn allen, die op U betrouwen, tot in eeuwigheid; laat hen juichen, omdat Gij hen overdekt; en laat in U van vreugde opspringen, die Uw Naam liefhebben. [ (Psalms 5:13) Want Gij, HEERE, zult den rechtvaardige zegenen; Gij zult hem met goedgunstigheid kronen, als met een rondas. ]"));
dusuperobject.biblemap.put("b19_6_1", new dusuperobject(19,6,1,"Een psalm van David, voor den opperzangmeester, op de Neginoth, op de Scheminith."));
dusuperobject.biblemap.put("b19_6_2", new dusuperobject(19,6,2,"O HEERE, straf mij niet in Uw toorn, en kastijd mij niet in Uw grimmigheid!"));
dusuperobject.biblemap.put("b19_6_3", new dusuperobject(19,6,3,"Wees mij genadig, HEERE, want ik ben verzwakt; genees mij, HEERE, want mijn beenderen zijn verschrikt."));
dusuperobject.biblemap.put("b19_6_4", new dusuperobject(19,6,4,"Ja, mijn ziel is zeer verschrikt; en Gij, HEERE, hoe lange?"));
dusuperobject.biblemap.put("b19_6_5", new dusuperobject(19,6,5,"Keer weder, HEERE, red mijn ziel; verlos mij, om Uwer goedertierenheid wil."));
dusuperobject.biblemap.put("b19_6_6", new dusuperobject(19,6,6,"Want in de dood is Uwer geen gedachtenis; wie zal U loven in het graf?"));
dusuperobject.biblemap.put("b19_6_7", new dusuperobject(19,6,7,"Ik ben moede van mijn zuchten; ik doe mijn bed den gansen nacht zwemmen; ik doornat mijn bedstede met mijn tranen."));
dusuperobject.biblemap.put("b19_6_8", new dusuperobject(19,6,8,"Mijn oog is doorknaagd van verdriet, is veroud, vanwege al mijn tegenpartijders."));
dusuperobject.biblemap.put("b19_6_9", new dusuperobject(19,6,9,"Wijkt van mij, al gij werkers der ongerechtigheid; want de HEERE heeft de stem mijns geweens gehoord."));
dusuperobject.biblemap.put("b19_6_10", new dusuperobject(19,6,10,"De HEERE heeft mijn smeking gehoord; de HEERE zal mijn gebed aannemen. [ (Psalms 6:11) Al mijn vijanden zullen zeer beschaamd en verbaasd worden; zij zullen terugkeren, zij zullen in een ogenblik beschaamd worden. ]"));
dusuperobject.biblemap.put("b19_7_1", new dusuperobject(19,7,1,"Davids Schiggajon, dat hij den HEERE gezongen heeft, over de woorden van Cusch, den zoon van Jemini."));
dusuperobject.biblemap.put("b19_7_2", new dusuperobject(19,7,2,"HEERE, mijn God, op U betrouw ik; verlos mij van al mijn vervolgers, en red mij."));
dusuperobject.biblemap.put("b19_7_3", new dusuperobject(19,7,3,"Opdat hij mijn ziel niet rove als een leeuw, verscheurende, terwijl er geen verlosser is."));
dusuperobject.biblemap.put("b19_7_4", new dusuperobject(19,7,4,"HEERE, mijn God, indien ik dat gedaan heb, indien er onrecht in mijn handen is;"));
dusuperobject.biblemap.put("b19_7_5", new dusuperobject(19,7,5,"Indien ik kwaad vergolden heb dien, die vrede met mij had; (ja, ik heb dien gered die mij zonder oorzaak benauwde!)"));
dusuperobject.biblemap.put("b19_7_6", new dusuperobject(19,7,6,"Zo vervolge de vijand mijn ziel, en achterhale ze, en vertrede mijn leven ter aarde, en doe mijn eer in het stof wonen! Sela."));
dusuperobject.biblemap.put("b19_7_7", new dusuperobject(19,7,7,"Sta op, HEERE, in Uw toorn, verhef U om de verbolgenheden mijner benauwers, en ontwaak tot mij; Gij hebt het gericht bevolen."));
dusuperobject.biblemap.put("b19_7_8", new dusuperobject(19,7,8,"Zo zal de vergadering der volken U omsingelen; keer dan boven haar weder in de hoogte."));
dusuperobject.biblemap.put("b19_7_9", new dusuperobject(19,7,9,"De HEERE zal den volken recht doen; richt mij, HEERE, naar mijn gerechtigheid, en naar mijn oprechtigheid, die bij mij is."));
dusuperobject.biblemap.put("b19_7_10", new dusuperobject(19,7,10,"Laat toch de boosheid der goddelozen een einde nemen, maar bevestig den rechtvaardige, Gij, Die harten en nieren beproeft, o rechtvaardige God!"));
dusuperobject.biblemap.put("b19_7_11", new dusuperobject(19,7,11,"Mijn schild is bij God, Die de oprechten van hart behoudt."));
dusuperobject.biblemap.put("b19_7_12", new dusuperobject(19,7,12,"God is een rechtvaardige Rechter, en een God, Die te allen dage toornt."));
dusuperobject.biblemap.put("b19_7_13", new dusuperobject(19,7,13,"Indien hij zich niet bekeert, zo zal Hij Zijn zwaard wetten; Hij heeft Zijn boog gespannen, en dien bereid."));
dusuperobject.biblemap.put("b19_7_14", new dusuperobject(19,7,14,"En heeft dodelijke wapenen voor hem gereed gemaakt; Hij zal Zijn pijlen tegen de hittige vervolgers te werk stellen."));
dusuperobject.biblemap.put("b19_7_15", new dusuperobject(19,7,15,"Ziet, hij is in arbeid van ongerechtigheid, en is zwanger van moeite, hij zal leugen baren."));
dusuperobject.biblemap.put("b19_7_16", new dusuperobject(19,7,16,"Hij heeft een kuil gedolven, en dien uitgegraven, maar hij is gevallen in de groeve, die hij gemaakt heeft."));
dusuperobject.biblemap.put("b19_7_17", new dusuperobject(19,7,17,"Zijn moeite zal op zijn hoofd wederkeren, en zijn geweld op zijn schedel nederdalen. [ (Psalms 7:18) Ik zal den HEERE loven naar Zijn gerechtigheid, en den Naam des HEEREN, des Allerhoogsten, psalmzingen. ]"));
dusuperobject.biblemap.put("b19_8_1", new dusuperobject(19,8,1,"Een psalm van David, voor den opperzangmeester, op de Gitthith."));
dusuperobject.biblemap.put("b19_8_2", new dusuperobject(19,8,2,"O HEERE, onze Heere! hoe heerlijk is Uw Naam op de ganse aarde! Gij, die Uw majesteit gesteld hebt boven de hemelen."));
dusuperobject.biblemap.put("b19_8_3", new dusuperobject(19,8,3,"Uit de mond der kinderkens en der zuigelingen hebt Gij sterkte gegrondvest, om Uwer tegenpartijen wil, om den vijand en wraakgierige te doen ophouden."));
dusuperobject.biblemap.put("b19_8_4", new dusuperobject(19,8,4,"Als ik Uw hemel aanzie, het werk Uwer vingeren, de maan en de sterren, die Gij bereid hebt;"));
dusuperobject.biblemap.put("b19_8_5", new dusuperobject(19,8,5,"Wat is de mens, dat Gij zijner gedenkt, en de zoon des mensen, dat Gij hem bezoekt?"));
dusuperobject.biblemap.put("b19_8_6", new dusuperobject(19,8,6,"En hebt hem een weinig minder gemaakt dan de engelen, en hebt hem met eer en heerlijkheid gekroond?"));
dusuperobject.biblemap.put("b19_8_7", new dusuperobject(19,8,7,"Gij doet hem heersen over de werken Uwer handen; Gij hebt alles onder zijn voeten gezet;"));
dusuperobject.biblemap.put("b19_8_8", new dusuperobject(19,8,8,"Schapen en ossen, alle die; ook mede de dieren des velds."));
dusuperobject.biblemap.put("b19_8_9", new dusuperobject(19,8,9,"Het gevogelte des hemels, en de vissen der zee; hetgeen de paden der zeeen doorwandelt. [ (Psalms 8:10) O HEERE, onze Heere! hoe heerlijk is Uw Naam op de ganse aarde! ]"));
dusuperobject.biblemap.put("b19_9_1", new dusuperobject(19,9,1,"Een psalm van David, voor den opperzangmeester, op Muth-Labben."));
dusuperobject.biblemap.put("b19_9_2", new dusuperobject(19,9,2,"Ik zal den HEERE loven met mijn ganse hart; ik zal al Uw wonderen vertellen."));
dusuperobject.biblemap.put("b19_9_3", new dusuperobject(19,9,3,"In U zal ik mij verblijden, en van vreugde opspringen; ik zal Uw Naam psalmzingen, o Allerhoogste!"));
dusuperobject.biblemap.put("b19_9_4", new dusuperobject(19,9,4,"Omdat mijn vijanden achterwaarts gekeerd, gevallen en vergaan zijn van Uw aangezicht."));
dusuperobject.biblemap.put("b19_9_5", new dusuperobject(19,9,5,"Want Gij hebt mijn recht en mijn rechtszaak afgedaan; Gij hebt gezeten op den troon, o Rechter, der gerechtigheid."));
dusuperobject.biblemap.put("b19_9_6", new dusuperobject(19,9,6,"Gij hebt de heidenen gescholden, den goddeloze verdaan, hun naam uitgedelgd, tot in eeuwigheid en altoos."));
dusuperobject.biblemap.put("b19_9_7", new dusuperobject(19,9,7,"O vijand! zijn de verwoestingen voleind in eeuwigheid, en hebt gij de steden uitgeroeid? Hunlieder gedachtenis is met hen vergaan."));
dusuperobject.biblemap.put("b19_9_8", new dusuperobject(19,9,8,"Maar de HEERE zal in eeuwigheid zitten; Hij heeft Zijn troon bereid ten gerichte."));
dusuperobject.biblemap.put("b19_9_9", new dusuperobject(19,9,9,"En Hij Zelf zal de wereld richten in gerechtigheid, en de volken oordelen in rechtmatigheden."));
dusuperobject.biblemap.put("b19_9_10", new dusuperobject(19,9,10,"En de HEERE zal een Hoog Vertrek zijn voor de verdrukte, een Hoog Vertrek in tijden van benauwdheid."));
dusuperobject.biblemap.put("b19_9_11", new dusuperobject(19,9,11,"En die Uw Naam kennen, zullen op U vertrouwen, omdat Gij, HEERE, niet hebt verlaten degenen, die U zoeken."));
dusuperobject.biblemap.put("b19_9_12", new dusuperobject(19,9,12,"Psalmzingt den HEERE, Die te Sion woont; verkondigt onder de volken Zijn daden."));
dusuperobject.biblemap.put("b19_9_13", new dusuperobject(19,9,13,"Want Hij zoekt de bloedstortingen, Hij gedenkt derzelve; Hij vergeet het geroep der ellendigen niet."));
dusuperobject.biblemap.put("b19_9_14", new dusuperobject(19,9,14,"Wees mij genadig, HEERE, zie mijn ellende aan, van mijn haters mij aangedaan, Gij, Die mij verhoogt uit de poorten des doods;"));
dusuperobject.biblemap.put("b19_9_15", new dusuperobject(19,9,15,"Opdat ik Uw gansen lof in de poorten der dochter van Sion vertelle, dat ik mij verheuge in Uw heil."));
dusuperobject.biblemap.put("b19_9_16", new dusuperobject(19,9,16,"De heidenen zijn gezonken in de groeve, die zij gemaakt hadden; hunlieder voet is gevangen in het net, dat zij verborgen hadden."));
dusuperobject.biblemap.put("b19_9_17", new dusuperobject(19,9,17,"De HEERE is bekend geworden; Hij heeft recht gedaan; de goddeloze is verstrikt in het werk zijner handen! Higgajon, Sela."));
dusuperobject.biblemap.put("b19_9_18", new dusuperobject(19,9,18,"De goddelozen zullen terugkeren, naar de hel toe, alle godvergetende heidenen."));
dusuperobject.biblemap.put("b19_9_19", new dusuperobject(19,9,19,"Want de nooddruftige zal niet voor altoos vergeten worden, noch de verwachting der ellendigen in eeuwigheid verloren zijn."));
dusuperobject.biblemap.put("b19_9_20", new dusuperobject(19,9,20,"Sta op, HEERE, laat de mens zich niet versterken; laat de heidenen voor Uw aangezicht geoordeeld worden. [ (Psalms 9:21) O HEERE! jaag hun vreze aan; laat de heidenen weten, dat zij mensen zijn. Sela. ]"));
dusuperobject.biblemap.put("b19_10_1", new dusuperobject(19,10,1,"O HEERE! waarom staat Gij van verre? waarom verbergt Gij U in tijden van benauwdheid?"));
dusuperobject.biblemap.put("b19_10_2", new dusuperobject(19,10,2,"De goddeloze vervolgt hittiglijk in hoogmoed de ellendige; laat hen gegrepen worden in de aanslagen, die zij bedacht hebben."));
dusuperobject.biblemap.put("b19_10_3", new dusuperobject(19,10,3,"Want de goddeloze roemt over den wens zijner ziel; hij zegent den gierigaard, hij lastert den HEERE."));
dusuperobject.biblemap.put("b19_10_4", new dusuperobject(19,10,4,"De goddeloze, gelijk hij zijn neus omhoog steekt, onderzoekt niet; al zijn gedachten zijn, dat er geen God is."));
dusuperobject.biblemap.put("b19_10_5", new dusuperobject(19,10,5,"Zijn wegen maken ten allen tijde smarte; Uw oordelen zijn een hoogte, verre van hem; al zijn tegenpartijders, die blaast hij aan."));
dusuperobject.biblemap.put("b19_10_6", new dusuperobject(19,10,6,"Hij zegt in zijn hart; Ik zal niet wankelen; want ik zal van geslacht tot geslacht in geen kwaad zijn."));
dusuperobject.biblemap.put("b19_10_7", new dusuperobject(19,10,7,"Zijn mond is vol van vloek, en bedriegerijen, en list; onder zijn tong is moeite en ongerechtigheid."));
dusuperobject.biblemap.put("b19_10_8", new dusuperobject(19,10,8,"Hij zit in de achterlage der hoeven, in verborgene plaatsen doodt hij den onschuldige; zijn ogen verbergen zich tegen den arme."));
dusuperobject.biblemap.put("b19_10_9", new dusuperobject(19,10,9,"Hij legt lagen in een verborgen plaats, gelijk een leeuw in zijn hol; hij legt lagen, om den ellendige te roven; hij rooft den ellendige, als hij hem trekt in zijn net."));
dusuperobject.biblemap.put("b19_10_10", new dusuperobject(19,10,10,"Hij duikt neder, hij buigt zich; en de arme hoop valt in zijn sterke poten."));
dusuperobject.biblemap.put("b19_10_11", new dusuperobject(19,10,11,"Hij zegt in zijn hart: God heeft het vergeten, Hij heeft Zijn aangezicht verborgen, Hij ziet niet in eeuwigheid."));
dusuperobject.biblemap.put("b19_10_12", new dusuperobject(19,10,12,"Sta op, HEERE God! hef Uw hand op, vergeet de ellendigen niet."));
dusuperobject.biblemap.put("b19_10_13", new dusuperobject(19,10,13,"Waarom lastert de goddeloze God? zegt in zijn hart: Gij zult het niet zoeken?"));
dusuperobject.biblemap.put("b19_10_14", new dusuperobject(19,10,14,"Gij ziet het immers; want Gij aanschouwt de moeite en het verdriet, opdat men het in Uw hand geve; op U verlaat zich de arme, Gij zijt geweest een Helper van den wees."));
dusuperobject.biblemap.put("b19_10_15", new dusuperobject(19,10,15,"Breek den arm des goddelozen en bozen. zoek zijn goddeloosheid, totdat Gij haar niet vindt."));
dusuperobject.biblemap.put("b19_10_16", new dusuperobject(19,10,16,"De HEERE is Koning eeuwiglijk en altoos; de heidenen zijn vergaan uit Zijn land."));
dusuperobject.biblemap.put("b19_10_17", new dusuperobject(19,10,17,"HEERE! Gij hebt den wens der zachtmoedigen gehoord; Gij zult hun hart sterken, Uw oor zal opmerken;"));
dusuperobject.biblemap.put("b19_10_18", new dusuperobject(19,10,18,"Om den wees en verdrukte recht te doen; opdat een mens van de aarde niet meer voortvare geweld te bedrijven."));
dusuperobject.biblemap.put("b19_11_1", new dusuperobject(19,11,1,"Een psalm van David, voor den opperzangmeester. Ik betrouw op den HEERE; hoe zegt gijlieden tot mijn ziel: Zwerft henen naar ulieder gebergte, als een vogel?"));
dusuperobject.biblemap.put("b19_11_2", new dusuperobject(19,11,2,"Want ziet, de goddelozen spannen den boog, zij schikken hun pijlen op de pees, om in het donkere te schieten naar de oprechten van harte."));
dusuperobject.biblemap.put("b19_11_3", new dusuperobject(19,11,3,"Zekerlijk, de fondamenten worden omgestoten; wat heeft de rechtvaardige bedreven?"));
dusuperobject.biblemap.put("b19_11_4", new dusuperobject(19,11,4,"De HEERE is in het paleis Zijner heiligheid, des HEEREN troon is in den hemel; Zijn ogen aanschouwen, Zijn oogleden proeven de mensenkinderen."));
dusuperobject.biblemap.put("b19_11_5", new dusuperobject(19,11,5,"De HEERE proeft den rechtvaardige; maar den goddeloze, en dien, die geweld liefheeft, haat Zijn ziel."));
dusuperobject.biblemap.put("b19_11_6", new dusuperobject(19,11,6,"Hij zal op de goddelozen regenen strikken, vuur en zwavel; en een geweldige stormwind zal het deel huns bekers zijn."));
dusuperobject.biblemap.put("b19_11_7", new dusuperobject(19,11,7,"Want de HEERE is rechtvaardig, Hij heeft gerechtigheden lief; Zijn aangezicht aanschouwt den oprechte."));
dusuperobject.biblemap.put("b19_12_1", new dusuperobject(19,12,1,"Een psalm van David, voor den opperzangmeester, op de Scheminith."));
dusuperobject.biblemap.put("b19_12_2", new dusuperobject(19,12,2,"Behoud, o HEERE; want de goedertierene ontbreekt, want de getrouwen zijn weinig geworden onder de mensenkinderen."));
dusuperobject.biblemap.put("b19_12_3", new dusuperobject(19,12,3,"Zij spreken valsheid, een ieder met zijn naaste, met vleiende lippen; zij spreken met een dubbel hart."));
dusuperobject.biblemap.put("b19_12_4", new dusuperobject(19,12,4,"De HEERE snijde af alle vleiende lippen, de grootsprekende tong."));
dusuperobject.biblemap.put("b19_12_5", new dusuperobject(19,12,5,"Die daar zeggen: Wij zullen de overhand hebben met onze tong; onze lippen zijn onze! Wie is heer over ons?"));
dusuperobject.biblemap.put("b19_12_6", new dusuperobject(19,12,6,"Om de verwoesting der ellendigen, om het kermen der nooddruftigen, zal Ik nu opstaan, zegt de HEERE; Ik zal in behoudenis zetten, dien hij aanblaast."));
dusuperobject.biblemap.put("b19_12_7", new dusuperobject(19,12,7,"De redenen des HEEREN zijn reine redenen, zilver, gelouterd in een aarden smeltkroes, gezuiverd zevenmaal."));
dusuperobject.biblemap.put("b19_12_8", new dusuperobject(19,12,8,"Gij, HEERE, zult hen bewaren; Gij zult hen behoeden voor dit geslacht, tot in eeuwigheid. [ (Psalms 12:9) De goddelozen draven rondom, wanneer de snoodsten van des mensenkinderen verhoogd worden. ]"));
dusuperobject.biblemap.put("b19_13_1", new dusuperobject(19,13,1,"Een psalm van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_13_2", new dusuperobject(19,13,2,"Hoe lang, HEERE, zult Gij mij steeds vergeten? Hoe lang zult Gij Uw aangezicht voor mij verbergen?"));
dusuperobject.biblemap.put("b19_13_3", new dusuperobject(19,13,3,"Hoe lang zal ik raadslagen voornemen in mijn ziel, droefenis in mijn hart bij dag? Hoe lang zal mijn vijand over mij verhoogd zijn?"));
dusuperobject.biblemap.put("b19_13_4", new dusuperobject(19,13,4,"Aanschouw, verhoor mij, HEERE, mijn God; verlicht mijn ogen, opdat ik in de dood niet ontslape;"));
dusuperobject.biblemap.put("b19_13_5", new dusuperobject(19,13,5,"Opdat niet mijn vijand zegge: Ik heb hem overmocht; mijn tegenpartijders zich verheugen, wanneer ik zou wankelen."));
dusuperobject.biblemap.put("b19_13_6", new dusuperobject(19,13,6,"Maar ik vertrouw op Uw goedertierenheid; mijn hart zal zich verheugen in Uw heil; ik zal den HEERE zingen, omdat Hij aan mij welgedaan heeft."));
dusuperobject.biblemap.put("b19_14_1", new dusuperobject(19,14,1,"Een psalm van David, voor den opperzangmeester. De dwaas zegt in zijn hart: Er is geen God. Zij verderven het, zij maken het gruwelijk met hun werk; er is niemand, die goed doet."));
dusuperobject.biblemap.put("b19_14_2", new dusuperobject(19,14,2,"De HEERE heeft uit den hemel nedergezien op de mensenkinderen, om te zien, of iemand verstandig ware, die God zocht."));
dusuperobject.biblemap.put("b19_14_3", new dusuperobject(19,14,3,"Zij zijn allen afgeweken, te zamen zijn zij stinkende geworden; er is niemand, die goed doet, ook niet een."));
dusuperobject.biblemap.put("b19_14_4", new dusuperobject(19,14,4,"Hebben dan alle werkers der ongerechtigheid geen kennis, die mijn volk opeten, alsof zij brood aten? Zij roepen den HEERE niet aan."));
dusuperobject.biblemap.put("b19_14_5", new dusuperobject(19,14,5,"Aldaar zijn zij met vervaardheid vervaard; want God is bij het geslacht des rechtvaardigen."));
dusuperobject.biblemap.put("b19_14_6", new dusuperobject(19,14,6,"Gijlieden beschaamt den raad des ellendigen, omdat de HEERE zijn Toevlucht is."));
dusuperobject.biblemap.put("b19_14_7", new dusuperobject(19,14,7,"Och, dat Israels verlossing uit Sion kwam! Als de HEERE de gevangenen Zijns volks zal doen wederkeren, dan zal zich Jakob verheugen, Israel zal verblijd zijn."));
dusuperobject.biblemap.put("b19_15_1", new dusuperobject(19,15,1,"Een psalm van David. HEERE, wie zal verkeren in Uw tent? Wie zal wonen op den berg Uwer heiligheid?"));
dusuperobject.biblemap.put("b19_15_2", new dusuperobject(19,15,2,"Die oprecht wandelt, en gerechtigheid werkt, en die met zijn hart de waarheid spreekt;"));
dusuperobject.biblemap.put("b19_15_3", new dusuperobject(19,15,3,"Die met zijn tong niet achterklapt, zijn metgezellen geen kwaad doet, en geen smaadrede opneemt tegen zijn naaste;"));
dusuperobject.biblemap.put("b19_15_4", new dusuperobject(19,15,4,"In wiens ogen de verworpene veracht is, maar hij eert degenen, die den HEERE vrezen; heeft hij gezworen tot zijn schade, evenwel verandert hij niet;"));
dusuperobject.biblemap.put("b19_15_5", new dusuperobject(19,15,5,"Die zijn geld niet geeft op woeker, en geen geschenk neemt tegen den onschuldige. Die deze dingen doet, zal niet wankelen in eeuwigheid."));
dusuperobject.biblemap.put("b19_16_1", new dusuperobject(19,16,1,"Een gouden kleinood van David. Bewaar mij, o God! want ik betrouw op U."));
dusuperobject.biblemap.put("b19_16_2", new dusuperobject(19,16,2,"O mijn ziel! gij hebt tot den HEERE gezegd: Gij zijt de HEERE, mijn goedheid raakt niet tot U;"));
dusuperobject.biblemap.put("b19_16_3", new dusuperobject(19,16,3,"Maar tot de heiligen, die op de aarde zijn, en de heerlijken, in dewelke al mijn lust is."));
dusuperobject.biblemap.put("b19_16_4", new dusuperobject(19,16,4,"De smarten dergenen, die een anderen God begiftigen, zullen vermenigvuldigd worden; ik zal hun drankofferen van bloed niet offeren, en hun namen op mijn lippen niet nemen."));
dusuperobject.biblemap.put("b19_16_5", new dusuperobject(19,16,5,"De HEERE is het deel mijner erve, en mijns bekers; Gij onderhoudt mijn lot."));
dusuperobject.biblemap.put("b19_16_6", new dusuperobject(19,16,6,"De snoeren zijn mij in liefelijke plaatsen gevallen; ja, een schone erfenis is mij geworden."));
dusuperobject.biblemap.put("b19_16_7", new dusuperobject(19,16,7,"Ik zal den HEERE loven, Die mij raad heeft gegeven; zelfs bij nacht onderwijzen mij mijn nieren."));
dusuperobject.biblemap.put("b19_16_8", new dusuperobject(19,16,8,"Ik stel den HEERE geduriglijk voor mij, omdat Hij aan mijn rechterhand is, zal ik niet wankelen."));
dusuperobject.biblemap.put("b19_16_9", new dusuperobject(19,16,9,"Daarom is mijn hart verblijd, en mijn eer verheugt zich; ook zal mijn vlees zeker wonen."));
dusuperobject.biblemap.put("b19_16_10", new dusuperobject(19,16,10,"Want Gij zult mijn ziel in de hel niet verlaten; Gij zult niet toelaten, dat Uw Heilige de verderving zie."));
dusuperobject.biblemap.put("b19_16_11", new dusuperobject(19,16,11,"Gij zult mij het pad des levens bekend maken; verzadiging der vreugde is bij Uw aangezicht; liefelijkheden zijn in Uw rechterhand, eeuwiglijk."));
dusuperobject.biblemap.put("b19_17_1", new dusuperobject(19,17,1,"Een gebed van David. HEERE! hoor de gerechtigheid, merk op mijn geschrei, neem ter ore mijn gebed, met onbedriegelijke lippen gesproken."));
dusuperobject.biblemap.put("b19_17_2", new dusuperobject(19,17,2,"Laat mijn recht van voor Uw aangezicht uitgaan, laat Uw ogen de billijkheden aanschouwen."));
dusuperobject.biblemap.put("b19_17_3", new dusuperobject(19,17,3,"Gij hebt mijn hart geproefd, des nachts bezocht, Gij hebt mij getoetst. Gij vindt niets; hetgeen ik gedacht heb, overtreedt mijn mond niet."));
dusuperobject.biblemap.put("b19_17_4", new dusuperobject(19,17,4,"Aangaande de handelingen des mensen, ik heb mij, naar het woord Uwer lippen, gewacht voor de paden des inbrekers;"));
dusuperobject.biblemap.put("b19_17_5", new dusuperobject(19,17,5,"Houdende mijn gangen in Uw sporen, opdat mijn voetstappen niet zouden wankelen."));
dusuperobject.biblemap.put("b19_17_6", new dusuperobject(19,17,6,"Ik roep U aan, omdat Gij mij verhoort; o God! neig Uw oor tot mij; hoor mijn rede."));
dusuperobject.biblemap.put("b19_17_7", new dusuperobject(19,17,7,"Maak Uw weldadigheden wonderbaar, Gij, Die verlost degenen, die op U betrouwen, van degenen, die tegen Uw rechterhand opstaan!"));
dusuperobject.biblemap.put("b19_17_8", new dusuperobject(19,17,8,"Bewaar mij als het zwart des oogappels, verberg mij onder de schaduw Uwer vleugelen,"));
dusuperobject.biblemap.put("b19_17_9", new dusuperobject(19,17,9,"Voor het aangezicht der goddelozen, die mij verwoesten, mijner doodsvijanden, die mij omringen."));
dusuperobject.biblemap.put("b19_17_10", new dusuperobject(19,17,10,"Met hun vet besluiten zij zich, met hun mond spreken zij hovaardelijk."));
dusuperobject.biblemap.put("b19_17_11", new dusuperobject(19,17,11,"In onzen gang hebben zij ons nu omsingeld, zij zetten hun ogen op ons ter aarde nederbukkende."));
dusuperobject.biblemap.put("b19_17_12", new dusuperobject(19,17,12,"Hij is gelijk als een leeuw, die begeert te roven, en als een jonge leeuw, zittende in verborgen plaatsen."));
dusuperobject.biblemap.put("b19_17_13", new dusuperobject(19,17,13,"Sta op, HEERE, kom zijn aangezicht voor, vel hem neder; bevrijd mijn ziel met Uw zwaard van den goddeloze;"));
dusuperobject.biblemap.put("b19_17_14", new dusuperobject(19,17,14,"Met Uw hand van de lieden, o HEERE! van de lieden, die van de wereld zijn, welker deel in dit leven is, welker buik Gij vervult met Uw verborgen schat; de kinderen worden verzadigd, en zij laten hun overschot hun kinderkens achter."));
dusuperobject.biblemap.put("b19_17_15", new dusuperobject(19,17,15,"Maar ik zal Uw aangezicht in gerechtigheid aanschouwen, ik zal verzadigd worden met Uw beeld, als ik zal opwaken."));
dusuperobject.biblemap.put("b19_18_1", new dusuperobject(19,18,1,"Voor den opperzangmeester, een psalm van David, de knecht des HEEREN, die de woorden dezes lieds tot den HEERE gesproken heeft, ten dage, als de HEERE hem gered had uit de hand van al zijn vijanden, en uit de hand van Saul."));
dusuperobject.biblemap.put("b19_18_2", new dusuperobject(19,18,2,"Hij zeide dan: Ik zal U hartelijk liefhebben, HEERE, mijn Sterkte!"));
dusuperobject.biblemap.put("b19_18_3", new dusuperobject(19,18,3,"De HEERE is mijn Steenrots, en mijn Burg, en mijn Uithelper; mijn God, mijn Rots, op Welken ik betrouw; mijn Schild, en de Hoorn mijns heils, mijn Hoog Vertrek."));
dusuperobject.biblemap.put("b19_18_4", new dusuperobject(19,18,4,"Ik riep den HEERE aan, Die te prijzen is, en werd verlost van mijn vijanden."));
dusuperobject.biblemap.put("b19_18_5", new dusuperobject(19,18,5,"Banden des doods hadden mij omvangen, en beken Belials verschrikten mij."));
dusuperobject.biblemap.put("b19_18_6", new dusuperobject(19,18,6,"Banden der hel omringden mij, strikken des doods bejegenden mij."));
dusuperobject.biblemap.put("b19_18_7", new dusuperobject(19,18,7,"Als mij bange was, riep ik den HEERE aan, en riep tot mijn God; Hij hoorde mijn stem uit Zijn paleis, en mijn geroep voor Zijn aangezicht kwam in Zijn oren."));
dusuperobject.biblemap.put("b19_18_8", new dusuperobject(19,18,8,"Toen daverde en beefde de aarde, en de gronden der bergen beroerden zich en daverden, omdat Hij ontstoken was."));
dusuperobject.biblemap.put("b19_18_9", new dusuperobject(19,18,9,"Rook ging op van Zijn neus, en een vuur uit Zijn mond verteerde; kolen werden daarvan aangestoken."));
dusuperobject.biblemap.put("b19_18_10", new dusuperobject(19,18,10,"En Hij boog den hemel, en daalde neder, en donkerheid was onder Zijn voeten."));
dusuperobject.biblemap.put("b19_18_11", new dusuperobject(19,18,11,"En Hij voer op een cherub, en vloog; ja, Hij vloog snellijk op de vleugelen des winds."));
dusuperobject.biblemap.put("b19_18_12", new dusuperobject(19,18,12,"Duisternis zette Hij tot Zijn verberging; rondom Hem was Zijn tent, duisterheid der wateren, wolken des hemels."));
dusuperobject.biblemap.put("b19_18_13", new dusuperobject(19,18,13,"Van den glans, die voor Hem was, dreven Zijn wolken daarhenen, hagel en vurige kolen."));
dusuperobject.biblemap.put("b19_18_14", new dusuperobject(19,18,14,"En de HEERE donderde in den hemel, en de Allerhoogste gaf Zijn stem, hagel en vurige kolen."));
dusuperobject.biblemap.put("b19_18_15", new dusuperobject(19,18,15,"En Hij zond Zijn pijlen uit, en verstrooide ze; en Hij vermenigvuldigde de bliksemen, en verschrikte ze."));
dusuperobject.biblemap.put("b19_18_16", new dusuperobject(19,18,16,"En de diepe kolken der wateren werden gezien, en de gronden der wereld werden ontdekt, van Uw schelden, o HEERE! van het geblaas des winds van Uw neus."));
dusuperobject.biblemap.put("b19_18_17", new dusuperobject(19,18,17,"Hij zond van de hoogte, Hij nam mij, Hij trok mij op uit grote wateren."));
dusuperobject.biblemap.put("b19_18_18", new dusuperobject(19,18,18,"Hij verloste mij van mijn sterken vijand, en van mijn haters, omdat zij machtiger waren dan ik."));
dusuperobject.biblemap.put("b19_18_19", new dusuperobject(19,18,19,"Zij hadden mij bejegend ten dage mijns ongevals; maar de HEERE was mij tot een Steunsel."));
dusuperobject.biblemap.put("b19_18_20", new dusuperobject(19,18,20,"En Hij voerde mij uit in de ruimte, Hij rukte mij uit, want Hij had lust aan mij."));
dusuperobject.biblemap.put("b19_18_21", new dusuperobject(19,18,21,"De HEERE vergold mij naar mijn gerechtigheid, Hij gaf mij weder naar de reinigheid mijner handen."));
dusuperobject.biblemap.put("b19_18_22", new dusuperobject(19,18,22,"Want ik heb des HEEREN wegen gehouden, en ben van mijn God niet goddelooslijk afgegaan."));
dusuperobject.biblemap.put("b19_18_23", new dusuperobject(19,18,23,"Want al Zijn rechten waren voor mij, en Zijn inzettingen deed ik niet van mij weg."));
dusuperobject.biblemap.put("b19_18_24", new dusuperobject(19,18,24,"Maar ik was oprecht bij Hem, en ik wachtte mij voor mijn ongerechtigheid."));
dusuperobject.biblemap.put("b19_18_25", new dusuperobject(19,18,25,"Zo gaf mij de HEERE weder naar mijn gerechtigheid, naar de reinigheid mijner handen, voor Zijn ogen."));
dusuperobject.biblemap.put("b19_18_26", new dusuperobject(19,18,26,"Bij den goedertierene houdt Gij U goedertieren, bij den oprechten man houdt Gij U oprecht."));
dusuperobject.biblemap.put("b19_18_27", new dusuperobject(19,18,27,"Bij den reine houdt Gij U rein, maar bij den verkeerde bewijst Gij U een Worstelaar."));
dusuperobject.biblemap.put("b19_18_28", new dusuperobject(19,18,28,"Want Gij verlost het bedrukte volk, maar de hoge ogen vernedert Gij."));
dusuperobject.biblemap.put("b19_18_29", new dusuperobject(19,18,29,"Want Gij doet mijn lamp lichten; de HEERE, mijn God, doet mijn duisternis opklaren."));
dusuperobject.biblemap.put("b19_18_30", new dusuperobject(19,18,30,"Want met U loop ik door een bende, en met mijn God spring ik over een muur."));
dusuperobject.biblemap.put("b19_18_31", new dusuperobject(19,18,31,"Gods weg is volmaakt; de rede des HEEREN is doorlouterd; Hij is een Schild allen, die op Hem betrouwen."));
dusuperobject.biblemap.put("b19_18_32", new dusuperobject(19,18,32,"Want wie is God, behalve de HEERE? En wie is een Rotssteen, dan alleen onze God?"));
dusuperobject.biblemap.put("b19_18_33", new dusuperobject(19,18,33,"Het is God, Die mij met kracht omgordt; en Hij heeft mijn weg volkomen gemaakt."));
dusuperobject.biblemap.put("b19_18_34", new dusuperobject(19,18,34,"Hij maakt mijn voeten gelijk als der hinden, en Hij stelt mij op mijn hoogten."));
dusuperobject.biblemap.put("b19_18_35", new dusuperobject(19,18,35,"Hij leert mijn handen ten strijde, zodat een stalen boog met mijn armen verbroken is."));
dusuperobject.biblemap.put("b19_18_36", new dusuperobject(19,18,36,"Ook hebt Gij mij het schild Uws heils gegeven, en Uw rechterhand heeft mij ondersteund, en Uw zachtmoedigheid heeft mij groot gemaakt."));
dusuperobject.biblemap.put("b19_18_37", new dusuperobject(19,18,37,"Gij hebt mijn voetstap ruim gemaakt onder mij, en mijn enkelen hebben niet gewankeld."));
dusuperobject.biblemap.put("b19_18_38", new dusuperobject(19,18,38,"Ik vervolgde mijn vijanden, en trof hen aan; en ik keerde niet weder, totdat ik hen verdaan had."));
dusuperobject.biblemap.put("b19_18_39", new dusuperobject(19,18,39,"Ik doorstak hen, dat zij niet weder konden opstaan; zij vielen onder mijn voeten."));
dusuperobject.biblemap.put("b19_18_40", new dusuperobject(19,18,40,"Want Gij omgorddet mij met kracht ten strijde; Gij deedt onder mij nederbukken, die tegen mij opstonden."));
dusuperobject.biblemap.put("b19_18_41", new dusuperobject(19,18,41,"En Gij gaaft mij den nek mijner vijanden, en mijn haters, die vernielde ik."));
dusuperobject.biblemap.put("b19_18_42", new dusuperobject(19,18,42,"Zij riepen, maar er was geen verlosser; tot den HEERE, maar Hij antwoordde hun niet."));
dusuperobject.biblemap.put("b19_18_43", new dusuperobject(19,18,43,"Toen vergruisde ik hen als stof voor den wind; ik ruimde hen weg als slijk der straten."));
dusuperobject.biblemap.put("b19_18_44", new dusuperobject(19,18,44,"Gij hebt mij uitgeholpen van de twisten des volks; Gij hebt mij gesteld tot een hoofd der heidenen; het volk, dat ik niet kende, heeft mij gediend."));
dusuperobject.biblemap.put("b19_18_45", new dusuperobject(19,18,45,"Zo haast als hun oor van mij hoorde, hebben zij mij gehoorzaamd; vreemden hebben zich mij geveinsdelijk onderworpen."));
dusuperobject.biblemap.put("b19_18_46", new dusuperobject(19,18,46,"Vreemden zijn vervallen, en hebben gesidderd uit hun sloten."));
dusuperobject.biblemap.put("b19_18_47", new dusuperobject(19,18,47,"De HEERE leeft, en geloofd zij mijn Rotssteen, en verhoogd zij de God mijns heils!"));
dusuperobject.biblemap.put("b19_18_48", new dusuperobject(19,18,48,"De God, Die mij volkomen wraak geeft, en de volken onder mij brengt;"));
dusuperobject.biblemap.put("b19_18_49", new dusuperobject(19,18,49,"Die mij uithelpt van mijn vijanden; ja, Gij verhoogt mij boven degenen, die tegen mij opstaan; Gij redt mij van den man des gewelds."));
dusuperobject.biblemap.put("b19_18_50", new dusuperobject(19,18,50,"Daarom zal ik U, o HEERE! loven onder de heidenen; en Uw Naam zal ik psalmzingen; [ (Psalms 18:51) Die de verlossingen Zijns konings groot maakt, en goedertierenheid doet aan Zijn gezalfde, aan David en aan zijn zaad tot in eeuwigheid. ]"));
dusuperobject.biblemap.put("b19_19_1", new dusuperobject(19,19,1,"Een psalm van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_19_2", new dusuperobject(19,19,2,"De hemelen vertellen Gods eer, en het uitspansel verkondigt Zijner handen werk."));
dusuperobject.biblemap.put("b19_19_3", new dusuperobject(19,19,3,"De dag aan den dag stort overvloediglijk spraak uit, en de nacht aan den nacht toont wetenschap."));
dusuperobject.biblemap.put("b19_19_4", new dusuperobject(19,19,4,"Geen spraak, en geen woorden zijn er, waar hun stem niet wordt gehoord."));
dusuperobject.biblemap.put("b19_19_5", new dusuperobject(19,19,5,"Hun richtsnoer gaat uit over de ganse aarde, en hun redenen aan het einde der wereld; Hij heeft in dezelve een tent gesteld voor de zon."));
dusuperobject.biblemap.put("b19_19_6", new dusuperobject(19,19,6,"En die is als een bruidegom, uitgaande uit zijn slaapkamer; zij is vrolijk als een held, om het pad te lopen."));
dusuperobject.biblemap.put("b19_19_7", new dusuperobject(19,19,7,"Haar uitgang is van het einde des hemels, en haar omloop tot aan de einden deszelven; en niets is verborgen voor haar hitte."));
dusuperobject.biblemap.put("b19_19_8", new dusuperobject(19,19,8,"De wet des HEEREN is volmaakt, bekerende de ziel; de getuigenis des HEEREN is gewis, den slechten wijsheid gevende."));
dusuperobject.biblemap.put("b19_19_9", new dusuperobject(19,19,9,"De bevelen des HEEREN zijn recht, verblijdende het hart; het gebod des HEEREN is zuiver, verlichtende de ogen."));
dusuperobject.biblemap.put("b19_19_10", new dusuperobject(19,19,10,"De vreze des HEEREN is rein, bestaande tot in eeuwigheid, de rechten des HEEREN zijn waarheid, samen zijn zij rechtvaardig."));
dusuperobject.biblemap.put("b19_19_11", new dusuperobject(19,19,11,"Zij zijn begeerlijker dan goud, ja, dan veel fijn goud; en zoeter dan honig en honigzeem."));
dusuperobject.biblemap.put("b19_19_12", new dusuperobject(19,19,12,"Ook wordt Uw knecht door dezelve klaarlijk vermaand; in het houden van die is grote loon."));
dusuperobject.biblemap.put("b19_19_13", new dusuperobject(19,19,13,"Wie zou de afdwalingen verstaan? Reinig mij van de verborgene afdwalingen."));
dusuperobject.biblemap.put("b19_19_14", new dusuperobject(19,19,14,"Houd Uw knecht ook terug van trotsheden; laat ze niet over mij heersen; dan zal ik oprecht zijn en rein van grote overtreding. [ (Psalms 19:15) Laat de redenen mijns monds, en de overdenking mijns harten welbehagelijk zijn voor Uw aangezicht, o HEERE, mijn Rotssteen en mijn Verlosser! ]"));
dusuperobject.biblemap.put("b19_20_1", new dusuperobject(19,20,1,"Een psalm van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_20_2", new dusuperobject(19,20,2,"De HEERE verhore u in den dag der benauwdheid; de Naam van den God Jakobs zette u in een hoog vertrek."));
dusuperobject.biblemap.put("b19_20_3", new dusuperobject(19,20,3,"Hij zende uw hulp uit het heiligdom, en ondersteune u uit Sion."));
dusuperobject.biblemap.put("b19_20_4", new dusuperobject(19,20,4,"Hij gedenke al uwer spijsofferen, en make uw brandoffer tot as. Sela."));
dusuperobject.biblemap.put("b19_20_5", new dusuperobject(19,20,5,"Hij geve u naar uw hart, en vervulle al uw raad."));
dusuperobject.biblemap.put("b19_20_6", new dusuperobject(19,20,6,"Wij zullen juichen over Uw heil, en de vaandelen opsteken in den Naam onzes Gods. De HEERE vervulle al uw begeerten."));
dusuperobject.biblemap.put("b19_20_7", new dusuperobject(19,20,7,"Alsnu weet ik, dat de HEERE Zijn Gezalfde behoudt; Hij zal Hem verhoren uit den hemel Zijner heiligheid; het heil Zijner rechterhand zal zijn met mogendheden."));
dusuperobject.biblemap.put("b19_20_8", new dusuperobject(19,20,8,"Dezen vermelden van wagens, en die van paarden; maar wij zullen vermelden van den Naam des HEEREN, onzes Gods."));
dusuperobject.biblemap.put("b19_20_9", new dusuperobject(19,20,9,"Zij hebben zich gekromd, en zijn gevallen; maar wij zijn gerezen en staande gebleven. [ (Psalms 20:10) O HEERE! behoud; die Koning verhore ons ten dage van ons roepen. ]"));
dusuperobject.biblemap.put("b19_21_1", new dusuperobject(19,21,1,"Een psalm van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_21_2", new dusuperobject(19,21,2,"O HEERE! de koning is verblijd over Uw sterkte; en hoezeer is hij verheugd over Uw heil!"));
dusuperobject.biblemap.put("b19_21_3", new dusuperobject(19,21,3,"Gij hebt hem zijns harten wens gegeven, en de uitspraak zijner lippen hebt Gij niet geweerd. Sela."));
dusuperobject.biblemap.put("b19_21_4", new dusuperobject(19,21,4,"Want Gij komt hem voor met zegeningen van het goede; op zijn hoofd zet Gij een kroon van fijn goud."));
dusuperobject.biblemap.put("b19_21_5", new dusuperobject(19,21,5,"Het leven heeft hij van U begeerd. Gij hebt het hem gegeven; lengte van dagen, eeuwiglijk en altoos."));
dusuperobject.biblemap.put("b19_21_6", new dusuperobject(19,21,6,"Groot is zijn eer door Uw heil; majesteit en heerlijkheid hebt Gij hem toegevoegd."));
dusuperobject.biblemap.put("b19_21_7", new dusuperobject(19,21,7,"Want Gij zet hem tot zegeningen in eeuwigheid; Gij vervrolijkt hem door vreugde met Uw aangezicht."));
dusuperobject.biblemap.put("b19_21_8", new dusuperobject(19,21,8,"Want de koning vertrouwt op den HEERE, en door de goedertierenheid des Allerhoogsten zal hij niet wankelen."));
dusuperobject.biblemap.put("b19_21_9", new dusuperobject(19,21,9,"Uw hand zal alle vijanden vinden; uw rechterhand zal uw haters vinden."));
dusuperobject.biblemap.put("b19_21_10", new dusuperobject(19,21,10,"Gij zult hen zetten als een vurige oven ter tijd uws toornigen aangezichts; de HEERE zal hen in Zijn toorn verslinden, en het vuur zal hen verteren."));
dusuperobject.biblemap.put("b19_21_11", new dusuperobject(19,21,11,"Gij zult hun vrucht van de aarde verdoen, en hun zaad van de kinderen der mensen."));
dusuperobject.biblemap.put("b19_21_12", new dusuperobject(19,21,12,"Want zij hebben kwaad tegen U aangelegd; zij hebben een schandelijke daad bedacht, doch zullen niets vermogen."));
dusuperobject.biblemap.put("b19_21_13", new dusuperobject(19,21,13,"Want Gij zult hen zetten tot een wit; met Uw pezen zult Gij het op hun aangezicht toeleggen. [ (Psalms 21:14) Verhoog U, HEERE! in Uw sterkte; zo zullen wij zingen, en Uw macht met psalmen loven. ]"));
dusuperobject.biblemap.put("b19_22_1", new dusuperobject(19,22,1,"Een psalm van David, voor den opperzangmeester, op Aijeleth hasschachar."));
dusuperobject.biblemap.put("b19_22_2", new dusuperobject(19,22,2,"Mijn God, mijn God! waarom hebt Gij mij verlaten, verre zijnde van mijn verlossing, van de woorden mijns brullens?"));
dusuperobject.biblemap.put("b19_22_3", new dusuperobject(19,22,3,"Mijn God! Ik roep des daags, maar Gij antwoordt niet; en des nachts, en ik heb geen stilte."));
dusuperobject.biblemap.put("b19_22_4", new dusuperobject(19,22,4,"Doch Gij zijt heilig, wonende onder de lofzangen Israels."));
dusuperobject.biblemap.put("b19_22_5", new dusuperobject(19,22,5,"Op U hebben onze vaders vertrouwd; zij hebben vertrouwd, en Gij hebt hen uitgeholpen."));
dusuperobject.biblemap.put("b19_22_6", new dusuperobject(19,22,6,"Tot U hebben zij geroepen, en zijn uitgered; op U hebben zij vertrouwd, en zijn niet beschaamd geworden."));
dusuperobject.biblemap.put("b19_22_7", new dusuperobject(19,22,7,"Maar ik ben een worm en geen man, een smaad van mensen, en veracht van het volk."));
dusuperobject.biblemap.put("b19_22_8", new dusuperobject(19,22,8,"Allen, die mij zien, bespotten mij; zij steken de lip uit, zij schudden het hoofd, zeggende:"));
dusuperobject.biblemap.put("b19_22_9", new dusuperobject(19,22,9,"Hij heeft het op den HEERE gewenteld, dat Hij hem nu uithelpe, dat Hij hem redde, dewijl Hij lust aan hem heeft!"));
dusuperobject.biblemap.put("b19_22_10", new dusuperobject(19,22,10,"Gij zijt het immers, Die mij uit den buik hebt uitgetogen; Die mij hebt doen vertrouwen, zijnde aan mijner moeders borsten."));
dusuperobject.biblemap.put("b19_22_11", new dusuperobject(19,22,11,"Op U ben ik geworpen van de baarmoeder af; van den buik mijner moeder aan zijt Gij mijn God."));
dusuperobject.biblemap.put("b19_22_12", new dusuperobject(19,22,12,"Zo wees niet verre van mij, want benauwdheid is nabij; want er is geen helper."));
dusuperobject.biblemap.put("b19_22_13", new dusuperobject(19,22,13,"Vele varren hebben mij omsingeld, sterke stieren van Basan hebben mij omringd."));
dusuperobject.biblemap.put("b19_22_14", new dusuperobject(19,22,14,"Zij hebben hun mond tegen mij opgesperd, als een verscheurende en brullende leeuw."));
dusuperobject.biblemap.put("b19_22_15", new dusuperobject(19,22,15,"Ik ben uitgestort als water, en al mijn beenderen hebben zich vaneen gescheiden; mijn hart is als was, het is gesmolten in het midden mijns ingewands."));
dusuperobject.biblemap.put("b19_22_16", new dusuperobject(19,22,16,"Mijn kracht is verdroogd als een potscherf, en mijn tong kleeft aan mijn gehemelte; en Gij legt mij in het stof des doods."));
dusuperobject.biblemap.put("b19_22_17", new dusuperobject(19,22,17,"Want honden hebben mij omsingeld; een vergadering van boosdoeners heeft mij omgeven; zij hebben mijn handen en mijn voeten doorgraven."));
dusuperobject.biblemap.put("b19_22_18", new dusuperobject(19,22,18,"Al mijn beenderen zou ik kunnen tellen; zij schouwen het aan, zij zien op mij."));
dusuperobject.biblemap.put("b19_22_19", new dusuperobject(19,22,19,"Zij delen mijn klederen onder zich, en werpen het lot over mijn gewaad."));
dusuperobject.biblemap.put("b19_22_20", new dusuperobject(19,22,20,"Maar Gij, HEERE! wees niet verre; mijn Sterkte! haast U tot mijn hulp."));
dusuperobject.biblemap.put("b19_22_21", new dusuperobject(19,22,21,"Red mijn ziel van het zwaard, mijn eenzame van het geweld des honds."));
dusuperobject.biblemap.put("b19_22_22", new dusuperobject(19,22,22,"Verlos mij uit des leeuwen muil; en verhoor mij van de hoornen der eenhoornen."));
dusuperobject.biblemap.put("b19_22_23", new dusuperobject(19,22,23,"Zo zal ik Uw Naam mijn broederen vertellen; in het midden der gemeente zal ik U prijzen."));
dusuperobject.biblemap.put("b19_22_24", new dusuperobject(19,22,24,"Gij, die den HEERE vreest! prijst Hem; al gij zaad van Jakob! vereert Hem; en ontziet u voor Hem, al gij zaad van Israel!"));
dusuperobject.biblemap.put("b19_22_25", new dusuperobject(19,22,25,"Want Hij heeft niet veracht, noch verfoeid de verdrukking des verdrukten, noch Zijn aangezicht voor hem verborgen; maar Hij heeft gehoord, als die tot Hem riep."));
dusuperobject.biblemap.put("b19_22_26", new dusuperobject(19,22,26,"Van U zal mijn lof zijn in een grote gemeente; ik zal mijn geloften betalen in tegenwoordigheid dergenen, die Hem vrezen."));
dusuperobject.biblemap.put("b19_22_27", new dusuperobject(19,22,27,"De zachtmoedigen zullen eten en verzadigd worden; zij zullen den HEERE prijzen, die Hem zoeken; ulieder hart zal in eeuwigheid leven."));
dusuperobject.biblemap.put("b19_22_28", new dusuperobject(19,22,28,"Alle einden der aarde zullen het gedenken, en zich tot den HEERE bekeren; en alle geslachten der heidenen zullen voor Uw aangezicht aanbidden."));
dusuperobject.biblemap.put("b19_22_29", new dusuperobject(19,22,29,"Want het koninkrijk is des HEEREN, en Hij heerst onder de heidenen."));
dusuperobject.biblemap.put("b19_22_30", new dusuperobject(19,22,30,"Alle vetten op aarde zullen eten, en aanbidden; allen, die in het stof nederdalen, zullen voor Zijn aangezicht nederbukken; en die zijn ziel bij het leven niet kan houden."));
dusuperobject.biblemap.put("b19_22_31", new dusuperobject(19,22,31,"Het zaad zal Hem dienen; het zal den HEERE aangeschreven worden tot in geslachten. [ (Psalms 22:32) Zij zullen aankomen, en Zijn gerechtigheid verkondigen den volke, dat geboren wordt, omdat Hij het gedaan heeft. ]"));
dusuperobject.biblemap.put("b19_23_1", new dusuperobject(19,23,1,"Een psalm van David. De HEERE is mijn Herder, mij zal niets ontbreken."));
dusuperobject.biblemap.put("b19_23_2", new dusuperobject(19,23,2,"Hij doet mij nederliggen in grazige weiden; Hij voert mij zachtjes aan zeer stille wateren."));
dusuperobject.biblemap.put("b19_23_3", new dusuperobject(19,23,3,"Hij verkwikt mijn ziel; Hij leidt mij in het spoor der gerechtigheid, om Zijns Naams wil."));
dusuperobject.biblemap.put("b19_23_4", new dusuperobject(19,23,4,"Al ging ik ook in een dal der schaduw des doods, ik zou geen kwaad vrezen, want Gij zijt met mij; Uw stok en Uw staf, die vertroosten mij."));
dusuperobject.biblemap.put("b19_23_5", new dusuperobject(19,23,5,"Gij richt de tafel toe voor mijn aangezicht, tegenover mijn tegenpartijders; Gij maakt mijn hoofd vet met olie, mijn beker is overvloeiende."));
dusuperobject.biblemap.put("b19_23_6", new dusuperobject(19,23,6,"Immers zullen mij het goede en de weldadigheid volgen al de dagen mijns levens; en ik zal in het huis des HEEREN blijven in lengte van dagen."));
dusuperobject.biblemap.put("b19_24_1", new dusuperobject(19,24,1,"Een psalm van David. De aarde is des HEEREN, mitsgaders haar volheid, de wereld, en die daarin wonen."));
dusuperobject.biblemap.put("b19_24_2", new dusuperobject(19,24,2,"Want Hij heeft ze gegrond op de zeeen, en heeft ze gevestigd op de rivieren."));
dusuperobject.biblemap.put("b19_24_3", new dusuperobject(19,24,3,"Wie zal klimmen op den berg des HEEREN, en wie zal staan in de plaats Zijner heiligheid?"));
dusuperobject.biblemap.put("b19_24_4", new dusuperobject(19,24,4,"Die rein van handen, en zuiver van hart is, die zijn ziel niet opheft tot ijdelheid, en die niet bedriegelijk zweert;"));
dusuperobject.biblemap.put("b19_24_5", new dusuperobject(19,24,5,"Die zal den zegen ontvangen van den HEERE, en gerechtigheid van den God zijns heils."));
dusuperobject.biblemap.put("b19_24_6", new dusuperobject(19,24,6,"Dat is het geslacht dergenen, die naar Hem vragen, die Uw aangezicht zoeken, dat is Jakob! Sela."));
dusuperobject.biblemap.put("b19_24_7", new dusuperobject(19,24,7,"Heft uw hoofden op, gij poorten, en verheft u, gij eeuwige deuren, opdat de Koning der ere inga!"));
dusuperobject.biblemap.put("b19_24_8", new dusuperobject(19,24,8,"Wie is de Koning der ere? De HEERE, sterk en geweldig, de HEERE, geweldig in den strijd."));
dusuperobject.biblemap.put("b19_24_9", new dusuperobject(19,24,9,"Heft uw hoofden op, gij poorten, ja, heft op, gij eeuwige deuren! opdat de Koning der ere inga!"));
dusuperobject.biblemap.put("b19_24_10", new dusuperobject(19,24,10,"Wie is Hij, deze Koning der ere? De HEERE der heirscharen, Die is de Koning der ere. Sela."));
dusuperobject.biblemap.put("b19_25_1", new dusuperobject(19,25,1,"Een psalm van David. Aleph. Tot U, o HEERE! hef ik mijn ziel op."));
dusuperobject.biblemap.put("b19_25_2", new dusuperobject(19,25,2,"Beth. Mijn God! op U vertrouw ik; laat mij niet beschaamd worden; laat mijn vijanden niet van vreugde opspringen over mij."));
dusuperobject.biblemap.put("b19_25_3", new dusuperobject(19,25,3,"Gimel. Ja, allen, die U verwachten, zullen niet beschaamd worden; zij zullen beschaamd worden, die trouwelooslijk handelen zonder oorzaak."));
dusuperobject.biblemap.put("b19_25_4", new dusuperobject(19,25,4,"Daleth. HEERE! maak mij Uw wegen bekend, leer mij Uw paden."));
dusuperobject.biblemap.put("b19_25_5", new dusuperobject(19,25,5,"He. Vau. Leid mij in Uw waarheid, en leer mij, want Gij zijt de God mijns heils; U verwacht ik den ganse dag."));
dusuperobject.biblemap.put("b19_25_6", new dusuperobject(19,25,6,"Zain. Gedenk, HEERE! Uwer barmhartigheden en Uwer goedertierenheden, want die zijn van eeuwigheid."));
dusuperobject.biblemap.put("b19_25_7", new dusuperobject(19,25,7,"Cheth. Gedenk niet der zonden mijner jonkheid, noch mijner overtredingen; gedenk mijner naar Uw goedertierenheid, om Uwer goedheid wil, o HEERE!"));
dusuperobject.biblemap.put("b19_25_8", new dusuperobject(19,25,8,"Teth. De HEERE is goed en recht; daarom zal Hij de zondaars onderwijzen in den weg."));
dusuperobject.biblemap.put("b19_25_9", new dusuperobject(19,25,9,"Jod. Hij zal de zachtmoedigen leiden in het recht, en Hij zal den zachtmoedigen Zijn weg leren."));
dusuperobject.biblemap.put("b19_25_10", new dusuperobject(19,25,10,"Caph. Alle paden des HEEREN zijn goedertierenheid en waarheid, dengenen, die Zijn verbond en Zijn getuigenissen bewaren."));
dusuperobject.biblemap.put("b19_25_11", new dusuperobject(19,25,11,"Lamed. Om Uws Naams wil, HEERE! zo vergeef mijn ongerechtigheid, want die is groot."));
dusuperobject.biblemap.put("b19_25_12", new dusuperobject(19,25,12,"Mem. Wie is de man, die den HEERE vreest? Hij zal hem onderwijzen in den weg, dien hij zal hebben te verkiezen."));
dusuperobject.biblemap.put("b19_25_13", new dusuperobject(19,25,13,"Nun. Zijn ziel zal vernachten in het goede, en zijn zaad zal de aarde beerven."));
dusuperobject.biblemap.put("b19_25_14", new dusuperobject(19,25,14,"Samech. De verborgenheid des HEEREN is voor degenen, die Hem vrezen; en Zijn verbond, om hun die bekend te maken."));
dusuperobject.biblemap.put("b19_25_15", new dusuperobject(19,25,15,"Ain. Mijn ogen zijn geduriglijk op den HEERE, want Hij zal mijn voeten uit het net uitvoeren."));
dusuperobject.biblemap.put("b19_25_16", new dusuperobject(19,25,16,"Pe. Wend U tot mij, en wees mij genadig, want ik ben eenzaam en ellendig."));
dusuperobject.biblemap.put("b19_25_17", new dusuperobject(19,25,17,"Tsade. De benauwdheden mijns harten hebben zich wijd uitgestrekt; voer mij uit mijn noden."));
dusuperobject.biblemap.put("b19_25_18", new dusuperobject(19,25,18,"Resch. Aanzie mijn ellende, en mijn moeite, en neem weg al mijn zonden."));
dusuperobject.biblemap.put("b19_25_19", new dusuperobject(19,25,19,"Resch. Aanzie mijn vijanden, want zij vermenigvuldigen, en zij haten mij met een wreveligen haat."));
dusuperobject.biblemap.put("b19_25_20", new dusuperobject(19,25,20,"Schin. Bewaar mijn ziel, en red mij; laat mij niet beschaamd worden, want ik betrouw op U."));
dusuperobject.biblemap.put("b19_25_21", new dusuperobject(19,25,21,"Thau. Laat oprechtigheid en vroomheid mij behoeden, want ik verwacht U."));
dusuperobject.biblemap.put("b19_25_22", new dusuperobject(19,25,22,"O God! verlos Israel uit al zijn benauwdheden."));
dusuperobject.biblemap.put("b19_26_1", new dusuperobject(19,26,1,"Een psalm van David! Doe mij recht, HEERE! want ik wandel in mijn oprechtigheid; en ik vertrouw op den HEERE, ik zal niet wankelen."));
dusuperobject.biblemap.put("b19_26_2", new dusuperobject(19,26,2,"Proef mij, HEERE, en verzoek mij; toets mijn nieren en mijn hart."));
dusuperobject.biblemap.put("b19_26_3", new dusuperobject(19,26,3,"Want Uw goedertierenheid is voor mijn ogen, en ik wandel in Uw waarheid."));
dusuperobject.biblemap.put("b19_26_4", new dusuperobject(19,26,4,"Ik zit niet bij ijdele lieden, en met bedekte lieden ga ik niet om."));
dusuperobject.biblemap.put("b19_26_5", new dusuperobject(19,26,5,"Ik haat de vergadering der boosdoeners, en bij de goddelozen zit ik niet."));
dusuperobject.biblemap.put("b19_26_6", new dusuperobject(19,26,6,"Ik was mijn handen in onschuld, en ik ga rondom uw altaar, o HEERE!"));
dusuperobject.biblemap.put("b19_26_7", new dusuperobject(19,26,7,"Om te doen horen de stem des lofs, en om te vertellen al Uw wonderen."));
dusuperobject.biblemap.put("b19_26_8", new dusuperobject(19,26,8,"HEERE! ik heb lief de woning van Uw huis, en de plaats des tabernakels Uwer eer."));
dusuperobject.biblemap.put("b19_26_9", new dusuperobject(19,26,9,"Raap mijn ziel niet weg met de zondaren, noch mijn leven met de mannen des bloeds;"));
dusuperobject.biblemap.put("b19_26_10", new dusuperobject(19,26,10,"In welker handen schandelijk bedrijf is, en welker rechterhand vol geschenken is."));
dusuperobject.biblemap.put("b19_26_11", new dusuperobject(19,26,11,"Maar ik wandel in mijn oprechtigheid, verlos mij dan en wees mij genadig."));
dusuperobject.biblemap.put("b19_26_12", new dusuperobject(19,26,12,"Mijn voet staat op effen baan; ik zal den HEERE loven in de vergaderingen."));
dusuperobject.biblemap.put("b19_27_1", new dusuperobject(19,27,1,"Een psalm van David. De HEERE is mijn Licht en mijn Heil, voor wien zou ik vrezen? De HEERE is mijns levens kracht, voor wien zou ik vervaard zijn?"));
dusuperobject.biblemap.put("b19_27_2", new dusuperobject(19,27,2,"Als de bozen, mijn tegenpartijen, en mijn vijanden tegen mij, tot mij naderden, om mijn vlees te eten, stieten zij zelven aan, en vielen."));
dusuperobject.biblemap.put("b19_27_3", new dusuperobject(19,27,3,"Ofschoon mij een leger belegerde, mijn hart zou niet vrezen; ofschoon een oorlog tegen mij opstond, zo vertrouw ik hierop."));
dusuperobject.biblemap.put("b19_27_4", new dusuperobject(19,27,4,"Een ding heb ik van den HEERE begeerd, dat zal ik zoeken: dat ik al de dagen mijns levens mocht wonen in het huis des HEEREN, om de liefelijkheid des HEEREN te aanschouwen, en te onderzoeken in Zijn tempel."));
dusuperobject.biblemap.put("b19_27_5", new dusuperobject(19,27,5,"Want Hij versteekt mij in Zijn hut, ten dage des kwaads; Hij verbergt mij in het verborgene Zijner tent; Hij verhoogt mij op een rotssteen."));
dusuperobject.biblemap.put("b19_27_6", new dusuperobject(19,27,6,"Ook nu zal mijn hoofd verhoogd worden boven mijn vijanden, die rondom mij zijn, en ik zal in Zijn tent offeranden des geklanks offeren; ik zal zingen, ja, psalmzingen den HEERE."));
dusuperobject.biblemap.put("b19_27_7", new dusuperobject(19,27,7,"Hoor, HEERE! mijn stem, als ik roep; en wees mij genadig, en antwoord mij."));
dusuperobject.biblemap.put("b19_27_8", new dusuperobject(19,27,8,"Mijn hart zegt tot U: Gij zegt: Zoek Mijn aangezicht; ik zoek Uw aangezicht, o HEERE!"));
dusuperobject.biblemap.put("b19_27_9", new dusuperobject(19,27,9,"Verberg Uw aangezicht niet voor mij, keer Uw knecht niet af in toorn; Gij zijt mijn Hulp geweest, begeef mij niet, en verlaat mij niet, o God mijns heils!"));
dusuperobject.biblemap.put("b19_27_10", new dusuperobject(19,27,10,"Want mijn vader en mijn moeder hebben mij verlaten, maar de HEERE zal mij aannemen."));
dusuperobject.biblemap.put("b19_27_11", new dusuperobject(19,27,11,"HEERE! leer mij Uw weg, en leid mij in het rechte pad, om mijner verspieders wil."));
dusuperobject.biblemap.put("b19_27_12", new dusuperobject(19,27,12,"Geef mij niet over in de begeerte mijner tegenpartijders; want valse getuigen zijn tegen mij opgestaan, mitsgaders die wrevel uitblaast."));
dusuperobject.biblemap.put("b19_27_13", new dusuperobject(19,27,13,"Zo ik niet had geloofd, dat ik het goede des HEEREN zou zien in het land der levenden, ik ware vergaan."));
dusuperobject.biblemap.put("b19_27_14", new dusuperobject(19,27,14,"Wacht op den HEERE, zijt sterk, en Hij zal uw hart versterken, ja, wacht op den HEERE."));
dusuperobject.biblemap.put("b19_28_1", new dusuperobject(19,28,1,"Een psalm van David. Tot U roep ik, HEERE! mijn Rotssteen, houd U niet als doof van mij af; opdat ik niet, zo Gij U van mij stil houdt, vergeleken worde met degenen, die in den kuil nederdalen."));
dusuperobject.biblemap.put("b19_28_2", new dusuperobject(19,28,2,"Hoor de stem mijner smekingen, als ik tot U roep, als ik mijn handen ophef naar de aanspraakplaats Uwer heiligheid."));
dusuperobject.biblemap.put("b19_28_3", new dusuperobject(19,28,3,"Trek mij niet weg met de goddelozen, en met de werkers der ongerechtigheid, die van vrede spreken met hun naasten, maar kwaad is in hun hart."));
dusuperobject.biblemap.put("b19_28_4", new dusuperobject(19,28,4,"Geef hun naar hun doen, en naar de boosheid hunner handelingen; geef hun naar hunner handen werk; doe hun vergelding tot hen wederkeren."));
dusuperobject.biblemap.put("b19_28_5", new dusuperobject(19,28,5,"Omdat zij niet letten op de daden des HEEREN, noch op het werk Zijner handen, zo zal Hij hen afbreken en zal hen niet bouwen."));
dusuperobject.biblemap.put("b19_28_6", new dusuperobject(19,28,6,"Geloofd zij de HEERE, want Hij heeft de stem mijner smekingen gehoord."));
dusuperobject.biblemap.put("b19_28_7", new dusuperobject(19,28,7,"De HEERE is mijn Sterkte en mijn Schild; op Hem heeft mijn hart vertrouwd, en ik ben geholpen; dies springt mijn hart van vreugde, en ik zal Hem met mijn gezang loven."));
dusuperobject.biblemap.put("b19_28_8", new dusuperobject(19,28,8,"De HEERE is hunlieder Sterkte, en Hij is de Sterkheid der verlossingen Zijns Gezalfden."));
dusuperobject.biblemap.put("b19_28_9", new dusuperobject(19,28,9,"Verlos Uw volk, en zegen Uw erve, en weid hen, en verhef hen tot in eeuwigheid."));
dusuperobject.biblemap.put("b19_29_1", new dusuperobject(19,29,1,"Een psalm van David. Geeft den HEERE, gij kinderen der machtigen! geeft den HEERE eer en sterkte."));
dusuperobject.biblemap.put("b19_29_2", new dusuperobject(19,29,2,"Geeft den HEERE de eer Zijns Naams, aanbidt den HEERE in de heerlijkheid des heiligdoms."));
dusuperobject.biblemap.put("b19_29_3", new dusuperobject(19,29,3,"De stem des HEEREN is op de wateren, de God der ere dondert; de HEERE is op de grote wateren."));
dusuperobject.biblemap.put("b19_29_4", new dusuperobject(19,29,4,"De stem des HEEREN is met kracht, de stem des HEEREN is met heerlijkheid."));
dusuperobject.biblemap.put("b19_29_5", new dusuperobject(19,29,5,"De stem des HEEREN breekt de cederen; ja, de HEERE verbreekt de cederen van Libanon."));
dusuperobject.biblemap.put("b19_29_6", new dusuperobject(19,29,6,"En Hij doet ze huppelen als een kalf, de Libanon en Sirjon als een jongen eenhoorn."));
dusuperobject.biblemap.put("b19_29_7", new dusuperobject(19,29,7,"De stem des HEEREN houwt er vlammen vuurs uit."));
dusuperobject.biblemap.put("b19_29_8", new dusuperobject(19,29,8,"De stem des HEEREN doet de woestijn beven; de HEERE doet de woestijn Kades beven."));
dusuperobject.biblemap.put("b19_29_9", new dusuperobject(19,29,9,"De stem des HEEREN doet de hinden jongen werpen, en ontbloot de wouden; maar in Zijn tempel zegt Hem een iegelijk eer."));
dusuperobject.biblemap.put("b19_29_10", new dusuperobject(19,29,10,"De HEERE heeft gezeten over den watervloed; ja, de HEERE zit, Koning in eeuwigheid."));
dusuperobject.biblemap.put("b19_29_11", new dusuperobject(19,29,11,"De HEERE zal Zijn volk sterkte geven; de HEERE zal Zijn volk zegenen met vrede."));
dusuperobject.biblemap.put("b19_30_1", new dusuperobject(19,30,1,"Een psalm, een lied der inwijding van Davids huis."));
dusuperobject.biblemap.put("b19_30_2", new dusuperobject(19,30,2,"Ik zal U verhogen, HEERE, want Gij hebt mij opgetrokken, en mijn vijanden over mij niet verblijd."));
dusuperobject.biblemap.put("b19_30_3", new dusuperobject(19,30,3,"HEERE, mijn God! ik heb tot U geroepen, en Gij hebt mij genezen."));
dusuperobject.biblemap.put("b19_30_4", new dusuperobject(19,30,4,"HEERE! Gij hebt mijn ziel uit het graf opgevoerd; Gij hebt mij bij het leven behouden, dat ik in den kuil niet ben nedergedaald."));
dusuperobject.biblemap.put("b19_30_5", new dusuperobject(19,30,5,"Psalmzingt den HEERE, gij Zijn gunstgenoten! en zegt lof ter gedachtenis Zijner heiligheid."));
dusuperobject.biblemap.put("b19_30_6", new dusuperobject(19,30,6,"Want een ogenblik is er in Zijn toorn, maar een leven in Zijn goedgunstigheid; des avonds vernacht het geween, maar des morgens is er gejuich."));
dusuperobject.biblemap.put("b19_30_7", new dusuperobject(19,30,7,"Ik zeide wel in mijn voorspoed: Ik zal niet wankelen in eeuwigheid."));
dusuperobject.biblemap.put("b19_30_8", new dusuperobject(19,30,8,"Want, HEERE! Gij hadt mijn berg door Uw goedgunstigheid vastgezet; maar toen Gij Uw aangezicht verborgt, werd ik verschrikt."));
dusuperobject.biblemap.put("b19_30_9", new dusuperobject(19,30,9,"Tot U, HEERE! riep ik, en ik smeekte tot den HEERE:"));
dusuperobject.biblemap.put("b19_30_10", new dusuperobject(19,30,10,"Wat gewin is er in mijn bloed, in mijn nederdalen tot de groeve? Zal U het stof loven? Zal het Uw waarheid verkondigen?"));
dusuperobject.biblemap.put("b19_30_11", new dusuperobject(19,30,11,"Hoor, HEERE! en wees mij genadig; HEERE! wees mij een Helper."));
dusuperobject.biblemap.put("b19_30_12", new dusuperobject(19,30,12,"Gij hebt mij mijn weeklage veranderd in een rei; Gij hebt mijn zak ontbonden, en mij met blijdschap omgord; [ (Psalms 30:13) Opdat mijn eer U psalmzinge, en niet zwijge. HEERE, mijn God! in eeuwigheid zal ik U loven. ]"));
dusuperobject.biblemap.put("b19_31_1", new dusuperobject(19,31,1,"Een psalm van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_31_2", new dusuperobject(19,31,2,"Op U, o HEERE! betrouw ik, laat mij niet beschaamd worden in eeuwigheid; help mij uit door Uw gerechtigheid."));
dusuperobject.biblemap.put("b19_31_3", new dusuperobject(19,31,3,"Neig Uw oor tot mij, red mij haastelijk; wees mij tot een sterke Rotssteen, tot een zeer vast Huis, om mij te behouden."));
dusuperobject.biblemap.put("b19_31_4", new dusuperobject(19,31,4,"Want Gij zijt mijn Steenrots en mijn Burg; leid mij dan, en voer mij, om Uws Naams wil."));
dusuperobject.biblemap.put("b19_31_5", new dusuperobject(19,31,5,"Doe mij uitgaan uit het net, dat zij voor mij verborgen hebben, want Gij zijt mijn Sterkte."));
dusuperobject.biblemap.put("b19_31_6", new dusuperobject(19,31,6,"In Uw hand beveel ik mijn geest; Gij hebt mij verlost, HEERE, Gij, God der waarheid!"));
dusuperobject.biblemap.put("b19_31_7", new dusuperobject(19,31,7,"Ik haat degenen, die op valse ijdelheden acht nemen, en ik betrouw op den HEERE."));
dusuperobject.biblemap.put("b19_31_8", new dusuperobject(19,31,8,"Ik zal mij verheugen en verblijden in Uw goedertierenheid, omdat Gij mijn ellende hebt aangezien, en mijn ziel in benauwdheden gekend;"));
dusuperobject.biblemap.put("b19_31_9", new dusuperobject(19,31,9,"En mij niet hebt overgeleverd in de hand des vijands; Gij hebt mijn voeten doen staan in de ruimte."));
dusuperobject.biblemap.put("b19_31_10", new dusuperobject(19,31,10,"Wees mij genadig, HEERE! want mij is bange; van verdriet is doorknaagd mijn oog, mijn ziel en mijn buik."));
dusuperobject.biblemap.put("b19_31_11", new dusuperobject(19,31,11,"Want mijn leven is verteerd van droefenis, en mijn jaren van zuchten; mijn kracht is vervallen door mijn ongerechtigheid, en mijn beenderen zijn doorknaagd."));
dusuperobject.biblemap.put("b19_31_12", new dusuperobject(19,31,12,"Vanwege al mijn wederpartijders ben ik, ook mijn naburen, grotelijks tot een smaad geworden, en mijn bekenden tot een schrik; die mij op de straten zien, vlieden van mij weg."));
dusuperobject.biblemap.put("b19_31_13", new dusuperobject(19,31,13,"Ik ben uit het hart vergeten als een dode; ik ben geworden als een bedorven vat."));
dusuperobject.biblemap.put("b19_31_14", new dusuperobject(19,31,14,"Want ik hoorde de naspraak van velen; vreze is van rondom, dewijl zij te zamen tegen mij raadslaan; zij denken mijn ziel te nemen."));
dusuperobject.biblemap.put("b19_31_15", new dusuperobject(19,31,15,"Maar ik vertrouw op U, o HEERE! Ik zeg: Gij zijt mijn God."));
dusuperobject.biblemap.put("b19_31_16", new dusuperobject(19,31,16,"Mijn tijden zijn in Uw hand; red mij van de hand mijner vijanden, en van mijn vervolgers."));
dusuperobject.biblemap.put("b19_31_17", new dusuperobject(19,31,17,"Laat Uw aangezicht over Uw knecht lichten; verlos mij door Uw goedertierenheid."));
dusuperobject.biblemap.put("b19_31_18", new dusuperobject(19,31,18,"HEERE! laat mij niet beschaamd worden, want ik roep U aan; laat de goddelozen beschaamd worden, laat hen zwijgen in het graf."));
dusuperobject.biblemap.put("b19_31_19", new dusuperobject(19,31,19,"Laat de valse lippen stom worden, die hard spreken tegen den rechtvaardige, in hoogmoed en verachting."));
dusuperobject.biblemap.put("b19_31_20", new dusuperobject(19,31,20,"O, hoe groot is Uw goed, dat Gij weggelegd hebt voor degenen, die U vrezen; dat Gij gewrocht hebt voor degenen, die op U betrouwen, in de tegenwoordigheid der mensenkinderen!"));
dusuperobject.biblemap.put("b19_31_21", new dusuperobject(19,31,21,"Gij verbergt hen in het verborgene Uws aangezichts voor de hoogmoedigheden des mans; Gij versteekt hen in een hut voor de twist der tongen."));
dusuperobject.biblemap.put("b19_31_22", new dusuperobject(19,31,22,"Geloofd zij de HEERE, want Hij heeft Zijn goedertierenheid aan mij wonderlijk gemaakt, mij voerende als in een vaste stad."));
dusuperobject.biblemap.put("b19_31_23", new dusuperobject(19,31,23,"Ik zeide wel in mijn haasten: Ik ben afgesneden van voor Uw ogen; dan nog hoordet Gij de stem mijner smekingen, als ik tot U riep."));
dusuperobject.biblemap.put("b19_31_24", new dusuperobject(19,31,24,"Hebt den HEERE lief, gij, al Zijn gunstgenoten! want de HEERE behoedt de gelovigen, en vergeldt overvloediglijk dengene, die hoogmoed bedrijft. [ (Psalms 31:25) Zijt sterk, en Hij zal ulieder hart versterken, allen gij, die op den HEERE hoopt! ]"));
dusuperobject.biblemap.put("b19_32_1", new dusuperobject(19,32,1,"Een onderwijzing van David. Welgelukzalig is hij, wiens overtreding vergeven, wiens zonde bedekt is."));
dusuperobject.biblemap.put("b19_32_2", new dusuperobject(19,32,2,"Welgelukzalig is de mens, dien de HEERE de ongerechtigheid niet toerekent, en in wiens geest geen bedrog is."));
dusuperobject.biblemap.put("b19_32_3", new dusuperobject(19,32,3,"Toen ik zweeg, werden mijn beenderen verouderd, in mijn brullen den gansen dag."));
dusuperobject.biblemap.put("b19_32_4", new dusuperobject(19,32,4,"Want Uw hand was dag en nacht zwaar op mij; mijn sap werd veranderd in zomerdroogten. Sela."));
dusuperobject.biblemap.put("b19_32_5", new dusuperobject(19,32,5,"Mijn zonde maakte ik U bekend, en mijn ongerechtigheid bedekte ik niet. Ik zeide: Ik zal belijdenis van mijn overtredingen doen voor den HEERE; en Gij vergaaft de ongerechtigheid mijner zonde. Sela."));
dusuperobject.biblemap.put("b19_32_6", new dusuperobject(19,32,6,"Hierom zal U ieder heilige aanbidden in vindenstijd; ja, in een overloop van grote wateren zullen zij hem niet aanraken."));
dusuperobject.biblemap.put("b19_32_7", new dusuperobject(19,32,7,"Gij zijt mij een Verberging; Gij behoedt mij voor benauwdheid; Gij omringt mij met vrolijke gezangen van bevrijding. Sela."));
dusuperobject.biblemap.put("b19_32_8", new dusuperobject(19,32,8,"Ik zal u onderwijzen, en u leren van den weg, dien gij gaan zult; Ik zal raad geven, Mijn oog zal op u zijn."));
dusuperobject.biblemap.put("b19_32_9", new dusuperobject(19,32,9,"Weest niet gelijk een paard, gelijk een muilezel, hetwelk geen verstand heeft, welks muil men breidelt met toom en gebit, opdat het tot u niet genake."));
dusuperobject.biblemap.put("b19_32_10", new dusuperobject(19,32,10,"De goddeloze heeft veel smarten, maar die op den HEERE vertrouwt, dien zal de goedertierenheid omringen."));
dusuperobject.biblemap.put("b19_32_11", new dusuperobject(19,32,11,"Verblijdt u in den HEERE, en verheugt u, gij rechtvaardigen! en zingt vrolijk, alle gij oprechten van harte!"));
dusuperobject.biblemap.put("b19_33_1", new dusuperobject(19,33,1,"Gij rechtvaardigen! zingt vrolijk in den HEERE; lof betaamt den oprechten."));
dusuperobject.biblemap.put("b19_33_2", new dusuperobject(19,33,2,"Looft den HEERE met de harp; psalmzingt Hem met de luit, en het tiensnarig instrument."));
dusuperobject.biblemap.put("b19_33_3", new dusuperobject(19,33,3,"Zingt Hem een nieuw lied; speelt wel met vrolijk geschal."));
dusuperobject.biblemap.put("b19_33_4", new dusuperobject(19,33,4,"Want des HEEREN woord is recht, en al Zijn werk getrouw."));
dusuperobject.biblemap.put("b19_33_5", new dusuperobject(19,33,5,"Hij heeft gerechtigheid en gericht lief; de aarde is vol van de goedertierenheid des HEEREN."));
dusuperobject.biblemap.put("b19_33_6", new dusuperobject(19,33,6,"Door het Woord des HEEREN zijn de hemelen gemaakt, en door den Geest Zijns monds al hun heir."));
dusuperobject.biblemap.put("b19_33_7", new dusuperobject(19,33,7,"Hij vergadert de wateren der zee als op een hoop; Hij stelt den afgronden schatkameren."));
dusuperobject.biblemap.put("b19_33_8", new dusuperobject(19,33,8,"Laat de ganse aarde voor den HEERE vrezen; laat alle inwoners van de wereld voor Hem schrikken."));
dusuperobject.biblemap.put("b19_33_9", new dusuperobject(19,33,9,"Want Hij spreekt, en het is er; Hij gebiedt, en het staat er."));
dusuperobject.biblemap.put("b19_33_10", new dusuperobject(19,33,10,"De HEERE vernietigt den raad der heidenen; Hij breekt de gedachten der volken."));
dusuperobject.biblemap.put("b19_33_11", new dusuperobject(19,33,11,"Maar de raad des HEEREN bestaat in eeuwigheid, de gedachten Zijns harten van geslacht tot geslacht."));
dusuperobject.biblemap.put("b19_33_12", new dusuperobject(19,33,12,"Welgelukzalig is het volk, welks God de HEERE is; het volk, dat Hij Zich ten erve verkoren heeft."));
dusuperobject.biblemap.put("b19_33_13", new dusuperobject(19,33,13,"De HEERE schouwt uit den hemel, en ziet alle mensenkinderen."));
dusuperobject.biblemap.put("b19_33_14", new dusuperobject(19,33,14,"Hij ziet uit van Zijn vaste woonplaats op alle inwoners der aarde."));
dusuperobject.biblemap.put("b19_33_15", new dusuperobject(19,33,15,"Hij formeert hun aller hart; Hij let op al hun werken."));
dusuperobject.biblemap.put("b19_33_16", new dusuperobject(19,33,16,"Een koning wordt niet behouden door een groot heir; een held wordt niet gered door grote kracht;"));
dusuperobject.biblemap.put("b19_33_17", new dusuperobject(19,33,17,"Het paard feilt ter overwinning, en bevrijdt niet door zijn grote sterkte."));
dusuperobject.biblemap.put("b19_33_18", new dusuperobject(19,33,18,"Ziet, des HEEREN oog is over degenen, die Hem vrezen, op degenen, die op Zijn goedertierenheid hopen."));
dusuperobject.biblemap.put("b19_33_19", new dusuperobject(19,33,19,"Om hun ziel van den dood te redden, en om hen bij het leven te houden in den honger."));
dusuperobject.biblemap.put("b19_33_20", new dusuperobject(19,33,20,"Onze ziel verbeidt den HEERE: Hij is onze Hulp en ons Schild."));
dusuperobject.biblemap.put("b19_33_21", new dusuperobject(19,33,21,"Want ons hart is in Hem verblijd, omdat wij op den Naam Zijner heiligheid vertrouwen."));
dusuperobject.biblemap.put("b19_33_22", new dusuperobject(19,33,22,"Uw goedertierenheid, HEERE! zij over ons; gelijk als wij op U hopen."));
dusuperobject.biblemap.put("b19_34_1", new dusuperobject(19,34,1,"Een psalm van David, als hij zijn gelaat veranderd had voor het aangezicht van Abimelech, die hem wegjoeg, dat hij doorging."));
dusuperobject.biblemap.put("b19_34_2", new dusuperobject(19,34,2,"Aleph. Ik zal den HEERE loven te aller tijd; Zijn lof zal geduriglijk in mijn mond zijn."));
dusuperobject.biblemap.put("b19_34_3", new dusuperobject(19,34,3,"Beth. Mijn ziel zal zich beroemen in den HEERE; de zachtmoedigen zullen het horen en verblijd zijn."));
dusuperobject.biblemap.put("b19_34_4", new dusuperobject(19,34,4,"Gimel. Maakt den HEERE met mij groot, en laat ons Zijn Naam samen verhogen."));
dusuperobject.biblemap.put("b19_34_5", new dusuperobject(19,34,5,"Daleth. Ik heb den HEERE gezocht, en Hij heeft mij geantwoord, en mij uit al mijn vrezen gered."));
dusuperobject.biblemap.put("b19_34_6", new dusuperobject(19,34,6,"He. Vau. Zij hebben op Hem gezien, ja, Hem als een waterstroom aangelopen; en hun aangezichten zijn niet schaamrood geworden."));
dusuperobject.biblemap.put("b19_34_7", new dusuperobject(19,34,7,"Zain. Deze ellendige riep, en de HEERE hoorde; en Hij verloste hem uit al zijn benauwdheden."));
dusuperobject.biblemap.put("b19_34_8", new dusuperobject(19,34,8,"Cheth. De Engel des HEEREN legert Zich rondom degenen, die Hem vrezen, en rukt hen uit."));
dusuperobject.biblemap.put("b19_34_9", new dusuperobject(19,34,9,"Teth. Smaakt en ziet, dat de HEERE goed is; welgelukzalig is de man, die op Hem betrouwt."));
dusuperobject.biblemap.put("b19_34_10", new dusuperobject(19,34,10,"Jod. Vreest den HEERE, gij Zijn heiligen! want die Hem vrezen, hebben geen gebrek."));
dusuperobject.biblemap.put("b19_34_11", new dusuperobject(19,34,11,"Caph. De jonge leeuwen lijden armoede, en hongeren; maar die den HEERE zoeken, hebben geen gebrek aan enig goed."));
dusuperobject.biblemap.put("b19_34_12", new dusuperobject(19,34,12,"Lamed. Komt, gij, kinderen! hoort naar mij! ik zal u des HEEREN vreze leren."));
dusuperobject.biblemap.put("b19_34_13", new dusuperobject(19,34,13,"Mem. Wie is de man, die lust heeft ten leven, die dagen liefheeft, om het goede te zien?"));
dusuperobject.biblemap.put("b19_34_14", new dusuperobject(19,34,14,"Nun. Bewaar uw tong van het kwaad, en uw lippen van bedrog te spreken."));
dusuperobject.biblemap.put("b19_34_15", new dusuperobject(19,34,15,"Samech. Wijk af van het kwaad, en doe het goede; zoek den vrede, en jaag dien na."));
dusuperobject.biblemap.put("b19_34_16", new dusuperobject(19,34,16,"Ain. De ogen des HEEREN zijn op de rechtvaardigen, en Zijn oren tot hun geroep."));
dusuperobject.biblemap.put("b19_34_17", new dusuperobject(19,34,17,"Pe. Het aangezicht des HEEREN is tegen degenen, die kwaad doen, om hun gedachtenis van de aarde uit te roeien."));
dusuperobject.biblemap.put("b19_34_18", new dusuperobject(19,34,18,"Tsade. Zij roepen, en de HEERE hoort, en Hij redt hen uit al hun benauwdheden."));
dusuperobject.biblemap.put("b19_34_19", new dusuperobject(19,34,19,"Koph. De HEERE is nabij de gebrokenen van harte, en Hij behoudt de verslagenen van geest."));
dusuperobject.biblemap.put("b19_34_20", new dusuperobject(19,34,20,"Resch. Vele zijn de tegenspoeden des rechtvaardigen; maar uit alle die redt hem de HEERE."));
dusuperobject.biblemap.put("b19_34_21", new dusuperobject(19,34,21,"Schin. Hij bewaart al zijn beenderen; niet een van die wordt gebroken."));
dusuperobject.biblemap.put("b19_34_22", new dusuperobject(19,34,22,"Thau. De boosheid zal den goddeloze doden; en die den rechtvaardige haten, zullen schuldig verklaard worden. [ (Psalms 34:23) De HEERE verlost de ziel Zijner knechten; en allen, die op Hem betrouwen, zullen niet schuldig verklaard worden. ]"));
dusuperobject.biblemap.put("b19_35_1", new dusuperobject(19,35,1,"Een psalm van David. Twist, HEERE! met mijn twisters; strijd met mijn bestrijders."));
dusuperobject.biblemap.put("b19_35_2", new dusuperobject(19,35,2,"Grijp het schild en de rondas, en sta op tot mijn hulp."));
dusuperobject.biblemap.put("b19_35_3", new dusuperobject(19,35,3,"En breng de spies voort, en sluit den weg toe, mijn vervolgers tegemoet; zeg tot mijn ziel: Ik ben uw Heil."));
dusuperobject.biblemap.put("b19_35_4", new dusuperobject(19,35,4,"Laat hen beschaamd en te schande worden, die mijn ziel zoeken; laat hen achterwaarts gedreven en schaamrood worden, die kwaad tegen mij bedenken."));
dusuperobject.biblemap.put("b19_35_5", new dusuperobject(19,35,5,"Laat hen worden als kaf voor den wind, en de Engel des HEEREN drijve hen weg."));
dusuperobject.biblemap.put("b19_35_6", new dusuperobject(19,35,6,"Hun weg zij duister en gans slibberig; en de Engel des HEEREN vervolge hen."));
dusuperobject.biblemap.put("b19_35_7", new dusuperobject(19,35,7,"Want zij hebben zonder oorzaak de groeve van hun net voor mij verborgen; zij hebben zonder oorzaak gegraven voor mijn ziel."));
dusuperobject.biblemap.put("b19_35_8", new dusuperobject(19,35,8,"De verwoesting overkome hem, dat hij het niet wete, en zijn net, dat hij verborgen heeft, vange hemzelven; hij valle daarin met verwoesting."));
dusuperobject.biblemap.put("b19_35_9", new dusuperobject(19,35,9,"Zo zal mijn ziel zich verheugen in den HEERE; zij zal vrolijk zijn in Zijn heil."));
dusuperobject.biblemap.put("b19_35_10", new dusuperobject(19,35,10,"Al mijn beenderen zullen zeggen: HEERE, wie is U gelijk! U, Die den ellendige redt van dien, die sterker is dan hij, en den ellendige en nooddruftige van zijn berover."));
dusuperobject.biblemap.put("b19_35_11", new dusuperobject(19,35,11,"Wrevelige getuigen staan er op; hetgeen ik niet weet, eisen zij van mij."));
dusuperobject.biblemap.put("b19_35_12", new dusuperobject(19,35,12,"Zij vergelden mij kwaad voor goed, de beroving mijner ziel."));
dusuperobject.biblemap.put("b19_35_13", new dusuperobject(19,35,13,"Mij aangaande daarentegen, als zij krank waren, was een zak mijn kleed; ik kwelde mijn ziel met vasten, en mijn gebed keerde weder in mijn boezem."));
dusuperobject.biblemap.put("b19_35_14", new dusuperobject(19,35,14,"Ik ging steeds, alsof het een vriend, alsof het mij een broeder geweest ware; ik ging gebukt in het zwart, als een, die over zijn moeder treurt."));
dusuperobject.biblemap.put("b19_35_15", new dusuperobject(19,35,15,"Maar als ik hinkte, waren zij verblijd, en verzamelden zich; zij verzamelden zich tot mij als geslagenen, en ik merkte niets; zij scheurden hun klederen, en zwegen niet stil."));
dusuperobject.biblemap.put("b19_35_16", new dusuperobject(19,35,16,"Onder de huichelende spotachtige tafelbroeders knersten zij over mij met hun tanden."));
dusuperobject.biblemap.put("b19_35_17", new dusuperobject(19,35,17,"HEERE! hoe lang zult Gij toezien? Breng mijn ziel weder van hunlieder verwoestingen, mijn eenzame van de jonge leeuwen."));
dusuperobject.biblemap.put("b19_35_18", new dusuperobject(19,35,18,"Zo zal ik U loven in de grote gemeente; onder machtig veel volks zal ik U prijzen."));
dusuperobject.biblemap.put("b19_35_19", new dusuperobject(19,35,19,"Laat hen zich niet verblijden over mij, die mij om valse oorzaken vijanden zijn; noch wenken met de ogen, die mij zonder oorzaak haten."));
dusuperobject.biblemap.put("b19_35_20", new dusuperobject(19,35,20,"Want zij spreken niet van vrede, maar zij bedenken bedriegelijke zaken tegen de stillen in het land."));
dusuperobject.biblemap.put("b19_35_21", new dusuperobject(19,35,21,"En zij sperren hun mond wijd op tegen mij; zij zeggen: Ha, ha, ons oog heeft het gezien!"));
dusuperobject.biblemap.put("b19_35_22", new dusuperobject(19,35,22,"HEERE! Gij hebt het gezien, zwijg niet; HEERE! wees niet verre van mij."));
dusuperobject.biblemap.put("b19_35_23", new dusuperobject(19,35,23,"Ontwaak en word wakker tot mijn recht; mijn God en HEERE! tot mijn twistzaak."));
dusuperobject.biblemap.put("b19_35_24", new dusuperobject(19,35,24,"Doe mij recht naar Uw gerechtigheid, HEERE, mijn God! en laat hen zich over mij niet verblijden."));
dusuperobject.biblemap.put("b19_35_25", new dusuperobject(19,35,25,"Laat hen niet zeggen in hun hart: Heah, onze ziel! laat hen niet zeggen: Wij hebben hem verslonden!"));
dusuperobject.biblemap.put("b19_35_26", new dusuperobject(19,35,26,"Laat hen beschaamd en te zamen schaamrood worden, die zich in mijn kwaad verblijden; laat hen met schaamte en schande bekleed worden, die zich tegen mij groot maken."));
dusuperobject.biblemap.put("b19_35_27", new dusuperobject(19,35,27,"Laat hen vrolijk zingen en verblijd zijn, die lust hebben tot mijn gerechtigheid; en laat hen geduriglijk zeggen: Groot gemaakt zij de HEERE, Die lust heeft tot den vrede Zijns knechts!"));
dusuperobject.biblemap.put("b19_35_28", new dusuperobject(19,35,28,"Zo zal mijn tong vermelden Uw gerechtigheid, en Uw lof den gansen dag."));
dusuperobject.biblemap.put("b19_36_1", new dusuperobject(19,36,1,"Een psalm van David, den knecht des HEEREN, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_36_2", new dusuperobject(19,36,2,"De overtreding des goddelozen spreekt in het binnenste van mijn hart: Er is geen vreze Gods voor zijn ogen."));
dusuperobject.biblemap.put("b19_36_3", new dusuperobject(19,36,3,"Want hij vleit zichzelven in zijn ogen, als men zijn ongerechtigheid bevindt, die te haten is."));
dusuperobject.biblemap.put("b19_36_4", new dusuperobject(19,36,4,"De woorden zijns monds zijn onrecht en bedrog; hij laat na te verstaan tot weldoen."));
dusuperobject.biblemap.put("b19_36_5", new dusuperobject(19,36,5,"Hij bedenkt onrecht op zijn leger; hij stelt zich op een weg, die niet goed is; het kwaad verwerpt hij niet."));
dusuperobject.biblemap.put("b19_36_6", new dusuperobject(19,36,6,"O HEERE! Uw goedertierenheid is tot in de hemelen; Uw waarheid tot de bovenste wolken toe."));
dusuperobject.biblemap.put("b19_36_7", new dusuperobject(19,36,7,"Uw gerechtigheid is als de bergen Gods; Uw oordelen zijn een grote afgrond; HEERE! Gij behoudt mensen en beesten."));
dusuperobject.biblemap.put("b19_36_8", new dusuperobject(19,36,8,"Hoe dierbaar is Uw goedertierenheid, o God! Dies de mensenkinderen onder de schaduw Uwer vleugelen toevlucht nemen."));
dusuperobject.biblemap.put("b19_36_9", new dusuperobject(19,36,9,"Zij worden dronken van de vettigheid Uws huizes; en Gij drenkt hen uit de beek Uwer wellusten."));
dusuperobject.biblemap.put("b19_36_10", new dusuperobject(19,36,10,"Want bij U is de fontein des levens; in Uw licht zien wij het licht."));
dusuperobject.biblemap.put("b19_36_11", new dusuperobject(19,36,11,"Strek Uw goedertierenheid uit over degenen, die U kennen, en Uw gerechtigheid over de oprechten van hart."));
dusuperobject.biblemap.put("b19_36_12", new dusuperobject(19,36,12,"De voet der hovaardigen kome niet over mij, en de hand der goddelozen doe mij niet omzwerven. [ (Psalms 36:13) Aldaar zijn de werkers der ongerechtigheid gevallen; zij zijn nedergestoten, en kunnen niet weder opstaan. ]"));
dusuperobject.biblemap.put("b19_37_1", new dusuperobject(19,37,1,"Een psalm van David. Aleph. Ontsteek u niet over de boosdoeners; benijd hen niet, die onrecht doen."));
dusuperobject.biblemap.put("b19_37_2", new dusuperobject(19,37,2,"Want als gras zullen zij haast worden afgesneden, en als de groene grasscheutjes zullen zij afvallen."));
dusuperobject.biblemap.put("b19_37_3", new dusuperobject(19,37,3,"Beth. Vertrouw op den HEERE, en doe het goede; bewoon de aarde, en voed u met getrouwigheid."));
dusuperobject.biblemap.put("b19_37_4", new dusuperobject(19,37,4,"En verlustig u in den HEERE, zo zal Hij u geven de begeerten uws harten."));
dusuperobject.biblemap.put("b19_37_5", new dusuperobject(19,37,5,"Gimel. Wentel uw weg op den HEERE, en vertrouw op Hem; Hij zal het maken;"));
dusuperobject.biblemap.put("b19_37_6", new dusuperobject(19,37,6,"En zal uw gerechtigheid doen voortkomen als het licht, en uw recht als den middag."));
dusuperobject.biblemap.put("b19_37_7", new dusuperobject(19,37,7,"Daleth. Zwijg den HEERE, en verbeid Hem; ontsteek u niet over dengene, wiens weg voorspoedig is; over een man, die listige aanslagen uitvoert."));
dusuperobject.biblemap.put("b19_37_8", new dusuperobject(19,37,8,"He. Laat af van toorn, en verlaat de grimmigheid; ontsteek u niet, immers niet, om kwaad te doen."));
dusuperobject.biblemap.put("b19_37_9", new dusuperobject(19,37,9,"Want de boosdoeners zullen uitgeroeid worden, maar die den HEERE verwachten, die zullen de aarde erfelijk bezitten."));
dusuperobject.biblemap.put("b19_37_10", new dusuperobject(19,37,10,"Vau. En nog een weinig, en de goddeloze zal er niet zijn; en gij zult acht nemen op zijn plaats, maar hij zal er niet wezen."));
dusuperobject.biblemap.put("b19_37_11", new dusuperobject(19,37,11,"De zachtmoedigen daarentegen zullen de aarde erfelijk bezitten, en zich verlustigen over groten vrede."));
dusuperobject.biblemap.put("b19_37_12", new dusuperobject(19,37,12,"Zain. De goddeloze bedenkt listige aanslagen tegen den rechtvaardige, en hij knerst over hem met zijn tanden."));
dusuperobject.biblemap.put("b19_37_13", new dusuperobject(19,37,13,"De Heere belacht hem, want Hij ziet, dat zijn dag komt."));
dusuperobject.biblemap.put("b19_37_14", new dusuperobject(19,37,14,"Cheth. De goddelozen hebben het zwaard uitgetrokken, en hun boog gespannen, om den ellendige en nooddruftige neder te vellen, om te slachten, die oprecht van weg zijn."));
dusuperobject.biblemap.put("b19_37_15", new dusuperobject(19,37,15,"Hun zwaard zal in hunlieder hart gaan; en hun bogen zullen verbroken worden."));
dusuperobject.biblemap.put("b19_37_16", new dusuperobject(19,37,16,"Teth. Het weinige, dat de rechtvaardige heeft, is beter dan de overvloed veler goddelozen."));
dusuperobject.biblemap.put("b19_37_17", new dusuperobject(19,37,17,"Want de armen der goddelozen zullen verbroken worden; maar de HEERE ondersteunt de rechtvaardigen."));
dusuperobject.biblemap.put("b19_37_18", new dusuperobject(19,37,18,"Jod. De HEERE kent de dagen der oprechten; en hun erfenis zal in eeuwigheid blijven."));
dusuperobject.biblemap.put("b19_37_19", new dusuperobject(19,37,19,"Zij zullen niet beschaamd worden in den kwade tijd, en in de dagen des hongers zullen zij verzadigd worden."));
dusuperobject.biblemap.put("b19_37_20", new dusuperobject(19,37,20,"Caph. Maar de goddelozen zullen vergaan, en de vijanden des HEEREN zullen verdwijnen, als het kostelijkste der lammeren; met den rook zullen zij verdwijnen."));
dusuperobject.biblemap.put("b19_37_21", new dusuperobject(19,37,21,"Lamed. De goddeloze ontleent en geeft niet weder; maar de rechtvaardige ontfermt zich, en geeft."));
dusuperobject.biblemap.put("b19_37_22", new dusuperobject(19,37,22,"Want zijn gezegenden zullen de aarde erfelijk bezitten; maar zijn vervloekten zullen uitgeroeid worden."));
dusuperobject.biblemap.put("b19_37_23", new dusuperobject(19,37,23,"Mem. De gangen deszelven mans worden van den HEERE bevestigd; en Hij heeft lust aan zijn weg."));
dusuperobject.biblemap.put("b19_37_24", new dusuperobject(19,37,24,"Als hij valt, zo wordt hij niet weggeworpen, want de HEERE ondersteunt zijn hand."));
dusuperobject.biblemap.put("b19_37_25", new dusuperobject(19,37,25,"Nun. Ik ben jong geweest, ook ben ik oud geworden, maar heb niet gezien den rechtvaardige verlaten, noch zijn zaad zoekende brood."));
dusuperobject.biblemap.put("b19_37_26", new dusuperobject(19,37,26,"Den gansen dag ontfermt hij zich, en leent; en zijn zaad is tot zegening."));
dusuperobject.biblemap.put("b19_37_27", new dusuperobject(19,37,27,"Samech. Wijk af van het kwade, en doe het goede, en woon in eeuwigheid."));
dusuperobject.biblemap.put("b19_37_28", new dusuperobject(19,37,28,"Want de HEERE heeft het recht lief, en zal Zijn gunstgenoten niet verlaten; in eeuwigheid worden zij bewaard; maar het zaad der goddelozen wordt uitgeroeid."));
dusuperobject.biblemap.put("b19_37_29", new dusuperobject(19,37,29,"De rechtvaardigen zullen de aarde erfelijk bezitten, en in eeuwigheid daarop wonen."));
dusuperobject.biblemap.put("b19_37_30", new dusuperobject(19,37,30,"Pe. De mond des rechtvaardigen vermeldt wijsheid, en zijn tong spreekt het recht."));
dusuperobject.biblemap.put("b19_37_31", new dusuperobject(19,37,31,"De wet zijns Gods is in zijn hart; zijn gangen zullen niet slibberen."));
dusuperobject.biblemap.put("b19_37_32", new dusuperobject(19,37,32,"Tsade. De goddeloze loert op den rechtvaardige, en zoekt hem te doden."));
dusuperobject.biblemap.put("b19_37_33", new dusuperobject(19,37,33,"Maar de HEERE laat hem niet in zijn hand; en Hij verdoemt hem niet, als hij geoordeeld wordt."));
dusuperobject.biblemap.put("b19_37_34", new dusuperobject(19,37,34,"Koph. Wacht op den HEERE, en houd Zijn weg, en Hij zal u verhogen, om de aarde erfelijk te bezitten; gij zult zien, dat de goddelozen worden uitgeroeid."));
dusuperobject.biblemap.put("b19_37_35", new dusuperobject(19,37,35,"Resch. Ik heb gezien een gewelddrijvende goddeloze, die zich uitbreidde als een groene inlandse boom."));
dusuperobject.biblemap.put("b19_37_36", new dusuperobject(19,37,36,"Maar hij ging door, en zie, hij was er niet meer; en ik zocht hem, maar hij werd niet gevonden."));
dusuperobject.biblemap.put("b19_37_37", new dusuperobject(19,37,37,"Schin. Let op den vrome, en zie naar den oprechte; want het einde van dien man zal vrede zijn."));
dusuperobject.biblemap.put("b19_37_38", new dusuperobject(19,37,38,"Maar de overtreders worden te zamen verdelgd. het einde der goddelozen wordt uitgeroeid."));
dusuperobject.biblemap.put("b19_37_39", new dusuperobject(19,37,39,"Thau. Doch het heil der rechtvaardigen is van den HEERE; hun Sterkte ter tijd van benauwdheid."));
dusuperobject.biblemap.put("b19_37_40", new dusuperobject(19,37,40,"En de HEERE zal hen helpen, en zal hen bevrijden; Hij zal ze bevrijden van de goddelozen, en zal ze behouden; want zij betrouwen op Hem."));
dusuperobject.biblemap.put("b19_38_1", new dusuperobject(19,38,1,"Een psalm van David, om te doen gedenken."));
dusuperobject.biblemap.put("b19_38_2", new dusuperobject(19,38,2,"O HEERE! straf mij niet in Uw groten toorn, en kastijd mij niet in Uw grimmigheid."));
dusuperobject.biblemap.put("b19_38_3", new dusuperobject(19,38,3,"Want Uw pijlen zijn in mij gedaald, en Uw hand is op mij nedergedaald."));
dusuperobject.biblemap.put("b19_38_4", new dusuperobject(19,38,4,"Er is niets geheels in mijn vlees, vanwege Uw gramschap; er is geen vrede in mijn beenderen, vanwege mijn zonde."));
dusuperobject.biblemap.put("b19_38_5", new dusuperobject(19,38,5,"Want mijn ongerechtigheden gaan over mijn hoofd; als een zware last zijn zij mij te zwaar geworden."));
dusuperobject.biblemap.put("b19_38_6", new dusuperobject(19,38,6,"Mijn etterbuilen stinken, zij zijn vervuild, vanwege mijn dwaasheid."));
dusuperobject.biblemap.put("b19_38_7", new dusuperobject(19,38,7,"Ik ben krom geworden, ik ben uitermate zeer nedergebogen; ik ga den gansen dag in het zwart."));
dusuperobject.biblemap.put("b19_38_8", new dusuperobject(19,38,8,"Want mijn darmen zijn vol van een verachtelijke plage, en er is niets geheels in mijn vlees."));
dusuperobject.biblemap.put("b19_38_9", new dusuperobject(19,38,9,"Ik ben verzwakt, en uitermate zeer verbrijzeld; ik brul van het geruis mijns harten."));
dusuperobject.biblemap.put("b19_38_10", new dusuperobject(19,38,10,"HEERE! voor U is al mijn begeerte; en mijn zuchten is voor U niet verborgen."));
dusuperobject.biblemap.put("b19_38_11", new dusuperobject(19,38,11,"Mijn hart keert om en om, mijn kracht heeft mij verlaten; en het licht mijner ogen, ook zij zelven zijn niet bij mij."));
dusuperobject.biblemap.put("b19_38_12", new dusuperobject(19,38,12,"Mijn liefhebbers en mijn vrienden staan van tegenover mijn plage, en mijn nabestaanden staan van verre."));
dusuperobject.biblemap.put("b19_38_13", new dusuperobject(19,38,13,"En die mijn ziel zoeken, leggen mij strikken; en die mijn kwaad zoeken, spreken verdervingen, en zij overdenken den gansen dag listen."));
dusuperobject.biblemap.put("b19_38_14", new dusuperobject(19,38,14,"Ik daarentegen ben als een dove, ik hoor niet, en als een stomme, die zijn mond niet opendoet."));
dusuperobject.biblemap.put("b19_38_15", new dusuperobject(19,38,15,"Ja, ik ben als een man, die niet hoort, en in wiens mond geen tegenredenen zijn."));
dusuperobject.biblemap.put("b19_38_16", new dusuperobject(19,38,16,"Want op U, HEERE! hoop ik; Gij zult verhoren, HEERE, mijn God!"));
dusuperobject.biblemap.put("b19_38_17", new dusuperobject(19,38,17,"Want ik zeide: Dat zij zich toch over mij niet verblijden! Wanneer mijn voet zou wankelen, zo zouden zij zich tegen mij groot maken."));
dusuperobject.biblemap.put("b19_38_18", new dusuperobject(19,38,18,"Want ik ben tot hinken gereed, en mijn smart is steeds voor mij."));
dusuperobject.biblemap.put("b19_38_19", new dusuperobject(19,38,19,"Want ik maak U mijn ongerechtigheid bekend, ik ben bekommerd vanwege mijn zonde."));
dusuperobject.biblemap.put("b19_38_20", new dusuperobject(19,38,20,"Maar mijn vijanden zijn levende, worden machtig; en die mij om valse oorzaken haten, worden groot."));
dusuperobject.biblemap.put("b19_38_21", new dusuperobject(19,38,21,"En die kwaad voor goed vergelden, staan mij tegen, omdat ik het goede najaag."));
dusuperobject.biblemap.put("b19_38_22", new dusuperobject(19,38,22,"Verlaat mij niet, o HEERE, mijn God! wees niet verre van mij. [ (Psalms 38:23) Haast U tot mijn hulp, HEERE, mijn Heil! ]"));
dusuperobject.biblemap.put("b19_39_1", new dusuperobject(19,39,1,"Een psalm van David, voor den opperzangmeester, voor Jeduthun."));
dusuperobject.biblemap.put("b19_39_2", new dusuperobject(19,39,2,"Ik zeide: Ik zal mijn wegen bewaren, dat ik niet zondige met mijn tong; ik zal mijn mond met een breidel bewaren, terwijl de goddeloze nog tegenover mij is."));
dusuperobject.biblemap.put("b19_39_3", new dusuperobject(19,39,3,"Ik was verstomd door stilzwijgen, ik zweeg van het goede; maar mijn smart werd verzwaard."));
dusuperobject.biblemap.put("b19_39_4", new dusuperobject(19,39,4,"Mijn hart werd heet in mijn binnenste, een vuur ontbrandde in mijn overdenking; toen sprak ik met mijn tong:"));
dusuperobject.biblemap.put("b19_39_5", new dusuperobject(19,39,5,"HEERE! maak mij bekend mijn einde, en welke de mate mijner dagen zij; dat ik wete, hoe vergankelijk ik zij."));
dusuperobject.biblemap.put("b19_39_6", new dusuperobject(19,39,6,"Zie, Gij hebt mijn dagen een handbreed gesteld, en mijn leeftijd is als niets voor U; immers is een ieder mens, hoe vast hij staat, enkel ijdelheid. Sela."));
dusuperobject.biblemap.put("b19_39_7", new dusuperobject(19,39,7,"Immers wandelt de mens als in een beeld, immers woelen zij ijdelijk; men brengt bijeen, en men weet niet, wie het naar zich nemen zal."));
dusuperobject.biblemap.put("b19_39_8", new dusuperobject(19,39,8,"En nu, wat verwacht ik, o HEERE! Mijn hoop, die is op U."));
dusuperobject.biblemap.put("b19_39_9", new dusuperobject(19,39,9,"Verlos mij van al mijn overtredingen; en stel mij niet tot een smaad des dwazen."));
dusuperobject.biblemap.put("b19_39_10", new dusuperobject(19,39,10,"Ik ben verstomd, ik zal mijn mond niet opendoen, want Gij hebt het gedaan."));
dusuperobject.biblemap.put("b19_39_11", new dusuperobject(19,39,11,"Neem Uw plage van op mij weg, ik ben bezweken van de bestrijding Uwer hand."));
dusuperobject.biblemap.put("b19_39_12", new dusuperobject(19,39,12,"Kastijdt Gij iemand met straffingen om de ongerechtigheid, zo doet Gij zijn bevalligheid smelten als een mot; immers is een ieder mens ijdelheid. Sela."));
dusuperobject.biblemap.put("b19_39_13", new dusuperobject(19,39,13,"Hoor, HEERE! mijn gebed, en neem mijn geroep ter ore; zwijg niet tot mijn tranen; want ik ben een vreemdeling bij U, een bijwoner, gelijk al mijn vaders. [ (Psalms 39:14) Wend U van mij af, dat ik mij verkwikke, eer dat ik heenga, en ik niet meer zij. ]"));
dusuperobject.biblemap.put("b19_40_1", new dusuperobject(19,40,1,"Davids psalm, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_40_2", new dusuperobject(19,40,2,"Ik heb den HEERE lang verwacht; en Hij heeft Zich tot mij geneigd, en mijn geroep gehoord."));
dusuperobject.biblemap.put("b19_40_3", new dusuperobject(19,40,3,"En Hij heeft mij uit een ruisenden kuil, uit modderig slijk opgehaald, en heeft mijn voeten op een rotssteen gesteld, Hij heeft mijn gangen vastgemaakt."));
dusuperobject.biblemap.put("b19_40_4", new dusuperobject(19,40,4,"En Hij heeft een nieuw lied in mijn mond gegeven, een lofzang onzen Gode; velen zullen het zien, en vrezen, en op den HEERE vertrouwen."));
dusuperobject.biblemap.put("b19_40_5", new dusuperobject(19,40,5,"Welgelukzalig is de man, die den HEERE tot zijn vertrouwen stelt, en niet omziet naar de hovaardigen, en die tot leugen afwijken."));
dusuperobject.biblemap.put("b19_40_6", new dusuperobject(19,40,6,"Gij, o HEERE, mijn God! hebt Uw wonderen en Uw gedachten aan ons vele gemaakt, men kan ze niet in orde bij U verhalen; zal ik ze verkondigen en uitspreken, zo zijn zij menigvuldiger dan dat ik ze zou kunnen vertellen."));
dusuperobject.biblemap.put("b19_40_7", new dusuperobject(19,40,7,"Gij hebt geen lust gehad aan slachtoffer en spijsoffer; Gij hebt mij de oren doorboord; brandoffer en zondoffer hebt Gij niet geeist."));
dusuperobject.biblemap.put("b19_40_8", new dusuperobject(19,40,8,"Toen zeide ik: Zie, ik kom; in de rol des boeks is van mij geschreven."));
dusuperobject.biblemap.put("b19_40_9", new dusuperobject(19,40,9,"Ik heb lust, o mijn God! om Uw welbehagen te doen; en Uw wet is in het midden mijns ingewands."));
dusuperobject.biblemap.put("b19_40_10", new dusuperobject(19,40,10,"Ik boodschap de gerechtigheid in de grote gemeente; zie, mijn lippen bedwing ik niet; HEERE! Gij weet het."));
dusuperobject.biblemap.put("b19_40_11", new dusuperobject(19,40,11,"Uw gerechtigheid bedek ik niet in het midden mijns harten; Uw waarheid en Uw heil spreek ik uit; Uw weldadigheid en Uw trouw verheel ik niet in de grote gemeente."));
dusuperobject.biblemap.put("b19_40_12", new dusuperobject(19,40,12,"Gij, o HEERE! zult Uw barmhartigheden van mij niet onthouden; laat Uw weldadigheid en Uw trouw mij geduriglijk behoeden."));
dusuperobject.biblemap.put("b19_40_13", new dusuperobject(19,40,13,"Want kwaden, tot zonder getal toe, hebben mij omgeven; mijn ongerechtigheden hebben mij aangegrepen, dat ik niet heb kunnen zien; zij zijn menigvuldiger dan de haren mijns hoofds, en mijn hart heeft mij verlaten."));
dusuperobject.biblemap.put("b19_40_14", new dusuperobject(19,40,14,"Het behage U, HEERE! mij te verlossen; HEERE! haast U tot mijn hulp."));
dusuperobject.biblemap.put("b19_40_15", new dusuperobject(19,40,15,"Laat hen te zamen beschaamd en schaamrood worden, die mijn ziel zoeken, om die te vernielen; laat hen achterwaarts gedreven worden, en te schande worden, die lust hebben aan mijn kwaad."));
dusuperobject.biblemap.put("b19_40_16", new dusuperobject(19,40,16,"Laat hen verwoest worden tot loon hunner beschaming, die van mij zeggen: Ha, ha!"));
dusuperobject.biblemap.put("b19_40_17", new dusuperobject(19,40,17,"Laat in U vrolijk en verblijd zijn allen, die U zoeken; laat de liefhebbers Uws heils geduriglijk zeggen: De HEERE zij groot gemaakt! [ (Psalms 40:18) Ik ben wel ellendig en nooddruftig, maar de HEERE denkt aan mij; Gij zijt mijn Hulp en mijn Bevrijder; o mijn God! vertoef niet. ]"));
dusuperobject.biblemap.put("b19_41_1", new dusuperobject(19,41,1,"Een psalm van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_41_2", new dusuperobject(19,41,2,"Welgelukzalig is hij, die zich verstandiglijk gedraagt jegens een ellendige; de HEERE zal hem bevrijden ten dage des kwaads."));
dusuperobject.biblemap.put("b19_41_3", new dusuperobject(19,41,3,"De HEERE zal hem bewaren, en zal hem bij het leven behouden; hij zal op aarde gelukzalig gemaakt worden. Geef hem ook niet over in zijner vijanden begeerte."));
dusuperobject.biblemap.put("b19_41_4", new dusuperobject(19,41,4,"De HEERE zal hem ondersteunen op het ziekbed; in zijn krankheid verandert Gij zijn ganse leger."));
dusuperobject.biblemap.put("b19_41_5", new dusuperobject(19,41,5,"Ik zeide: O HEERE! wees mij genadig; genees mijn ziel, want ik heb tegen U gezondigd."));
dusuperobject.biblemap.put("b19_41_6", new dusuperobject(19,41,6,"Mijn vijanden spreken kwaad van mij, zeggende: Wanneer zal hij sterven, en zijn naam vergaan?"));
dusuperobject.biblemap.put("b19_41_7", new dusuperobject(19,41,7,"En zo iemand van hen komt, om mij te zien, hij spreekt valsheid; zijn hart vergadert zich onrecht; gaat hij uit naar buiten, hij spreekt er van."));
dusuperobject.biblemap.put("b19_41_8", new dusuperobject(19,41,8,"Al mijn haters mompelen te zamen tegen mij; ze bedenken tegen mij, hetgeen mij kwaad is, zeggende:"));
dusuperobject.biblemap.put("b19_41_9", new dusuperobject(19,41,9,"Een Belialsstuk kleeft hem aan; en hij, die nederligt, zal niet weder opstaan."));
dusuperobject.biblemap.put("b19_41_10", new dusuperobject(19,41,10,"Zelfs de man mijns vredes, op welken ik vertrouwde, die mijn brood at, heeft de verzenen tegen mij grotelijks verheven."));
dusuperobject.biblemap.put("b19_41_11", new dusuperobject(19,41,11,"Maar Gij, o HEERE! wees mij genadig, en richt mij op; en ik zal het hun vergelden."));
dusuperobject.biblemap.put("b19_41_12", new dusuperobject(19,41,12,"Hierbij weet ik, dat Gij lust aan mij hebt, dat mijn vijand over mij niet zal juichen."));
dusuperobject.biblemap.put("b19_41_13", new dusuperobject(19,41,13,"Want mij aangaande, Gij onderhoudt mij in mijn oprechtigheid, en Gij stelt mij voor Uw aangezicht in eeuwigheid. [ (Psalms 41:14) Geloofd zij de HEERE, de God Israels, van eeuwigheid en tot in eeuwigheid! Amen, ja, amen. ]"));
dusuperobject.biblemap.put("b19_42_1", new dusuperobject(19,42,1,"Een onderwijzing, voor den opperzangmeester, onder de kinderen van Korach."));
dusuperobject.biblemap.put("b19_42_2", new dusuperobject(19,42,2,"Gelijk een hert schreeuwt naar de waterstromen, alzo schreeuwt mijn ziel tot U, o God!"));
dusuperobject.biblemap.put("b19_42_3", new dusuperobject(19,42,3,"Mijn ziel dorst naar God, naar den levenden God; wanneer zal ik ingaan, en voor Gods aangezicht verschijnen?"));
dusuperobject.biblemap.put("b19_42_4", new dusuperobject(19,42,4,"Mijn tranen zijn mij tot spijs dag en nacht; omdat zij den gansen dag tot mij zeggen: Waar is uw God?"));
dusuperobject.biblemap.put("b19_42_5", new dusuperobject(19,42,5,"Ik gedenk daaraan, en stort mijn ziel uit in mij, omdat ik placht heen te gaan onder de schare, en met hen te treden naar Gods huis, met een stem van vreugdegezang en lof, onder de feesthoudende menigte."));
dusuperobject.biblemap.put("b19_42_6", new dusuperobject(19,42,6,"Wat buigt gij u neder, o mijn ziel! en zijt onrustig in mij? Hoop op God, want ik zal Hem nog loven voor de verlossingen Zijns aangezichts."));
dusuperobject.biblemap.put("b19_42_7", new dusuperobject(19,42,7,"O mijn God! mijn ziel buigt zich neder in mij, daarom gedenk ik Uwer uit het land van de Jordaan, en Hermon, uit het klein gebergte."));
dusuperobject.biblemap.put("b19_42_8", new dusuperobject(19,42,8,"De afgrond roept tot den afgrond, bij het gedruis Uwer watergoten; al Uw baren en Uw golven zijn over mij heengegaan."));
dusuperobject.biblemap.put("b19_42_9", new dusuperobject(19,42,9,"Maar de HEERE zal des daags Zijn goedertierenheid gebieden, en des nachts zal Zijn lied bij mij zijn; het gebed tot den God mijns levens."));
dusuperobject.biblemap.put("b19_42_10", new dusuperobject(19,42,10,"Ik zal zeggen tot God: Mijn Steenrots! waarom vergeet Gij mij? Waarom ga ik in het zwart, vanwege des vijands onderdrukking?"));
dusuperobject.biblemap.put("b19_42_11", new dusuperobject(19,42,11,"Met een doodsteek in mijn beenderen honen mij mijn wederpartijders, als zij den gansen dag tot mij zeggen: Waar is uw God? [ (Psalms 42:12) Wat buigt gij u neder, o mijn ziel! en wat zijt gij onrustig in mij? Hoop op God, want ik zal Hem nog loven; Hij is de menigvuldige Verlossing mijns aangezichts, en mijn God. ]"));
dusuperobject.biblemap.put("b19_43_1", new dusuperobject(19,43,1,"Doe mij recht, o God! en twist Gij mijn twistzaak; bevrijd mij van het ongoedertieren volk, van den man des bedrogs en des onrechts."));
dusuperobject.biblemap.put("b19_43_2", new dusuperobject(19,43,2,"Want Gij zijt de God mijner sterkte; waarom verstoot Gij mij dan? Waarom ga ik steeds in het zwart, vanwege des vijands onderdrukking?"));
dusuperobject.biblemap.put("b19_43_3", new dusuperobject(19,43,3,"Zend Uw licht en Uw waarheid, dat die mij leiden; dat zij mij brengen tot den berg Uwer heiligheid, en tot Uw woningen;"));
dusuperobject.biblemap.put("b19_43_4", new dusuperobject(19,43,4,"En dat ik inga tot Gods altaar, tot den God der blijdschap mijner verheuging, en U met de harp love, o God, mijn God!"));
dusuperobject.biblemap.put("b19_43_5", new dusuperobject(19,43,5,"Wat buigt gij u neder, o mijn ziel! en wat zijt gij onrustig in mij? Hoop op God, want ik zal Hem nog loven; Hij is de menigvuldige Verlossing mijns aangezichts, en mijn God."));
dusuperobject.biblemap.put("b19_44_1", new dusuperobject(19,44,1,"Een onderwijzing, voor den opperzangmeester, onder de kinderen van Korach."));
dusuperobject.biblemap.put("b19_44_2", new dusuperobject(19,44,2,"O God! wij hebben het met onze oren gehoord, onze vaders hebben het ons verteld: Gij hebt een werk gewrocht in hun dagen, in de dagen van ouds."));
dusuperobject.biblemap.put("b19_44_3", new dusuperobject(19,44,3,"Gij hebt de heidenen met Uw hand uit de bezitting verdreven, maar henlieden geplant; Gij hebt de volken geplaagd, henlieden daarentegen doen voortschieten."));
dusuperobject.biblemap.put("b19_44_4", new dusuperobject(19,44,4,"Want zij hebben het land niet geerfd door hun zwaard, en hun arm heeft hun geen heil gegeven; maar Uw rechterhand, en Uw arm, en het licht Uws aangezichts, omdat Gij een welbehagen in hen hadt."));
dusuperobject.biblemap.put("b19_44_5", new dusuperobject(19,44,5,"Gij Zelf zijt mijn Koning, o God! gebied de verlossingen Jakobs."));
dusuperobject.biblemap.put("b19_44_6", new dusuperobject(19,44,6,"Door U zullen wij onze wederpartijders met hoornen stoten; in Uw Naam zullen wij vertreden, die tegen ons opstaan."));
dusuperobject.biblemap.put("b19_44_7", new dusuperobject(19,44,7,"Want ik vertrouw niet op mijn boog, en mijn zwaard zal mij niet verlossen."));
dusuperobject.biblemap.put("b19_44_8", new dusuperobject(19,44,8,"Maar Gij verlost ons van onze wederpartijders, en Gij maakt onze haters beschaamd."));
dusuperobject.biblemap.put("b19_44_9", new dusuperobject(19,44,9,"In God roemen wij den gansen dag, en Uw Naam zullen wij loven in eeuwigheid. Sela."));
dusuperobject.biblemap.put("b19_44_10", new dusuperobject(19,44,10,"Maar nu hebt Gij ons verstoten en te schande gemaakt, dewijl Gij met onze krijgsheiren niet uittrekt."));
dusuperobject.biblemap.put("b19_44_11", new dusuperobject(19,44,11,"Gij doet ons achterwaarts keren van den wederpartijder; en onze haters beroven ons voor zich."));
dusuperobject.biblemap.put("b19_44_12", new dusuperobject(19,44,12,"Gij geeft ons over als schapen ter spijze, en Gij verstrooit ons onder de heidenen."));
dusuperobject.biblemap.put("b19_44_13", new dusuperobject(19,44,13,"Gij verkoopt Uw volk om geen waardij; en Gij verhoogt hun prijs niet."));
dusuperobject.biblemap.put("b19_44_14", new dusuperobject(19,44,14,"Gij stelt ons onze naburen tot smaad, tot spot en schimp dengenen, die rondom ons zijn."));
dusuperobject.biblemap.put("b19_44_15", new dusuperobject(19,44,15,"Gij stelt ons tot een spreekwoord onder de heidenen, tot een hoofdschudding onder de volken."));
dusuperobject.biblemap.put("b19_44_16", new dusuperobject(19,44,16,"Mijn schande is den gansen dag voor mij, en de schaamte mijns aangezichts bedekt mij;"));
dusuperobject.biblemap.put("b19_44_17", new dusuperobject(19,44,17,"Om de stem des honers en des lasteraars, vanwege den vijand en den wraakgierige."));
dusuperobject.biblemap.put("b19_44_18", new dusuperobject(19,44,18,"Dit alles is ons overkomen, nochtans hebben wij U niet vergeten, noch valselijk gehandeld tegen Uw verbond."));
dusuperobject.biblemap.put("b19_44_19", new dusuperobject(19,44,19,"Ons hart is niet achterwaarts gekeerd, noch onze gang geweken van Uw pad."));
dusuperobject.biblemap.put("b19_44_20", new dusuperobject(19,44,20,"Hoewel Gij ons verpletterd hebt in een plaats der draken, en ons met een doodsschaduw bedekt hebt."));
dusuperobject.biblemap.put("b19_44_21", new dusuperobject(19,44,21,"Zo wij den Naam onzes Gods hadden vergeten, en onze handen tot een vreemden God uitgebreid."));
dusuperobject.biblemap.put("b19_44_22", new dusuperobject(19,44,22,"Zou God zulks niet onderzoeken? Want Hij weet de verborgenheden des harten."));
dusuperobject.biblemap.put("b19_44_23", new dusuperobject(19,44,23,"Maar om Uwentwil worden wij den gansen dag gedood; wij worden geacht als slachtschapen."));
dusuperobject.biblemap.put("b19_44_24", new dusuperobject(19,44,24,"Waak op, waarom zoudt Gij slapen, HEERE! Ontwaak, verstoot niet in eeuwigheid."));
dusuperobject.biblemap.put("b19_44_25", new dusuperobject(19,44,25,"Waarom zoudt Gij Uw aangezicht verbergen, onze ellende en onze onderdrukking vergeten?"));
dusuperobject.biblemap.put("b19_44_26", new dusuperobject(19,44,26,"Want onze ziel is in het stof nedergebogen; onze buik kleeft aan de aarde. [ (Psalms 44:27) Sta op, ons ter hulp, en verlos ons om Uwer goedertierenheid wil. ]"));
dusuperobject.biblemap.put("b19_45_1", new dusuperobject(19,45,1,"Een onderwijzing, een lied der liefde, voor den opperzangmeester, onder de kinderen van Korach, op Schoschannim."));
dusuperobject.biblemap.put("b19_45_2", new dusuperobject(19,45,2,"Mijn hart geeft een goede rede op; ik zegge mijn gedichten uit van een Koning; mijn tong is een pen eens vaardigen schrijvers."));
dusuperobject.biblemap.put("b19_45_3", new dusuperobject(19,45,3,"Gij zijt veel schoner dan de mensenkinderen; genade is uitgestort in Uw lippen; daarom heeft U God gezegend in eeuwigheid."));
dusuperobject.biblemap.put("b19_45_4", new dusuperobject(19,45,4,"Gord Uw zwaard aan de heup, o Held! Uw Majesteit en Uw heerlijkheid."));
dusuperobject.biblemap.put("b19_45_5", new dusuperobject(19,45,5,"En rijd voorspoediglijk in Uw heerlijkheid, op het woord der waarheid en rechtvaardige zachtmoedigheid; en Uw rechterhand zal U vreselijke dingen leren."));
dusuperobject.biblemap.put("b19_45_6", new dusuperobject(19,45,6,"Uw pijlen zijn scherp; volken zullen onder U vallen; zij treffen in het hart van des Konings vijanden."));
dusuperobject.biblemap.put("b19_45_7", new dusuperobject(19,45,7,"Uw troon, o God! is eeuwiglijk en altoos; de scepter Uws Koninkrijks is een scepter der rechtmatigheid."));
dusuperobject.biblemap.put("b19_45_8", new dusuperobject(19,45,8,"Gij hebt gerechtigheid lief, en haat goddeloosheid; daarom heeft U, o God! Uw God gezalfd met vreugdeolie, boven Uw medegenoten."));
dusuperobject.biblemap.put("b19_45_9", new dusuperobject(19,45,9,"Al Uw klederen zijn mirre, en aloe, en kassie; uit de elpenbenen paleizen, van waar zij U verblijden."));
dusuperobject.biblemap.put("b19_45_10", new dusuperobject(19,45,10,"Dochters van koningen zijn onder Uw kostelijke staatsdochteren; de Koningin staat aan Uw rechterhand, in het fijnste goud van Ofir."));
dusuperobject.biblemap.put("b19_45_11", new dusuperobject(19,45,11,"Hoor, o Dochter! en zie, en neig uw oor; en vergeet uw volk en uws vaders huis."));
dusuperobject.biblemap.put("b19_45_12", new dusuperobject(19,45,12,"Zo zal de Koning lust hebben aan uw schoonheid; dewijl Hij uw Heere is, zo buig u voor Hem neder."));
dusuperobject.biblemap.put("b19_45_13", new dusuperobject(19,45,13,"En de dochter van Tyrus, de rijken onder het volk, zullen uw aangezicht met geschenk smeken."));
dusuperobject.biblemap.put("b19_45_14", new dusuperobject(19,45,14,"Des Konings Dochter is geheel verheerlijkt inwendig; haar kleding is van gouden borduursel."));
dusuperobject.biblemap.put("b19_45_15", new dusuperobject(19,45,15,"In gestikte klederen zal zij tot den Koning geleid worden; de jonge dochteren, die achter haar zijn, haar medegezellinnen, zullen tot u gebracht worden."));
dusuperobject.biblemap.put("b19_45_16", new dusuperobject(19,45,16,"Zij zullen geleid worden met alle blijdschap en verheuging; zij zullen ingaan in des Konings paleis."));
dusuperobject.biblemap.put("b19_45_17", new dusuperobject(19,45,17,"In plaats van Uw vaderen zullen Uw zonen zijn; Gij zult hen tot vorsten zetten over de ganse aarde. [ (Psalms 45:18) Ik zal Uws Naams doen gedenken van elk geslacht tot geslacht; daarom zullen U de volken loven eeuwiglijk en altoos. ]"));
dusuperobject.biblemap.put("b19_46_1", new dusuperobject(19,46,1,"Een lied op Alamoth, voor den opperzangmeester, onder de kinderen van Korach."));
dusuperobject.biblemap.put("b19_46_2", new dusuperobject(19,46,2,"God is ons een Toevlucht en Sterkte; Hij is krachtelijk bevonden een Hulp in benauwdheden."));
dusuperobject.biblemap.put("b19_46_3", new dusuperobject(19,46,3,"Daarom zullen wij niet vrezen, al veranderde de aarde haar plaats, en al werden de bergen verzet in het hart der zeeen;"));
dusuperobject.biblemap.put("b19_46_4", new dusuperobject(19,46,4,"Laat haar wateren bruisen, laat ze beroerd worden; laat de bergen daveren, door derzelver verheffing! Sela."));
dusuperobject.biblemap.put("b19_46_5", new dusuperobject(19,46,5,"De beekjes der rivier zullen verblijden de stad Gods, het heiligdom der woningen des Allerhoogsten."));
dusuperobject.biblemap.put("b19_46_6", new dusuperobject(19,46,6,"God is in het midden van haar, zij zal niet wankelen; God zal haar helpen in het aanbreken van den morgenstond."));
dusuperobject.biblemap.put("b19_46_7", new dusuperobject(19,46,7,"De heidenen raasden, de koninkrijken bewogen zich; Hij verhief Zijn stem, de aarde versmolt."));
dusuperobject.biblemap.put("b19_46_8", new dusuperobject(19,46,8,"De HEERE der heirscharen is met ons; de God van Jakob is ons een Hoog Vertrek. Sela."));
dusuperobject.biblemap.put("b19_46_9", new dusuperobject(19,46,9,"Komt, aanschouwt de daden des HEEREN, Die verwoestingen op aarde aanricht."));
dusuperobject.biblemap.put("b19_46_10", new dusuperobject(19,46,10,"Die de oorlogen doet ophouden tot aan het einde der aarde, de boog verbreekt, en de spies aan twee slaat, de wagenen met vuur verbrandt."));
dusuperobject.biblemap.put("b19_46_11", new dusuperobject(19,46,11,"Laat af, en weet, dat Ik God ben; Ik zal verhoogd worden onder de heidenen, Ik zal verhoogd worden op de aarde. [ (Psalms 46:12) De HEERE der heirscharen is met ons; de God van Jakob is ons een Hoog Vertrek. Sela. ]"));
dusuperobject.biblemap.put("b19_47_1", new dusuperobject(19,47,1,"Een psalm, voor den opperzangmeester, onder de kinderen van Korach."));
dusuperobject.biblemap.put("b19_47_2", new dusuperobject(19,47,2,"Al gij volken, klapt in de hand; juicht Gode met een stem van vreugdegezang."));
dusuperobject.biblemap.put("b19_47_3", new dusuperobject(19,47,3,"Want de HEERE, de Allerhoogste, is vreselijk, een groot Koning over de ganse aarde."));
dusuperobject.biblemap.put("b19_47_4", new dusuperobject(19,47,4,"Hij brengt de volken onder ons, en de natien onder onze voeten."));
dusuperobject.biblemap.put("b19_47_5", new dusuperobject(19,47,5,"Hij verkiest voor ons onze erfenis, de heerlijkheid van Jakob, dien Hij heeft liefgehad. Sela."));
dusuperobject.biblemap.put("b19_47_6", new dusuperobject(19,47,6,"God vaart op met gejuich, de HEERE met geklank der bazuin."));
dusuperobject.biblemap.put("b19_47_7", new dusuperobject(19,47,7,"Psalmzingt Gode, psalmzingt! Psalmzingt onzen Koning, psalmzingt!"));
dusuperobject.biblemap.put("b19_47_8", new dusuperobject(19,47,8,"Want God is een Koning der ganse aarde; psalmzingt met een onderwijzing!"));
dusuperobject.biblemap.put("b19_47_9", new dusuperobject(19,47,9,"God regeert over de heidenen; God zit op den troon Zijner heiligheid. [ (Psalms 47:10) De edelen der volken zijn verzameld tot het volk van den God van Abraham; want de schilden der aarde zijn Godes. Hij is zeer verheven! ]"));
dusuperobject.biblemap.put("b19_48_1", new dusuperobject(19,48,1,"Een lied, een psalm, voor de kinderen van Korach."));
dusuperobject.biblemap.put("b19_48_2", new dusuperobject(19,48,2,"De HEERE is groot en zeer te prijzen, in de stad onzes Gods, op den berg Zijner heiligheid."));
dusuperobject.biblemap.put("b19_48_3", new dusuperobject(19,48,3,"Schoon van gelegenheid, een vreugde der ganse aarde is de berg Sion, aan de zijden van het noorden; de stad des groten Konings."));
dusuperobject.biblemap.put("b19_48_4", new dusuperobject(19,48,4,"God is in haar paleizen; Hij is er bekend voor een Hoog Vertrek."));
dusuperobject.biblemap.put("b19_48_5", new dusuperobject(19,48,5,"Want ziet, de koningen waren vergaderd; zij waren te zamen doorgetogen."));
dusuperobject.biblemap.put("b19_48_6", new dusuperobject(19,48,6,"Gelijk zij het zagen, alzo waren zij verwonderd; zij werden verschrikt, zij haastten weg."));
dusuperobject.biblemap.put("b19_48_7", new dusuperobject(19,48,7,"Beving greep hen aldaar aan, smart als van een barende vrouw."));
dusuperobject.biblemap.put("b19_48_8", new dusuperobject(19,48,8,"Met een oostenwind verbreekt Gij de schepen van Tharsis."));
dusuperobject.biblemap.put("b19_48_9", new dusuperobject(19,48,9,"Gelijk wij gehoord hadden, alzo hebben wij gezien in de stad des HEEREN der heirscharen, in de stad onzes Gods; God zal haar bevestigen tot in eeuwigheid. Sela."));
dusuperobject.biblemap.put("b19_48_10", new dusuperobject(19,48,10,"O God! wij gedenken Uwer weldadigheid, in het midden Uws tempels."));
dusuperobject.biblemap.put("b19_48_11", new dusuperobject(19,48,11,"Gelijk Uw Naam is, o God! alzo is Uw roem tot aan de einden der aarde; Uw rechterhand is vol van gerechtigheid."));
dusuperobject.biblemap.put("b19_48_12", new dusuperobject(19,48,12,"Laat de berg Sion blijde zijn; laat de dochteren van Juda zich verheugen, om Uwer oordelen wil."));
dusuperobject.biblemap.put("b19_48_13", new dusuperobject(19,48,13,"Gaat rondom Sion, en omringt haar; telt haar torens;"));
dusuperobject.biblemap.put("b19_48_14", new dusuperobject(19,48,14,"Zet uw hart op haar vesting; beschouwt onderscheidenlijk haar paleizen, opdat gij het aan het navolgende geslacht vertelt. [ (Psalms 48:15) Want deze God is onze God eeuwiglijk en altoos; Hij zal ons geleiden tot den dood toe. ]"));
dusuperobject.biblemap.put("b19_49_1", new dusuperobject(19,49,1,"Een psalm, voor den opperzangmeester, onder de kinderen van Korach."));
dusuperobject.biblemap.put("b19_49_2", new dusuperobject(19,49,2,"Hoort dit, alle gij volken! neemt ter ore, alle inwoners der wereld,"));
dusuperobject.biblemap.put("b19_49_3", new dusuperobject(19,49,3,"Zowel slechten als aanzienlijken, te zamen rijk en arm!"));
dusuperobject.biblemap.put("b19_49_4", new dusuperobject(19,49,4,"Mijn mond zal enkel wijsheid spreken, en de overdenking mijns harten zal vol verstand zijn."));
dusuperobject.biblemap.put("b19_49_5", new dusuperobject(19,49,5,"Ik zal mijn oor neigen tot een spreuk; ik zal mijn verborgene rede openen op de harp."));
dusuperobject.biblemap.put("b19_49_6", new dusuperobject(19,49,6,"Waarom zou ik vrezen in kwade dagen, als de ongerechtigen, die op de hielen zijn, mij omringen?"));
dusuperobject.biblemap.put("b19_49_7", new dusuperobject(19,49,7,"Aangaande degenen, die op hun goed vertrouwen; en op de veelheid huns rijkdoms roemen;"));
dusuperobject.biblemap.put("b19_49_8", new dusuperobject(19,49,8,"Niemand van hen zal zijn broeder immermeer kunnen verlossen; hij zal Gode zijn rantsoen niet kunnen geven;"));
dusuperobject.biblemap.put("b19_49_9", new dusuperobject(19,49,9,"(Want de verlossing hunner ziel is te kostelijk, en zal in eeuwigheid ophouden);"));
dusuperobject.biblemap.put("b19_49_10", new dusuperobject(19,49,10,"Dat hij ook voortaan geduriglijk zou leven, en de verderving niet zien."));
dusuperobject.biblemap.put("b19_49_11", new dusuperobject(19,49,11,"Want hij ziet, dat de wijzen sterven, dat te zamen een dwaas en een onvernuftige omkomen, en hun goed anderen nalaten."));
dusuperobject.biblemap.put("b19_49_12", new dusuperobject(19,49,12,"Hun binnenste gedachte is, dat hun huizen zullen zijn in eeuwigheid, hun woningen van geslacht tot geslacht; zij noemen de landen naar hun namen."));
dusuperobject.biblemap.put("b19_49_13", new dusuperobject(19,49,13,"De mens nochtans, die in waarde is, blijft niet; hij wordt gelijk als de beesten, die vergaan."));
dusuperobject.biblemap.put("b19_49_14", new dusuperobject(19,49,14,"Deze hun weg is een dwaasheid van hen; nochtans hebben hun nakomelingen een welbehagen in hun woorden. Sela."));
dusuperobject.biblemap.put("b19_49_15", new dusuperobject(19,49,15,"Men zet hen als schapen in het graf, de dood zal hen afweiden; en de oprechten zullen over hen heersen in dien morgenstond; en het graf zal hun gedaante verslijten, elk uit zijn woning."));
dusuperobject.biblemap.put("b19_49_16", new dusuperobject(19,49,16,"Maar God zal mijn ziel van het geweld des grafs verlossen, want Hij zal mij opnemen. Sela."));
dusuperobject.biblemap.put("b19_49_17", new dusuperobject(19,49,17,"Vrees niet, wanneer een man rijk wordt, wanneer de eer van zijn huis groot wordt;"));
dusuperobject.biblemap.put("b19_49_18", new dusuperobject(19,49,18,"Want hij zal in zijn sterven niet met al medenemen, zijn eer zal hem niet nadalen."));
dusuperobject.biblemap.put("b19_49_19", new dusuperobject(19,49,19,"Hoewel hij zijn ziel in zijn leven zegent, en zij u loven, omdat gij uzelven goed doet;"));
dusuperobject.biblemap.put("b19_49_20", new dusuperobject(19,49,20,"Zo zal zij toch komen tot het geslacht harer vaderen; tot in eeuwigheid zullen zij het licht niet zien. [ (Psalms 49:21) De mens, die in waarde is, en geen verstand heeft, wordt gelijk als de beesten, die vergaan. ]"));
dusuperobject.biblemap.put("b19_50_1", new dusuperobject(19,50,1,"Een psalm van Asaf. De God der goden, de HEERE spreekt, en roept de aarde, van den opgang der zon tot aan haar ondergang."));
dusuperobject.biblemap.put("b19_50_2", new dusuperobject(19,50,2,"Uit Sion, de volkomenheid der schoonheid, verschijnt God blinkende."));
dusuperobject.biblemap.put("b19_50_3", new dusuperobject(19,50,3,"Onze God zal komen en zal niet zwijgen; een vuur voor Zijn aangezicht zal verteren, en rondom Hem zal het zeer stormen."));
dusuperobject.biblemap.put("b19_50_4", new dusuperobject(19,50,4,"Hij zal roepen tot den hemel van boven, en tot de aarde, om Zijn volk te richten."));
dusuperobject.biblemap.put("b19_50_5", new dusuperobject(19,50,5,"Verzamelt Mij Mijn gunstgenoten, die Mijn verbond maken met offerande!"));
dusuperobject.biblemap.put("b19_50_6", new dusuperobject(19,50,6,"En de hemelen verkondigen Zijn gerechtigheid; want God Zelf is Rechter. Sela."));
dusuperobject.biblemap.put("b19_50_7", new dusuperobject(19,50,7,"Hoort, Mijn volk! en Ik zal spreken; Israel! en Ik zal onder u betuigen; Ik, God, ben uw God."));
dusuperobject.biblemap.put("b19_50_8", new dusuperobject(19,50,8,"Om uw offeranden zal Ik u niet straffen, want uw brandofferen zijn steeds voor Mij."));
dusuperobject.biblemap.put("b19_50_9", new dusuperobject(19,50,9,"Ik zal uit uw huis geen var nemen, noch bokken uit uw kooien;"));
dusuperobject.biblemap.put("b19_50_10", new dusuperobject(19,50,10,"Want al het gedierte des wouds is Mijn, de beesten op duizend bergen."));
dusuperobject.biblemap.put("b19_50_11", new dusuperobject(19,50,11,"Ik ken al het gevogelte der bergen, en het wild des velds is bij Mij."));
dusuperobject.biblemap.put("b19_50_12", new dusuperobject(19,50,12,"Zo Mij hongerde, Ik zou het u niet zeggen; want Mijn is de wereld en haar volheid."));
dusuperobject.biblemap.put("b19_50_13", new dusuperobject(19,50,13,"Zou Ik stierenvlees eten, of bokkenbloed drinken?"));
dusuperobject.biblemap.put("b19_50_14", new dusuperobject(19,50,14,"Offert Gode dank, en betaalt den Allerhoogste uw geloften."));
dusuperobject.biblemap.put("b19_50_15", new dusuperobject(19,50,15,"En roept Mij aan in den dag der benauwdheid; Ik zal er u uithelpen, en gij zult Mij eren."));
dusuperobject.biblemap.put("b19_50_16", new dusuperobject(19,50,16,"Maar tot den goddeloze zegt God: Wat hebt gij Mijn inzettingen te vertellen, en neemt Mijn verbond in uw mond?"));
dusuperobject.biblemap.put("b19_50_17", new dusuperobject(19,50,17,"Dewijl gij de kastijding haat, en Mijn woorden achter u henenwerpt."));
dusuperobject.biblemap.put("b19_50_18", new dusuperobject(19,50,18,"Indien gij een dief ziet, zo loopt gij met hem; en uw deel is met de overspelers."));
dusuperobject.biblemap.put("b19_50_19", new dusuperobject(19,50,19,"Uw mond slaat gij in het kwade, en uw tong koppelt bedrog."));
dusuperobject.biblemap.put("b19_50_20", new dusuperobject(19,50,20,"Gij zit, gij spreekt tegen uw broeder; tegen den zoon uwer moeder geeft gij lastering uit."));
dusuperobject.biblemap.put("b19_50_21", new dusuperobject(19,50,21,"Deze dingen doet gij, en Ik zwijg; gij meent, dat Ik te enenmale ben, gelijk gij; Ik zal u straffen, en zal het ordentelijk voor uw ogen stellen."));
dusuperobject.biblemap.put("b19_50_22", new dusuperobject(19,50,22,"Verstaat dit toch, gij godvergetenden! opdat Ik niet verscheure en niemand redde."));
dusuperobject.biblemap.put("b19_50_23", new dusuperobject(19,50,23,"Wie dankoffert, die zal Mij eren; en wie zijn weg wel aanstelt, dien zal Ik Gods heil doen zien."));
dusuperobject.biblemap.put("b19_51_1", new dusuperobject(19,51,1,"Een psalm van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_51_2", new dusuperobject(19,51,2,"Toen de profeet Nathan tot hem was gekomen, nadat hij tot Bathseba was ingegaan."));
dusuperobject.biblemap.put("b19_51_3", new dusuperobject(19,51,3,"Wees mij genadig, o God! naar Uw goedertierenheid; delg mijn overtreding uit, naar de grootheid Uwer barmhartigheden."));
dusuperobject.biblemap.put("b19_51_4", new dusuperobject(19,51,4,"Was mij wel van mijn ongerechtigheid, en reinig mij van mijn zonde."));
dusuperobject.biblemap.put("b19_51_5", new dusuperobject(19,51,5,"Want ik ken mijn overtredingen, en mijn zonde is steeds voor mij."));
dusuperobject.biblemap.put("b19_51_6", new dusuperobject(19,51,6,"Tegen U, U alleen, heb ik gezondigd, en gedaan, dat kwaad is in Uw ogen; opdat Gij rechtvaardig zijt in Uw spreken, en rein zijt in Uw richten."));
dusuperobject.biblemap.put("b19_51_7", new dusuperobject(19,51,7,"Zie, ik ben in ongerechtigheid geboren, en in zonde heeft mij mijn moeder ontvangen."));
dusuperobject.biblemap.put("b19_51_8", new dusuperobject(19,51,8,"Zie, Gij hebt lust tot waarheid in het binnenste, en in het verborgene maakt Gij mij wijsheid bekend."));
dusuperobject.biblemap.put("b19_51_9", new dusuperobject(19,51,9,"Ontzondig mij met hysop, en ik zal rein zijn; was mij, en ik zal witter zijn dan sneeuw."));
dusuperobject.biblemap.put("b19_51_10", new dusuperobject(19,51,10,"Doe mij vreugde en blijdschap horen; dat de beenderen zich verheugen, die Gij verbrijzeld hebt."));
dusuperobject.biblemap.put("b19_51_11", new dusuperobject(19,51,11,"Verberg Uw aangezicht van mijn zonden, en delg uit al mijn ongerechtigheden."));
dusuperobject.biblemap.put("b19_51_12", new dusuperobject(19,51,12,"Schep mij een rein hart, o God! en vernieuw in het binnenste van mij een vasten geest."));
dusuperobject.biblemap.put("b19_51_13", new dusuperobject(19,51,13,"Verwerp mij niet van Uw aangezicht, en neem Uw Heiligen Geest niet van mij."));
dusuperobject.biblemap.put("b19_51_14", new dusuperobject(19,51,14,"Geef mij weder de vreugde Uws heils; en de vrijmoedige geest ondersteune mij."));
dusuperobject.biblemap.put("b19_51_15", new dusuperobject(19,51,15,"Zo zal ik de overtreders Uw wegen leren; en de zondaars zullen zich tot U bekeren."));
dusuperobject.biblemap.put("b19_51_16", new dusuperobject(19,51,16,"Verlos mij van bloedschulden, o God, Gij, God mijns heils! zo zal mijn tong Uw gerechtigheid vrolijk roemen."));
dusuperobject.biblemap.put("b19_51_17", new dusuperobject(19,51,17,"Heere, open mijn lippen, zo zal mijn mond Uw lof verkondigen."));
dusuperobject.biblemap.put("b19_51_18", new dusuperobject(19,51,18,"Want Gij hebt geen lust tot offerande, anders zou ik ze geven; in brandofferen hebt Gij geen behagen."));
dusuperobject.biblemap.put("b19_51_19", new dusuperobject(19,51,19,"De offeranden Gods zijn een gebroken geest; een gebroken en verslagen hart zult Gij, o God! niet verachten. [ (Psalms 51:20) Doe wel bij Sion naar Uw welbehagen; bouw de muren van Jeruzalem op. ] [ (Psalms 51:21) Dan zult Gij lust hebben aan de offeranden der gerechtigheid, aan brandoffer en een offer, dat gans verteerd wordt; dan zullen zij varren offeren op Uw altaar. ]"));
dusuperobject.biblemap.put("b19_52_1", new dusuperobject(19,52,1,"Een onderwijzing van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_52_2", new dusuperobject(19,52,2,"Als Doeg, de Edomiet, gekomen was, en Saul te kennen gegeven, en tot hem gezegd had: David is gekomen ten huize van Achimelech."));
dusuperobject.biblemap.put("b19_52_3", new dusuperobject(19,52,3,"Wat beroemt gij u in het kwaad, o gij geweldige? Gods goedertierenheid duurt toch den gansen dag."));
dusuperobject.biblemap.put("b19_52_4", new dusuperobject(19,52,4,"Uw tong denkt enkel schade als een geslepen scheermes, werkende bedrog."));
dusuperobject.biblemap.put("b19_52_5", new dusuperobject(19,52,5,"Gij hebt het kwade liever dan het goede, de leugen, dan gerechtigheid te spreken. Sela."));
dusuperobject.biblemap.put("b19_52_6", new dusuperobject(19,52,6,"Gij hebt lief alle woorden van verslinding, en een tong des bedrogs."));
dusuperobject.biblemap.put("b19_52_7", new dusuperobject(19,52,7,"God zal u ook afbreken in eeuwigheid; Hij zal u wegrapen en u uit de tent uitrukken; ja, Hij zal u uitwortelen uit het land der levenden. Sela."));
dusuperobject.biblemap.put("b19_52_8", new dusuperobject(19,52,8,"En de rechtvaardigen zullen het zien, en vrezen; en zij zullen over hem lachen, zeggende:"));
dusuperobject.biblemap.put("b19_52_9", new dusuperobject(19,52,9,"Ziet den man, die God niet stelde tot Zijn Sterkte, maar vertrouwde op de veelheid zijns rijkdoms; hij was sterk geworden door zijn beschadigen. [ (Psalms 52:10) Maar ik zal zijn als een groene olijfboom in Gods huis; ik vertrouw op Gods goedertierenheid eeuwiglijk en altoos. ] [ (Psalms 52:11) Ik zal U loven in eeuwigheid, omdat Gij het gedaan hebt; en ik zal Uw Naam verwachten; want hij is goed voor Uw gunstgenoten. ]"));
dusuperobject.biblemap.put("b19_53_1", new dusuperobject(19,53,1,"Een onderwijzing van David, voor den opperzangmeester, op Machalath."));
dusuperobject.biblemap.put("b19_53_2", new dusuperobject(19,53,2,"De dwaas zegt in zijn hart: Er is geen God; zij verderven het, en zij bedrijven gruwelijk onrecht; er is niemand, die goed doet."));
dusuperobject.biblemap.put("b19_53_3", new dusuperobject(19,53,3,"God heeft van den hemel nedergezien op de mensenkinderen, om te zien, of iemand verstandig ware, die God zocht."));
dusuperobject.biblemap.put("b19_53_4", new dusuperobject(19,53,4,"Een ieder van hen is teruggekeerd, te zamen zijn zij stinkende geworden, er is niemand, die goed doet, ook niet een."));
dusuperobject.biblemap.put("b19_53_5", new dusuperobject(19,53,5,"Hebben dan de werkers der ongerechtigheid geen kennis, die Mijn volk opeten, alsof zij brood aten? Zij roepen God niet aan."));
dusuperobject.biblemap.put("b19_53_6", new dusuperobject(19,53,6,"Aldaar zijn zij met vervaardheid vervaard geworden, waar geen vervaardheid was; want God heeft de beenderen desgenen, die u belegerde, verstrooid; gij hebt hen beschaamd gemaakt, want God heeft hen verworpen. [ (Psalms 53:7) Och, dat Israels verlossingen uit Sion kwamen! Als God de gevangenen Zijns volks zal doen wederkeren, dan zal zich Jakob verheugen, Israel zal verblijd zijn. ]"));
dusuperobject.biblemap.put("b19_54_1", new dusuperobject(19,54,1,"Een onderwijzing van David, voor den opperzangmeester, op de Neginoth;"));
dusuperobject.biblemap.put("b19_54_2", new dusuperobject(19,54,2,"Als de Zifieten gekomen waren, en tot Saul gezegd hadden: Verbergt zich David niet bij ons?"));
dusuperobject.biblemap.put("b19_54_3", new dusuperobject(19,54,3,"O God! verlos mij door Uw Naam, en doe mij recht door Uw macht."));
dusuperobject.biblemap.put("b19_54_4", new dusuperobject(19,54,4,"O God! hoor mijn gebed; neig de oren tot de redenen mijns monds."));
dusuperobject.biblemap.put("b19_54_5", new dusuperobject(19,54,5,"Want vreemden staan tegen mij op, en tirannen zoeken mijn ziel; zij stellen God niet voor hun ogen. Sela."));
dusuperobject.biblemap.put("b19_54_6", new dusuperobject(19,54,6,"Ziet, God is mij een Helper; de Heere is onder degenen, die mijn ziel ondersteunen."));
dusuperobject.biblemap.put("b19_54_7", new dusuperobject(19,54,7,"Hij zal dit kwaad mijn verspieders vergelden; roei hen uit door Uw waarheid. [ (Psalms 54:8) Ik zal U met vrijwilligheid offeren; ik zal Uw Naam, o HEERE! loven, want Hij is goed. ] [ (Psalms 54:9) Want Hij heeft mij gered uit alle benauwdheid; en mijn oog heeft gezien op mijn vijanden. ]"));
dusuperobject.biblemap.put("b19_55_1", new dusuperobject(19,55,1,"Een onderwijzing van David, voor den opperzangmeester, op de Neginoth."));
dusuperobject.biblemap.put("b19_55_2", new dusuperobject(19,55,2,"O God! neem mijn gebed ter oren, en verberg U niet voor mijn smeking."));
dusuperobject.biblemap.put("b19_55_3", new dusuperobject(19,55,3,"Merk op mij, en verhoor mij; ik bedrijf misbaar in mijn klacht, en maak getier;"));
dusuperobject.biblemap.put("b19_55_4", new dusuperobject(19,55,4,"Om den roep des vijands, vanwege de beangstiging des goddelozen; want zij schuiven ongerechtigheid op mij, en in toorn haten zij mij."));
dusuperobject.biblemap.put("b19_55_5", new dusuperobject(19,55,5,"Mijn hart smart in het binnenste van mij, en verschrikkingen des doods zijn op mij gevallen."));
dusuperobject.biblemap.put("b19_55_6", new dusuperobject(19,55,6,"Vrees en beving komt mij aan, en gruwen overdekt mij;"));
dusuperobject.biblemap.put("b19_55_7", new dusuperobject(19,55,7,"Zodat ik zeg: Och, dat mij iemand vleugelen, als ener duive, gave! ik zou henenvliegen, waar ik blijven mocht."));
dusuperobject.biblemap.put("b19_55_8", new dusuperobject(19,55,8,"Ziet, ik zou ver wegzwerven, ik zou vernachten in de woestijn. Sela."));
dusuperobject.biblemap.put("b19_55_9", new dusuperobject(19,55,9,"Ik zou haasten, dat ik ontkwame, van den drijvenden wind, van den storm."));
dusuperobject.biblemap.put("b19_55_10", new dusuperobject(19,55,10,"Verslind hen, HEERE! deel hun tong; want ik zie wrevel en twist in de stad."));
dusuperobject.biblemap.put("b19_55_11", new dusuperobject(19,55,11,"Dag en nacht omringen zij haar op haar muren; en ongerechtigheid en overlast is binnen in haar."));
dusuperobject.biblemap.put("b19_55_12", new dusuperobject(19,55,12,"Enkel verderving is binnen in haar; en list en bedrog wijkt niet van haar straat."));
dusuperobject.biblemap.put("b19_55_13", new dusuperobject(19,55,13,"Want het is geen vijand, die mij hoont, anders zou ik het hebben gedragen; het is mijn hater niet, die zich tegen mij groot maakt, anders zou ik mij voor hem verborgen hebben."));
dusuperobject.biblemap.put("b19_55_14", new dusuperobject(19,55,14,"Maar gij zijt het, o mens, als van mijn waardigheid, mijn leidsman en mijn bekende!"));
dusuperobject.biblemap.put("b19_55_15", new dusuperobject(19,55,15,"Wij, die te zamen in zoetigheid heimelijk raadpleegden; wij wandelden in gezelschap ten huize Gods."));
dusuperobject.biblemap.put("b19_55_16", new dusuperobject(19,55,16,"Dat hun de dood als een schuldeiser overvalle, dat zij als levend ter helle nederdalen; want boosheden zijn in hun woning, in het binnenste van hen."));
dusuperobject.biblemap.put("b19_55_17", new dusuperobject(19,55,17,"Mij aangaande, ik zal tot God roepen, en de HEERE zal mij verlossen."));
dusuperobject.biblemap.put("b19_55_18", new dusuperobject(19,55,18,"Des avonds, en des morgens, en des middags zal ik klagen en getier maken; en Hij zal mijn stem horen."));
dusuperobject.biblemap.put("b19_55_19", new dusuperobject(19,55,19,"Hij heeft mijn ziel in vrede verlost van den strijd tegen mij; want met menigte zijn zij tegen mij geweest."));
dusuperobject.biblemap.put("b19_55_20", new dusuperobject(19,55,20,"God zal horen, en zal hen plagen, als die van ouds zit, Sela; dewijl bij hen gans geen verandering is, en zij God niet vrezen."));
dusuperobject.biblemap.put("b19_55_21", new dusuperobject(19,55,21,"Hij slaat zijn handen aan degenen, die vrede met Hem hadden; hij ontheiligt Zijn verbond."));
dusuperobject.biblemap.put("b19_55_22", new dusuperobject(19,55,22,"Zijn mond is gladder dan boter, maar zijn hart is krijg; zijn woorden zijn zachter dan olie, maar dezelve zijn blote zwaarden."));
dusuperobject.biblemap.put("b19_55_23", new dusuperobject(19,55,23,"Werp uw zorg op den HEERE, en Hij zal u onderhouden; Hij zal in eeuwigheid niet toelaten, dat de rechtvaardige wankele. [ (Psalms 55:24) Maar Gij, o God! zult die doen nederdalen in den put des verderfs; de mannen des bloeds en bedrogs zullen hun dagen niet ter helft brengen; ik, daarentegen, zal op U vertrouwen. ]"));
dusuperobject.biblemap.put("b19_56_1", new dusuperobject(19,56,1,"Een gouden kleinood van David, voor den opperzangmeester, op Jonath Elem Rechokim; als de Filistijnen hem gegrepen hadden te Gath."));
dusuperobject.biblemap.put("b19_56_2", new dusuperobject(19,56,2,"Wees mij genadig, o God! want de mens zoekt mij op te slokken; den gansen dag dringt mij de bestrijder."));
dusuperobject.biblemap.put("b19_56_3", new dusuperobject(19,56,3,"Mijn verspieders zoeken mij den gansen dag op te slokken; want ik heb veel bestrijders, o Allerhoogste!"));
dusuperobject.biblemap.put("b19_56_4", new dusuperobject(19,56,4,"Ten dage, als ik zal vrezen, zal ik op U vertrouwen."));
dusuperobject.biblemap.put("b19_56_5", new dusuperobject(19,56,5,"In God zal ik Zijn woord prijzen; ik vertrouw op God, ik zal niet vrezen; wat zoude mij vlees doen?"));
dusuperobject.biblemap.put("b19_56_6", new dusuperobject(19,56,6,"Den gansen dag verdraaien zij mijn woorden; al hun gedachten zijn tegen mij ten kwade."));
dusuperobject.biblemap.put("b19_56_7", new dusuperobject(19,56,7,"Zij rotten samen, zij versteken zich, zij passen op mijn hielen; als die op mijn ziel wachten."));
dusuperobject.biblemap.put("b19_56_8", new dusuperobject(19,56,8,"Zouden zij om hun ongerechtigheid vrijgaan? Stort de volken neder in toorn, o God!"));
dusuperobject.biblemap.put("b19_56_9", new dusuperobject(19,56,9,"Gij hebt mijn omzwerven geteld; leg mijn tranen in uw fles; zijn zij niet in Uw register?"));
dusuperobject.biblemap.put("b19_56_10", new dusuperobject(19,56,10,"Dan zullen mijn vijanden achterwaarts keren, ten dage als ik roepen zal; dit weet ik, dat God met mij is."));
dusuperobject.biblemap.put("b19_56_11", new dusuperobject(19,56,11,"In God zal ik het woord prijzen; in den HEERE zal ik het woord prijzen."));
dusuperobject.biblemap.put("b19_56_12", new dusuperobject(19,56,12,"Ik vertrouw op God, ik zal niet vrezen; wat zou mij de mens doen?"));
dusuperobject.biblemap.put("b19_56_13", new dusuperobject(19,56,13,"O God! op mij zijn Uw geloften; ik zal U dankzeggingen vergelden; [ (Psalms 56:14) Want Gij hebt mijn ziel gered van den dood; ook niet mijn voeten van aanstoot, om voor Gods aangezicht te wandelen in het licht der levenden? ]"));
dusuperobject.biblemap.put("b19_57_1", new dusuperobject(19,57,1,"Een gouden kleinood van David, voor den opperzangmeester, Altascheth; als hij voor Sauls aangezicht vlood in de spelonk."));
dusuperobject.biblemap.put("b19_57_2", new dusuperobject(19,57,2,"Wees mij genadig, o God! Wees mij genadig, want mijn ziel betrouwt op U, en ik neem mijn toevlucht onder de schaduw Uwer vleugelen, totdat de verdervingen zullen voorbij zijn gegaan."));
dusuperobject.biblemap.put("b19_57_3", new dusuperobject(19,57,3,"Ik zal roepen tot God, den Allerhoogste, tot God, Die het aan mij voleinden zal."));
dusuperobject.biblemap.put("b19_57_4", new dusuperobject(19,57,4,"Hij zal van den hemel zenden, en mij verlossen, te schande makende dengene, die mij zoekt op te slokken. Sela. God zal Zijn goedertierenheid en Zijn waarheid zenden."));
dusuperobject.biblemap.put("b19_57_5", new dusuperobject(19,57,5,"Mijn ziel is in het midden der leeuwen, ik lig onder stokebranden, mensenkinderen, welker tanden spiesen en pijlen zijn, en hun tong een scherp zwaard."));
dusuperobject.biblemap.put("b19_57_6", new dusuperobject(19,57,6,"Verhef U boven de hemelen, o God! Uw eer zij over de ganse aarde."));
dusuperobject.biblemap.put("b19_57_7", new dusuperobject(19,57,7,"Zij hebben een net bereid voor mijn gangen, mijn ziel was nedergebukt; zij hebben een kuil voor mijn aangezicht gegraven; zij zijn er midden in gevallen. Sela."));
dusuperobject.biblemap.put("b19_57_8", new dusuperobject(19,57,8,"Mijn hart is bereid, o God! mijn hart is bereid; ik zal zingen, en psalmzingen."));
dusuperobject.biblemap.put("b19_57_9", new dusuperobject(19,57,9,"Waak op, mijn eer! waak op, gij, luit en harp! ik zal in den dageraad opwaken."));
dusuperobject.biblemap.put("b19_57_10", new dusuperobject(19,57,10,"Ik zal U loven onder de volken, o Heere! ik zal U psalmzingen onder de natien."));
dusuperobject.biblemap.put("b19_57_11", new dusuperobject(19,57,11,"Want Uw goedertierenheid is groot tot aan de hemelen, en Uw waarheid tot aan de bovenste wolken. [ (Psalms 57:12) Verhef U boven de hemelen, o God! Uw eer zij over de ganse aarde. ]"));
dusuperobject.biblemap.put("b19_58_1", new dusuperobject(19,58,1,"Een gouden kleinood van David, voor den opperzangmeester, Altascheth."));
dusuperobject.biblemap.put("b19_58_2", new dusuperobject(19,58,2,"Spreekt gijlieden waarlijk gerechtigheid, gij, vergadering? Oordeelt gij billijkheden, gij, mensenkinderen?"));
dusuperobject.biblemap.put("b19_58_3", new dusuperobject(19,58,3,"Ja, gij werkt ongerechtigheden in het hart; gij weegt het geweld uwer handen op de aarde."));
dusuperobject.biblemap.put("b19_58_4", new dusuperobject(19,58,4,"De goddelozen zijn vervreemd van de baarmoeder aan; de leugensprekers dolen van moeders buik aan."));
dusuperobject.biblemap.put("b19_58_5", new dusuperobject(19,58,5,"Zij hebben vurig venijn, naar gelijkheid van vurig slangenvenijn; zij zijn als een dove adder, die haar oren toestopt;"));
dusuperobject.biblemap.put("b19_58_6", new dusuperobject(19,58,6,"Opdat zij niet hore naar de stem der belezers, desgenen, die ervaren is met bezweringen om te gaan."));
dusuperobject.biblemap.put("b19_58_7", new dusuperobject(19,58,7,"O God! verbreek hun tanden in hun mond; breek af de baktanden der jonge leeuwen, o HEERE!"));
dusuperobject.biblemap.put("b19_58_8", new dusuperobject(19,58,8,"Laat hen smelten als water, laat hen daarhenen drijven; legt hij zijn pijlen aan, laat hen zijn, alsof zij afgesneden waren."));
dusuperobject.biblemap.put("b19_58_9", new dusuperobject(19,58,9,"Laat hem henengaan, als een smeltende slak; laat hen, als ener vrouwe misdracht, de zon niet aanschouwen."));
dusuperobject.biblemap.put("b19_58_10", new dusuperobject(19,58,10,"Eer dan uw potten den doornstruik gewaar worden, zal Hij hem als levend, als in heten toorn wegstormen."));
dusuperobject.biblemap.put("b19_58_11", new dusuperobject(19,58,11,"De rechtvaardige zal zich verblijden, als hij de wraak aanschouwt; hij zal zijn voeten wassen in het bloed des goddelozen. [ (Psalms 58:12) En de mens zal zeggen: Immers is er vrucht voor den rechtvaardige; immers is er een God, Die op de aarde richt. ]"));
dusuperobject.biblemap.put("b19_59_1", new dusuperobject(19,59,1,"Een gouden kleinood van David, voor den opperzangmeester, Altascheth; toen Saul gezonden had, die zijn huis bewaren zouden, om hem te doden."));
dusuperobject.biblemap.put("b19_59_2", new dusuperobject(19,59,2,"Red mij van mijn vijanden, o mijn God! stel mij in een hoog vertrek voor degenen, die tegen mij opstaan."));
dusuperobject.biblemap.put("b19_59_3", new dusuperobject(19,59,3,"Red mij van de werkers der ongerechtigheid, en verlos mij van de mannen des bloeds."));
dusuperobject.biblemap.put("b19_59_4", new dusuperobject(19,59,4,"Want zie, zij leggen mijner ziel lagen; sterken rotten zich tegen mij; zonder mijn overtreding, en zonder mijn zonde, o HEERE!"));
dusuperobject.biblemap.put("b19_59_5", new dusuperobject(19,59,5,"Zij lopen en bereiden zich zonder mijn misdaad; waak op mij tegemoet, en zie."));
dusuperobject.biblemap.put("b19_59_6", new dusuperobject(19,59,6,"Ja, Gij HEERE, God der heirscharen, God Israels! ontwaak, om al deze heidenen te bezoeken; wees niemand van hen genadig, die trouwelooslijk ongerechtigheid bedrijven. Sela."));
dusuperobject.biblemap.put("b19_59_7", new dusuperobject(19,59,7,"Tegen den avond keren zij weder, zij tieren als een hond, en zij gaan rondom de stad."));
dusuperobject.biblemap.put("b19_59_8", new dusuperobject(19,59,8,"Zie, zij storten overvloediglijk uit met hun mond; zwaarden zijn op hun lippen; want wie hoort het?"));
dusuperobject.biblemap.put("b19_59_9", new dusuperobject(19,59,9,"Maar Gij, HEERE! zult hen belachen; Gij zult alle heidenen bespotten."));
dusuperobject.biblemap.put("b19_59_10", new dusuperobject(19,59,10,"Tegen zijn sterkte zal ik op U wachten; want God is mijn Hoog Vertrek."));
dusuperobject.biblemap.put("b19_59_11", new dusuperobject(19,59,11,"De God mijner goedertierenheid zal mij voorkomen; God zal mij op mijn verspieders doen zien."));
dusuperobject.biblemap.put("b19_59_12", new dusuperobject(19,59,12,"Dood hen niet, opdat mijn volk het niet vergete; doe hen omzwerven door Uw macht, en werp hen neder, o Heere, ons Schild!"));
dusuperobject.biblemap.put("b19_59_13", new dusuperobject(19,59,13,"Om de zonde huns monds, om het woord hunner lippen; en laat hen gevangen worden in hun hoogmoed; en om den vloek, en om de leugen, die zij vertellen."));
dusuperobject.biblemap.put("b19_59_14", new dusuperobject(19,59,14,"Verteer hen in grimmigheid; verteer hen, dat zij er niet zijn, en laat hen weten, dat God heerser is in Jakob, ja, tot aan de einden der aarde. Sela."));
dusuperobject.biblemap.put("b19_59_15", new dusuperobject(19,59,15,"Laat hen dan tegen de avond wederkeren, laat hen tieren als een hond, en rondom de stad gaan;"));
dusuperobject.biblemap.put("b19_59_16", new dusuperobject(19,59,16,"Laat hen zelfs omzwerven om spijs; en laat hen vernachten, al zijn zij niet verzadigd."));
dusuperobject.biblemap.put("b19_59_17", new dusuperobject(19,59,17,"Maar ik zal Uw sterkte zingen, en des morgens Uw goedertierenheid vrolijk roemen, omdat Gij mij een Hoog Vertrek zijt geweest, en een Toevlucht ten dage, als mij bange was. [ (Psalms 59:18) Van U, o mijn Sterkte! zal ik psalmzingen; want God is mijn Hoog Vertrek, de God mijner goedertierenheid. ]"));
dusuperobject.biblemap.put("b19_60_1", new dusuperobject(19,60,1,"Een gouden kleinood van David tot lering, voor den opperzangmeester, op Schusan Eduth;"));
dusuperobject.biblemap.put("b19_60_2", new dusuperobject(19,60,2,"Als hij gevochten had met de Syriers van Mesopotamie, en met de Syriers van Zoba; en Joab wederkwam, en de Edomieten sloeg in het Zoutdal, twaalf duizend."));
dusuperobject.biblemap.put("b19_60_3", new dusuperobject(19,60,3,"O God! Gij hadt ons verstoten, Gij hadt ons gescheurd, Gij zijt toornig geweest; keer weder tot ons."));
dusuperobject.biblemap.put("b19_60_4", new dusuperobject(19,60,4,"Gij hebt het land geschud, Gij hebt het gespleten; genees zijn breuken, want het wankelt."));
dusuperobject.biblemap.put("b19_60_5", new dusuperobject(19,60,5,"Gij hebt Uw volk een harde zaak doen zien; Gij hebt ons gedrenkt met zwijmelwijn."));
dusuperobject.biblemap.put("b19_60_6", new dusuperobject(19,60,6,"Maar nu hebt Gij dengenen, die U vrezen, een banier gegeven, om die op te werpen, vanwege de waarheid. Sela."));
dusuperobject.biblemap.put("b19_60_7", new dusuperobject(19,60,7,"Opdat Uw beminden zouden bevrijd worden; geef heil door Uw rechterhand, en verhoor ons."));
dusuperobject.biblemap.put("b19_60_8", new dusuperobject(19,60,8,"God heeft gesproken in Zijn heiligdom; dies zal ik van vreugde opspringen; ik zal Sichem delen, en het dal van Sukkoth zal ik afmeten."));
dusuperobject.biblemap.put("b19_60_9", new dusuperobject(19,60,9,"Gilead is mijn, en Manasse is mijn, en Efraim is de sterkte mijns hoofds; Juda is mijn wetgever."));
dusuperobject.biblemap.put("b19_60_10", new dusuperobject(19,60,10,"Moab is mijn waspot; op Edom zal ik mijn schoen werpen! juich over mij, o gij Palestina!"));
dusuperobject.biblemap.put("b19_60_11", new dusuperobject(19,60,11,"Wie zal mij voeren in een vaste stad? Wie zal mij leiden tot in Edom?"));
dusuperobject.biblemap.put("b19_60_12", new dusuperobject(19,60,12,"Zult Gij het niet zijn, o God! Die ons verstoten hadt, en niet uittoogt, o God! met onze heirkrachten? [ (Psalms 60:13) Geef Gij ons hulp uit de benauwdheid, want 's mensen heil is ijdelheid. ] [ (Psalms 60:14) In God zullen wij kloeke daden doen, en Hij zal onze wederpartijders vertreden. ]"));
dusuperobject.biblemap.put("b19_61_1", new dusuperobject(19,61,1,"Een psalm van David, voor den opperzangmeester, op de Neginoth."));
dusuperobject.biblemap.put("b19_61_2", new dusuperobject(19,61,2,"O God! hoor mijn geschrei, merk op mijn gebed."));
dusuperobject.biblemap.put("b19_61_3", new dusuperobject(19,61,3,"Van het einde des lands roep ik tot U als mijn hart overstelpt is; leid mij op een rotssteen, die mij te hoog zou zijn."));
dusuperobject.biblemap.put("b19_61_4", new dusuperobject(19,61,4,"Want Gij zijt mij een Toevlucht geweest, een sterke Toren voor den vijand."));
dusuperobject.biblemap.put("b19_61_5", new dusuperobject(19,61,5,"Ik zal in Uw hut verkeren in eeuwigheden; ik zal mijn toevlucht nemen in het verborgene Uwer vleugelen. Sela."));
dusuperobject.biblemap.put("b19_61_6", new dusuperobject(19,61,6,"Want Gij, o God! hebt gehoord naar mijn geloften; Gij hebt mij gegeven de erfenis dergenen, die Uw Naam vrezen."));
dusuperobject.biblemap.put("b19_61_7", new dusuperobject(19,61,7,"Gij zult dagen tot des konings dagen toedoen; zijn jaren zullen zijn als van geslacht tot geslacht;"));
dusuperobject.biblemap.put("b19_61_8", new dusuperobject(19,61,8,"Hij zal eeuwiglijk voor Gods aangezicht zitten; bereid goedertierenheid en waarheid, dat zij hem behoeden. [ (Psalms 61:9) Zo zal ik Uw Naam psalmzingen in eeuwigheid; opdat ik mijn geloften betale, dag bij dag. ]"));
dusuperobject.biblemap.put("b19_62_1", new dusuperobject(19,62,1,"Een psalm van David, voor den opperzangmeester, over Jeduthun."));
dusuperobject.biblemap.put("b19_62_2", new dusuperobject(19,62,2,"Immers is mijn ziel stil tot God; van Hem is mijn heil."));
dusuperobject.biblemap.put("b19_62_3", new dusuperobject(19,62,3,"Immers is Hij mijn Rotssteen en mijn Heil, mijn Hoog Vertrek, ik zal niet grotelijks wankelen."));
dusuperobject.biblemap.put("b19_62_4", new dusuperobject(19,62,4,"Hoe lang zult gijlieden kwaad aanstichten tegen een man? Gij allen zult gedood worden; gij zult zijn als een ingebogen wand, een aangestoten muur."));
dusuperobject.biblemap.put("b19_62_5", new dusuperobject(19,62,5,"Zij raadslagen slechts, om hem van zijn hoogheid te verstoten; zij hebben behagen in leugen; met hun mond zegenen zij; maar met hun binnenste vloeken zij. Sela."));
dusuperobject.biblemap.put("b19_62_6", new dusuperobject(19,62,6,"Doch gij, o mijn ziel! zwijg Gode; want van Hem is mijn verwachting."));
dusuperobject.biblemap.put("b19_62_7", new dusuperobject(19,62,7,"Hij is immers mijn Rotssteen en mijn Heil, mijn Hoog Vertrek; ik zal niet wankelen."));
dusuperobject.biblemap.put("b19_62_8", new dusuperobject(19,62,8,"In God is mijn Heil en mijn Eer; de Rotssteen mijner sterkte, mijn Toevlucht is in God."));
dusuperobject.biblemap.put("b19_62_9", new dusuperobject(19,62,9,"Vertrouw op Hem te aller tijd, o gij volk! Stort ulieder hart uit voor Zijn aangezicht; God is ons een Toevlucht. Sela."));
dusuperobject.biblemap.put("b19_62_10", new dusuperobject(19,62,10,"Immers zijn de gemene lieden ijdelheid, de grote lieden zijn leugen; in de weegschaal opgewogen, zouden zij samen lichter zijn dan de ijdelheid."));
dusuperobject.biblemap.put("b19_62_11", new dusuperobject(19,62,11,"Vertrouwt niet op onderdrukking, noch op roverij; wordt niet ijdel, als het vermogen overvloedig aanwast, en zet er het hart niet op."));
dusuperobject.biblemap.put("b19_62_12", new dusuperobject(19,62,12,"God heeft een ding gesproken, ik heb dit tweemaal gehoord: dat de sterkte Godes is. [ (Psalms 62:13) En de goedertierenheid, o Heere! is Uwe; want Gij zult een iegelijk vergelden naar zijn werk. ]"));
dusuperobject.biblemap.put("b19_63_1", new dusuperobject(19,63,1,"Een psalm van David, als hij was in de woestijn van Juda."));
dusuperobject.biblemap.put("b19_63_2", new dusuperobject(19,63,2,"O God! Gij zijt mijn God! ik zoek U in den dageraad; mijn ziel dorst naar U; mijn vlees verlangt naar U, in een land, dor en mat, zonder water."));
dusuperobject.biblemap.put("b19_63_3", new dusuperobject(19,63,3,"Voorwaar, ik heb U in het heiligdom aanschouwd, ziende Uw sterkheid en Uw eer;"));
dusuperobject.biblemap.put("b19_63_4", new dusuperobject(19,63,4,"Want Uw goedertierenheid is beter dan het leven; mijn lippen zouden U prijzen."));
dusuperobject.biblemap.put("b19_63_5", new dusuperobject(19,63,5,"Alzo zou ik U loven in mijn leven; in Uw Naam zou ik mijn handen opheffen."));
dusuperobject.biblemap.put("b19_63_6", new dusuperobject(19,63,6,"Mijn ziel zou als met smeer en vettigheid verzadigd worden, en mijn mond zou roemen met vrolijk zingende lippen."));
dusuperobject.biblemap.put("b19_63_7", new dusuperobject(19,63,7,"Als ik Uwer gedenk op mijn legerstede, zo peins ik aan U in de nachtwaken."));
dusuperobject.biblemap.put("b19_63_8", new dusuperobject(19,63,8,"Want Gij zijt mij een hulp geweest; en in de schaduw Uwer vleugelen zal ik vrolijk zingen."));
dusuperobject.biblemap.put("b19_63_9", new dusuperobject(19,63,9,"Mijn ziel kleeft U achteraan; Uw rechterhand ondersteunt mij."));
dusuperobject.biblemap.put("b19_63_10", new dusuperobject(19,63,10,"Maar dezen, die mijn ziel zoeken tot verwoesting, zullen komen in de onderste plaatsen der aarde."));
dusuperobject.biblemap.put("b19_63_11", new dusuperobject(19,63,11,"Men zal hen storten door het geweld des zwaards; zij zullen de vossen ten deel worden. [ (Psalms 63:12) Maar de koning zal zich in God verblijden; een iegelijk, die bij Hem zweert, zal zich beroemen; want de mond der leugensprekers zal gestopt worden. ]"));
dusuperobject.biblemap.put("b19_64_1", new dusuperobject(19,64,1,"Een psalm van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_64_2", new dusuperobject(19,64,2,"Hoor, o God! mijn stem in mijn geklag; behoed mijn leven voor des vijands schrik."));
dusuperobject.biblemap.put("b19_64_3", new dusuperobject(19,64,3,"Verberg mij voor den heimelijken raad der boosdoeners, voor de oproerigheid van de werkers der ongerechtigheid."));
dusuperobject.biblemap.put("b19_64_4", new dusuperobject(19,64,4,"Die hun tong scherpen als een zwaard, een bitter woord aanleggen als hun pijl;"));
dusuperobject.biblemap.put("b19_64_5", new dusuperobject(19,64,5,"Om in verborgen plaatsen den oprechte te schieten; haastig schieten zij naar hem, en vrezen niet."));
dusuperobject.biblemap.put("b19_64_6", new dusuperobject(19,64,6,"Zij sterken zichzelven in een boze zaak; zij houden spraak van strikken te verbergen; zij zeggen: Wie zal ze zien?"));
dusuperobject.biblemap.put("b19_64_7", new dusuperobject(19,64,7,"Zij doorzoeken allerlei schalkheid; ten uiterste doorzoeken zij, wat te doorzoeken is; zelfs het binnenste eens mans, en het diepe hart."));
dusuperobject.biblemap.put("b19_64_8", new dusuperobject(19,64,8,"Maar God zal hen haastig met een pijl schieten; hun plagen zijn er."));
dusuperobject.biblemap.put("b19_64_9", new dusuperobject(19,64,9,"En hun tong zal hen doen aanstoten tegen zichzelven; een ieder, die hen ziet, zal zich wegpakken."));
dusuperobject.biblemap.put("b19_64_10", new dusuperobject(19,64,10,"En alle mensen zullen vrezen, en Gods werk verkondigen, en Zijn doen verstandelijk aanmerken. [ (Psalms 64:11) De rechtvaardige zal zich verblijden in den HEERE, en op Hem betrouwen; en alle oprechten van hart zullen zich beroemen. ]"));
dusuperobject.biblemap.put("b19_65_1", new dusuperobject(19,65,1,"Een psalm van David, een lied, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_65_2", new dusuperobject(19,65,2,"De lofzang is in stilheid tot U, o God! in Sion; en U zal de gelofte betaald worden."));
dusuperobject.biblemap.put("b19_65_3", new dusuperobject(19,65,3,"Gij hoort het gebed; tot U zal alle vlees komen."));
dusuperobject.biblemap.put("b19_65_4", new dusuperobject(19,65,4,"Ongerechtige dingen hadden de overhand over mij; maar onze overtredingen, die verzoent Gij."));
dusuperobject.biblemap.put("b19_65_5", new dusuperobject(19,65,5,"Welgelukzalig is hij, dien Gij verkiest, en doet naderen, dat hij wone in Uw voorhoven; wij zullen verzadigd worden met het goed van Uw huis, met het heilige van Uw paleis."));
dusuperobject.biblemap.put("b19_65_6", new dusuperobject(19,65,6,"Vreselijke dingen zult Gij ons in gerechtigheid antwoorden, o God onzes heils! o Vertrouwen aller einden der aarde, en der verre gelegenen aan de zee!"));
dusuperobject.biblemap.put("b19_65_7", new dusuperobject(19,65,7,"Die de bergen vastzet door Zijn kracht, omgord zijnde met macht."));
dusuperobject.biblemap.put("b19_65_8", new dusuperobject(19,65,8,"Die het bruisen der zeeen stilt, het bruisen harer golven, en het rumoer der volken."));
dusuperobject.biblemap.put("b19_65_9", new dusuperobject(19,65,9,"En die op de einden wonen, vrezen voor Uw tekenen; Gij doet de uitgangen des morgens en des avonds juichen."));
dusuperobject.biblemap.put("b19_65_10", new dusuperobject(19,65,10,"Gij bezoekt het land, en hebbende het begerig gemaakt, verrijkt Gij het grotelijks; de rivier Gods is vol waters; wanneer Gij het alzo bereid hebt, maakt Gij hunlieder koren gereed."));
dusuperobject.biblemap.put("b19_65_11", new dusuperobject(19,65,11,"Gij maakt zijn omgeploegde aarde dronken; Gij doet ze dalen in zijn voren; Gij maakt het week door de druppelen; Gij zegent zijn uitspruitsel."));
dusuperobject.biblemap.put("b19_65_12", new dusuperobject(19,65,12,"Gij kroont het jaar Uwer goedheid; en Uw voetstappen druipen van vettigheid."));
dusuperobject.biblemap.put("b19_65_13", new dusuperobject(19,65,13,"Zij bedruipen de weiden der woestijn; en de heuvelen zijn aangegord met verheuging. [ (Psalms 65:14) De velden zijn bekleed met kudden, en de dalen zijn bedekt met koren; zij juichen, ook zingen zij. ]"));
dusuperobject.biblemap.put("b19_66_1", new dusuperobject(19,66,1,"Een lied, een psalm, voor den opperzangmeester. Juicht Gode, gij ganse aarde!"));
dusuperobject.biblemap.put("b19_66_2", new dusuperobject(19,66,2,"Psalmzingt de eer Zijns Naams; geeft eer Zijn lof."));
dusuperobject.biblemap.put("b19_66_3", new dusuperobject(19,66,3,"Zegt tot God: Hoe vreselijk zijt Gij in Uw werken! Om de grootheid Uwer sterkte zullen zich Uw vijanden geveinsdelijk aan U onderwerpen."));
dusuperobject.biblemap.put("b19_66_4", new dusuperobject(19,66,4,"De ganse aarde aanbidde U, en psalmzinge U; zij psalmzinge Uw Naam. Sela."));
dusuperobject.biblemap.put("b19_66_5", new dusuperobject(19,66,5,"Komt en ziet Gods daden; Hij is vreselijk van werking aan de mensenkinderen."));
dusuperobject.biblemap.put("b19_66_6", new dusuperobject(19,66,6,"Hij heeft de zee veranderd in het droge; zij zijn te voet doorgegaan door de rivier; daar hebben wij ons in Hem verblijd."));
dusuperobject.biblemap.put("b19_66_7", new dusuperobject(19,66,7,"Hij heerst eeuwiglijk met Zijn macht; Zijn ogen houden wacht over de heidenen; laat de afvalligen niet verhoogd worden. Sela."));
dusuperobject.biblemap.put("b19_66_8", new dusuperobject(19,66,8,"Looft, gij volken! onzen God; en laat horen de stem Zijns roems."));
dusuperobject.biblemap.put("b19_66_9", new dusuperobject(19,66,9,"Die onze zielen in het leven stelt, en niet toelaat, dat onze voet wankele."));
dusuperobject.biblemap.put("b19_66_10", new dusuperobject(19,66,10,"Want Gij hebt ons beproefd, o God! Gij hebt ons gelouterd, gelijk men het zilver loutert;"));
dusuperobject.biblemap.put("b19_66_11", new dusuperobject(19,66,11,"Gij hadt ons in het net gebracht; Gij hadt een engen band om onze lenden gelegd;"));
dusuperobject.biblemap.put("b19_66_12", new dusuperobject(19,66,12,"Gij hadt den mens op ons hoofd doen rijden; wij waren in het vuur en in het water gekomen; maar Gij hebt ons uitgevoerd in een overvloeiende verversing."));
dusuperobject.biblemap.put("b19_66_13", new dusuperobject(19,66,13,"Ik zal met brandofferen in Uw huis gaan; ik zal U mijn geloften betalen,"));
dusuperobject.biblemap.put("b19_66_14", new dusuperobject(19,66,14,"Die mijn lippen hebben geuit, en mijn mond heeft uitgesproken, als mij bange was."));
dusuperobject.biblemap.put("b19_66_15", new dusuperobject(19,66,15,"Brandofferen van mergbeesten zal ik U offeren, met rookwerk van rammen; ik zal runderen met bokken bereiden. Sela."));
dusuperobject.biblemap.put("b19_66_16", new dusuperobject(19,66,16,"Komt, hoort toe, o allen gij, die God vreest, en ik zal vertellen, wat Hij aan mijn ziel gedaan heeft."));
dusuperobject.biblemap.put("b19_66_17", new dusuperobject(19,66,17,"Ik riep tot Hem met mijn mond, en Hij werd verhoogd onder mijn tong."));
dusuperobject.biblemap.put("b19_66_18", new dusuperobject(19,66,18,"Had ik naar ongerechtigheid met mijn hart gezien, de Heere zou niet gehoord hebben."));
dusuperobject.biblemap.put("b19_66_19", new dusuperobject(19,66,19,"Maar zeker, God heeft gehoord; Hij heeft gemerkt op de stem mijns gebeds."));
dusuperobject.biblemap.put("b19_66_20", new dusuperobject(19,66,20,"Geloofd zij God, Die mijn gebed niet heeft afgewend, noch Zijn goedertierenheid van mij."));
dusuperobject.biblemap.put("b19_67_1", new dusuperobject(19,67,1,"Een psalm, een lied, voor den opperzangmeester, op de Neginoth."));
dusuperobject.biblemap.put("b19_67_2", new dusuperobject(19,67,2,"God zij ons genadig en zegene ons; Hij doe Zijn aanschijn aan ons lichten. Sela."));
dusuperobject.biblemap.put("b19_67_3", new dusuperobject(19,67,3,"Opdat men op de aarde Uw weg kenne, onder alle heidenen Uw heil."));
dusuperobject.biblemap.put("b19_67_4", new dusuperobject(19,67,4,"De volken zullen U, o God! loven; de volken, altemaal, zullen U loven."));
dusuperobject.biblemap.put("b19_67_5", new dusuperobject(19,67,5,"De natien zullen zich verblijden en juichen, omdat Gij de volken zult richten in rechtmatigheid; en de natien op de aarde die zult Gij leiden. Sela."));
dusuperobject.biblemap.put("b19_67_6", new dusuperobject(19,67,6,"De volken zullen U, o God! loven; de volken, altemaal, zullen U loven."));
dusuperobject.biblemap.put("b19_67_7", new dusuperobject(19,67,7,"De aarde geeft haar gewas; God, onze God, zal ons zegenen. [ (Psalms 67:8) God zal ons zegenen; en alle einden der aarde zullen Hem vrezen. ]"));
dusuperobject.biblemap.put("b19_68_1", new dusuperobject(19,68,1,"Een psalm, een lied van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_68_2", new dusuperobject(19,68,2,"God zal opstaan, Zijn vijanden zullen verstrooid worden, en Zijn haters zullen van Zijn aangezicht vlieden."));
dusuperobject.biblemap.put("b19_68_3", new dusuperobject(19,68,3,"Gij zult hen verdrijven, gelijk rook verdreven wordt; gelijk was voor het vuur smelt, zullen de goddelozen vergaan van Gods aangezicht."));
dusuperobject.biblemap.put("b19_68_4", new dusuperobject(19,68,4,"Maar de rechtvaardigen zullen zich verblijden; zij zullen van vreugde opspringen voor Gods aangezicht, en van blijdschap vrolijk zijn."));
dusuperobject.biblemap.put("b19_68_5", new dusuperobject(19,68,5,"Zingt Gode, psalmzingt Zijn Naam; hoogt de wegen voor Dien, Die in de vlakken velden rijdt, omdat Zijn Naam is HEERE; en springt op van vreugde voor Zijn aangezicht."));
dusuperobject.biblemap.put("b19_68_6", new dusuperobject(19,68,6,"Hij is een Vader der wezen, en een Rechter der weduwen; God, in de woonstede Zijner heiligheid."));
dusuperobject.biblemap.put("b19_68_7", new dusuperobject(19,68,7,"Een God, Die de eenzamen zet in een huisgezin, uitvoert, die in boeien gevangen zijn; maar de afvalligen wonen in het dorre."));
dusuperobject.biblemap.put("b19_68_8", new dusuperobject(19,68,8,"O God! toen Gij voor het aangezicht Uws volks uittoogt, toen Gij daarhenen tradt in de woestijn; Sela."));
dusuperobject.biblemap.put("b19_68_9", new dusuperobject(19,68,9,"Daverde de aarde, ook dropen de hemelen voor Gods aanschijn; zelfs deze Sinai, voor het aanschijn Gods, des Gods van Israel."));
dusuperobject.biblemap.put("b19_68_10", new dusuperobject(19,68,10,"Gij hebt zeer milden regen doen druipen, o God! en Gij hebt Uw erfenis gesterkt, als zij mat was geworden."));
dusuperobject.biblemap.put("b19_68_11", new dusuperobject(19,68,11,"Uw hoop woonde daarin; Gij bereiddet ze door Uw goedheid voor den ellendige, o God!"));
dusuperobject.biblemap.put("b19_68_12", new dusuperobject(19,68,12,"De HEERE gaf te spreken; der boodschappers van goede tijdingen was een grote heirschaar."));
dusuperobject.biblemap.put("b19_68_13", new dusuperobject(19,68,13,"De koningen der heirscharen vloden weg, zij vloden weg; en zij, die te huis bleef, deelde den roof uit."));
dusuperobject.biblemap.put("b19_68_14", new dusuperobject(19,68,14,"Al laagt gijlieden tussen twee rijen van stenen, zo zult gij toch worden als vleugelen ener duive, overdekt met zilver, en welker vederen zijn met uitgegraven geluwen goud."));
dusuperobject.biblemap.put("b19_68_15", new dusuperobject(19,68,15,"Als de Almachtige de koningen daarin verstrooide, werd zij sneeuwwit als op Zalmon."));
dusuperobject.biblemap.put("b19_68_16", new dusuperobject(19,68,16,"De berg Basan is een berg Gods; de berg Basan is een bultige berg."));
dusuperobject.biblemap.put("b19_68_17", new dusuperobject(19,68,17,"Waarom springt gij op, gij bultige bergen? Deze berg heeft God begeerd tot Zijn woning; ook zal er de HEERE wonen in eeuwigheid."));
dusuperobject.biblemap.put("b19_68_18", new dusuperobject(19,68,18,"Gods wagenen zijn tweemaal tien duizend, de duizenden verdubbeld. De Heere is onder hen, een Sinai in heiligheid!"));
dusuperobject.biblemap.put("b19_68_19", new dusuperobject(19,68,19,"Gij zijt opgevaren in de hoogte; Gij hebt de gevangenis gevankelijk gevoerd; Gij hebt gaven genomen om uit te delen onder de mensen; ja, ook de wederhorigen om bij U te wonen, o HEERE God!"));
dusuperobject.biblemap.put("b19_68_20", new dusuperobject(19,68,20,"Geloofd zij de HEERE; dag bij dag overlaadt Hij ons. Die God is onze Zaligheid. Sela."));
dusuperobject.biblemap.put("b19_68_21", new dusuperobject(19,68,21,"Die God is ons een God van volkomene Zaligheid; en bij den HEERE, den Heere, zijn uitkomsten tegen den dood."));
dusuperobject.biblemap.put("b19_68_22", new dusuperobject(19,68,22,"Voorzeker zal God den kop Zijner vijanden verslaan, den harigen schedel desgenen, die in zijn schulden wandelt."));
dusuperobject.biblemap.put("b19_68_23", new dusuperobject(19,68,23,"De Heere heeft gezegd: Ik zal wederbrengen uit Basan; Ik zal wederbrengen uit de diepten der zee;"));
dusuperobject.biblemap.put("b19_68_24", new dusuperobject(19,68,24,"Opdat gij uw voet, ja, de tong uwer honden, moogt steken in het bloed van de vijanden, van een iegelijk van hen."));
dusuperobject.biblemap.put("b19_68_25", new dusuperobject(19,68,25,"O God! zij hebben Uw gangen gezien, de gangen mijns Gods, mijns Konings, in het heiligdom."));
dusuperobject.biblemap.put("b19_68_26", new dusuperobject(19,68,26,"De zangers gingen voor, de speellieden achter, in het midden de trommelende maagden."));
dusuperobject.biblemap.put("b19_68_27", new dusuperobject(19,68,27,"Looft God in de gemeenten, den Heere, gij, die zijt uit den springader van Israel!"));
dusuperobject.biblemap.put("b19_68_28", new dusuperobject(19,68,28,"Daar is Benjamin de kleine, die over hen heerste, de vorsten van Juda, met hun vergadering, de vorsten van Zebulon, de vorsten van Nafthali."));
dusuperobject.biblemap.put("b19_68_29", new dusuperobject(19,68,29,"Uw God heeft uw sterkte geboden; sterk, o God, wat Gij aan ons gewrocht hebt!"));
dusuperobject.biblemap.put("b19_68_30", new dusuperobject(19,68,30,"Om Uws tempels wil te Jeruzalem, zullen U de koningen geschenk toebrengen."));
dusuperobject.biblemap.put("b19_68_31", new dusuperobject(19,68,31,"Scheld het wild gedierte des riets, de vergadering der stieren met de kalveren der volken; en dien, die zich onderwerpt met stukken zilvers; Hij heeft de volken verstrooid, die lust hebben in oorlogen."));
dusuperobject.biblemap.put("b19_68_32", new dusuperobject(19,68,32,"Prinselijke gezanten zullen komen uit Egypte; Morenland zal zich haasten zijn handen tot God uit te strekken."));
dusuperobject.biblemap.put("b19_68_33", new dusuperobject(19,68,33,"Gij koninkrijken der aarde, zingt Gode; psalmzingt den Heere! Sela."));
dusuperobject.biblemap.put("b19_68_34", new dusuperobject(19,68,34,"Dien, Die daar rijdt in den hemel der hemelen, Die van ouds is; ziet, Hij geeft Zijn stem, een stem der sterkte."));
dusuperobject.biblemap.put("b19_68_35", new dusuperobject(19,68,35,"Geeft Gode sterkte! Zijn hoogheid is over Israel, en Zijn sterkte in de bovenste wolken. [ (Psalms 68:36) O God! Gij zijt vreselijk uit Uw heiligdommen; de God Israels, Die geeft den volke sterkte en krachten. Geloofd zij God! ]"));
dusuperobject.biblemap.put("b19_69_1", new dusuperobject(19,69,1,"Een psalm van David, voor den opperzangmeester, op Schoschannim."));
dusuperobject.biblemap.put("b19_69_2", new dusuperobject(19,69,2,"Verlos mij, o God! want de wateren zijn gekomen tot aan de ziel."));
dusuperobject.biblemap.put("b19_69_3", new dusuperobject(19,69,3,"Ik ben gezonken in grondeloze modder, waar men niet kan staan; ik ben gekomen in de diepten der wateren, en de vloed overstroomt mij."));
dusuperobject.biblemap.put("b19_69_4", new dusuperobject(19,69,4,"Ik ben vermoeid van mijn roepen, mijn keel is ontstoken, mijn ogen zijn bezweken, daar ik ben hopende op mijn God."));
dusuperobject.biblemap.put("b19_69_5", new dusuperobject(19,69,5,"Die mij zonder oorzaak haten, zijn meer dan de haren mijns hoofds; die mij zoeken te vernielen, die mij om valse oorzaken vijand zijn, zijn machtig geworden; wat ik niet geroofd heb, moet ik alsdan wedergeven."));
dusuperobject.biblemap.put("b19_69_6", new dusuperobject(19,69,6,"O God! Gij weet van mijn dwaasheid, en mijn schulden zijn voor U niet verborgen."));
dusuperobject.biblemap.put("b19_69_7", new dusuperobject(19,69,7,"Laat hen door mij niet beschaamd worden, die U verwachten, o Heere, HEERE der heirscharen, laat hen door mij niet te schande worden, die U zoeken, o God Israels!"));
dusuperobject.biblemap.put("b19_69_8", new dusuperobject(19,69,8,"Want om Uwentwil draag ik versmaadheid; schande heeft mijn aangezicht bedekt."));
dusuperobject.biblemap.put("b19_69_9", new dusuperobject(19,69,9,"Ik ben mijn broederen vreemd geworden, en onbekend aan mijner moeders kinderen."));
dusuperobject.biblemap.put("b19_69_10", new dusuperobject(19,69,10,"Want de ijver van Uw huis heeft mij verteerd; en de smaadheden dergenen, die U smaden, zijn op mij gevallen."));
dusuperobject.biblemap.put("b19_69_11", new dusuperobject(19,69,11,"En ik heb geweend in het vasten mijner ziel; maar het is mij geworden tot allerlei smaad."));
dusuperobject.biblemap.put("b19_69_12", new dusuperobject(19,69,12,"En ik heb een zak tot mijn kleed aangedaan; maar ik ben hun tot een spreekwoord geworden."));
dusuperobject.biblemap.put("b19_69_13", new dusuperobject(19,69,13,"Die in de poort zitten, klappen van mij; en ik ben een snarenspel dergenen, die sterken drank drinken."));
dusuperobject.biblemap.put("b19_69_14", new dusuperobject(19,69,14,"Maar mij aangaande, mijn gebed is tot U, o HEERE; er is een tijd des welbehagens, o God! door de grootheid Uwer goedertierenheid; verhoor mij door de getrouwheid Uws heils."));
dusuperobject.biblemap.put("b19_69_15", new dusuperobject(19,69,15,"Ruk mij uit het slijk, en laat mij niet verzinken; laat mij gered worden van mijn haters, en uit de diepten der wateren."));
dusuperobject.biblemap.put("b19_69_16", new dusuperobject(19,69,16,"Laat de watervloed mij niet overstromen, en laat de diepte mij niet verslinden; en laat den put zijn mond over mij niet toesluiten."));
dusuperobject.biblemap.put("b19_69_17", new dusuperobject(19,69,17,"Verhoor mij, o HEERE, want Uw goedertierenheid is goed; zie mij aan naar de grootheid Uwer barmhartigheden."));
dusuperobject.biblemap.put("b19_69_18", new dusuperobject(19,69,18,"En verberg Uw aangezicht niet van Uw knecht, want mij is bange; haast U, verhoor mij."));
dusuperobject.biblemap.put("b19_69_19", new dusuperobject(19,69,19,"Nader tot mijn ziel, bevrijd ze; verlos mij om mijner vijanden wil."));
dusuperobject.biblemap.put("b19_69_20", new dusuperobject(19,69,20,"Gij weet mijn versmaadheid, en mijn schaamte, en mijn schande; al mijn benauwers zijn voor U."));
dusuperobject.biblemap.put("b19_69_21", new dusuperobject(19,69,21,"De versmaadheid heeft mijn hart gebroken, en ik ben zeer zwak; en ik heb gewacht naar medelijden, maar er is geen; en naar vertroosters, maar heb ze niet gevonden."));
dusuperobject.biblemap.put("b19_69_22", new dusuperobject(19,69,22,"Ja, zij hebben mij gal tot mijn spijs gegeven; en in mijn dorst hebben zij mij edik te drinken gegeven."));
dusuperobject.biblemap.put("b19_69_23", new dusuperobject(19,69,23,"Hun tafel worde voor hun aangezicht tot een strik, en tot volle vergelding tot een valstrik."));
dusuperobject.biblemap.put("b19_69_24", new dusuperobject(19,69,24,"Laat hun ogen duister worden, dat zij niet zien; en doe hun lenden gedurig waggelen."));
dusuperobject.biblemap.put("b19_69_25", new dusuperobject(19,69,25,"Stort over hen Uw gramschap uit; en de hittigheid Uws toorns grijpe hen aan."));
dusuperobject.biblemap.put("b19_69_26", new dusuperobject(19,69,26,"Hun paleis zij verwoest; in hun tenten zij geen inwoner."));
dusuperobject.biblemap.put("b19_69_27", new dusuperobject(19,69,27,"Want zij vervolgen, dien Gij geslagen hebt; en maken een praat van de smart Uwer verwonden."));
dusuperobject.biblemap.put("b19_69_28", new dusuperobject(19,69,28,"Doe misdaad tot hun misdaad, en laat hen niet komen tot Uw gerechtigheid."));
dusuperobject.biblemap.put("b19_69_29", new dusuperobject(19,69,29,"Laat hen uitgedelgd worden uit het boek des levens, en met de rechtvaardigen niet aangeschreven worden."));
dusuperobject.biblemap.put("b19_69_30", new dusuperobject(19,69,30,"Doch ik ben ellendig en in smart; Uw heil, o God! zette mij in een hoog vertrek."));
dusuperobject.biblemap.put("b19_69_31", new dusuperobject(19,69,31,"Ik zal Gods Naam prijzen met gezang, en Hem met dankzegging grootmaken."));
dusuperobject.biblemap.put("b19_69_32", new dusuperobject(19,69,32,"En het zal den HEERE aangenamer zijn dan een os, of een gehoornde var, die de klauwen verdeelt."));
dusuperobject.biblemap.put("b19_69_33", new dusuperobject(19,69,33,"De zachtmoedigen, dit gezien hebbende, zullen zich verblijden; en gij, die God zoekt, ulieder hart zal leven."));
dusuperobject.biblemap.put("b19_69_34", new dusuperobject(19,69,34,"Want de HEERE hoort de nooddruftigen, en Hij veracht Zijn gevangenen niet."));
dusuperobject.biblemap.put("b19_69_35", new dusuperobject(19,69,35,"Dat Hem prijzen de hemel en de aarde, de zeeen, en al wat daarin wriemelt."));
dusuperobject.biblemap.put("b19_69_36", new dusuperobject(19,69,36,"Want God zal Sion verlossen, en de steden van Juda bouwen; en aldaar zullen zij wonen, en haar erfelijk bezitten; [ (Psalms 69:37) En het zaad Zijner knechten zal haar beerven; en de liefhebbers Zijns Naams zullen daarin wonen. ]"));
dusuperobject.biblemap.put("b19_70_1", new dusuperobject(19,70,1,"Een psalm van David, voor den opperzangmeester, om te doen gedenken."));
dusuperobject.biblemap.put("b19_70_2", new dusuperobject(19,70,2,"Haast U, o God, om mij te verlossen, o HEERE, tot mijn hulp."));
dusuperobject.biblemap.put("b19_70_3", new dusuperobject(19,70,3,"Laat hen beschaamd en schaamrood worden, die mijn ziel zoeken; laat hen achterwaarts gedreven en te schande worden, die lust hebben aan mijn kwaad."));
dusuperobject.biblemap.put("b19_70_4", new dusuperobject(19,70,4,"Laat hen terugkeren tot loon hunner beschaming, die daar zeggen: Ha, ha!"));
dusuperobject.biblemap.put("b19_70_5", new dusuperobject(19,70,5,"Laat in U vrolijk en verblijd zijn allen, die U zoeken; laat de liefhebbers Uws heils geduriglijk zeggen: God zij groot gemaakt! [ (Psalms 70:6) Doch ik ben ellendig en nooddruftig; o God, haast U tot mij; Gij zijt mijn Hulp en mijn Bevrijder; HEERE, vertoef niet! ]"));
dusuperobject.biblemap.put("b19_71_1", new dusuperobject(19,71,1,"Op U, o HEERE! betrouw ik; laat mij niet beschaamd worden in eeuwigheid."));
dusuperobject.biblemap.put("b19_71_2", new dusuperobject(19,71,2,"Red mij door Uw gerechtigheid, en bevrijd mij; neig Uw oor tot mij, en verlos mij."));
dusuperobject.biblemap.put("b19_71_3", new dusuperobject(19,71,3,"Wees mij tot een Rotssteen, om daarin te wonen, om geduriglijk daarin te gaan; Gij hebt bevel gegeven, om mij te verlossen, want Gij zijt mijn Steenrots en mijn Burg."));
dusuperobject.biblemap.put("b19_71_4", new dusuperobject(19,71,4,"Mijn God, bevrijd mij van de hand des goddelozen, van de hand desgenen, die verkeerdelijk handelt, en des opgeblazenen."));
dusuperobject.biblemap.put("b19_71_5", new dusuperobject(19,71,5,"Want Gij zijt mijn Verwachting, Heere, HEERE! mijn Vertrouwen van mijn jeugd aan."));
dusuperobject.biblemap.put("b19_71_6", new dusuperobject(19,71,6,"Op U heb ik gesteund van den buik aan; van mijner moeders ingewand aan zijt Gij mijn Uithelper; mijn lof is geduriglijk van U."));
dusuperobject.biblemap.put("b19_71_7", new dusuperobject(19,71,7,"Ik ben velen als een wonder geweest; doch Gij zijt mijn sterke Toevlucht."));
dusuperobject.biblemap.put("b19_71_8", new dusuperobject(19,71,8,"Laat mijn mond vervuld worden met Uw lof, den gansen dag met Uw heerlijkheid."));
dusuperobject.biblemap.put("b19_71_9", new dusuperobject(19,71,9,"Verwerp mij niet in den tijd des ouderdoms; verlaat mij niet, terwijl mijn kracht vergaat."));
dusuperobject.biblemap.put("b19_71_10", new dusuperobject(19,71,10,"Want mijn vijanden spreken van mij, en die op mijn ziel loeren, beraadslagen te zamen,"));
dusuperobject.biblemap.put("b19_71_11", new dusuperobject(19,71,11,"Zeggende: God heeft hem verlaten; jaagt na, en grijpt hem, want er is geen verlosser."));
dusuperobject.biblemap.put("b19_71_12", new dusuperobject(19,71,12,"O God, wees niet verre van mij; mijn God! haast U tot mijn hulp."));
dusuperobject.biblemap.put("b19_71_13", new dusuperobject(19,71,13,"Laat hen beschaamd worden, laat hen verteerd worden, die mijn ziel tegen zijn; laat hen met smaad en schande overdekt worden, die mijn kwaad zoeken."));
dusuperobject.biblemap.put("b19_71_14", new dusuperobject(19,71,14,"Doch ik zal geduriglijk hopen, en zal al Uw lof nog groter maken."));
dusuperobject.biblemap.put("b19_71_15", new dusuperobject(19,71,15,"Mijn mond zal Uw gerechtigheid vertellen, den gansen dag Uw heil; hoewel ik de getallen niet weet."));
dusuperobject.biblemap.put("b19_71_16", new dusuperobject(19,71,16,"Ik zal heengaan in de mogendheden des Heeren HEEREN; ik zal Uw gerechtigheid vermelden, de Uwe alleen."));
dusuperobject.biblemap.put("b19_71_17", new dusuperobject(19,71,17,"O God! Gij hebt mij geleerd van mijn jeugd aan, en tot nog toe verkondig ik Uw wonderen."));
dusuperobject.biblemap.put("b19_71_18", new dusuperobject(19,71,18,"Daarom ook, terwijl de ouderdom en grijsheid daar is, verlaat mij niet, o God, totdat ik dezen geslachte verkondige Uw arm, allen nakomelingen Uw macht."));
dusuperobject.biblemap.put("b19_71_19", new dusuperobject(19,71,19,"Ook is Uw gerechtigheid, o God, tot in de hoogte; Gij, Die grote dingen gedaan hebt; o God! wie is U gelijk?"));
dusuperobject.biblemap.put("b19_71_20", new dusuperobject(19,71,20,"Gij, Die mij veel benauwdheden en kwaden hebt doen zien, zult mij weder levend maken, en zult mij weder ophalen uit de afgronden der aarde."));
dusuperobject.biblemap.put("b19_71_21", new dusuperobject(19,71,21,"Gij zult mijn grootheid vermeerderen, en mij rondom vertroosten."));
dusuperobject.biblemap.put("b19_71_22", new dusuperobject(19,71,22,"Ook zal ik U loven met het instrument der luit, Uw trouw, mijn God; ik zal U psalmzingen met de harp, o Heilige Israels!"));
dusuperobject.biblemap.put("b19_71_23", new dusuperobject(19,71,23,"Mijn lippen zullen juichen, wanneer ik U zal psalmzingen, en mijn ziel, die Gij verlost hebt."));
dusuperobject.biblemap.put("b19_71_24", new dusuperobject(19,71,24,"Ook zal mijn tong Uw gerechtigheid den gansen dag uitspreken, want zij zijn beschaamd, want zij zijn schaamrood geworden, die mijn kwaad zoeken."));
dusuperobject.biblemap.put("b19_72_1", new dusuperobject(19,72,1,"Voor Salomo. O God! geef den koning Uw rechten, en Uw gerechtigheid den zoon des konings."));
dusuperobject.biblemap.put("b19_72_2", new dusuperobject(19,72,2,"Zo zal hij Uw volk richten met gerechtigheid, en Uw ellendigen met recht."));
dusuperobject.biblemap.put("b19_72_3", new dusuperobject(19,72,3,"De bergen zullen den volke vrede dragen, ook de heuvelen, met gerechtigheid."));
dusuperobject.biblemap.put("b19_72_4", new dusuperobject(19,72,4,"Hij zal de ellendigen des volks richten; hij zal de kinderen des nooddruftigen verlossen, en den verdrukker verbrijzelen."));
dusuperobject.biblemap.put("b19_72_5", new dusuperobject(19,72,5,"Zij zullen U vrezen, zolang de zon en maan zullen zijn, van geslacht tot geslacht."));
dusuperobject.biblemap.put("b19_72_6", new dusuperobject(19,72,6,"Hij zal nederdalen als een regen op het nagras, als de druppelen, die de aarde bevochtigen."));
dusuperobject.biblemap.put("b19_72_7", new dusuperobject(19,72,7,"In zijn dagen zal de rechtvaardige bloeien, en de veelheid van vrede, totdat de maan niet meer zij."));
dusuperobject.biblemap.put("b19_72_8", new dusuperobject(19,72,8,"En hij zal heersen van de zee tot aan de zee, en van de rivier tot aan de einden der aarde."));
dusuperobject.biblemap.put("b19_72_9", new dusuperobject(19,72,9,"De ingezetenen van dorre plaatsen zullen voor zijn aangezicht knielen, en zijn vijanden zullen het stof lekken."));
dusuperobject.biblemap.put("b19_72_10", new dusuperobject(19,72,10,"De koningen van Tharsis en de eilanden zullen geschenken aanbrengen; de koningen van Scheba en Seba zullen vereringen toevoeren."));
dusuperobject.biblemap.put("b19_72_11", new dusuperobject(19,72,11,"Ja, alle koningen zullen zich voor hem nederbuigen, alle heidenen zullen hem dienen."));
dusuperobject.biblemap.put("b19_72_12", new dusuperobject(19,72,12,"Want hij zal den nooddruftige redden, die daar roept, mitsgaders den ellendige, en die geen helper heeft."));
dusuperobject.biblemap.put("b19_72_13", new dusuperobject(19,72,13,"Hij zal den arme en nooddruftige verschonen, en de zielen der nooddruftigen verlossen."));
dusuperobject.biblemap.put("b19_72_14", new dusuperobject(19,72,14,"Hij zal hun zielen van list en geweld bevrijden, en hun bloed zal dierbaar zijn in zijn ogen."));
dusuperobject.biblemap.put("b19_72_15", new dusuperobject(19,72,15,"En hij zal leven; en men zal hem geven van het goud van Scheba, en men zal geduriglijk voor hem bidden; den gansen dag zal men hem zegenen."));
dusuperobject.biblemap.put("b19_72_16", new dusuperobject(19,72,16,"Is er een hand vol koren in het land op de hoogte der bergen, de vrucht daarvan zal ruisen als de Libanon; en die van de stad zullen bloeien als het kruid der aarde."));
dusuperobject.biblemap.put("b19_72_17", new dusuperobject(19,72,17,"Zijn naam zal zijn tot in eeuwigheid; zolang als er de zon is, zal zijn naam van kind tot kind voortgeplant worden; en zij zullen in hem gezegend worden; alle heidenen zullen hem welgelukzalig roemen."));
dusuperobject.biblemap.put("b19_72_18", new dusuperobject(19,72,18,"Geloofd zij de HEERE God, de God Israels, Die alleen wonderen doet."));
dusuperobject.biblemap.put("b19_72_19", new dusuperobject(19,72,19,"En geloofd zij de Naam Zijner heerlijkheid tot in eeuwigheid; en de ganse aarde worde met Zijn heerlijkheid vervuld. Amen, ja, amen."));
dusuperobject.biblemap.put("b19_72_20", new dusuperobject(19,72,20,"De gebeden van David, den zoon van Isai, hebbende een einde."));
dusuperobject.biblemap.put("b19_73_1", new dusuperobject(19,73,1,"Een psalm van Asaf. Immers is God Israel goed, dengenen, die rein van harte zijn."));
dusuperobject.biblemap.put("b19_73_2", new dusuperobject(19,73,2,"Maar mij aangaande, mijn voeten waren bijna uitgeweken; mijn treden waren bijkans uitgeschoten."));
dusuperobject.biblemap.put("b19_73_3", new dusuperobject(19,73,3,"Want ik was nijdig op de dwazen, ziende der goddelozen vrede."));
dusuperobject.biblemap.put("b19_73_4", new dusuperobject(19,73,4,"Want er zijn geen banden tot hun dood toe, en hun kracht is fris."));
dusuperobject.biblemap.put("b19_73_5", new dusuperobject(19,73,5,"Zij zijn niet in de moeite als andere mensen, en worden met andere mensen niet geplaagd."));
dusuperobject.biblemap.put("b19_73_6", new dusuperobject(19,73,6,"Daarom omringt hen de hovaardij als een keten; het geweld bedekt hen als een gewaad."));
dusuperobject.biblemap.put("b19_73_7", new dusuperobject(19,73,7,"Hun ogen puilen uit van vet; zij gaan de inbeeldingen des harten te boven."));
dusuperobject.biblemap.put("b19_73_8", new dusuperobject(19,73,8,"Zij mergelen de lieden uit, en spreken boselijk van verdrukking; zij spreken uit de hoogte."));
dusuperobject.biblemap.put("b19_73_9", new dusuperobject(19,73,9,"Zij zetten hun mond tegen den hemel, en hun tong wandelt op de aarde."));
dusuperobject.biblemap.put("b19_73_10", new dusuperobject(19,73,10,"Daarom keert zich Zijn volk hiertoe, als hun wateren eens vollen bekers worden uitgedrukt,"));
dusuperobject.biblemap.put("b19_73_11", new dusuperobject(19,73,11,"Dat zij zeggen: Hoe zou het God weten, en zou er wetenschap zijn bij den Allerhoogste?"));
dusuperobject.biblemap.put("b19_73_12", new dusuperobject(19,73,12,"Ziet, dezen zijn goddeloos; nochtans hebben zij rust in de wereld; zij vermenigvuldigen het vermogen."));
dusuperobject.biblemap.put("b19_73_13", new dusuperobject(19,73,13,"Immers heb ik tevergeefs mijn hart gezuiverd, en mijn handen in onschuld gewassen."));
dusuperobject.biblemap.put("b19_73_14", new dusuperobject(19,73,14,"Dewijl ik den gansen dag geplaagd ben, en mijn straffing is er alle morgens."));
dusuperobject.biblemap.put("b19_73_15", new dusuperobject(19,73,15,"Indien ik zou zeggen: Ik zal ook alzo spreken; ziet, zo zou ik trouweloos zijn aan het geslacht Uwer kinderen."));
dusuperobject.biblemap.put("b19_73_16", new dusuperobject(19,73,16,"Nochtans heb ik gedacht om dit te mogen verstaan; maar het was moeite in mijn ogen;"));
dusuperobject.biblemap.put("b19_73_17", new dusuperobject(19,73,17,"Totdat ik in Gods heiligdommen inging, en op hun einde merkte."));
dusuperobject.biblemap.put("b19_73_18", new dusuperobject(19,73,18,"Immers zet Gij hen op gladde plaatsen; Gij doet hen vallen in verwoestingen."));
dusuperobject.biblemap.put("b19_73_19", new dusuperobject(19,73,19,"Hoe worden zij als in een ogenblik tot verwoesting, nemen een einde, worden te niet van verschrikkingen!"));
dusuperobject.biblemap.put("b19_73_20", new dusuperobject(19,73,20,"Als een droom na het ontwaken! Als Gij opwaakt, o Heere, dan zult Gij hun beeld verachten."));
dusuperobject.biblemap.put("b19_73_21", new dusuperobject(19,73,21,"Als mijn hart opgezwollen was, en ik in mijn nieren geprikkeld werd,"));
dusuperobject.biblemap.put("b19_73_22", new dusuperobject(19,73,22,"Toen was ik onvernuftig, en wist niets; ik was een groot beest bij U."));
dusuperobject.biblemap.put("b19_73_23", new dusuperobject(19,73,23,"Ik zal dan geduriglijk bij U zijn; Gij hebt mijn rechterhand gevat;"));
dusuperobject.biblemap.put("b19_73_24", new dusuperobject(19,73,24,"Gij zult mij leiden door Uw raad; en daarna zult Gij mij in heerlijkheid opnemen."));
dusuperobject.biblemap.put("b19_73_25", new dusuperobject(19,73,25,"Wien heb ik nevens U in den hemel? Nevens U lust mij ook niets op de aarde!"));
dusuperobject.biblemap.put("b19_73_26", new dusuperobject(19,73,26,"Bezwijkt mijn vlees en mijn hart, zo is God de Rotssteen mijns harten, en mijn Deel in eeuwigheid."));
dusuperobject.biblemap.put("b19_73_27", new dusuperobject(19,73,27,"Want ziet, die verre van U zijn, zullen vergaan; Gij roeit uit, al wie van U afhoereert."));
dusuperobject.biblemap.put("b19_73_28", new dusuperobject(19,73,28,"Maar mij aangaande, het is mij goed nabij God te wezen; ik zet mijn betrouwen op den Heere HEERE, om al Uw werken te vertellen."));
dusuperobject.biblemap.put("b19_74_1", new dusuperobject(19,74,1,"Een onderwijzing, voor Asaf. O God! waarom verstoot Gij in eeuwigheid? Waarom zou Uw toorn roken tegen de schapen Uwer weide?"));
dusuperobject.biblemap.put("b19_74_2", new dusuperobject(19,74,2,"Gedenk aan Uw vergadering, die Gij van ouds verworven hebt; de roede Uwer erfenis, die Gij verlost hebt; den berg Sion, waarop Gij gewoond hebt."));
dusuperobject.biblemap.put("b19_74_3", new dusuperobject(19,74,3,"Hef Uw voeten op tot de eeuwige verwoestingen; de vijand heeft alles in het heiligdom verdorven."));
dusuperobject.biblemap.put("b19_74_4", new dusuperobject(19,74,4,"Uw wederpartijders hebben in het midden van Uw vergaderplaatsen gebruld; zij hebben hun tekenen tot tekenen gesteld."));
dusuperobject.biblemap.put("b19_74_5", new dusuperobject(19,74,5,"Een ieder werd er bekend als een, die de bijlen omhoog aanbrengt in de dichtigheid van een geboomte."));
dusuperobject.biblemap.put("b19_74_6", new dusuperobject(19,74,6,"Alzo hebben zij nu derzelver graveerselen samen met houwelen en beukhamers in stukken geslagen."));
dusuperobject.biblemap.put("b19_74_7", new dusuperobject(19,74,7,"Zij hebben Uw heiligdommen in het vuur gezet; ter aarde toe hebben zij de woning Uws Naams ontheiligd."));
dusuperobject.biblemap.put("b19_74_8", new dusuperobject(19,74,8,"Zij hebben in hun hart gezegd: Laat ze ons te zamen uitplunderen; zij hebben alle Gods vergaderplaatsen in het land verbrand."));
dusuperobject.biblemap.put("b19_74_9", new dusuperobject(19,74,9,"Wij zien onze tekenen niet; er is geen profeet meer, noch iemand bij ons, die weet, hoe lang."));
dusuperobject.biblemap.put("b19_74_10", new dusuperobject(19,74,10,"Hoe lang, o God! zal de wederpartijder smaden? Zal de vijand Uw Naam in eeuwigheid lasteren?"));
dusuperobject.biblemap.put("b19_74_11", new dusuperobject(19,74,11,"Waarom trekt Gij Uw hand, ja, Uw rechterhand af? Trek haar uit het midden van Uw boezem; maak een einde."));
dusuperobject.biblemap.put("b19_74_12", new dusuperobject(19,74,12,"Evenwel is God mijn Koning van ouds af, Die verlossingen werkt in het midden der aarde."));
dusuperobject.biblemap.put("b19_74_13", new dusuperobject(19,74,13,"Gij hebt door Uw sterkte de zee gespleten; Gij hebt de koppen der draken in de wateren verbroken."));
dusuperobject.biblemap.put("b19_74_14", new dusuperobject(19,74,14,"Gij hebt de koppen des Leviathans verpletterd; Gij hebt hem tot spijs gegeven aan het volk in dorre plaatsen."));
dusuperobject.biblemap.put("b19_74_15", new dusuperobject(19,74,15,"Gij hebt een fontein en beek gekliefd; Gij hebt sterke rivieren uitgedroogd."));
dusuperobject.biblemap.put("b19_74_16", new dusuperobject(19,74,16,"De dag is Uwe, ook is de nacht Uwe; Gij hebt het licht en de zon bereid."));
dusuperobject.biblemap.put("b19_74_17", new dusuperobject(19,74,17,"Gij hebt al de palen der aarde gesteld; zomer en winter, die hebt Gij geformeerd."));
dusuperobject.biblemap.put("b19_74_18", new dusuperobject(19,74,18,"Gedenk hieraan; de vijand heeft den HEERE gesmaad, en een dwaas volk heeft Uw Naam gelasterd."));
dusuperobject.biblemap.put("b19_74_19", new dusuperobject(19,74,19,"Geef aan het wild gedierte de ziel Uwer tortelduif niet over; vergeet den hoop Uwer ellendigen niet in eeuwigheid."));
dusuperobject.biblemap.put("b19_74_20", new dusuperobject(19,74,20,"Aanschouw het verbond; want de duistere plaatsen des lands zijn vol woningen van geweld."));
dusuperobject.biblemap.put("b19_74_21", new dusuperobject(19,74,21,"Laat den verdrukte niet beschaamd wederkeren; laat den ellendige en nooddruftige Uw Naam prijzen."));
dusuperobject.biblemap.put("b19_74_22", new dusuperobject(19,74,22,"Sta op, o God! twist Uw twistzaak; gedenk der smaadheid, die U van den dwaze wedervaart den gansen dag."));
dusuperobject.biblemap.put("b19_74_23", new dusuperobject(19,74,23,"Vergeet niet het geroep Uwer wederpartijders; het getier dergenen, die tegen U opstaan, klimt geduriglijk op."));
dusuperobject.biblemap.put("b19_75_1", new dusuperobject(19,75,1,"Voor den opperzangmeester, Altascheth; een psalm, een lied, voor Asaf."));
dusuperobject.biblemap.put("b19_75_2", new dusuperobject(19,75,2,"Wij loven U, o God; wij loven, dat Uw Naam nabij is; men vertelt Uw wonderen."));
dusuperobject.biblemap.put("b19_75_3", new dusuperobject(19,75,3,"Als ik het bestemde ambt zal ontvangen hebben, zo zal ik gans recht richten."));
dusuperobject.biblemap.put("b19_75_4", new dusuperobject(19,75,4,"Het land en al zijn inwoners waren versmolten; maar ik heb zijn pilaren vastgemaakt. Sela."));
dusuperobject.biblemap.put("b19_75_5", new dusuperobject(19,75,5,"Ik heb gezegd tot de onzinnigen: Weest niet onzinnig; en tot de goddelozen: Verhoogt den hoorn niet."));
dusuperobject.biblemap.put("b19_75_6", new dusuperobject(19,75,6,"Verhoogt uw hoorn niet omhoog; spreekt niet met stijven hals."));
dusuperobject.biblemap.put("b19_75_7", new dusuperobject(19,75,7,"Want het verhogen komt niet uit het oosten, noch uit het westen, noch uit de woestijn;"));
dusuperobject.biblemap.put("b19_75_8", new dusuperobject(19,75,8,"Maar God is Rechter; Hij vernedert dezen, en verhoogt genen."));
dusuperobject.biblemap.put("b19_75_9", new dusuperobject(19,75,9,"Want in des HEEREN hand is een beker, en de wijn is beroerd, vol van mengeling, en Hij schenkt daaruit; doch alle goddelozen der aarde zullen zijn droesemen uitzuigende drinken."));
dusuperobject.biblemap.put("b19_75_10", new dusuperobject(19,75,10,"En ik zal het in eeuwigheid verkondigen; ik zal den God Jakobs psalmzingen. [ (Psalms 75:11) En ik zal alle hoornen der goddelozen afhouwen; de hoornen des rechtvaardigen zullen verhoogd worden. ]"));

}

private void putmapbible19_2() {

dusuperobject.biblemap.put("b19_76_1", new dusuperobject(19,76,1,"Een psalm, een lied van Asaf, voor den opperzangmeester, op de Neginoth."));
dusuperobject.biblemap.put("b19_76_2", new dusuperobject(19,76,2,"God is bekend in Juda; Zijn Naam is groot in Israel."));
dusuperobject.biblemap.put("b19_76_3", new dusuperobject(19,76,3,"En in Salem is Zijn hut, en Zijn woning in Sion."));
dusuperobject.biblemap.put("b19_76_4", new dusuperobject(19,76,4,"Aldaar heeft Hij verbroken de vurige pijlen van den boog, het schild, en het zwaard, en den krijg. Sela."));
dusuperobject.biblemap.put("b19_76_5", new dusuperobject(19,76,5,"Gij zijt doorluchtiger en heerlijker dan de roofbergen."));
dusuperobject.biblemap.put("b19_76_6", new dusuperobject(19,76,6,"De stouthartigen zijn beroofd geworden; zij hebben hun slaap gesluimerd; en geen van de dappere mannen hebben hun handen gevonden."));
dusuperobject.biblemap.put("b19_76_7", new dusuperobject(19,76,7,"Van Uw schelden, o God van Jakob! is samen wagen en paard in slaap gezonken."));
dusuperobject.biblemap.put("b19_76_8", new dusuperobject(19,76,8,"Gij, vreselijk zijt Gij; en wie zal voor Uw aangezicht bestaan, van den tijd Uws toorns af?"));
dusuperobject.biblemap.put("b19_76_9", new dusuperobject(19,76,9,"Gij deedt een oordeel horen uit den hemel; de aarde vreesde en werd stil,"));
dusuperobject.biblemap.put("b19_76_10", new dusuperobject(19,76,10,"Als God opstond ten oordeel, om alle zachtmoedigen der aarde te verlossen. Sela."));
dusuperobject.biblemap.put("b19_76_11", new dusuperobject(19,76,11,"Want de grimmigheid des mensen zal U loffelijk maken; het overblijfsel der grimmigheden zult Gij opbinden."));
dusuperobject.biblemap.put("b19_76_12", new dusuperobject(19,76,12,"Doet geloften en betaalt ze den HEERE, uw God, gij allen, die rondom Hem zijt! Laat hen Dien, Die te vrezen is, geschenken brengen; [ (Psalms 76:13) Die den geest der vorsten als druiven afsnijdt; Die den koningen der aarde vreselijk is. ]"));
dusuperobject.biblemap.put("b19_77_1", new dusuperobject(19,77,1,"Een psalm van Asaf, voor den opperzangmeester, over Jeduthun."));
dusuperobject.biblemap.put("b19_77_2", new dusuperobject(19,77,2,"Mijn stem is tot God, en ik roep; mijn stem is tot God, en Hij zal het oor tot mij neigen."));
dusuperobject.biblemap.put("b19_77_3", new dusuperobject(19,77,3,"Ten dage mijner benauwdheid zocht ik den HEERE; mijn hand was des nachts uitgestrekt, en liet niet af; mijn ziel weigerde getroost te worden."));
dusuperobject.biblemap.put("b19_77_4", new dusuperobject(19,77,4,"Dacht ik aan God, zo maakte ik misbaar; peinsde ik, zo werd mijn ziel overstelpt. Sela."));
dusuperobject.biblemap.put("b19_77_5", new dusuperobject(19,77,5,"Gij hieldt mijn ogen wakende; ik was verslagen, en sprak niet."));
dusuperobject.biblemap.put("b19_77_6", new dusuperobject(19,77,6,"Ik overdacht de dagen van ouds, de jaren der eeuwen."));
dusuperobject.biblemap.put("b19_77_7", new dusuperobject(19,77,7,"Ik dacht aan mijn snarenspel; in den nacht overlegde ik in mijn hart, en mijn geest onderzocht:"));
dusuperobject.biblemap.put("b19_77_8", new dusuperobject(19,77,8,"Zal dan de Heere in eeuwigheden verstoten, en voortaan niet meer goedgunstig zijn?"));
dusuperobject.biblemap.put("b19_77_9", new dusuperobject(19,77,9,"Houdt Zijn goedertierenheid in eeuwigheid op? Heeft de toezegging een einde, van geslacht tot geslacht?"));
dusuperobject.biblemap.put("b19_77_10", new dusuperobject(19,77,10,"Heeft God vergeten genadig te zijn? Heeft Hij Zijn barmhartigheden door toorn toegesloten? Sela."));
dusuperobject.biblemap.put("b19_77_11", new dusuperobject(19,77,11,"Daarna zeide ik: Dit krenkt mij; maar de rechterhand des Allerhoogsten verandert."));
dusuperobject.biblemap.put("b19_77_12", new dusuperobject(19,77,12,"Ik zal de daden des HEEREN gedenken; ja, ik zal gedenken Uw wonderen van ouds her;"));
dusuperobject.biblemap.put("b19_77_13", new dusuperobject(19,77,13,"En zal al Uw werken betrachten, en van Uw daden spreken."));
dusuperobject.biblemap.put("b19_77_14", new dusuperobject(19,77,14,"O God! Uw weg is in het heiligdom; wie is een groot God, gelijk God?"));
dusuperobject.biblemap.put("b19_77_15", new dusuperobject(19,77,15,"Gij zijt die God, Die wonder doet; Gij hebt Uw sterkte bekend gemaakt onder de volken."));
dusuperobject.biblemap.put("b19_77_16", new dusuperobject(19,77,16,"Gij hebt Uw volk door Uw arm verlost; de kinderen van Jakob en van Jozef. Sela."));
dusuperobject.biblemap.put("b19_77_17", new dusuperobject(19,77,17,"De wateren zagen U, o God! de wateren zagen U, zij beefden; ook waren de afgronden beroerd."));
dusuperobject.biblemap.put("b19_77_18", new dusuperobject(19,77,18,"De dikke wolken goten water uit; de bovenste wolken gaven geluid; ook gingen Uw pijlen daarhenen."));
dusuperobject.biblemap.put("b19_77_19", new dusuperobject(19,77,19,"Het geluid Uws donders was in het ronde; de bliksemen verlichtten de wereld; de aarde werd beroerd en daverde."));
dusuperobject.biblemap.put("b19_77_20", new dusuperobject(19,77,20,"Uw weg was in de zee, en Uw pad in grote wateren, en Uw voetstappen werden niet bekend. [ (Psalms 77:21) Gij leiddet Uw volk, als een kudde door de hand van Mozes en Aaron. ]"));
dusuperobject.biblemap.put("b19_78_1", new dusuperobject(19,78,1,"Een onderwijzing van Asaf. O mijn volk! neem mijn leer ter oren; neigt ulieder oor tot de redenen mijns monds."));
dusuperobject.biblemap.put("b19_78_2", new dusuperobject(19,78,2,"Ik zal mijn mond opendoen met spreuken; ik zal verborgenheden overvloediglijk uitstorten, van ouds her;"));
dusuperobject.biblemap.put("b19_78_3", new dusuperobject(19,78,3,"Die wij gehoord hebben en weten ze, en onze vaders ons verteld hebben."));
dusuperobject.biblemap.put("b19_78_4", new dusuperobject(19,78,4,"Wij zullen het niet verbergen voor hun kinderen, voor het navolgende geslacht, vertellende de loffelijkheden des HEEREN, en Zijn sterkheid, en Zijn wonderen, die Hij gedaan heeft."));
dusuperobject.biblemap.put("b19_78_5", new dusuperobject(19,78,5,"Want Hij heeft een getuigenis opgericht in Jakob, en een wet gesteld in Israel; die Hij onzen vaderen geboden heeft, dat zij ze hun kinderen zouden bekend maken;"));
dusuperobject.biblemap.put("b19_78_6", new dusuperobject(19,78,6,"Opdat het navolgende geslacht die weten zou, de kinderen, die geboren zouden worden; en zouden opstaan, en vertellen ze hun kinderen;"));
dusuperobject.biblemap.put("b19_78_7", new dusuperobject(19,78,7,"En dat zij hun hoop op God zouden stellen, en Gods daden niet vergeten, maar Zijn geboden bewaren;"));
dusuperobject.biblemap.put("b19_78_8", new dusuperobject(19,78,8,"En dat zij niet zouden worden gelijk hun vaders, een wederhorig en wederspannig geslacht; een geslacht, dat zijn hart niet richtte, en welks geest niet getrouw was met God."));
dusuperobject.biblemap.put("b19_78_9", new dusuperobject(19,78,9,"(De kinderen van Efraim, gewapende boogschutters, keerden om ten dage des strijds.)"));
dusuperobject.biblemap.put("b19_78_10", new dusuperobject(19,78,10,"Zij hielden Gods verbond niet, en weigerden te wandelen in Zijn wet."));
dusuperobject.biblemap.put("b19_78_11", new dusuperobject(19,78,11,"En zij vergaten Zijn daden, en Zijn wonderen, die Hij hun had doen zien."));
dusuperobject.biblemap.put("b19_78_12", new dusuperobject(19,78,12,"Voor hun vaderen had Hij wonder gedaan, in Egypteland, in het veld van Zoan."));
dusuperobject.biblemap.put("b19_78_13", new dusuperobject(19,78,13,"Hij kliefde de zee, en deed er hen doorgaan; en de wateren deed Hij staan als een hoop."));
dusuperobject.biblemap.put("b19_78_14", new dusuperobject(19,78,14,"En Hij leidde hen des daags met een wolk, en den gansen nacht met een licht des vuurs."));
dusuperobject.biblemap.put("b19_78_15", new dusuperobject(19,78,15,"Hij kliefde de rotsstenen in de woestijn, en drenkte hen overvloedig, als uit afgronden."));
dusuperobject.biblemap.put("b19_78_16", new dusuperobject(19,78,16,"Want Hij bracht stromen voort uit de steenrots, en deed de wateren afdalen als rivieren."));
dusuperobject.biblemap.put("b19_78_17", new dusuperobject(19,78,17,"Nog voeren zij wijders voort tegen Hem te zondigen, verbitterende den Allerhoogste in de dorre wildernis."));
dusuperobject.biblemap.put("b19_78_18", new dusuperobject(19,78,18,"En zij verzochten God in hun hart, begerende spijs naar hun lust."));
dusuperobject.biblemap.put("b19_78_19", new dusuperobject(19,78,19,"En zij spraken tegen God, zij zeiden: Zou God een tafel kunnen toerichten in de woestijn?"));
dusuperobject.biblemap.put("b19_78_20", new dusuperobject(19,78,20,"Ziet, Hij heeft den rotssteen geslagen, dat er wateren uitvloeiden, en beken overvloediglijk uitbraken, zou Hij ook brood kunnen geven? Zou Hij Zijn volke vlees toebereiden?"));
dusuperobject.biblemap.put("b19_78_21", new dusuperobject(19,78,21,"Daarom hoorde de HEERE, en werd verbolgen; en een vuur werd ontstoken tegen Jakob, en toorn ging ook op tegen Israel;"));
dusuperobject.biblemap.put("b19_78_22", new dusuperobject(19,78,22,"Omdat zij in God niet geloofden, en op Zijn heil niet vertrouwden."));
dusuperobject.biblemap.put("b19_78_23", new dusuperobject(19,78,23,"Daar Hij den wolken van boven gebood, en de deuren des hemels opende;"));
dusuperobject.biblemap.put("b19_78_24", new dusuperobject(19,78,24,"En regende op hen het Man om te eten, en gaf hun hemels koren."));
dusuperobject.biblemap.put("b19_78_25", new dusuperobject(19,78,25,"Een iegelijk at het brood der Machtigen; Hij zond hun teerkost tot verzadiging."));
dusuperobject.biblemap.put("b19_78_26", new dusuperobject(19,78,26,"Hij dreef den oostenwind voort in den hemel, en voerde den zuidenwind aan door Zijn sterkte;"));
dusuperobject.biblemap.put("b19_78_27", new dusuperobject(19,78,27,"En regende op hen vlees als stof, en gevleugeld gevogelte als zand der zeeen;"));
dusuperobject.biblemap.put("b19_78_28", new dusuperobject(19,78,28,"En deed het vallen in het midden zijns legers, rondom zijn woningen."));
dusuperobject.biblemap.put("b19_78_29", new dusuperobject(19,78,29,"Toen aten zij, en werden zeer zat; zodat Hij hun hun lust toebracht."));
dusuperobject.biblemap.put("b19_78_30", new dusuperobject(19,78,30,"Zij waren nog niet vervreemd van hun lust; hun spijs was nog in hun mond,"));
dusuperobject.biblemap.put("b19_78_31", new dusuperobject(19,78,31,"Als Gods toorn tegen hen opging, dat Hij van hun vetsten doodde, en de uitgelezenen van Israel nedervelde."));
dusuperobject.biblemap.put("b19_78_32", new dusuperobject(19,78,32,"Boven dit alles zondigden zij nog, en geloofden niet, door Zijn wonderen."));
dusuperobject.biblemap.put("b19_78_33", new dusuperobject(19,78,33,"Dies deed Hij hun dagen vergaan in ijdelheid, en hun jaren in verschrikking."));
dusuperobject.biblemap.put("b19_78_34", new dusuperobject(19,78,34,"Als Hij hen doodde, zo vraagden zij naar Hem, en keerden weder, en zochten God vroeg;"));
dusuperobject.biblemap.put("b19_78_35", new dusuperobject(19,78,35,"En gedachten, dat God hun Rotssteen was, en God, de Allerhoogste, hun Verlosser."));
dusuperobject.biblemap.put("b19_78_36", new dusuperobject(19,78,36,"En zij vleiden Hem met hun mond, en logen Hem met hun tong."));
dusuperobject.biblemap.put("b19_78_37", new dusuperobject(19,78,37,"Want hun hart was niet recht met Hem, en zij waren niet getrouw in Zijn verbond."));
dusuperobject.biblemap.put("b19_78_38", new dusuperobject(19,78,38,"Doch Hij, barmhartig zijnde, verzoende de ongerechtigheid, en verdierf hen niet; maar wendde dikwijls Zijn toorn af, en wekte Zijn ganse grimmigheid niet op."));
dusuperobject.biblemap.put("b19_78_39", new dusuperobject(19,78,39,"En Hij dacht, dat zij vlees waren, een wind, die henengaat en niet wederkeert."));
dusuperobject.biblemap.put("b19_78_40", new dusuperobject(19,78,40,"Hoe dikwijls verbitterden zij Hem in de woestijn, deden Hem smart aan in de wildernis!"));
dusuperobject.biblemap.put("b19_78_41", new dusuperobject(19,78,41,"Want zij kwamen alweder, en verzochten God, en stelden den Heilige Israels een perk."));
dusuperobject.biblemap.put("b19_78_42", new dusuperobject(19,78,42,"Zij dachten niet aan Zijn hand, aan den dag, toen Hij hen van den wederpartijder verloste;"));
dusuperobject.biblemap.put("b19_78_43", new dusuperobject(19,78,43,"Hoe Hij Zijn tekenen stelde in Egypte, en Zijn wonderheden in het veld van Zoan;"));
dusuperobject.biblemap.put("b19_78_44", new dusuperobject(19,78,44,"En hun vloeden in bloed veranderde, en hun stromen, opdat zij niet zouden drinken."));
dusuperobject.biblemap.put("b19_78_45", new dusuperobject(19,78,45,"Hij zond een vermenging van ongedierte onder hen, dat hen verteerde, en vorsen, die hen verdierven."));
dusuperobject.biblemap.put("b19_78_46", new dusuperobject(19,78,46,"En Hij gaf hun gewas den kruidworm, en hun arbeid den sprinkhaan."));
dusuperobject.biblemap.put("b19_78_47", new dusuperobject(19,78,47,"Hij doodde hun wijnstok door den hagel, en hun wilde vijgebomen door vurigen hagelsteen."));
dusuperobject.biblemap.put("b19_78_48", new dusuperobject(19,78,48,"Ook gaf Hij hun vee den hagel over, en hun beesten aan de vurige kolen."));
dusuperobject.biblemap.put("b19_78_49", new dusuperobject(19,78,49,"Hij zond onder hen de hittigheid Zijns toorns, verbolgenheid, en verstoordheid, en benauwdheid, met uitzending der boden van veel kwaads."));
dusuperobject.biblemap.put("b19_78_50", new dusuperobject(19,78,50,"Hij woog een pad voor Zijn toorn; Hij onttrok hun ziel niet van den dood; en hun gedierte gaf Hij aan de pestilentie over."));
dusuperobject.biblemap.put("b19_78_51", new dusuperobject(19,78,51,"En Hij sloeg al het eerstgeborene in Egypte, het beginsel der krachten in de tenten van Cham."));
dusuperobject.biblemap.put("b19_78_52", new dusuperobject(19,78,52,"En Hij voerde Zijn volk als schapen, en leidde hen, als een kudde, in de woestijn."));
dusuperobject.biblemap.put("b19_78_53", new dusuperobject(19,78,53,"Ja, Hij leidde hen zeker, zodat zij niet vreesden; want de zee had hun vijanden overdekt."));
dusuperobject.biblemap.put("b19_78_54", new dusuperobject(19,78,54,"En Hij bracht hen tot de landpale Zijner heiligheid, tot dezen berg, dien Zijn rechterhand verkregen heeft."));
dusuperobject.biblemap.put("b19_78_55", new dusuperobject(19,78,55,"En Hij verdreef voor hun aangezicht de heidenen, en deed hen vallen in het snoer hunner erfenis, en deed de stammen Israels in hun tenten wonen."));
dusuperobject.biblemap.put("b19_78_56", new dusuperobject(19,78,56,"Maar zij verzochten en verbitterden God, den Allerhoogste, en onderhielden Zijn getuigenissen niet."));
dusuperobject.biblemap.put("b19_78_57", new dusuperobject(19,78,57,"En zij weken terug, en handelden trouwelooslijk, gelijk hun vaders; zij zijn omgekeerd, als een bedriegelijke boog."));
dusuperobject.biblemap.put("b19_78_58", new dusuperobject(19,78,58,"En zij verwekten Hem tot toorn door hun hoogten, en verwekten Hem tot ijver door hun gesneden beelden."));
dusuperobject.biblemap.put("b19_78_59", new dusuperobject(19,78,59,"God hoorde het en werd verbolgen, en versmaadde Israel zeer."));
dusuperobject.biblemap.put("b19_78_60", new dusuperobject(19,78,60,"Dies verliet Hij den tabernakel te Silo, de tent, die Hij tot een woning gesteld had onder de mensen."));
dusuperobject.biblemap.put("b19_78_61", new dusuperobject(19,78,61,"En Hij gaf Zijn sterkte in de gevangenis, en Zijn heerlijkheid in de hand des wederpartijders."));
dusuperobject.biblemap.put("b19_78_62", new dusuperobject(19,78,62,"En Hij leverde Zijn volk over ten zwaarde, en werd verbolgen tegen Zijn erfenis."));
dusuperobject.biblemap.put("b19_78_63", new dusuperobject(19,78,63,"Het vuur verteerde hun jongelingen, en hun jonge dochters werden niet geprezen."));
dusuperobject.biblemap.put("b19_78_64", new dusuperobject(19,78,64,"Hun priesters vielen door het zwaard, en hun weduwen weenden niet."));
dusuperobject.biblemap.put("b19_78_65", new dusuperobject(19,78,65,"Toen ontwaakte de Heere, als een slapende, als een held, die juicht van den wijn."));
dusuperobject.biblemap.put("b19_78_66", new dusuperobject(19,78,66,"En Hij sloeg Zijn wederpartijders aan het achterste; Hij deed hun eeuwige smaadheid aan."));
dusuperobject.biblemap.put("b19_78_67", new dusuperobject(19,78,67,"Doch Hij verwierp de tent van Jozef, en den stam van Efraim verkoos Hij niet."));
dusuperobject.biblemap.put("b19_78_68", new dusuperobject(19,78,68,"Maar Hij verkoos den stam van Juda, den berg Sion, dien Hij liefhad."));
dusuperobject.biblemap.put("b19_78_69", new dusuperobject(19,78,69,"En Hij bouwde Zijn heiligdom als hoogten, als de aarde, die Hij gegrond heeft in eeuwigheid."));
dusuperobject.biblemap.put("b19_78_70", new dusuperobject(19,78,70,"En Hij verkoos Zijn knecht David, en nam hem van de schaapskooien;"));
dusuperobject.biblemap.put("b19_78_71", new dusuperobject(19,78,71,"Van achter de zogende schapen deed Hij hem komen, om te weiden Jakob, Zijn volk, en Israel, Zijn erfenis."));
dusuperobject.biblemap.put("b19_78_72", new dusuperobject(19,78,72,"Ook heeft hij hen geweid naar de oprechtheid zijns harten, en heeft hen geleid met een zeer verstandig beleid zijner handen."));
dusuperobject.biblemap.put("b19_79_1", new dusuperobject(19,79,1,"Een psalm van Asaf. O God! Heidenen zijn gekomen in Uw erfenis; zij hebben den tempel Uwer heiligheid verontreinigd; zij hebben Jeruzalem tot steenhopen gesteld."));
dusuperobject.biblemap.put("b19_79_2", new dusuperobject(19,79,2,"Zij hebben de dode lichamen Uwer knechten aan het gevogelte des hemels tot spijs gegeven; het vlees Uwer gunstgenoten aan het gedierte des lands."));
dusuperobject.biblemap.put("b19_79_3", new dusuperobject(19,79,3,"Zij hebben hun bloed rondom Jeruzalem als water vergoten; en er was niemand, die hen begroef."));
dusuperobject.biblemap.put("b19_79_4", new dusuperobject(19,79,4,"Wij zijn onzen naburen een smaadheid geworden; een spot en schimp dien, die rondom ons zijn."));
dusuperobject.biblemap.put("b19_79_5", new dusuperobject(19,79,5,"Hoe lang, HEERE? Zult Gij eeuwiglijk toornen? Zal Uw ijver als vuur branden?"));
dusuperobject.biblemap.put("b19_79_6", new dusuperobject(19,79,6,"Stort Uw grimmigheid uit over de heidenen, die U niet kennen, en over de koninkrijken, die Uw Naam niet aanroepen."));
dusuperobject.biblemap.put("b19_79_7", new dusuperobject(19,79,7,"Want men heeft Jakob opgegeten, en zij hebben zijn liefelijke woning verwoest."));
dusuperobject.biblemap.put("b19_79_8", new dusuperobject(19,79,8,"Gedenk ons de vorige misdaden niet; haast U, laat Uw barmhartigheden ons voorkomen; want wij zijn zeer dun geworden."));
dusuperobject.biblemap.put("b19_79_9", new dusuperobject(19,79,9,"Help ons, o God onzes heils! ter oorzake van de eer Uws Naams; en red ons, en doe verzoening over onze zonden, om Uws Naams wil."));
dusuperobject.biblemap.put("b19_79_10", new dusuperobject(19,79,10,"Waarom zouden de heidenen zeggen: Waar is hun God? Laat de wraak des vergoten bloeds Uwer knechten onder de heidenen voor onze ogen bekend worden."));
dusuperobject.biblemap.put("b19_79_11", new dusuperobject(19,79,11,"Laat het gekerm der gevangenen voor Uw aanschijn komen; behoud overig de kinderen des doods, naar de grootheid Uws arms."));
dusuperobject.biblemap.put("b19_79_12", new dusuperobject(19,79,12,"En geef onze naburen zevenvoudig weder in hun schoot hun smaad, waarmede zij U, o Heere! gesmaad hebben."));
dusuperobject.biblemap.put("b19_79_13", new dusuperobject(19,79,13,"Zo zullen wij, Uw volk en de schapen Uwer weide, U loven in eeuwigheid, van geslacht tot geslacht; wij zullen Uw roem vertellen."));
dusuperobject.biblemap.put("b19_80_1", new dusuperobject(19,80,1,"Voor den opperzangmeester, op Schoschannim; een getuigenis, een psalm van Asaf."));
dusuperobject.biblemap.put("b19_80_2", new dusuperobject(19,80,2,"O Herder Israels! neem ter ore, Die Jozef als schapen leiddet; Die tussen de cherubim zit, verschijn blinkende."));
dusuperobject.biblemap.put("b19_80_3", new dusuperobject(19,80,3,"Wek Uw macht op voor het aangezicht van Efraim, en Benjamin, en Manasse, en kom tot onze verlossing."));
dusuperobject.biblemap.put("b19_80_4", new dusuperobject(19,80,4,"O God! breng ons weder, en laat Uw aanschijn lichten, zo zullen wij verlost worden."));
dusuperobject.biblemap.put("b19_80_5", new dusuperobject(19,80,5,"O HEERE, God der heirscharen! hoe lang zult Gij roken tegen het gebed Uws volks?"));
dusuperobject.biblemap.put("b19_80_6", new dusuperobject(19,80,6,"Gij spijst hen met tranenbrood, en drenkt hen met tranen uit een drieling."));
dusuperobject.biblemap.put("b19_80_7", new dusuperobject(19,80,7,"Gij hebt ons onzen naburen tot een twist gesteld, en onze vijanden spotten onder zich."));
dusuperobject.biblemap.put("b19_80_8", new dusuperobject(19,80,8,"O God der heirscharen! breng ons weder, en laat Uw aangezicht lichten; zo zullen wij verlost worden."));
dusuperobject.biblemap.put("b19_80_9", new dusuperobject(19,80,9,"Gij hebt een wijnstok uit Egypte overgebracht, hebt de heidenen verdreven, en hebt denzelven geplant;"));
dusuperobject.biblemap.put("b19_80_10", new dusuperobject(19,80,10,"Gij hebt de plaats voor hem bereid, en zijn wortelen doen inwortelen, zodat hij het land vervuld heeft."));
dusuperobject.biblemap.put("b19_80_11", new dusuperobject(19,80,11,"De bergen zijn met zijn schaduw bedekt geweest, en zijn ranken waren als cederbomen Gods."));
dusuperobject.biblemap.put("b19_80_12", new dusuperobject(19,80,12,"Hij schoot zijn ranken uit tot aan de zee, en zijn scheuten tot aan de rivier."));
dusuperobject.biblemap.put("b19_80_13", new dusuperobject(19,80,13,"Waarom hebt Gij zijn muren doorgebroken, zodat allen, die den weg voorbijgaan, hem plukken?"));
dusuperobject.biblemap.put("b19_80_14", new dusuperobject(19,80,14,"Het zwijn uit het woud heeft hem uitgewroet, en het wild des velds heeft hem afgeweid."));
dusuperobject.biblemap.put("b19_80_15", new dusuperobject(19,80,15,"O God der heirscharen! keer toch weder; aanschouw uit den hemel, en zie, en bezoek dezen wijnstok,"));
dusuperobject.biblemap.put("b19_80_16", new dusuperobject(19,80,16,"En den stam, dien Uw rechterhand geplant heeft, en dat om den zoon, dien Gij U gesterkt hebt!"));
dusuperobject.biblemap.put("b19_80_17", new dusuperobject(19,80,17,"Hij is met vuur verbrand; hij is afgehouwen; zij komen om van het schelden Uws aangezichts."));
dusuperobject.biblemap.put("b19_80_18", new dusuperobject(19,80,18,"Uw hand zij over den man Uwer rechterhand, over des mensen zoon, dien Gij U gesterkt hebt."));
dusuperobject.biblemap.put("b19_80_19", new dusuperobject(19,80,19,"Zo zullen wij van U niet terugkeren; behoud ons in het leven, zo zullen wij Uw Naam aanroepen. [ (Psalms 80:20) O HEERE, God der heirscharen! breng ons weder; laat Uw aanschijn lichten, zo zullen wij verlost worden. ]"));
dusuperobject.biblemap.put("b19_81_1", new dusuperobject(19,81,1,"Voor den opperzangmeester, op de Gittith, een psalm van Asaf."));
dusuperobject.biblemap.put("b19_81_2", new dusuperobject(19,81,2,"Zingt vrolijk Gode, onze Sterkte; juicht den God van Jakob."));
dusuperobject.biblemap.put("b19_81_3", new dusuperobject(19,81,3,"Heft een psalm op, en geeft de trommel; de liefelijke harp met de luit."));
dusuperobject.biblemap.put("b19_81_4", new dusuperobject(19,81,4,"Blaast de bazuin in de nieuwe maan, ter bestemder tijd, op onzen feestdag."));
dusuperobject.biblemap.put("b19_81_5", new dusuperobject(19,81,5,"Want dit is een inzetting in Israel, een recht van den God Jakobs."));
dusuperobject.biblemap.put("b19_81_6", new dusuperobject(19,81,6,"Hij heeft het gezet tot een getuigenis in Jozef, als Hij uitgetogen was tegen Egypteland; alwaar ik gehoord heb een spraak, die ik niet verstond;"));
dusuperobject.biblemap.put("b19_81_7", new dusuperobject(19,81,7,"Ik heb zijn schouder van den last onttrokken; zijn handen zijn van de potten ontslagen."));
dusuperobject.biblemap.put("b19_81_8", new dusuperobject(19,81,8,"In de benauwdheid riept gij, en Ik hielp u uit; Ik antwoordde u uit de schuilplaats des donders; Ik beproefde u aan de wateren van Meriba. Sela."));
dusuperobject.biblemap.put("b19_81_9", new dusuperobject(19,81,9,"Mijn volk, zeide Ik hoor toe, en Ik zal onder u betuigen, Israel, of gij naar Mij hoordet!"));
dusuperobject.biblemap.put("b19_81_10", new dusuperobject(19,81,10,"Er zal onder u geen uitlands god wezen, en gij zult u voor geen vreemden god nederbuigen."));
dusuperobject.biblemap.put("b19_81_11", new dusuperobject(19,81,11,"Ik ben de Heere, uw God, Die u heb opgevoerd uit het land van Egypte; doe uw mond wijd open, en Ik zal hem vervullen."));
dusuperobject.biblemap.put("b19_81_12", new dusuperobject(19,81,12,"Maar Mijn volk heeft Mijn stem niet gehoord; en Israel heeft Mijner niet gewild."));
dusuperobject.biblemap.put("b19_81_13", new dusuperobject(19,81,13,"Dies heb Ik het overgegeven in het goeddunken huns harten, dat zij wandelden in hun raadslagen."));
dusuperobject.biblemap.put("b19_81_14", new dusuperobject(19,81,14,"Och, dat Mijn volk naar Mij gehoord had, dat Israel in Mijn wegen gewandeld had!"));
dusuperobject.biblemap.put("b19_81_15", new dusuperobject(19,81,15,"In kort zou Ik hun vijanden gedempt hebben, en Mijn hand gewend hebben tegen hun wederpartijders."));
dusuperobject.biblemap.put("b19_81_16", new dusuperobject(19,81,16,"Die den HEERE haten, zouden zich Hem geveinsdelijk onderworpen hebben, maar hunlieder tijd zou eeuwig geweest zijn. [ (Psalms 81:17) En Hij zou het gespijsd hebben met het vette der tarwe; ja, Ik zou u verzadigd hebben met honig uit de rotsstenen. ]"));
dusuperobject.biblemap.put("b19_82_1", new dusuperobject(19,82,1,"Een psalm van Asaf. God staat in de vergadering Godes; Hij oordeelt in het midden der goden;"));
dusuperobject.biblemap.put("b19_82_2", new dusuperobject(19,82,2,"Hoe lang zult gijlieden onrecht oordelen, en het aangezicht der goddelozen aannemen? Sela."));
dusuperobject.biblemap.put("b19_82_3", new dusuperobject(19,82,3,"Doet recht den arme en den wees; rechtvaardigt den verdrukte en den arme."));
dusuperobject.biblemap.put("b19_82_4", new dusuperobject(19,82,4,"Verlost den arme en den behoeftige, rukt hem uit der goddelozen hand."));
dusuperobject.biblemap.put("b19_82_5", new dusuperobject(19,82,5,"Zij weten niet, en verstaan niet; zij wandelen steeds in duisternis; dies wankelen alle fondamenten der aarde."));
dusuperobject.biblemap.put("b19_82_6", new dusuperobject(19,82,6,"Ik heb wel gezegd: Gij zijt goden; en gij zijt allen kinderen des Allerhoogsten;"));
dusuperobject.biblemap.put("b19_82_7", new dusuperobject(19,82,7,"Nochtans zult gij sterven als een mens; en als een van de vorsten zult gij vallen."));
dusuperobject.biblemap.put("b19_82_8", new dusuperobject(19,82,8,"Sta op, o God! oordeel het aardrijk, want Gij bezit alle natien."));
dusuperobject.biblemap.put("b19_83_1", new dusuperobject(19,83,1,"Een lied, een psalm van Asaf."));
dusuperobject.biblemap.put("b19_83_2", new dusuperobject(19,83,2,"O God! zwijg niet, houd U niet als doof, en zijt niet stil, o God!"));
dusuperobject.biblemap.put("b19_83_3", new dusuperobject(19,83,3,"Want zie, Uw vijanden maken getier, en Uw haters steken het hoofd op."));
dusuperobject.biblemap.put("b19_83_4", new dusuperobject(19,83,4,"Zij maken listiglijk een heimelijken aanslag tegen Uw volk, en beraadslagen zich tegen Uw verborgenen."));
dusuperobject.biblemap.put("b19_83_5", new dusuperobject(19,83,5,"Zij hebben gezegd: Komt, en laat ons hen uitroeien, dat zij geen volk meer zijn; dat aan den naam Israels niet meer gedacht worde."));
dusuperobject.biblemap.put("b19_83_6", new dusuperobject(19,83,6,"Want zij hebben in het hart te zamen geraadslaagd; tegen U hebben zij een verbond gemaakt;"));
dusuperobject.biblemap.put("b19_83_7", new dusuperobject(19,83,7,"De tenten van Edom en der Ismaelieten, Moab en de Hagarenen;"));
dusuperobject.biblemap.put("b19_83_8", new dusuperobject(19,83,8,"Gebal, en Ammon, en Amalek, Palestina met de inwoners van Tyrus."));
dusuperobject.biblemap.put("b19_83_9", new dusuperobject(19,83,9,"Ook heeft zich Assur bij hen gevoegd; zij zijn den kinderen van Lot tot een arm geweest. Sela."));
dusuperobject.biblemap.put("b19_83_10", new dusuperobject(19,83,10,"Doe hun als Midian, als Sisera, als Jabin aan de beek Kison;"));
dusuperobject.biblemap.put("b19_83_11", new dusuperobject(19,83,11,"Die verdelgd zijn te Endor; zij zijn geworden tot drek der aarde."));
dusuperobject.biblemap.put("b19_83_12", new dusuperobject(19,83,12,"Maak hen en hun prinsen als Oreb en als Zeeb, en al hun vorsten als Zebah en als Zalmuna;"));
dusuperobject.biblemap.put("b19_83_13", new dusuperobject(19,83,13,"Die zeiden: Laat ons de schone woningen Gods voor ons in erfelijke bezitting nemen."));
dusuperobject.biblemap.put("b19_83_14", new dusuperobject(19,83,14,"Mijn God! maak hen als een wervel, als stoppelen voor den wind."));
dusuperobject.biblemap.put("b19_83_15", new dusuperobject(19,83,15,"Gelijk het vuur een woud verbrandt, en gelijk de vlam de bergen aansteekt;"));
dusuperobject.biblemap.put("b19_83_16", new dusuperobject(19,83,16,"Vervolg hen alzo met Uw onweder, en verschrik hen met Uw draaiwind."));
dusuperobject.biblemap.put("b19_83_17", new dusuperobject(19,83,17,"Maak hun aangezicht vol schande, opdat zij, o HEERE! Uw Naam zoeken."));
dusuperobject.biblemap.put("b19_83_18", new dusuperobject(19,83,18,"Laat hen beschaamd en verschrikt wezen tot in eeuwigheid, en laat hen schaamrood worden, en omkomen; [ (Psalms 83:19) Opdat zij weten, dat Gij alleen met Uw Naam zijt de HEERE, de Allerhoogste over de ganse aarde. ]"));
dusuperobject.biblemap.put("b19_84_1", new dusuperobject(19,84,1,"Voor den opperzangmeester, op de Gittith; een psalm, voor de kinderen van Korach."));
dusuperobject.biblemap.put("b19_84_2", new dusuperobject(19,84,2,"Hoe liefelijk zijn Uw woningen, o HEERE der heirscharen!"));
dusuperobject.biblemap.put("b19_84_3", new dusuperobject(19,84,3,"Mijn ziel is begerig, en bezwijkt ook van verlangen, naar de voorhoven des HEEREN; mijn hart en mijn vlees roepen uit tot den levenden God."));
dusuperobject.biblemap.put("b19_84_4", new dusuperobject(19,84,4,"Zelfs vindt de mus een huis, en de zwaluw een nest voor zich, waar zij haar jongen legt, bij Uw altaren, HEERE der heirscharen, mijn Koning, en mijn God!"));
dusuperobject.biblemap.put("b19_84_5", new dusuperobject(19,84,5,"Welgelukzalig zijn zij, die in Uw huis wonen; zij prijzen U gestadiglijk. Sela."));
dusuperobject.biblemap.put("b19_84_6", new dusuperobject(19,84,6,"Welgelukzalig is de mens, wiens sterkte in U is, in welker hart de gebaande wegen zijn."));
dusuperobject.biblemap.put("b19_84_7", new dusuperobject(19,84,7,"Als zij door het dal der moerbezienbomen doorgaan, stellen zij Hem tot een fontein; ook zal de regen hen gans rijkelijk overdekken."));
dusuperobject.biblemap.put("b19_84_8", new dusuperobject(19,84,8,"Zij gaan van kracht tot kracht; een iegelijk van hen zal verschijnen voor God in Sion."));
dusuperobject.biblemap.put("b19_84_9", new dusuperobject(19,84,9,"HEERE, God der heirscharen! hoor mijn gebed; neem het ter oren, o God van Jakob! Sela."));
dusuperobject.biblemap.put("b19_84_10", new dusuperobject(19,84,10,"O God, ons Schild! zie, en aanschouw het aangezicht Uws gezalfden."));
dusuperobject.biblemap.put("b19_84_11", new dusuperobject(19,84,11,"Want een dag in Uw voorhoven is beter dan duizend elders; ik koos liever aan den dorpel in het huis mijns Gods te wezen, dan lang te wonen in de tenten der goddeloosheid."));
dusuperobject.biblemap.put("b19_84_12", new dusuperobject(19,84,12,"Want God, de HEERE, is een Zon en Schild; de HEERE zal genade en eer geven; Hij zal het goede niet onthouden dengenen, die in oprechtheid wandelen. [ (Psalms 84:13) HEERE der heirscharen! welgelukzalig is de mens, die op U vertrouwt. ]"));
dusuperobject.biblemap.put("b19_85_1", new dusuperobject(19,85,1,"Een psalm, voor den opperzangmeester, onder de kinderen van Korach."));
dusuperobject.biblemap.put("b19_85_2", new dusuperobject(19,85,2,"Gij zijt Uw lande gunstig geweest, HEERE! de gevangenis van Jakob hebt Gij gewend."));
dusuperobject.biblemap.put("b19_85_3", new dusuperobject(19,85,3,"De misdaad Uws volks hebt Gij weggenomen; Gij hebt al hun zonden bedekt. Sela."));
dusuperobject.biblemap.put("b19_85_4", new dusuperobject(19,85,4,"Gij hebt weggenomen al Uw verbolgenheid; Gij hebt U gewend van de hittigheid Uws toorns."));
dusuperobject.biblemap.put("b19_85_5", new dusuperobject(19,85,5,"Breng ons weder, o God onzes heils! en doe te niet Uw toornigheid over ons."));
dusuperobject.biblemap.put("b19_85_6", new dusuperobject(19,85,6,"Zult Gij eeuwiglijk tegen ons toornen? Zult Gij Uw toorn uitstrekken van geslacht tot geslacht?"));
dusuperobject.biblemap.put("b19_85_7", new dusuperobject(19,85,7,"Zult Gij ons niet weder levend maken, opdat Uw volk zich in U verblijde?"));
dusuperobject.biblemap.put("b19_85_8", new dusuperobject(19,85,8,"Toon ons Uw goedertierenheid, o HEERE, en geef ons Uw heil."));
dusuperobject.biblemap.put("b19_85_9", new dusuperobject(19,85,9,"Ik zal horen, wat God, de HEERE, spreken zal; want Hij zal tot Zijn volk en tot Zijn gunstgenoten van vrede spreken; maar dat zij niet weder tot dwaasheid keren."));
dusuperobject.biblemap.put("b19_85_10", new dusuperobject(19,85,10,"Zekerlijk, Zijn heil is nabij degenen, die Hem vrezen, opdat in ons land eer wone."));
dusuperobject.biblemap.put("b19_85_11", new dusuperobject(19,85,11,"De goedertierenheid en waarheid zullen elkander ontmoeten; de gerechtigheid en vrede zullen elkander kussen."));
dusuperobject.biblemap.put("b19_85_12", new dusuperobject(19,85,12,"De waarheid zal uit de aarde spruiten, en gerechtigheid zal van den hemel nederzien."));
dusuperobject.biblemap.put("b19_85_13", new dusuperobject(19,85,13,"Ook zal de HEERE het goede geven; en ons land zal zijn vrucht geven. [ (Psalms 85:14) De gerechtigheid zal voor Zijn aangezicht henengaan, en Hij zal ze zetten op den weg Zijner voetstappen. ]"));
dusuperobject.biblemap.put("b19_86_1", new dusuperobject(19,86,1,"Een gebed van David. HEERE! neig Uw oor, verhoor mij; want ik ben ellendig en nooddruftig."));
dusuperobject.biblemap.put("b19_86_2", new dusuperobject(19,86,2,"Bewaar mijn ziel, want ik ben Uw gunstgenoot, o Gij, mijn God! verlos Uw knecht die op U betrouwt."));
dusuperobject.biblemap.put("b19_86_3", new dusuperobject(19,86,3,"Zijt mij genadig, HEERE! want ik roep tot U den gansen dag."));
dusuperobject.biblemap.put("b19_86_4", new dusuperobject(19,86,4,"Verheug de ziel Uws knechts; want tot U, HEERE! verhef ik mijn ziel."));
dusuperobject.biblemap.put("b19_86_5", new dusuperobject(19,86,5,"Want Gij, HEERE! zijt goed, en gaarne vergevende, en van grote goedertierenheid allen, die U aanroepen."));
dusuperobject.biblemap.put("b19_86_6", new dusuperobject(19,86,6,"HEERE! neem mijn gebed ter ore, en merk op de stem mijner smekingen."));
dusuperobject.biblemap.put("b19_86_7", new dusuperobject(19,86,7,"In den dag mijner benauwdheid roep ik U aan, want Gij verhoort mij."));
dusuperobject.biblemap.put("b19_86_8", new dusuperobject(19,86,8,"Onder de goden is niemand U gelijk, Heere! en er zijn geen gelijk Uw werken."));
dusuperobject.biblemap.put("b19_86_9", new dusuperobject(19,86,9,"Al de heidenen, Heere! die Gij gemaakt hebt, zullen komen, en zullen zich voor Uw aanschijn nederbuigen, en Uw Naam eren."));
dusuperobject.biblemap.put("b19_86_10", new dusuperobject(19,86,10,"Want Gij zijt groot, en doet wonderwerken; Gij alleen zijt God."));
dusuperobject.biblemap.put("b19_86_11", new dusuperobject(19,86,11,"Leer mij, HEERE! Uw weg; ik zal in Uw waarheid wandelen; verenig mijn hart tot de vreze Uws Naams."));
dusuperobject.biblemap.put("b19_86_12", new dusuperobject(19,86,12,"Heere, mijn God! ik zal U met mijn ganse hart loven, en ik zal Uw Naam eren in eeuwigheid;"));
dusuperobject.biblemap.put("b19_86_13", new dusuperobject(19,86,13,"Want Uw goedertierenheid is groot over mij; en Gij hebt mijn ziel uit het onderste des grafs uitgerukt."));
dusuperobject.biblemap.put("b19_86_14", new dusuperobject(19,86,14,"O God! de hovaardigen staan tegen mij op, en de vergaderingen der tirannen zoeken mijn ziel; en zij stellen U niet voor hun ogen."));
dusuperobject.biblemap.put("b19_86_15", new dusuperobject(19,86,15,"Maar Gij, Heere! zijt een barmhartig en genadig God, lankmoedig, en groot van goedertierenheid en waarheid."));
dusuperobject.biblemap.put("b19_86_16", new dusuperobject(19,86,16,"Wend U tot mij, en zijt mij genadig, geef Uw knecht Uw sterkte, en verlos den zoon Uwer dienstmaagd."));
dusuperobject.biblemap.put("b19_86_17", new dusuperobject(19,86,17,"Doe aan mij een teken ten goede, opdat het mijn haters zien, en beschaamd worden, als Gij, HEERE! mij geholpen, en mij getroost zult hebben."));
dusuperobject.biblemap.put("b19_87_1", new dusuperobject(19,87,1,"Een psalm, een lied voor de kinderen van Korach. Zijn grondslag is op de bergen der heiligheid."));
dusuperobject.biblemap.put("b19_87_2", new dusuperobject(19,87,2,"De HEERE bemint de poorten van Sion boven alle woningen van Jakob."));
dusuperobject.biblemap.put("b19_87_3", new dusuperobject(19,87,3,"Zeer heerlijke dingen worden van u gesproken, o stad Gods! Sela."));
dusuperobject.biblemap.put("b19_87_4", new dusuperobject(19,87,4,"Ik zal Rahab en Babel vermelden, onder degenen, die Mij kennen; ziet, de Filistijn, en de Tyrier, met den Moor, deze is aldaar geboren."));
dusuperobject.biblemap.put("b19_87_5", new dusuperobject(19,87,5,"En van Sion zal gezegd worden: Die en die is daarin geboren; en de Allerhoogste Zelf zal hen bevestigen."));
dusuperobject.biblemap.put("b19_87_6", new dusuperobject(19,87,6,"De HEERE zal hen rekenen in het opschrijven der volken, zeggende: Deze is aldaar geboren. Sela."));
dusuperobject.biblemap.put("b19_87_7", new dusuperobject(19,87,7,"En de zangers, gelijk de speellieden, mitsgaders al mijn fonteinen, zullen binnen u zijn."));
dusuperobject.biblemap.put("b19_88_1", new dusuperobject(19,88,1,"Een lied, een psalm voor de kinderen van Korach, voor den opperzangmeester, op Machalath Leannoth; een onderwijzing van Heman, den Ezrahiet."));
dusuperobject.biblemap.put("b19_88_2", new dusuperobject(19,88,2,"O HEERE, God mijns heils! bij dag, bij nacht roep ik voor U."));
dusuperobject.biblemap.put("b19_88_3", new dusuperobject(19,88,3,"Laat mijn gebed voor Uw aanschijn komen; neig Uw oor tot mijn geschrei."));
dusuperobject.biblemap.put("b19_88_4", new dusuperobject(19,88,4,"Want mijn ziel is der tegenheden zat, en mijn leven raakt tot aan het graf."));
dusuperobject.biblemap.put("b19_88_5", new dusuperobject(19,88,5,"Ik ben gerekend met degenen, die in de kuil nederdalen; ik ben geworden als een man, die krachteloos is;"));
dusuperobject.biblemap.put("b19_88_6", new dusuperobject(19,88,6,"Afgezonderd onder de doden, gelijk de verslagenen, die in het graf liggen, die Gij niet meer gedenkt, en zij zijn afgesneden van Uw hand."));
dusuperobject.biblemap.put("b19_88_7", new dusuperobject(19,88,7,"Gij hebt mij in den ondersten kuil gelegd, in duisternissen, in diepten."));
dusuperobject.biblemap.put("b19_88_8", new dusuperobject(19,88,8,"Uw grimmigheid ligt op mij; Gij hebt mij nedergedrukt met al Uw baren. Sela."));
dusuperobject.biblemap.put("b19_88_9", new dusuperobject(19,88,9,"Mijn bekenden hebt Gij verre van mij gedaan, Gij hebt mij hun tot een groten gruwel gesteld; ik ben besloten, en kan niet uitkomen."));
dusuperobject.biblemap.put("b19_88_10", new dusuperobject(19,88,10,"Mijn oog treurt vanwege verdrukking; HEERE! ik roep tot U den gansen dag; ik strek mijn handen uit tot U."));
dusuperobject.biblemap.put("b19_88_11", new dusuperobject(19,88,11,"Zult Gij wonder doen aan de doden? Of zullen de overledenen opstaan, zullen zij U loven? Sela."));
dusuperobject.biblemap.put("b19_88_12", new dusuperobject(19,88,12,"Zal Uw goedertierenheid in het graf verteld worden, Uw getrouwheid in het verderf?"));
dusuperobject.biblemap.put("b19_88_13", new dusuperobject(19,88,13,"Zullen Uw wonderen bekend worden in de duisternis, en Uw gerechtigheid in het land der vergetelheid?"));
dusuperobject.biblemap.put("b19_88_14", new dusuperobject(19,88,14,"Maar ik, HEERE! roep tot U, en mijn gebed komt U voor in den morgenstond."));
dusuperobject.biblemap.put("b19_88_15", new dusuperobject(19,88,15,"HEERE! waarom verstoot Gij mijn ziel, en verbergt Uw aanschijn voor mij?"));
dusuperobject.biblemap.put("b19_88_16", new dusuperobject(19,88,16,"Van der jeugd aan ben ik bedrukt en doodbrakende; ik draag Uw vervaarnissen, ik ben twijfelmoedig."));
dusuperobject.biblemap.put("b19_88_17", new dusuperobject(19,88,17,"Uw hittige toornigheden gaan over mij; Uw verschrikkingen doen mij vergaan."));
dusuperobject.biblemap.put("b19_88_18", new dusuperobject(19,88,18,"Den gansen dag omringen zij mij als water; te zamen omgeven zij mij. [ (Psalms 88:19) Gij hebt vriend en metgezel verre van mij gedaan; mijn bekenden zijn in duisternis. ]"));
dusuperobject.biblemap.put("b19_89_1", new dusuperobject(19,89,1,"Een onderwijzing van Ethan, den Ezrahiet."));
dusuperobject.biblemap.put("b19_89_2", new dusuperobject(19,89,2,"Ik zal de goedertierenheid des HEEREN eeuwiglijk zingen; ik zal Uw waarheid met mijn mond bekend maken, van geslacht tot geslacht."));
dusuperobject.biblemap.put("b19_89_3", new dusuperobject(19,89,3,"Want ik heb gezegd: Uw goedertierenheid zal eeuwiglijk gebouwd worden; in de hemelen zelve hebt Gij Uw waarheid bevestigd, zeggende:"));
dusuperobject.biblemap.put("b19_89_4", new dusuperobject(19,89,4,"Ik heb een verbond gemaakt met Mijn uitverkorene; Ik heb Mijn knecht David gezworen:"));
dusuperobject.biblemap.put("b19_89_5", new dusuperobject(19,89,5,"Ik zal uw zaad tot in eeuwigheid bevestigen, en uw troon opbouwen van geslacht tot geslacht. Sela."));
dusuperobject.biblemap.put("b19_89_6", new dusuperobject(19,89,6,"Dies loven de hemelen Uw wonderen, o HEERE! ook is Uw getrouwheid in de gemeente der heiligen."));
dusuperobject.biblemap.put("b19_89_7", new dusuperobject(19,89,7,"Want wie mag in den hemel tegen den HEERE geschat worden? Wie is den HEERE gelijk, onder de kinderen der sterken?"));
dusuperobject.biblemap.put("b19_89_8", new dusuperobject(19,89,8,"God is grotelijks geducht in den raad der heiligen, en vreselijk boven allen, die rondom Hem zijn."));
dusuperobject.biblemap.put("b19_89_9", new dusuperobject(19,89,9,"O HEERE, God der heirscharen! wie is als Gij, grootmachtig, o HEERE! en Uw getrouwheid is rondom U."));
dusuperobject.biblemap.put("b19_89_10", new dusuperobject(19,89,10,"Gij heerst over de opgeblazenheid der zee; wanneer haar baren zich verheffen, zo stilt Gij ze."));
dusuperobject.biblemap.put("b19_89_11", new dusuperobject(19,89,11,"Gij hebt Rahab verbrijzeld als een verslagene; Gij hebt Uw vijanden verstrooid met den arm Uwer sterkte."));
dusuperobject.biblemap.put("b19_89_12", new dusuperobject(19,89,12,"De hemel is Uwe, ook is de aarde Uwe; de wereld en haar volheid, die hebt Gij gegrond."));
dusuperobject.biblemap.put("b19_89_13", new dusuperobject(19,89,13,"Het noorden en het zuiden, die hebt Gij geschapen; Thabor en Hermon juichen in Uw Naam."));
dusuperobject.biblemap.put("b19_89_14", new dusuperobject(19,89,14,"Gij hebt een arm met macht; Uw hand is sterk, Uw rechterhand is hoog."));
dusuperobject.biblemap.put("b19_89_15", new dusuperobject(19,89,15,"Gerechtigheid en gericht zijn de vastigheid Uws troons; goedertierenheid en waarheid gaan voor Uw aanschijn henen."));
dusuperobject.biblemap.put("b19_89_16", new dusuperobject(19,89,16,"Welgelukzalig is het volk, hetwelk het geklank kent; o HEERE! zij zullen in het licht Uws aanschijns wandelen."));
dusuperobject.biblemap.put("b19_89_17", new dusuperobject(19,89,17,"Zij zullen zich den gansen dag verheugen in Uw Naam, en door Uw gerechtigheid verhoogd worden."));
dusuperobject.biblemap.put("b19_89_18", new dusuperobject(19,89,18,"Want Gij zijt de heerlijkheid hunner sterkte; en door Uw welbehagen zal onze hoorn verhoogd worden."));
dusuperobject.biblemap.put("b19_89_19", new dusuperobject(19,89,19,"Want ons schild is van den HEERE, en onze koning is van den Heilige Israels."));
dusuperobject.biblemap.put("b19_89_20", new dusuperobject(19,89,20,"Toen hebt Gij in een gezicht gesproken van Uw heilige, en gezegd: Ik heb hulp besteld bij een held; Ik heb een verkorene uit het volk verhoogd."));
dusuperobject.biblemap.put("b19_89_21", new dusuperobject(19,89,21,"Ik heb David, Mijn knecht, gevonden; met Mijn heilige olie heb Ik hem gezalfd;"));
dusuperobject.biblemap.put("b19_89_22", new dusuperobject(19,89,22,"Met welken Mijn hand vast blijven zal; ook zal hem Mijn arm versterken."));
dusuperobject.biblemap.put("b19_89_23", new dusuperobject(19,89,23,"De vijand zal hem niet dringen, en de zoon der ongerechtigheid zal hem niet onderdrukken."));
dusuperobject.biblemap.put("b19_89_24", new dusuperobject(19,89,24,"Maar Ik zal zijn wederpartijders verpletteren voor zijn aangezicht, en die hem haten, zal Ik plagen."));
dusuperobject.biblemap.put("b19_89_25", new dusuperobject(19,89,25,"En Mijn getrouwheid en Mijn goedertierenheid zullen met hem zijn; en zijn hoorn zal in Mijn Naam verhoogd worden."));
dusuperobject.biblemap.put("b19_89_26", new dusuperobject(19,89,26,"En Ik zal zijn hand in de zee zetten, en zijn rechterhand in de rivieren."));
dusuperobject.biblemap.put("b19_89_27", new dusuperobject(19,89,27,"Hij zal Mij noemen: Gij zijt mijn Vader! mijn God, en de Rotssteen mijns heils!"));
dusuperobject.biblemap.put("b19_89_28", new dusuperobject(19,89,28,"Ook zal Ik hem ten eerstgeborenen zoon stellen, ten hoogste over de koningen der aarde."));
dusuperobject.biblemap.put("b19_89_29", new dusuperobject(19,89,29,"Ik zal hem Mijn goedertierenheid in eeuwigheid houden, en Mijn verbond zal hem vast blijven."));
dusuperobject.biblemap.put("b19_89_30", new dusuperobject(19,89,30,"En Ik zal zijn zaad in eeuwigheid zetten, en zijn troon als de dagen der hemelen."));
dusuperobject.biblemap.put("b19_89_31", new dusuperobject(19,89,31,"Indien zijn kinderen Mijn wet verlaten, en in Mijn rechten niet wandelen;"));
dusuperobject.biblemap.put("b19_89_32", new dusuperobject(19,89,32,"Indien zij Mijn inzettingen ontheiligen, en Mijn geboden niet houden;"));
dusuperobject.biblemap.put("b19_89_33", new dusuperobject(19,89,33,"Zo zal Ik hun overtreding met de roede bezoeken, en hun ongerechtigheid met plagen."));
dusuperobject.biblemap.put("b19_89_34", new dusuperobject(19,89,34,"Maar Mijn goedertierenheid zal Ik van hem niet wegnemen, en in Mijn getrouwheid niet feilen."));
dusuperobject.biblemap.put("b19_89_35", new dusuperobject(19,89,35,"Ik zal Mijn verbond niet ontheiligen, en hetgeen uit Mijn lippen gegaan is, zal Ik niet veranderen."));
dusuperobject.biblemap.put("b19_89_36", new dusuperobject(19,89,36,"Ik heb eens gezworen bij Mijn heiligheid: Zo Ik aan David liege!"));
dusuperobject.biblemap.put("b19_89_37", new dusuperobject(19,89,37,"Zijn zaad zal in der eeuwigheid zijn, en zijn troon zal voor Mij zijn gelijk de zon."));
dusuperobject.biblemap.put("b19_89_38", new dusuperobject(19,89,38,"Hij zal eeuwiglijk bevestigd worden, gelijk de maan; en de Getuige in den hemel is getrouw. Sela."));
dusuperobject.biblemap.put("b19_89_39", new dusuperobject(19,89,39,"Maar Gij hebt hem verstoten en verworpen; Gij zijt verbolgen geworden tegen Uw gezalfde."));
dusuperobject.biblemap.put("b19_89_40", new dusuperobject(19,89,40,"Gij hebt het verbond Uws knechts te niet gedaan; Gij hebt zijn kroon ontheiligd tegen de aarde."));
dusuperobject.biblemap.put("b19_89_41", new dusuperobject(19,89,41,"Gij hebt al zijn muren doorgebroken; Gij hebt zijn vestingen nedergeworpen."));
dusuperobject.biblemap.put("b19_89_42", new dusuperobject(19,89,42,"Allen, die den weg voorbijgingen, hebben hem beroofd; zijn naburen is hij tot een smaad geweest."));
dusuperobject.biblemap.put("b19_89_43", new dusuperobject(19,89,43,"Gij hebt de rechterhand zijner wederpartijders verhoogd; Gij hebt al zijn vijanden verblijd."));
dusuperobject.biblemap.put("b19_89_44", new dusuperobject(19,89,44,"Gij hebt ook de scherpte zijns zwaards omgekeerd, en hebt hem niet staande gehouden in den strijd."));
dusuperobject.biblemap.put("b19_89_45", new dusuperobject(19,89,45,"Gij hebt zijn schoonheid doen ophouden; en Gij hebt zijn troon ter aarde nedergestoten."));
dusuperobject.biblemap.put("b19_89_46", new dusuperobject(19,89,46,"Gij hebt de dagen zijner jeugd verkort; Gij hebt hem met schaamte overdekt. Sela."));
dusuperobject.biblemap.put("b19_89_47", new dusuperobject(19,89,47,"Hoe lang, o HEERE! zult Gij U steeds verbergen, zal Uw grimmigheid branden als een vuur?"));
dusuperobject.biblemap.put("b19_89_48", new dusuperobject(19,89,48,"Gedenk van hoedanige eeuw ik ben; waarom zoudt Gij aller mensenkinderen tevergeefs geschapen hebben?"));
dusuperobject.biblemap.put("b19_89_49", new dusuperobject(19,89,49,"Wat man leeft er, die den dood niet zien zal, die zijn ziel zal bevrijden van het geweld des grafs? Sela."));
dusuperobject.biblemap.put("b19_89_50", new dusuperobject(19,89,50,"HEERE! waar zijn Uw vorige goedertierenheden, die Gij David gezworen hebt bij Uw trouw?"));
dusuperobject.biblemap.put("b19_89_51", new dusuperobject(19,89,51,"Gedenk, HEERE! aan de smaad Uwer knechten, dien ik in mijn boezem draag, van alle grote volken."));
dusuperobject.biblemap.put("b19_89_52", new dusuperobject(19,89,52,"Waarmede, o HEERE! Uw vijanden smaden, waarmede zij de voetstappen Uws gezalfden smaden. [ (Psalms 89:53) Geloofd zij de HEERE in eeuwigheid! Amen, ja, amen. ]"));
dusuperobject.biblemap.put("b19_90_1", new dusuperobject(19,90,1,"Een gebed van Mozes, den man Gods. HEERE! Gij zijt ons geweest een Toevlucht van geslacht tot geslacht."));
dusuperobject.biblemap.put("b19_90_2", new dusuperobject(19,90,2,"Eer de bergen geboren waren, en Gij de aarde en de wereld voortgebracht hadt, ja, van eeuwigheid tot eeuwigheid zijt Gij God."));
dusuperobject.biblemap.put("b19_90_3", new dusuperobject(19,90,3,"Gij doet den mens wederkeren tot verbrijzeling, en zegt: Keert weder, gij mensenkinderen!"));
dusuperobject.biblemap.put("b19_90_4", new dusuperobject(19,90,4,"Want duizend jaren zijn in Uw ogen als de dag van gisteren, als hij voorbijgegaan is, en als een nachtwaak."));
dusuperobject.biblemap.put("b19_90_5", new dusuperobject(19,90,5,"Gij overstroomt hen; zij zijn gelijk een slaap; in den morgenstond zijn zij gelijk het gras, dat verandert;"));
dusuperobject.biblemap.put("b19_90_6", new dusuperobject(19,90,6,"In den morgenstond bloeit het, en het verandert; des avonds wordt het afgesneden, en het verdort."));
dusuperobject.biblemap.put("b19_90_7", new dusuperobject(19,90,7,"Want wij vergaan door Uw toorn; en door Uw grimmigheid worden wij verschrikt."));
dusuperobject.biblemap.put("b19_90_8", new dusuperobject(19,90,8,"Gij stelt onze ongerechtigheden voor U, onze heimelijke zonden in het licht Uws aanschijns."));
dusuperobject.biblemap.put("b19_90_9", new dusuperobject(19,90,9,"Want al onze dagen gaan henen door Uw verbolgenheid; wij brengen onze jaren door als een gedachte."));
dusuperobject.biblemap.put("b19_90_10", new dusuperobject(19,90,10,"Aangaande de dagen onzer jaren, daarin zijn zeventig jaren, of, zo wij zeer sterk zijn, tachtig jaren; en het uitnemendste van die is moeite en verdriet; want het wordt snellijk afgesneden, en wij vliegen daarheen."));
dusuperobject.biblemap.put("b19_90_11", new dusuperobject(19,90,11,"Wie kent de sterkte Uws toorns, en Uw verbolgenheid, naardat Gij te vrezen zijt?"));
dusuperobject.biblemap.put("b19_90_12", new dusuperobject(19,90,12,"Leer ons alzo onze dagen tellen, dat wij een wijs hart bekomen."));
dusuperobject.biblemap.put("b19_90_13", new dusuperobject(19,90,13,"Keer weder, HEERE! tot hoe lange? en het berouwe U over Uw knechten."));
dusuperobject.biblemap.put("b19_90_14", new dusuperobject(19,90,14,"Verzadig ons in den morgenstond met Uw goedertierenheid, zo zullen wij juichen, en verblijd zijn in al onze dagen."));
dusuperobject.biblemap.put("b19_90_15", new dusuperobject(19,90,15,"Verblijd ons naar de dagen, in dewelke Gij ons gedrukt hebt, naar de jaren, in dewelke wij het kwaad gezien hebben."));
dusuperobject.biblemap.put("b19_90_16", new dusuperobject(19,90,16,"Laat Uw werk aan Uw knechten gezien worden, en Uw heerlijkheid over hun kinderen."));
dusuperobject.biblemap.put("b19_90_17", new dusuperobject(19,90,17,"En de liefelijkheid des HEEREN, onzes Gods; zij over ons; en bevestig Gij het werk onzer handen over ons, ja, het werk onzer handen, bevestig dat."));
dusuperobject.biblemap.put("b19_91_1", new dusuperobject(19,91,1,"Die in de schuilplaats des Allerhoogsten is gezeten, die zal vernachten in de schaduw des Almachtigen."));
dusuperobject.biblemap.put("b19_91_2", new dusuperobject(19,91,2,"Ik zal tot den HEERE zeggen: Mijn Toevlucht en mijn Burg! mijn God, op Welken ik vertrouw!"));
dusuperobject.biblemap.put("b19_91_3", new dusuperobject(19,91,3,"Want Hij zal u redden van den strik des vogelvangers, van de zeer verderfelijke pestilentie."));
dusuperobject.biblemap.put("b19_91_4", new dusuperobject(19,91,4,"Hij zal u dekken met Zijn vlerken, en onder Zijn vleugelen zult gij betrouwen; Zijn waarheid is een rondas en beukelaar."));
dusuperobject.biblemap.put("b19_91_5", new dusuperobject(19,91,5,"Gij zult niet vrezen voor den schrik des nachts, voor den pijl, die des daags vliegt;"));
dusuperobject.biblemap.put("b19_91_6", new dusuperobject(19,91,6,"Voor de pestilentie, die in de donkerheid wandelt; voor het verderf, dat op den middag verwoest."));
dusuperobject.biblemap.put("b19_91_7", new dusuperobject(19,91,7,"Aan uw zijden zullen er duizend vallen, en tien duizend aan uw rechterhand; tot u zal het niet genaken."));
dusuperobject.biblemap.put("b19_91_8", new dusuperobject(19,91,8,"Alleenlijk zult gij het met uw ogen aanschouwen; en gij zult de vergelding der goddelozen zien."));
dusuperobject.biblemap.put("b19_91_9", new dusuperobject(19,91,9,"Want Gij, HEERE! zijt mijn Toevlucht! De Allerhoogste hebt gij gesteld tot uw Vertrek;"));
dusuperobject.biblemap.put("b19_91_10", new dusuperobject(19,91,10,"U zal geen kwaad wedervaren, en geen plage zal uw tent naderen."));
dusuperobject.biblemap.put("b19_91_11", new dusuperobject(19,91,11,"Want Hij zal Zijn engelen van u bevelen, dat zij u bewaren in al uw wegen."));
dusuperobject.biblemap.put("b19_91_12", new dusuperobject(19,91,12,"Zij zullen u op de handen dragen, opdat gij uw voet aan geen steen stoot."));
dusuperobject.biblemap.put("b19_91_13", new dusuperobject(19,91,13,"Op den fellen leeuw en de adder zult gij treden, gij zult den jongen leeuw en den draak vertreden."));
dusuperobject.biblemap.put("b19_91_14", new dusuperobject(19,91,14,"Dewijl hij Mij zeer bemint, spreekt God, zo zal Ik hem uithelpen; Ik zal hem op een hoogte stellen, want hij kent Mijn Naam."));
dusuperobject.biblemap.put("b19_91_15", new dusuperobject(19,91,15,"Hij zal Mij aanroepen, en Ik zal hem verhoren; in de benauwdheid zal Ik bij hem zijn. Ik zal er hem uittrekken, en zal hem verheerlijken."));
dusuperobject.biblemap.put("b19_91_16", new dusuperobject(19,91,16,"Ik zal hem met langheid der dagen verzadigen, en Ik zal hem Mijn heil doen zien."));
dusuperobject.biblemap.put("b19_92_1", new dusuperobject(19,92,1,"Een psalm, een lied, op den sabbatdag."));
dusuperobject.biblemap.put("b19_92_2", new dusuperobject(19,92,2,"Het is goed, dat men den HEERE love, en Uw Naam psalmzinge, o Allerhoogste!"));
dusuperobject.biblemap.put("b19_92_3", new dusuperobject(19,92,3,"Dat men in den morgenstond Uw goedertierenheid verkondige, en Uw getrouwheid in de nachten;"));
dusuperobject.biblemap.put("b19_92_4", new dusuperobject(19,92,4,"Op het tiensnarig instrument en op de luit, met een voorbedacht lied op de harp."));
dusuperobject.biblemap.put("b19_92_5", new dusuperobject(19,92,5,"Want Gij hebt mij verblijd, HEERE! met Uw daden, ik zal juichen over de werken Uwer handen."));
dusuperobject.biblemap.put("b19_92_6", new dusuperobject(19,92,6,"O HEERE! hoe groot zijn Uw werken! zeer diep zijn Uw gedachten."));
dusuperobject.biblemap.put("b19_92_7", new dusuperobject(19,92,7,"Een onvernuftig man weet er niet van, en een dwaas verstaat ditzelve niet;"));
dusuperobject.biblemap.put("b19_92_8", new dusuperobject(19,92,8,"Dat de goddelozen groeien als het kruid, en al de werkers der ongerechtigheid bloeien, opdat zij tot in der eeuwigheid verdelgd worden."));
dusuperobject.biblemap.put("b19_92_9", new dusuperobject(19,92,9,"Maar Gij zijt de Allerhoogste in eeuwigheid de HEERE!"));
dusuperobject.biblemap.put("b19_92_10", new dusuperobject(19,92,10,"Want zie, Uw vijanden, o HEERE! want zie, Uw vijanden zullen vergaan; al de werkers der ongerechtigheid zullen verstrooid worden."));
dusuperobject.biblemap.put("b19_92_11", new dusuperobject(19,92,11,"Maar Gij zult mijn hoorn verhogen, gelijk eens eenhoorns; ik ben met verse olie overgoten."));
dusuperobject.biblemap.put("b19_92_12", new dusuperobject(19,92,12,"En mijn oog zal mijn verspieders aanschouwen; mijn oren zullen het horen, aangaande de boosdoeners, die tegen mij opstaan."));
dusuperobject.biblemap.put("b19_92_13", new dusuperobject(19,92,13,"De rechtvaardige zal groeien als een palmboom; hij zal wassen als een cederboom op Libanon."));
dusuperobject.biblemap.put("b19_92_14", new dusuperobject(19,92,14,"Die in het huis des HEEREN geplant zijn, dien zal gegeven worden te groeien in de voorhoven onzes Gods."));
dusuperobject.biblemap.put("b19_92_15", new dusuperobject(19,92,15,"In den grijzen ouderdom zullen zij nog vruchten dragen; zij zullen vet en groen zijn, [ (Psalms 92:16) Om te verkondigen, dat de HEERE recht is; Hij is mijn Rotssteen, en in Hem is geen onrecht. ]"));
dusuperobject.biblemap.put("b19_93_1", new dusuperobject(19,93,1,"De HEERE regeert, Hij is met hoogheid bekleed; de HEERE is bekleed met sterkte, Hij heeft Zich omgord. Ook is de wereld bevestigd, zij zal niet wankelen."));
dusuperobject.biblemap.put("b19_93_2", new dusuperobject(19,93,2,"Van toen af is Uw troon bevestigd, Gij zijt van eeuwigheid af."));
dusuperobject.biblemap.put("b19_93_3", new dusuperobject(19,93,3,"De rivieren verheffen, o HEERE! de rivieren verheffen haar bruisen; de rivieren verheffen haar aanstoting."));
dusuperobject.biblemap.put("b19_93_4", new dusuperobject(19,93,4,"Doch de HEERE in de hoogte is geweldiger dan het bruisen van grote wateren, dan de geweldige baren der zee."));
dusuperobject.biblemap.put("b19_93_5", new dusuperobject(19,93,5,"Uw getuigenissen zijn zeer getrouw; de heiligheid is Uw huize sierlijk, HEERE! tot lange dagen."));
dusuperobject.biblemap.put("b19_94_1", new dusuperobject(19,94,1,"O God der wraken! o HEERE, God der wraken! verschijn blinkende."));
dusuperobject.biblemap.put("b19_94_2", new dusuperobject(19,94,2,"Gij, Rechter der aarde! verhef U; breng vergelding weder over de hovaardigen."));
dusuperobject.biblemap.put("b19_94_3", new dusuperobject(19,94,3,"Hoe lang zullen de goddelozen, o HEERE! hoe lang zullen de goddelozen van vreugde opspringen?"));
dusuperobject.biblemap.put("b19_94_4", new dusuperobject(19,94,4,"Uitgieten? hard spreken? alle werkers der ongerechtigheid zich beroemen?"));
dusuperobject.biblemap.put("b19_94_5", new dusuperobject(19,94,5,"O HEERE! zij verbrijzelen Uw volk, en zij verdrukken Uw erfdeel."));
dusuperobject.biblemap.put("b19_94_6", new dusuperobject(19,94,6,"De weduwe en den vreemdeling doden zij, en zij vermoorden de wezen."));
dusuperobject.biblemap.put("b19_94_7", new dusuperobject(19,94,7,"En zeggen: De HEERE ziet het niet, en de God van Jakob merkt het niet."));
dusuperobject.biblemap.put("b19_94_8", new dusuperobject(19,94,8,"Aanmerkt, gij onvernuftigen onder het volk! en gij dwazen! wanneer zult gij verstandig worden?"));
dusuperobject.biblemap.put("b19_94_9", new dusuperobject(19,94,9,"Zou Hij, Die het oor plant, niet horen? zou Hij, Die het oog formeert, niet aanschouwen?"));
dusuperobject.biblemap.put("b19_94_10", new dusuperobject(19,94,10,"Zou Hij, Die de heidenen tuchtigt, niet straffen, Hij, Die den mens wetenschap leert?"));
dusuperobject.biblemap.put("b19_94_11", new dusuperobject(19,94,11,"De HEERE weet de gedachten des mensen, dat zij ijdelheid zijn."));
dusuperobject.biblemap.put("b19_94_12", new dusuperobject(19,94,12,"Welgelukzalig is de man, o HEERE! dien Gij tuchtigt, en dien Gij leert uit Uw wet,"));
dusuperobject.biblemap.put("b19_94_13", new dusuperobject(19,94,13,"Om hem rust te geven van de kwade dagen; totdat de kuil voor den goddeloze gegraven wordt."));
dusuperobject.biblemap.put("b19_94_14", new dusuperobject(19,94,14,"Want de HEERE zal Zijn volk niet begeven, en Hij zal Zijn erve niet verlaten."));
dusuperobject.biblemap.put("b19_94_15", new dusuperobject(19,94,15,"Want het oordeel zal wederkeren tot de gerechtigheid; en alle oprechten van hart zullen hetzelve navolgen."));
dusuperobject.biblemap.put("b19_94_16", new dusuperobject(19,94,16,"Wie zal voor mij staan tegen de boosdoeners? Wie zal zich voor mij stellen tegen de werkers der ongerechtigheid?"));
dusuperobject.biblemap.put("b19_94_17", new dusuperobject(19,94,17,"Ten ware dat de HEERE mij een Hulp geweest ware, mijn ziel had bijna in de stilte gewoond."));
dusuperobject.biblemap.put("b19_94_18", new dusuperobject(19,94,18,"Als ik zeide: Mijn voet wankelt; Uw goedertierenheid, o HEERE! ondersteunde mij."));
dusuperobject.biblemap.put("b19_94_19", new dusuperobject(19,94,19,"Als mijn gedachten binnen in mij vermenigvuldigd werden, hebben Uw vertroostingen mijn ziel verkwikt."));
dusuperobject.biblemap.put("b19_94_20", new dusuperobject(19,94,20,"Zou zich de stoel der schadelijkheden met U vergezelschappen, die moeite verdicht bij inzetting?"));
dusuperobject.biblemap.put("b19_94_21", new dusuperobject(19,94,21,"Zij rotten zich samen tegen de ziel des rechtvaardigen, en zij verdoemen onschuldig bloed."));
dusuperobject.biblemap.put("b19_94_22", new dusuperobject(19,94,22,"Doch de HEERE is mij geweest tot een Hoog Vertrek, en mijn God tot een Steenrots mijner toevlucht."));
dusuperobject.biblemap.put("b19_94_23", new dusuperobject(19,94,23,"En Hij zal hun ongerechtigheid op hen doen wederkeren, en Hij zal hen in hun boosheid verdelgen; de HEERE, onze God, zal hen verdelgen."));
dusuperobject.biblemap.put("b19_95_1", new dusuperobject(19,95,1,"Komt, laat ons den HEERE vrolijk zingen; laat ons juichen den Rotssteen onzes heils."));
dusuperobject.biblemap.put("b19_95_2", new dusuperobject(19,95,2,"Laat ons Zijn aangezicht tegemoet gaan met lof; laat ons Hem juichen met psalmen."));
dusuperobject.biblemap.put("b19_95_3", new dusuperobject(19,95,3,"Want de HEERE is een groot God; ja, een groot Koning boven alle goden;"));
dusuperobject.biblemap.put("b19_95_4", new dusuperobject(19,95,4,"In Wiens hand de diepste plaatsen der aarde zijn, en de hoogten der bergen zijn Zijne;"));
dusuperobject.biblemap.put("b19_95_5", new dusuperobject(19,95,5,"Wiens ook de zee is, want Hij heeft ze gemaakt; en Zijn handen hebben het droge geformeerd."));
dusuperobject.biblemap.put("b19_95_6", new dusuperobject(19,95,6,"Komt, laat ons aanbidden en nederbukken; laat ons knielen voor den HEERE, Die ons gemaakt heeft."));
dusuperobject.biblemap.put("b19_95_7", new dusuperobject(19,95,7,"Want Hij is onze God, en wij zijn het volk Zijner weide, en de schapen Zijner hand. Heden, zo gij Zijn stem hoort,"));
dusuperobject.biblemap.put("b19_95_8", new dusuperobject(19,95,8,"Verhardt uw hart niet, gelijk te Meriba, gelijk ten dage van Massa in de woestijn;"));
dusuperobject.biblemap.put("b19_95_9", new dusuperobject(19,95,9,"Waar Mij uw vaders verzochten, Mij beproefden, ook Mijn werk zagen."));
dusuperobject.biblemap.put("b19_95_10", new dusuperobject(19,95,10,"Veertig jaren heb Ik verdriet gehad aan dit geslacht, en heb gezegd: Zij zijn een volk, dwalende van hart, en zij kennen Mijn wegen niet."));
dusuperobject.biblemap.put("b19_95_11", new dusuperobject(19,95,11,"Daarom heb Ik in Mijn toorn gezworen: Zo zij in Mijn rust zullen ingaan!"));
dusuperobject.biblemap.put("b19_96_1", new dusuperobject(19,96,1,"Zingt den HEERE een nieuw lied; zingt de HEERE, gij ganse aarde!"));
dusuperobject.biblemap.put("b19_96_2", new dusuperobject(19,96,2,"Zingt den HEERE, looft Zijn Naam; boodschapt Zijn heil van dag tot dag."));
dusuperobject.biblemap.put("b19_96_3", new dusuperobject(19,96,3,"Vertelt onder de heidenen Zijn eer, onder alle volken Zijn wonderen."));
dusuperobject.biblemap.put("b19_96_4", new dusuperobject(19,96,4,"Want de HEERE is groot, en zeer te prijzen; Hij is vreselijk boven alle goden."));
dusuperobject.biblemap.put("b19_96_5", new dusuperobject(19,96,5,"Want al de goden der volken zijn afgoden; maar de HEERE heeft de hemelen gemaakt."));
dusuperobject.biblemap.put("b19_96_6", new dusuperobject(19,96,6,"Majesteit en heerlijkheid zijn voor Zijn aangezicht, sterkte en sieraad in Zijn heiligdom."));
dusuperobject.biblemap.put("b19_96_7", new dusuperobject(19,96,7,"Geeft den HEERE, gij geslachten der volken! geeft den HEERE eer en sterkte."));
dusuperobject.biblemap.put("b19_96_8", new dusuperobject(19,96,8,"Geeft den HEERE de eer Zijns Naams; brengt offer, en komt in Zijn voorhoven."));
dusuperobject.biblemap.put("b19_96_9", new dusuperobject(19,96,9,"Aanbidt den HEERE in de heerlijkheid des heiligdoms; schrikt voor Zijn aangezicht, gij ganse aarde."));
dusuperobject.biblemap.put("b19_96_10", new dusuperobject(19,96,10,"Zegt onder de heidenen: De HEERE regeert; ook zal de wereld bevestigd worden, zij zal niet bewogen worden; Hij zal de volken richten in alle rechtmatigheid."));
dusuperobject.biblemap.put("b19_96_11", new dusuperobject(19,96,11,"Dat de hemelen zich verblijden, en de aarde zich verheuge, dat de zee bruise met haar volheid."));
dusuperobject.biblemap.put("b19_96_12", new dusuperobject(19,96,12,"Dat het veld huppele van vreugde met al wat er in is, dat dan al de bomen des wouds juichen."));
dusuperobject.biblemap.put("b19_96_13", new dusuperobject(19,96,13,"Voor het aangezicht des HEEREN; want Hij komt, want Hij komt, om de aarde te richten; Hij zal de wereld richten met gerechtigheid, en de volken met Zijn waarheid."));
dusuperobject.biblemap.put("b19_97_1", new dusuperobject(19,97,1,"De HEERE regeert, de aarde verheuge zich; dat veel eilanden zich verblijden."));
dusuperobject.biblemap.put("b19_97_2", new dusuperobject(19,97,2,"Rondom Hem zijn wolken en donkerheid, gerechtigheid en gericht zijn de vastigheid Zijns troons."));
dusuperobject.biblemap.put("b19_97_3", new dusuperobject(19,97,3,"Een vuur gaat voor Zijn aangezicht heen, en het steekt Zijn wederpartijen rondom aan brand."));
dusuperobject.biblemap.put("b19_97_4", new dusuperobject(19,97,4,"Zijn bliksemen verlichten de wereld; het aardrijk ziet ze en het beeft."));
dusuperobject.biblemap.put("b19_97_5", new dusuperobject(19,97,5,"De bergen smelten als was voor het aanschijn des HEEREN, voor het aanschijn des HEEREN der ganse aarde."));
dusuperobject.biblemap.put("b19_97_6", new dusuperobject(19,97,6,"De hemelen verkondigen Zijn gerechtigheid, en alle volken zien Zijn eer."));
dusuperobject.biblemap.put("b19_97_7", new dusuperobject(19,97,7,"Beschaamd moeten wezen allen, die de beelden dienen, die zich op afgoden beroemen; buigt u neder voor Hem, alle gij goden!"));
dusuperobject.biblemap.put("b19_97_8", new dusuperobject(19,97,8,"Sion heeft gehoord, en het heeft zich verblijd, en de dochteren van Juda hebben zich verheugd vanwege Uw oordelen, o HEERE!"));
dusuperobject.biblemap.put("b19_97_9", new dusuperobject(19,97,9,"Want Gij, HEERE! zijt de Allerhoogste over de gehele aarde; Gij zijt zeer hoog verheven boven alle goden."));
dusuperobject.biblemap.put("b19_97_10", new dusuperobject(19,97,10,"Gij liefhebbers des HEEREN! haat het kwade; Hij bewaart de zielen Zijner gunstgenoten; Hij redt hen uit der goddelozen hand."));
dusuperobject.biblemap.put("b19_97_11", new dusuperobject(19,97,11,"Het licht is voor den rechtvaardige gezaaid, en vrolijkheid voor de oprechten van hart."));
dusuperobject.biblemap.put("b19_97_12", new dusuperobject(19,97,12,"Gij rechtvaardigen! verblijdt u in den HEERE, en spreekt lof ter gedachtenis Zijner heiligheid."));
dusuperobject.biblemap.put("b19_98_1", new dusuperobject(19,98,1,"Een psalm. Zingt den HEERE een nieuw lied; want Hij heeft wonderen gedaan; Zijn rechterhand, en de arm Zijner heiligheid, heeft Hem heil gegeven."));
dusuperobject.biblemap.put("b19_98_2", new dusuperobject(19,98,2,"De HEERE heeft Zijn heil bekend gemaakt; Hij heeft Zijn gerechtigheid geopenbaard voor de ogen der heidenen."));
dusuperobject.biblemap.put("b19_98_3", new dusuperobject(19,98,3,"Hij is gedachtig geweest Zijner goedertierenheid, en Zijner waarheid aan het huis Israels; en al de einden der aarde hebben gezien het heil onzes Gods."));
dusuperobject.biblemap.put("b19_98_4", new dusuperobject(19,98,4,"Juicht den HEERE, gij ganse aarde! roept uit van vreugde, en zingt vrolijk, en psalmzingt."));
dusuperobject.biblemap.put("b19_98_5", new dusuperobject(19,98,5,"Psalmzingt den HEERE met de harp, met de harp en met de stem des gezangs,"));
dusuperobject.biblemap.put("b19_98_6", new dusuperobject(19,98,6,"Met trompetten en bazuinengeklank; juicht voor het aangezicht des Konings, des HEEREN."));
dusuperobject.biblemap.put("b19_98_7", new dusuperobject(19,98,7,"De zee bruise met haar volheid, de wereld met degenen, die daarin wonen."));
dusuperobject.biblemap.put("b19_98_8", new dusuperobject(19,98,8,"Dat de rivieren met de handen klappen, dat tegelijk de gebergten vreugde bedrijven,"));
dusuperobject.biblemap.put("b19_98_9", new dusuperobject(19,98,9,"Voor het aangezicht des HEEREN, want Hij komt, om de aarde te richten; Hij zal de wereld richten in gerechtigheid, en de volken in alle rechtmatigheid."));
dusuperobject.biblemap.put("b19_99_1", new dusuperobject(19,99,1,"De HEERE regeert, dat de volken beven; Hij zit tussen de cherubim; de aarde bewege zich."));
dusuperobject.biblemap.put("b19_99_2", new dusuperobject(19,99,2,"De HEERE is groot in Sion, en Hij is hoog boven alle volken."));
dusuperobject.biblemap.put("b19_99_3", new dusuperobject(19,99,3,"Dat zij Uw groten en vreselijken Naam loven, die heilig is;"));
dusuperobject.biblemap.put("b19_99_4", new dusuperobject(19,99,4,"En de sterkte des Konings, die het recht lief heeft. Gij hebt billijkheden bevestigd, Gij hebt recht en gerechtigheid gedaan in Jakob."));
dusuperobject.biblemap.put("b19_99_5", new dusuperobject(19,99,5,"Verheft den HEERE, onzen God, en buigt u neder voor de voetbank Zijner voeten; Hij is heilig!"));
dusuperobject.biblemap.put("b19_99_6", new dusuperobject(19,99,6,"Mozes en Aaron waren onder Zijn priesters, en Samuel onder de aanroepers Zijns Naams; zij riepen tot den HEERE, en Hij verhoorde hen."));
dusuperobject.biblemap.put("b19_99_7", new dusuperobject(19,99,7,"Hij sprak tot hen in een wolkkolom; zij hebben Zijn getuigenissen onderhouden, en de inzettingen, die Hij hun gegeven had."));
dusuperobject.biblemap.put("b19_99_8", new dusuperobject(19,99,8,"O HEERE, onze God! Gij hebt hen verhoord, Gij zijt hun geweest een vergevend God, hoewel wraak doende over hun daden."));
dusuperobject.biblemap.put("b19_99_9", new dusuperobject(19,99,9,"Verheft den HEERE, onzen God, en buigt u voor den berg Zijner heiligheid; want de HEERE, onze God, is heilig."));
dusuperobject.biblemap.put("b19_100_1", new dusuperobject(19,100,1,"Een lofzang. Gij ganse aarde! juicht den HEERE."));
dusuperobject.biblemap.put("b19_100_2", new dusuperobject(19,100,2,"Dient den HEERE met blijdschap, komt voor Zijn aanschijn met vrolijk gezang."));
dusuperobject.biblemap.put("b19_100_3", new dusuperobject(19,100,3,"Weet, dat de HEERE is God; Hij heeft ons gemaakt (en niet wij), Zijn volk en de schapen Zijner weide."));
dusuperobject.biblemap.put("b19_100_4", new dusuperobject(19,100,4,"Gaat in tot Zijn poorten met lof, in Zijn voorhoven met lofgezang; looft Hem, prijst Zijn Naam."));
dusuperobject.biblemap.put("b19_100_5", new dusuperobject(19,100,5,"Want de HEERE is goed; Zijn goedertierenheid is in der eeuwigheid, en Zijn getrouwheid van geslacht tot geslacht."));
dusuperobject.biblemap.put("b19_11_1", new dusuperobject(19,11,1,"Een psalm van David. Ik zal van goedertierenheid en recht zingen; U zal ik psalmzingen, o HEERE!"));
dusuperobject.biblemap.put("b19_11_2", new dusuperobject(19,11,2,"Ik zal verstandelijk handelen in den oprechten weg; wanneer zult Gij tot mij komen? Ik zal in het midden mijns huizes wandelen, in oprechtigheid mijns harten."));
dusuperobject.biblemap.put("b19_11_3", new dusuperobject(19,11,3,"Ik zal geen Belials-stuk voor mijn ogen stellen; ik haat het doen der afvalligen, het zal mij niet aankleven."));
dusuperobject.biblemap.put("b19_11_4", new dusuperobject(19,11,4,"Het verkeerde hart zal van mij wijken; den boze zal ik niet kennen."));
dusuperobject.biblemap.put("b19_11_5", new dusuperobject(19,11,5,"Die zijn naaste in het heimelijke achterklapt; dien zal ik verdelgen; die hoog van ogen is, en trots van hart, die zal ik niet vermogen."));
dusuperobject.biblemap.put("b19_11_6", new dusuperobject(19,11,6,"Mijn ogen zullen zijn op de getrouwen in het land, dat zij bij mij zitten; die in den oprechten weg wandelt, die zal mij dienen."));
dusuperobject.biblemap.put("b19_11_7", new dusuperobject(19,11,7,"Wie bedrog pleegt, zal binnen mijn huis niet blijven; die leugenen spreekt, zal voor mijn ogen niet bevestigd worden."));
dusuperobject.biblemap.put("b19_11_8", new dusuperobject(19,11,8,"Allen morgen zal ik alle goddelozen des lands verdelgen, om uit de stad des HEEREN alle werkers der ongerechtigheid uit te roeien."));
dusuperobject.biblemap.put("b19_12_1", new dusuperobject(19,12,1,"Een gebed des verdrukten, als hij overstelpt is, en zijn klacht uitstort voor het aangezicht des HEEREN."));
dusuperobject.biblemap.put("b19_12_2", new dusuperobject(19,12,2,"O HEERE! hoor mijn gebed, en laat mijn geroep tot U komen."));
dusuperobject.biblemap.put("b19_12_3", new dusuperobject(19,12,3,"Verberg Uw aangezicht niet voor mij, neig Uw oor tot mij ten dage mijner benauwdheid; ten dagen als ik roep, verhoor mij haastelijk."));
dusuperobject.biblemap.put("b19_12_4", new dusuperobject(19,12,4,"Want mijn dagen zijn vergaan als rook, en mijn gebeenten zijn uitgebrand als een haard."));
dusuperobject.biblemap.put("b19_12_5", new dusuperobject(19,12,5,"Mijn hart is geslagen en verdord als gras, zodat ik vergeten heb mijn brood te eten."));
dusuperobject.biblemap.put("b19_12_6", new dusuperobject(19,12,6,"Mijn gebeente kleeft aan mijn vlees, vanwege de stem mijns zuchtens."));
dusuperobject.biblemap.put("b19_12_7", new dusuperobject(19,12,7,"Ik ben een roerdomp der woestijn gelijk geworden, ik ben geworden als een steenuil der wildernissen."));
dusuperobject.biblemap.put("b19_12_8", new dusuperobject(19,12,8,"Ik waak, en ben geworden als een eenzame mus op het dak."));
dusuperobject.biblemap.put("b19_12_9", new dusuperobject(19,12,9,"Mijn vijanden smaden mij al den dag; die tegen mij razen, zweren bij mij."));
dusuperobject.biblemap.put("b19_12_10", new dusuperobject(19,12,10,"Want ik eet as als brood, en vermeng mijn drank met tranen."));
dusuperobject.biblemap.put("b19_12_11", new dusuperobject(19,12,11,"Vanwege Uw verstoordheid en Uw groten toorn; want Gij hebt mij verheven, en mij weder nedergeworpen."));
dusuperobject.biblemap.put("b19_12_12", new dusuperobject(19,12,12,"Mijn dagen zijn als een afgaande schaduw, en ik verdor als gras."));
dusuperobject.biblemap.put("b19_12_13", new dusuperobject(19,12,13,"Maar Gij, HEERE! blijft in eeuwigheid, en Uw gedachtenis van geslacht tot geslacht."));
dusuperobject.biblemap.put("b19_12_14", new dusuperobject(19,12,14,"Gij zult opstaan, Gij zult U ontfermen over Sion, want de tijd om haar genadig te zijn, want de bestemde tijd is gekomen."));
dusuperobject.biblemap.put("b19_12_15", new dusuperobject(19,12,15,"Want Uw knechten hebben een welgevallen aan haar stenen, en hebben medelijden met haar gruis."));
dusuperobject.biblemap.put("b19_12_16", new dusuperobject(19,12,16,"Dan zullen de heidenen den Naam des HEEREN vrezen, en alle koningen der aarde Uw heerlijkheid."));
dusuperobject.biblemap.put("b19_12_17", new dusuperobject(19,12,17,"Als de HEERE Sion zal opgebouwd hebben, in Zijn heerlijkheid zal verschenen zijn,"));
dusuperobject.biblemap.put("b19_12_18", new dusuperobject(19,12,18,"Zich gewend zal hebben tot het gebed desgenen, die gans ontbloot is, en niet versmaad hebben hunlieder gebed;"));
dusuperobject.biblemap.put("b19_12_19", new dusuperobject(19,12,19,"Dat zal geschreven worden voor het navolgende geslacht; en het volk, dat geschapen zal worden, zal den HEERE loven;"));
dusuperobject.biblemap.put("b19_12_20", new dusuperobject(19,12,20,"Omdat Hij uit de hoogte Zijns heiligdoms zal hebben nederwaarts gezien; dat de HEERE uit den hemel op de aarde geschouwd zal hebben;"));
dusuperobject.biblemap.put("b19_12_21", new dusuperobject(19,12,21,"Om het zuchten der gevangenen te horen, om los te maken de kinderen des doods;"));
dusuperobject.biblemap.put("b19_12_22", new dusuperobject(19,12,22,"Opdat men den Naam des HEEREN vertelle te Sion, en Zijn lof te Jeruzalem;"));
dusuperobject.biblemap.put("b19_12_23", new dusuperobject(19,12,23,"Wanneer de volken samen zullen vergaderd worden, ook de koninkrijken, om den HEERE te dienen."));
dusuperobject.biblemap.put("b19_12_24", new dusuperobject(19,12,24,"Hij heeft mijn kracht op den weg ter nedergedrukt; mijn dagen heeft Hij verkort."));
dusuperobject.biblemap.put("b19_12_25", new dusuperobject(19,12,25,"Ik zeide: Mijn God! neem mij niet weg in het midden mijner dagen; Uw jaren zijn van geslacht tot geslacht."));
dusuperobject.biblemap.put("b19_12_26", new dusuperobject(19,12,26,"Gij hebt voormaals de aarde gegrond, en de hemelen zijn het werk Uwer handen;"));
dusuperobject.biblemap.put("b19_12_27", new dusuperobject(19,12,27,"Die zullen vergaan, maar Gij zult staande blijven; en zij alle zullen als een kleed verouden; Gij zult ze veranderen als een gewaad, en zij zullen veranderd zijn."));
dusuperobject.biblemap.put("b19_12_28", new dusuperobject(19,12,28,"Maar Gij zijt Dezelfde, en Uw jaren zullen niet geeindigd worden. [ (Psalms 102:29) De kinderen Uwer knechten zullen wonen, en hun zaad zal voor Uw aangezicht bevestigd worden. ]"));
dusuperobject.biblemap.put("b19_13_1", new dusuperobject(19,13,1,"Een psalm van David. Loof den HEERE, mijn ziel, en al wat binnen in mij is, Zijn heiligen Naam."));
dusuperobject.biblemap.put("b19_13_2", new dusuperobject(19,13,2,"Loof den HEERE, mijn ziel, en vergeet geen van Zijn weldaden;"));
dusuperobject.biblemap.put("b19_13_3", new dusuperobject(19,13,3,"Die al uw ongerechtigheid vergeeft, die al uw krankheden geneest;"));
dusuperobject.biblemap.put("b19_13_4", new dusuperobject(19,13,4,"Die uw leven verlost van het verderf, die u kroont met goedertierenheid en barmhartigheden;"));
dusuperobject.biblemap.put("b19_13_5", new dusuperobject(19,13,5,"Die uw mond verzadigt met het goede, uw jeugd vernieuwt als eens arends."));
dusuperobject.biblemap.put("b19_13_6", new dusuperobject(19,13,6,"De HEERE doet gerechtigheid en gerichten al dengenen, die onderdrukt worden."));
dusuperobject.biblemap.put("b19_13_7", new dusuperobject(19,13,7,"Hij heeft Mozes Zijn wegen bekend gemaakt, den kinderen Israels Zijn daden."));
dusuperobject.biblemap.put("b19_13_8", new dusuperobject(19,13,8,"Barmhartig en genadig is de HEERE, lankmoedig en groot van goedertierenheid."));
dusuperobject.biblemap.put("b19_13_9", new dusuperobject(19,13,9,"Hij zal niet altoos twisten, noch eeuwiglijk den toorn behouden."));
dusuperobject.biblemap.put("b19_13_10", new dusuperobject(19,13,10,"Hij doet ons niet naar onze zonden, en vergeldt ons niet naar onze ongerechtigheden."));
dusuperobject.biblemap.put("b19_13_11", new dusuperobject(19,13,11,"Want zo hoog de hemel is boven de aarde, is Zijn goedertierenheid geweldig over degenen, die Hem vrezen."));
dusuperobject.biblemap.put("b19_13_12", new dusuperobject(19,13,12,"Zo ver het oosten is van het westen, zo ver doet Hij onze overtredingen van ons."));
dusuperobject.biblemap.put("b19_13_13", new dusuperobject(19,13,13,"Gelijk zich een vader ontfermt over de kinderen, ontfermt Zich de HEERE over degenen, die Hem vrezen."));
dusuperobject.biblemap.put("b19_13_14", new dusuperobject(19,13,14,"Want Hij weet, wat maaksel wij zijn, gedachtig zijnde, dat wij stof zijn."));
dusuperobject.biblemap.put("b19_13_15", new dusuperobject(19,13,15,"De dagen des mensen zijn als het gras, gelijk een bloem des velds, alzo bloeit hij."));
dusuperobject.biblemap.put("b19_13_16", new dusuperobject(19,13,16,"Als de wind daarover gegaan is, zo is zij niet meer, en haar plaats kent haar niet meer."));
dusuperobject.biblemap.put("b19_13_17", new dusuperobject(19,13,17,"Maar de goedertierenheid des HEEREN is van eeuwigheid en tot eeuwigheid over degenen, die Hem vrezen, en Zijn gerechtigheid aan kindskinderen;"));
dusuperobject.biblemap.put("b19_13_18", new dusuperobject(19,13,18,"Aan degenen, die Zijn verbond houden, en die aan Zijn bevelen denken, om die te doen."));
dusuperobject.biblemap.put("b19_13_19", new dusuperobject(19,13,19,"De HEERE heeft Zijn troon in de hemelen bevestigd, en Zijn Koninkrijk heerst over alles."));
dusuperobject.biblemap.put("b19_13_20", new dusuperobject(19,13,20,"Looft den HEERE, Zijn engelen! gij krachtige helden, die Zijn woord doet, gehoorzamende de stem Zijns woords."));
dusuperobject.biblemap.put("b19_13_21", new dusuperobject(19,13,21,"Looft den HEERE, al Zijn heirscharen! gij Zijn dienaars, die Zijn welbehagen doet!"));
dusuperobject.biblemap.put("b19_13_22", new dusuperobject(19,13,22,"Looft den HEERE, al Zijn werken! aan alle plaatsen Zijner heerschappij. Loof den HEERE, mijn ziel!"));
dusuperobject.biblemap.put("b19_14_1", new dusuperobject(19,14,1,"Loof den HEERE, mijn ziel! O HEERE, mijn God! Gij zijt zeer groot, Gij zijt bekleed met majesteit en heerlijkheid."));
dusuperobject.biblemap.put("b19_14_2", new dusuperobject(19,14,2,"Hij bedekt Zich met het licht, als met een kleed; Hij rekt den hemel uit als een gordijn."));
dusuperobject.biblemap.put("b19_14_3", new dusuperobject(19,14,3,"Die Zijn opperzalen zoldert in de wateren, Die van de wolken Zijn wagen maakt, Die op de vleugelen des winds wandelt."));
dusuperobject.biblemap.put("b19_14_4", new dusuperobject(19,14,4,"Hij maakt Zijn engelen geesten, Zijn dienaars tot een vlammend vuur."));
dusuperobject.biblemap.put("b19_14_5", new dusuperobject(19,14,5,"Hij heeft de aarde gegrond op haar grondvesten; zij zal nimmermeer noch eeuwiglijk wankelen."));
dusuperobject.biblemap.put("b19_14_6", new dusuperobject(19,14,6,"Gij hadt ze met den afgrond als een kleed overdekt; de wateren stonden boven de bergen."));
dusuperobject.biblemap.put("b19_14_7", new dusuperobject(19,14,7,"Van Uw schelden vloden zij, zij haastten zich weg voor de stem Uws donders."));
dusuperobject.biblemap.put("b19_14_8", new dusuperobject(19,14,8,"De bergen rezen op, de dalen daalden, ter plaatse, die Gij voor hen gegrond hadt."));
dusuperobject.biblemap.put("b19_14_9", new dusuperobject(19,14,9,"Gij hebt een paal gesteld, dien zij niet overgaan zullen; zij zullen de aarde niet weder bedekken."));
dusuperobject.biblemap.put("b19_14_10", new dusuperobject(19,14,10,"Die de fonteinen uitzendt door de dalen, dat zij tussen de gebergten henen wandelen."));
dusuperobject.biblemap.put("b19_14_11", new dusuperobject(19,14,11,"Zij drenken al het gedierte des velds; de woudezels breken er hun dorst mede."));
dusuperobject.biblemap.put("b19_14_12", new dusuperobject(19,14,12,"Bij dezelve woont het gevogelte des hemels, een stem gevende van tussen de takken."));
dusuperobject.biblemap.put("b19_14_13", new dusuperobject(19,14,13,"Hij drenkt de bergen uit Zijn opperzalen; de aarde wordt verzadigd van de vrucht Uwer werken."));
dusuperobject.biblemap.put("b19_14_14", new dusuperobject(19,14,14,"Hij doet het gras uitspruiten voor de beesten, en het kruid tot dienst des mensen, doende het brood uit de aarde voortkomen."));
dusuperobject.biblemap.put("b19_14_15", new dusuperobject(19,14,15,"En den wijn, die het hart des mensen verheugt, doende het aangezicht blinken van olie; en het brood, dat het hart des mensen sterkt."));
dusuperobject.biblemap.put("b19_14_16", new dusuperobject(19,14,16,"De bomen des HEEREN worden verzadigd, de cederbomen van Libanon, die Hij geplant heeft;"));
dusuperobject.biblemap.put("b19_14_17", new dusuperobject(19,14,17,"Alwaar de vogeltjes nestelen; des ooievaars huis zijn de dennebomen."));
dusuperobject.biblemap.put("b19_14_18", new dusuperobject(19,14,18,"De hoge bergen zijn voor de steenbokken; de steenrotsen zijn een vertrek voor de konijnen."));
dusuperobject.biblemap.put("b19_14_19", new dusuperobject(19,14,19,"Hij heeft de maan gemaakt tot de gezette tijden, de zon weet haar ondergang."));
dusuperobject.biblemap.put("b19_14_20", new dusuperobject(19,14,20,"Gij beschikt de duisternis, en het wordt nacht, in denwelken al het gedierte des wouds uittreedt:"));
dusuperobject.biblemap.put("b19_14_21", new dusuperobject(19,14,21,"De jonge leeuwen, briesende om een roof, en om hun spijs van God te zoeken."));
dusuperobject.biblemap.put("b19_14_22", new dusuperobject(19,14,22,"De zon opgaande, maken zij zich weg, en liggen neder in hun holen."));
dusuperobject.biblemap.put("b19_14_23", new dusuperobject(19,14,23,"De mens gaat dan uit tot zijn werk, en naar zijn arbeid tot den avond toe."));
dusuperobject.biblemap.put("b19_14_24", new dusuperobject(19,14,24,"Hoe groot zijn Uw werken, o HEERE! Gij hebt ze alle met wijsheid gemaakt; het aardrijk is vol van Uw goederen."));
dusuperobject.biblemap.put("b19_14_25", new dusuperobject(19,14,25,"Deze zee, die groot en wijd van ruimte is, daarin is het wriemelende gedierte, en dat zonder getal, kleine gedierten met grote."));
dusuperobject.biblemap.put("b19_14_26", new dusuperobject(19,14,26,"Daar wandelen de schepen, en de Leviathan, dien Gij geformeerd hebt, om daarin te spelen."));
dusuperobject.biblemap.put("b19_14_27", new dusuperobject(19,14,27,"Zij allen wachten op U, dat Gij hun hun spijze geeft te zijner tijd."));
dusuperobject.biblemap.put("b19_14_28", new dusuperobject(19,14,28,"Geeft Gij ze hun, zij vergaderen ze; doet Gij Uw hand open, zij worden met goed verzadigd."));
dusuperobject.biblemap.put("b19_14_29", new dusuperobject(19,14,29,"Verbergt Gij Uw aangezicht, zij worden verschrikt; neemt Gij hun adem weg, zij sterven, en zij keren weder tot hun stof."));
dusuperobject.biblemap.put("b19_14_30", new dusuperobject(19,14,30,"Zendt Gij Uw Geest uit, zo worden zij geschapen, en Gij vernieuwt het gelaat des aardrijks."));
dusuperobject.biblemap.put("b19_14_31", new dusuperobject(19,14,31,"De heerlijkheid des HEEREN zij tot in der eeuwigheid; de HEERE verblijde Zich in Zijn werken."));
dusuperobject.biblemap.put("b19_14_32", new dusuperobject(19,14,32,"Als Hij de aarde aanschouwt, zo beeft zij; als Hij de bergen aanroert, zo roken zij."));
dusuperobject.biblemap.put("b19_14_33", new dusuperobject(19,14,33,"Ik zal den HEERE zingen in mijn leven; ik zal mijn God psalmzingen, terwijl ik nog ben."));
dusuperobject.biblemap.put("b19_14_34", new dusuperobject(19,14,34,"Mijn overdenking van Hem zal zoet zijn; ik zal mij in den HEERE verblijden."));
dusuperobject.biblemap.put("b19_14_35", new dusuperobject(19,14,35,"De zondaars zullen van de aarde verdaan worden, en de goddelozen zullen niet meer zijn. Loof den HEERE, mijn ziel! Hallelujah!"));
dusuperobject.biblemap.put("b19_15_1", new dusuperobject(19,15,1,"Looft den HEERE, roept Zijn Naam aan, maakt Zijn daden bekend onder de volken."));
dusuperobject.biblemap.put("b19_15_2", new dusuperobject(19,15,2,"Zingt Hem, psalmzingt Hem, spreekt aandachtelijk van al Zijn wonderen."));
dusuperobject.biblemap.put("b19_15_3", new dusuperobject(19,15,3,"Roemt u in den Naam Zijner heiligheid; het hart dergenen, die den HEERE zoeken, verblijde zich."));
dusuperobject.biblemap.put("b19_15_4", new dusuperobject(19,15,4,"Vraagt naar den HEERE en Zijn sterkte; zoekt Zijn aangezicht geduriglijk."));
dusuperobject.biblemap.put("b19_15_5", new dusuperobject(19,15,5,"Gedenkt Zijner wonderen, die Hij gedaan heeft, Zijner wondertekenen, en der oordelen Zijns monds."));
dusuperobject.biblemap.put("b19_15_6", new dusuperobject(19,15,6,"Gij zaad van Abraham, Zijn knecht, gij kinderen van Jakob, Zijn uitverkorene!"));
dusuperobject.biblemap.put("b19_15_7", new dusuperobject(19,15,7,"Hij is de HEERE, onze God; Zijn oordelen zijn over de gehele aarde."));
dusuperobject.biblemap.put("b19_15_8", new dusuperobject(19,15,8,"Hij gedenkt Zijns verbonds tot in der eeuwigheid, des woords, dat Hij ingesteld heeft, tot in duizend geslachten;"));
dusuperobject.biblemap.put("b19_15_9", new dusuperobject(19,15,9,"Des verbonds, dat Hij met Abraham heeft gemaakt, en Zijns eeds aan Izak;"));
dusuperobject.biblemap.put("b19_15_10", new dusuperobject(19,15,10,"Welken Hij ook gesteld heeft aan Jakob tot een inzetting, aan Israel tot een eeuwig verbond,"));
dusuperobject.biblemap.put("b19_15_11", new dusuperobject(19,15,11,"Zeggende: Ik zal u geven het land Kanaan, het snoer van ulieder erfdeel."));
dusuperobject.biblemap.put("b19_15_12", new dusuperobject(19,15,12,"Als zij weinig mensen in getal waren, ja, weinig en vreemdelingen daarin;"));
dusuperobject.biblemap.put("b19_15_13", new dusuperobject(19,15,13,"En wandelden van volk tot volk, van het ene koninkrijk tot het andere volk;"));
dusuperobject.biblemap.put("b19_15_14", new dusuperobject(19,15,14,"Hij liet geen mens toe hen te onderdrukken; ook bestrafte Hij koningen om hunnentwil, zeggende:"));
dusuperobject.biblemap.put("b19_15_15", new dusuperobject(19,15,15,"Tast Mijn gezalfden niet aan, en doet Mijn profeten geen kwaad."));
dusuperobject.biblemap.put("b19_15_16", new dusuperobject(19,15,16,"Hij riep ook een honger in het land; Hij brak allen staf des broods."));
dusuperobject.biblemap.put("b19_15_17", new dusuperobject(19,15,17,"Hij zond een man voor hun aangezicht henen; Jozef werd verkocht tot een slaaf."));
dusuperobject.biblemap.put("b19_15_18", new dusuperobject(19,15,18,"Men drukte zijn voeten in den stok; zijn persoon kwam in de ijzers."));
dusuperobject.biblemap.put("b19_15_19", new dusuperobject(19,15,19,"Tot den tijd toe, dat Zijn woord kwam, heeft hem de rede des HEEREN doorlouterd."));
dusuperobject.biblemap.put("b19_15_20", new dusuperobject(19,15,20,"De koning zond, en deed hem ontslaan; de heerser der volken liet hem los."));
dusuperobject.biblemap.put("b19_15_21", new dusuperobject(19,15,21,"Hij zette hem tot een heer over zijn huis, en tot een heerser over al zijn goed;"));
dusuperobject.biblemap.put("b19_15_22", new dusuperobject(19,15,22,"Om zijn vorsten te binden naar zijn lust, en zijn oudsten te onderwijzen."));
dusuperobject.biblemap.put("b19_15_23", new dusuperobject(19,15,23,"Daarna kwam Israel in Egypte, en Jakob verkeerde als vreemdeling in het land van Cham."));
dusuperobject.biblemap.put("b19_15_24", new dusuperobject(19,15,24,"En Hij deed Zijn volk zeer wassen, en maakte het machtiger dan Zijn tegenpartijders."));
dusuperobject.biblemap.put("b19_15_25", new dusuperobject(19,15,25,"Hij keerde hun hart om, dat zij Zijn volk haatten, dat zij met Zijn knechten listiglijk handelden."));
dusuperobject.biblemap.put("b19_15_26", new dusuperobject(19,15,26,"Hij zond Mozes, Zijn knecht, en Aaron, dien Hij verkoren had."));
dusuperobject.biblemap.put("b19_15_27", new dusuperobject(19,15,27,"Zij deden onder hen de bevelen Zijner tekenen, en de wonderwerken in het land van Cham."));
dusuperobject.biblemap.put("b19_15_28", new dusuperobject(19,15,28,"Hij zond duisternis, en maakte het duister; en zij waren Zijn woord niet wederspannig."));
dusuperobject.biblemap.put("b19_15_29", new dusuperobject(19,15,29,"Hij keerde hun wateren in bloed, en Hij doodde hun vissen."));
dusuperobject.biblemap.put("b19_15_30", new dusuperobject(19,15,30,"Hun land bracht vorsen voort in overvloed, tot in de binnenste kameren hunner koningen."));
dusuperobject.biblemap.put("b19_15_31", new dusuperobject(19,15,31,"Hij sprak, en er kwam een vermenging van ongedierte, luizen, in hun ganse landpale."));
dusuperobject.biblemap.put("b19_15_32", new dusuperobject(19,15,32,"Hij maakte hun regen tot hagel, vlammig vuur in hun land."));
dusuperobject.biblemap.put("b19_15_33", new dusuperobject(19,15,33,"En Hij sloeg hun wijnstok en hun vijgeboom, en Hij brak het geboomte hunner landpalen."));
dusuperobject.biblemap.put("b19_15_34", new dusuperobject(19,15,34,"Hij sprak, en er kwamen sprinkhanen en kevers, en dat zonder getal;"));
dusuperobject.biblemap.put("b19_15_35", new dusuperobject(19,15,35,"Die al het kruid in hun land opaten, ja, aten de vrucht hunner landbouwe op."));
dusuperobject.biblemap.put("b19_15_36", new dusuperobject(19,15,36,"Hij versloeg ook alle eerstgeborenen in hun land, de eerstelingen al hunner krachten."));
dusuperobject.biblemap.put("b19_15_37", new dusuperobject(19,15,37,"En Hij voerde hen uit met zilver en goud; en onder hun stammen was niemand, die struikelde."));
dusuperobject.biblemap.put("b19_15_38", new dusuperobject(19,15,38,"Egypte was blijde, als zij uittrokken, want hun verschrikking was op hen gevallen."));
dusuperobject.biblemap.put("b19_15_39", new dusuperobject(19,15,39,"Hij breidde een wolk uit tot een deksel, en vuur om den nacht te verlichten."));
dusuperobject.biblemap.put("b19_15_40", new dusuperobject(19,15,40,"Zij baden, en Hij deed kwakkelen komen, en Hij verzadigde hen met hemels brood."));
dusuperobject.biblemap.put("b19_15_41", new dusuperobject(19,15,41,"Hij opende een steenrots, en er vloeiden wateren uit, die gingen door de dorre plaatsen als een rivier."));
dusuperobject.biblemap.put("b19_15_42", new dusuperobject(19,15,42,"Want Hij dacht aan Zijn heilig woord, aan Abraham, Zijn knecht."));
dusuperobject.biblemap.put("b19_15_43", new dusuperobject(19,15,43,"Alzo voerde Hij Zijn volk uit met vrolijkheid, Zijn uitverkorenen met gejuich."));
dusuperobject.biblemap.put("b19_15_44", new dusuperobject(19,15,44,"En Hij gaf hun de landen der heidenen, zodat zij in erfenis bezaten den arbeid der volken;"));
dusuperobject.biblemap.put("b19_15_45", new dusuperobject(19,15,45,"Opdat zij Zijn inzettingen onderhielden, en Zijn wetten bewaarden. Hallelujah!"));
dusuperobject.biblemap.put("b19_16_1", new dusuperobject(19,16,1,"Hallelujah! Looft den HEERE, want Hij is goed, want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_16_2", new dusuperobject(19,16,2,"Wie zal de mogendheden des HEEREN uitspreken, al Zijn lof verkondigen?"));
dusuperobject.biblemap.put("b19_16_3", new dusuperobject(19,16,3,"Welgelukzalig zijn zij, die het recht onderhouden, die te aller tijd gerechtigheid doet."));
dusuperobject.biblemap.put("b19_16_4", new dusuperobject(19,16,4,"Gedenk mijner, o HEERE! naar het welbehagen tot Uw volk, bezoek mij met Uw heil;"));
dusuperobject.biblemap.put("b19_16_5", new dusuperobject(19,16,5,"Opdat ik aanschouwe het goede Uwer uitverkorenen; opdat ik mij verblijde met de blijdschap Uws volks; opdat ik mij beroeme met Uw erfdeel."));
dusuperobject.biblemap.put("b19_16_6", new dusuperobject(19,16,6,"Wij hebben gezondigd, mitsgaders onze vaderen, wij hebben verkeerdelijk gedaan; wij hebben goddelooslijk gehandeld."));
dusuperobject.biblemap.put("b19_16_7", new dusuperobject(19,16,7,"Onze vaders in Egypte hebben niet gelet op Uw wonderen; zij zijn der menigte Uwer goedertierenheid niet gedachtig geweest; maar zij waren wederspannig aan de zee, bij de Schelfzee."));
dusuperobject.biblemap.put("b19_16_8", new dusuperobject(19,16,8,"Doch Hij verloste hen om Zijns Naams wil, opdat Hij Zijn mogendheid bekend maakte."));
dusuperobject.biblemap.put("b19_16_9", new dusuperobject(19,16,9,"En Hij schold de Schelfzee, zodat zij verdroogde, en Hij deed hen wandelen door de afgronden, als door een woestijn."));
dusuperobject.biblemap.put("b19_16_10", new dusuperobject(19,16,10,"En Hij verloste hen uit de hand des haters, en Hij bevrijdde hen van de hand des vijands."));
dusuperobject.biblemap.put("b19_16_11", new dusuperobject(19,16,11,"En de wateren overdekten hun wederpartijders; niet een van hen bleef over."));
dusuperobject.biblemap.put("b19_16_12", new dusuperobject(19,16,12,"Toen geloofden zij aan Zijn woorden; zij zongen Zijn lof."));
dusuperobject.biblemap.put("b19_16_13", new dusuperobject(19,16,13,"Doch zij vergaten haast Zijn werken, zij verbeidden naar Zijn raad niet."));
dusuperobject.biblemap.put("b19_16_14", new dusuperobject(19,16,14,"Maar zij werden belust met lust in de woestijn, en zij verzochten God in de wildernis."));
dusuperobject.biblemap.put("b19_16_15", new dusuperobject(19,16,15,"Toen gaf Hij hun hun begeerte; maar Hij zond aan hun zielen een magerheid."));
dusuperobject.biblemap.put("b19_16_16", new dusuperobject(19,16,16,"En zij benijdden Mozes in het leger, en Aaron, den heilige des HEEREN."));
dusuperobject.biblemap.put("b19_16_17", new dusuperobject(19,16,17,"De aarde deed zich open, en verslond Dathan, en overdekte de vergadering van Abiram."));
dusuperobject.biblemap.put("b19_16_18", new dusuperobject(19,16,18,"En een vuur brandde onder hun vergadering, een vlam stak de goddelozen aan brand."));
dusuperobject.biblemap.put("b19_16_19", new dusuperobject(19,16,19,"Zij maakten een kalf bij Horeb, en zij bogen zich voor een gegoten beeld."));
dusuperobject.biblemap.put("b19_16_20", new dusuperobject(19,16,20,"En zij veranderden hun Eer in de gedaante van een os, die gras eet."));
dusuperobject.biblemap.put("b19_16_21", new dusuperobject(19,16,21,"Zij vergaten God, hun Heiland, Die grote dingen gedaan had in Egypte;"));
dusuperobject.biblemap.put("b19_16_22", new dusuperobject(19,16,22,"Wonderdaden in het land van Cham; vreselijke dingen aan de Schelfzee."));
dusuperobject.biblemap.put("b19_16_23", new dusuperobject(19,16,23,"Dies Hij zeide, dat Hij hen verdelgen zou, ten ware Mozes, Zijn uitverkorene, in de scheure voor Zijn aangezicht gestaan had, om Zijn grimmigheid af te keren, dat Hij hen niet verdierf."));
dusuperobject.biblemap.put("b19_16_24", new dusuperobject(19,16,24,"Zij versmaadden ook het gewenste land; zij geloofden Zijn woord niet."));
dusuperobject.biblemap.put("b19_16_25", new dusuperobject(19,16,25,"Maar zij murmureerden in hun tenten; naar de stem des HEEREN hoorden zij niet."));
dusuperobject.biblemap.put("b19_16_26", new dusuperobject(19,16,26,"Dies hief Hij tegen hen Zijn hand op, zwerende dat Hij hen nedervellen zou in de woestijn;"));
dusuperobject.biblemap.put("b19_16_27", new dusuperobject(19,16,27,"En dat Hij hun zaad zou nedervellen onder de heidenen, en hen verstrooien zou door de landen."));
dusuperobject.biblemap.put("b19_16_28", new dusuperobject(19,16,28,"Ook hebben zij zich gekoppeld aan Baal-Peor, en zij hebben de offeranden der doden gegeten."));
dusuperobject.biblemap.put("b19_16_29", new dusuperobject(19,16,29,"En zij hebben den HEERE tot toorn verwekt met hun daden, zodat de plaag een inbreuk onder hen deed."));
dusuperobject.biblemap.put("b19_16_30", new dusuperobject(19,16,30,"Toen stond Pinehas op, en hij oefende gericht, en de plaag werd opgehouden."));
dusuperobject.biblemap.put("b19_16_31", new dusuperobject(19,16,31,"En het is hem gerekend tot gerechtigheid, van geslacht tot geslacht tot in eeuwigheid."));
dusuperobject.biblemap.put("b19_16_32", new dusuperobject(19,16,32,"Zij maakten Hem ook zeer toornig aan het twistwater, en het ging Mozes kwalijk om hunnentwil."));
dusuperobject.biblemap.put("b19_16_33", new dusuperobject(19,16,33,"Want zij verbitterden zijn geest, zodat hij wat onbedachtelijk voortbracht met zijn lippen."));
dusuperobject.biblemap.put("b19_16_34", new dusuperobject(19,16,34,"Zij hebben die volken niet verdelgd, die de HEERE hun gezegd had;"));
dusuperobject.biblemap.put("b19_16_35", new dusuperobject(19,16,35,"Maar zij vermengden zich met de heidenen, en leerden derzelver werken."));
dusuperobject.biblemap.put("b19_16_36", new dusuperobject(19,16,36,"En zij dienden hun afgoden, en zij werden hun tot een strik."));
dusuperobject.biblemap.put("b19_16_37", new dusuperobject(19,16,37,"Daarenboven hebben zij hun zonen en hun dochteren den duivelen geofferd."));
dusuperobject.biblemap.put("b19_16_38", new dusuperobject(19,16,38,"En zij hebben onschuldig bloed vergoten, het bloed hunner zonen en hunner dochteren, die zij den afgoden van Kanaan hebben opgeofferd; zodat het land door deze bloedschulden is ontheiligd geworden."));
dusuperobject.biblemap.put("b19_16_39", new dusuperobject(19,16,39,"En zij ontreinigden zich door hun werken, en zij hebben gehoereerd door hun daden."));
dusuperobject.biblemap.put("b19_16_40", new dusuperobject(19,16,40,"Dies is de toorn des HEEREN ontstoken tegen Zijn volk, en Hij heeft een gruwel gehad aan Zijn erfdeel."));
dusuperobject.biblemap.put("b19_16_41", new dusuperobject(19,16,41,"En Hij gaf hen in de hand der heidenen, en hun haters heersten over hen."));
dusuperobject.biblemap.put("b19_16_42", new dusuperobject(19,16,42,"En hun vijanden hebben hen verdrukt, en zij zijn vernederd geworden onder hun hand."));
dusuperobject.biblemap.put("b19_16_43", new dusuperobject(19,16,43,"Hij heeft hen menigmaal gered; maar zij verbitterden Hem door hun raad, en werden uitgeteerd door hun ongerechtigheid."));
dusuperobject.biblemap.put("b19_16_44", new dusuperobject(19,16,44,"Nochtans zag Hij hun benauwdheid aan, als Hij hun geschrei hoorde."));
dusuperobject.biblemap.put("b19_16_45", new dusuperobject(19,16,45,"En Hij dacht tot hun beste aan Zijn verbond, en het berouwde Hem naar de veelheid Zijner goedertierenheden."));
dusuperobject.biblemap.put("b19_16_46", new dusuperobject(19,16,46,"Dies gaf Hij hun barmhartigheid voor het aangezicht van allen, die hen gevangen hadden."));
dusuperobject.biblemap.put("b19_16_47", new dusuperobject(19,16,47,"Verlos ons, HEERE, onze God! en verzamel ons uit de heidenen, opdat wij den Naam Uwer heiligheid loven, ons beroemende in Uw lof."));
dusuperobject.biblemap.put("b19_16_48", new dusuperobject(19,16,48,"Geloofd zij de HEERE, de God Israels, van eeuwigheid en tot in eeuwigheid; en al het volk zegge: Amen, Hallelujah!"));
dusuperobject.biblemap.put("b19_17_1", new dusuperobject(19,17,1,"Looft den HEERE, want Hij is goed; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_17_2", new dusuperobject(19,17,2,"Dat zulks de bevrijden des HEEREN zeggen, die Hij van de hand der wederpartijders bevrijd heeft."));
dusuperobject.biblemap.put("b19_17_3", new dusuperobject(19,17,3,"En die Hij uit de landen verzameld heeft, van het oosten en van het westen, van het noorden en van de zee."));
dusuperobject.biblemap.put("b19_17_4", new dusuperobject(19,17,4,"Die in de woestijn dwaalden, in een weg der wildernis, die geen stad ter woning vonden;"));
dusuperobject.biblemap.put("b19_17_5", new dusuperobject(19,17,5,"Zij waren hongerig, ook dorstig; hun ziel was in hen overstelpt."));
dusuperobject.biblemap.put("b19_17_6", new dusuperobject(19,17,6,"Doch roepende tot den HEERE in de benauwdheid, die zij hadden, heeft Hij hen gered uit hun angsten;"));
dusuperobject.biblemap.put("b19_17_7", new dusuperobject(19,17,7,"En Hij leidde hen op een rechten weg, om te gaan tot een stad ter woning."));
dusuperobject.biblemap.put("b19_17_8", new dusuperobject(19,17,8,"Laat hen voor den HEERE Zijn goedertierenheid loven, en Zijn wonderwerken voor de kinderen der mensen."));
dusuperobject.biblemap.put("b19_17_9", new dusuperobject(19,17,9,"Want Hij heeft de dorstige ziel verzadigd, en de hongerige ziel met goed vervuld;"));
dusuperobject.biblemap.put("b19_17_10", new dusuperobject(19,17,10,"Die in duisternis en de schaduw des doods zaten, gebonden met verdrukking en ijzer;"));
dusuperobject.biblemap.put("b19_17_11", new dusuperobject(19,17,11,"Omdat zij wederspannig waren geweest tegen Gods geboden, en den raad des Allerhoogsten onwaardiglijk verworpen hadden."));
dusuperobject.biblemap.put("b19_17_12", new dusuperobject(19,17,12,"Waarom Hij hun het hart door zwarigheid vernederd heeft; zij zijn gestruikeld, en er was geen helper."));
dusuperobject.biblemap.put("b19_17_13", new dusuperobject(19,17,13,"Doch roepende tot den HEERE in de benauwdheid, die zij hadden, verloste Hij hen uit hun angsten."));
dusuperobject.biblemap.put("b19_17_14", new dusuperobject(19,17,14,"Hij voerde hen uit de duisternis en de schaduw des doods, en Hij brak hun banden."));
dusuperobject.biblemap.put("b19_17_15", new dusuperobject(19,17,15,"Laat hen voor den HEERE Zijn goedertierenheid loven, en Zijn wonderwerken voor de kinderen der mensen;"));
dusuperobject.biblemap.put("b19_17_16", new dusuperobject(19,17,16,"Want Hij heeft de koperen deuren gebroken, en de ijzeren grendelen in stukken gehouwen."));
dusuperobject.biblemap.put("b19_17_17", new dusuperobject(19,17,17,"De zotten worden om den weg hunner overtreding, en om hun ongerechtigheden geplaagd;"));
dusuperobject.biblemap.put("b19_17_18", new dusuperobject(19,17,18,"Hun ziel gruwelde van alle spijze, en zij waren tot aan de poorten des doods gekomen."));
dusuperobject.biblemap.put("b19_17_19", new dusuperobject(19,17,19,"Doch roepende tot den HEERE in de benauwdheid, die zij hadden, verloste Hij hen uit hun angsten."));
dusuperobject.biblemap.put("b19_17_20", new dusuperobject(19,17,20,"Hij zond Zijn woord uit, en heelde hen, en rukte hen uit hun kuilen."));
dusuperobject.biblemap.put("b19_17_21", new dusuperobject(19,17,21,"Laat hen voor den HEERE Zijn goedertierenheid loven, en Zijn wonderwerken voor de kinderen der mensen."));
dusuperobject.biblemap.put("b19_17_22", new dusuperobject(19,17,22,"En dat zij lofofferen offeren, en met gejuich Zijn werken vertellen."));
dusuperobject.biblemap.put("b19_17_23", new dusuperobject(19,17,23,"Die met schepen ter zee afvaren, handel doende op grote wateren;"));
dusuperobject.biblemap.put("b19_17_24", new dusuperobject(19,17,24,"Die zien de werken des HEEREN, en Zijn wonderwerken in de diepte."));
dusuperobject.biblemap.put("b19_17_25", new dusuperobject(19,17,25,"Als Hij spreekt, zo doet Hij een stormwind opstaan, die haar golven omhoog verheft."));
dusuperobject.biblemap.put("b19_17_26", new dusuperobject(19,17,26,"Zij rijzen op naar den hemel; zij dalen neder tot in de afgronden; hun ziel versmelt van angst."));
dusuperobject.biblemap.put("b19_17_27", new dusuperobject(19,17,27,"Zij dansen en waggelen als een dronken man, en al hun wijsheid wordt verslonden."));
dusuperobject.biblemap.put("b19_17_28", new dusuperobject(19,17,28,"Doch roepende tot den HEERE in de benauwdheid, die zij hadden, zo voerde Hij hen uit hun angsten."));
dusuperobject.biblemap.put("b19_17_29", new dusuperobject(19,17,29,"Hij doet de storm stilstaan, zodat hun golven stilzwijgen."));
dusuperobject.biblemap.put("b19_17_30", new dusuperobject(19,17,30,"Dan zijn zij verblijd, omdat zij gestild zijn, en dat Hij hen tot de haven hunner begeerte geleid heeft."));
dusuperobject.biblemap.put("b19_17_31", new dusuperobject(19,17,31,"Laat hen voor den HEERE Zijn goedertierenheid loven, en Zijn wonderwerken voor de kinderen der mensen."));
dusuperobject.biblemap.put("b19_17_32", new dusuperobject(19,17,32,"En Hem verhogen in de gemeente des volks, en in het gestoelte der oudsten Hem roemen."));
dusuperobject.biblemap.put("b19_17_33", new dusuperobject(19,17,33,"Hij stelt de rivieren tot een woestijn, en watertochten tot dorstig land."));
dusuperobject.biblemap.put("b19_17_34", new dusuperobject(19,17,34,"Het vruchtbaar land tot zouten grond, om de boosheid dergenen, die daarin wonen."));
dusuperobject.biblemap.put("b19_17_35", new dusuperobject(19,17,35,"Hij stelt de woestijn tot een waterpoel, en het dorre land tot watertochten."));
dusuperobject.biblemap.put("b19_17_36", new dusuperobject(19,17,36,"En Hij doet de hongerigen aldaar wonen, en zij stichten een stad ter woning;"));
dusuperobject.biblemap.put("b19_17_37", new dusuperobject(19,17,37,"En bezaaien akkers, en planten wijngaarden, die inkomende vrucht voortbrengen."));
dusuperobject.biblemap.put("b19_17_38", new dusuperobject(19,17,38,"En Hij zegent hen, zodat zij zeer vermenigvuldigen, en hun vee vermindert Hij niet."));
dusuperobject.biblemap.put("b19_17_39", new dusuperobject(19,17,39,"Daarna verminderen zij, en komen ten onder, door verdrukking, kwaad en droefenis."));
dusuperobject.biblemap.put("b19_17_40", new dusuperobject(19,17,40,"Hij stort verachting uit over de prinsen, en doet hen dwalen in het woeste, waar geen weg is."));
dusuperobject.biblemap.put("b19_17_41", new dusuperobject(19,17,41,"Maar Hij brengt den nooddruftige uit de verdrukking in een hoog vertrek, en maakt de huisgezinnen als kudden."));
dusuperobject.biblemap.put("b19_17_42", new dusuperobject(19,17,42,"De oprechten zien het, en zijn verblijd, maar alle ongerechtigheid stopt haar mond."));
dusuperobject.biblemap.put("b19_17_43", new dusuperobject(19,17,43,"Wie is wijs? Die neme deze dingen waar; en dat zij verstandelijk letten op de goedertierenheden des HEEREN."));
dusuperobject.biblemap.put("b19_18_1", new dusuperobject(19,18,1,"Een lied, een psalm van David."));
dusuperobject.biblemap.put("b19_18_2", new dusuperobject(19,18,2,"O God! mijn hart is bereid; ik zal zingen en psalmzingen, ook mijn eer."));
dusuperobject.biblemap.put("b19_18_3", new dusuperobject(19,18,3,"Waak op, gij luit en harp! ik zal in den dageraad opwaken."));
dusuperobject.biblemap.put("b19_18_4", new dusuperobject(19,18,4,"Ik zal U loven onder de volken, o HEERE! en ik zal U psalmzingen onder de natien."));
dusuperobject.biblemap.put("b19_18_5", new dusuperobject(19,18,5,"Want Uw goedertierenheid is groot tot boven de hemelen, en Uw waarheid tot aan de bovenste wolken."));
dusuperobject.biblemap.put("b19_18_6", new dusuperobject(19,18,6,"Verhef U, o God! boven de hemelen, en Uw eer over de ganse aarde."));
dusuperobject.biblemap.put("b19_18_7", new dusuperobject(19,18,7,"Opdat Uw beminden bevrijd worden; geef heil door Uw rechterhand, en verhoor ons."));
dusuperobject.biblemap.put("b19_18_8", new dusuperobject(19,18,8,"God heeft gesproken in Zijn heiligdom, dies zal ik van vreugde opspringen; ik zal Sichem delen, en het dal van Sukkoth zal ik afmeten."));
dusuperobject.biblemap.put("b19_18_9", new dusuperobject(19,18,9,"Gilead is mijn, Manasse is mijn, en Efraim is de sterkte mijns hoofds; Juda is mijn wetgever."));
dusuperobject.biblemap.put("b19_18_10", new dusuperobject(19,18,10,"Moab is mijn waspot; op Edom zal ik mijn schoen werpen; over Palestina zal ik juichen."));
dusuperobject.biblemap.put("b19_18_11", new dusuperobject(19,18,11,"Wie zal mij voeren in een vaste stad? Wie zal mij leiden tot in Edom?"));
dusuperobject.biblemap.put("b19_18_12", new dusuperobject(19,18,12,"Zult Gij het niet zijn, o God! Die ons verstoten hadt, en Die niet uittoogt, o God! met onze heirkrachten?"));
dusuperobject.biblemap.put("b19_18_13", new dusuperobject(19,18,13,"Geef Gij ons hulp uit de benauwdheid; want des mensen heil is ijdelheid. [ (Psalms 108:14) In God zullen wij kloeke daden doen, en Hij zal onze wederpartijders vertreden. ]"));
dusuperobject.biblemap.put("b19_19_1", new dusuperobject(19,19,1,"Een psalm van David, voor den opperzangmeester. O God mijns lofs! zwijg niet."));
dusuperobject.biblemap.put("b19_19_2", new dusuperobject(19,19,2,"Want de mond des goddelozen en de mond des bedrogs zijn tegen mij opengedaan; zij hebben met mij gesproken met een valse tong."));
dusuperobject.biblemap.put("b19_19_3", new dusuperobject(19,19,3,"En met hatelijke woorden hebben zij mij omsingeld; ja, zij hebben mij bestreden zonder oorzaak."));
dusuperobject.biblemap.put("b19_19_4", new dusuperobject(19,19,4,"Voor mijn liefde, staan zij mij tegen; maar ik was steeds in het gebed."));
dusuperobject.biblemap.put("b19_19_5", new dusuperobject(19,19,5,"En zij hebben mij kwaad voor goed opgelegd, en haat voor mijn liefde."));
dusuperobject.biblemap.put("b19_19_6", new dusuperobject(19,19,6,"Stel een goddeloze over hem, en de satan sta aan zijn rechterhand."));
dusuperobject.biblemap.put("b19_19_7", new dusuperobject(19,19,7,"Als hij gericht wordt, zo ga hij schuldig uit, en zijn gebed zij tot zonde."));
dusuperobject.biblemap.put("b19_19_8", new dusuperobject(19,19,8,"Dat zijn dagen weinig zijn; een ander neme zijn ambt;"));
dusuperobject.biblemap.put("b19_19_9", new dusuperobject(19,19,9,"Dat zijn kinderen wezen worden, en zijn vrouw weduwe."));
dusuperobject.biblemap.put("b19_19_10", new dusuperobject(19,19,10,"En dat zijn kinderen hier en daar omzwerven, en bedelen, en de nooddruft uit hun verwoeste plaatsen zoeken."));
dusuperobject.biblemap.put("b19_19_11", new dusuperobject(19,19,11,"Dat de schuldeiser aansla al wat hij heeft, en dat de vreemden zijn arbeid roven."));
dusuperobject.biblemap.put("b19_19_12", new dusuperobject(19,19,12,"Dat hij niemand hebbe, die weldadigheid over hem uitstrekke, en dat er niemand zij, die zijn wezen genadig zij."));
dusuperobject.biblemap.put("b19_19_13", new dusuperobject(19,19,13,"Dat zijn nakomelingen uitgeroeid worden; hun naam worde uitgedelgd in het andere geslacht."));
dusuperobject.biblemap.put("b19_19_14", new dusuperobject(19,19,14,"De ongerechtigheid zijner vaderen worde gedacht bij den HEERE, en de zonde zijner moeder worde niet uitgedelgd."));
dusuperobject.biblemap.put("b19_19_15", new dusuperobject(19,19,15,"Dat zij gedurig voor den HEERE zijn; en Hij roeie hun gedachtenis uit van de aarde."));
dusuperobject.biblemap.put("b19_19_16", new dusuperobject(19,19,16,"Omdat hij niet gedacht heeft weldadigheid te doen, maar heeft den ellendigen en den nooddruftigen man vervolgd, en den verslagene van hart, om hem te doden."));
dusuperobject.biblemap.put("b19_19_17", new dusuperobject(19,19,17,"Dewijl hij den vloek heeft liefgehad, dat die hem overkome, en geen lust gehad heeft tot den zegen, zo zij die verre van hem."));
dusuperobject.biblemap.put("b19_19_18", new dusuperobject(19,19,18,"En hij zij bekleed met den vloek, als met zijn kleed, en dat die ga tot in het binnenste van hem als het water, en als de olie in zijn beenderen."));
dusuperobject.biblemap.put("b19_19_19", new dusuperobject(19,19,19,"Die zij hem als een kleed, waarmede hij zich bedekt, en tot een gordel, waarmede hij zich steeds omgordt."));
dusuperobject.biblemap.put("b19_19_20", new dusuperobject(19,19,20,"Dit zij het werkloon mijner tegenstanders van den HEERE, en dergenen, die kwaad spreken tegen mijn ziel."));
dusuperobject.biblemap.put("b19_19_21", new dusuperobject(19,19,21,"Maar Gij, o HEERE Heere! maak het met mij om Uws Naams wil; dewijl Uw goedertierenheid goed is, verlos mij."));
dusuperobject.biblemap.put("b19_19_22", new dusuperobject(19,19,22,"Want ik ben ellendig en nooddruftig, en mijn hart is in het binnenste van mij doorwond."));
dusuperobject.biblemap.put("b19_19_23", new dusuperobject(19,19,23,"Ik ga heen gelijk een schaduw, wanneer zij zich neigt; ik worde omgedreven als een sprinkhaan."));
dusuperobject.biblemap.put("b19_19_24", new dusuperobject(19,19,24,"Mijn knieen struikelen van vasten, en mijn vlees is vermagerd, zodat er geen vet aan is."));
dusuperobject.biblemap.put("b19_19_25", new dusuperobject(19,19,25,"Nog ben ik hun een smaad; als zij mij zien, zo schudden zij hun hoofd."));
dusuperobject.biblemap.put("b19_19_26", new dusuperobject(19,19,26,"Help mij, HEERE, mijn God! verlos mij naar Uw goedertierenheid."));
dusuperobject.biblemap.put("b19_19_27", new dusuperobject(19,19,27,"Opdat zij weten, dat dit Uw hand is, dat Gij het, HEERE! gedaan hebt."));
dusuperobject.biblemap.put("b19_19_28", new dusuperobject(19,19,28,"Laat hen vloeken, maar zegen Gij; laat hen zich opmaken, maar dat zij beschaamd worden; doch dat zich Uw knecht verblijde."));
dusuperobject.biblemap.put("b19_19_29", new dusuperobject(19,19,29,"Laat mijn tegenstanders met schande bekleed worden, en dat zij met hun beschaamdheid zich bedekken, als met een mantel."));
dusuperobject.biblemap.put("b19_19_30", new dusuperobject(19,19,30,"Ik zal den HEERE met mijn mond zeer loven, en in het midden van velen zal ik Hem prijzen."));
dusuperobject.biblemap.put("b19_19_31", new dusuperobject(19,19,31,"Want Hij zal den nooddruftige ter rechterhand staan, om hem te verlossen van degenen, die zijn ziel veroordelen."));
dusuperobject.biblemap.put("b19_110_1", new dusuperobject(19,110,1,"Een psalm van David. De HEERE heeft tot mijn Heere gesproken: Zit aan Mijn rechterhand, totdat Ik Uw vijanden gezet zal hebben tot een voetbank Uwer voeten."));
dusuperobject.biblemap.put("b19_110_2", new dusuperobject(19,110,2,"De HEERE zal de scepter Uwer sterkte zenden uit Sion, zeggende: Heers in het midden Uwer vijanden."));
dusuperobject.biblemap.put("b19_110_3", new dusuperobject(19,110,3,"Uw volk zal zeer gewillig zijn op den dag Uwer heirkracht, in heilig sieraad; uit de baarmoeder des dageraads zal U de dauw Uwer jeugd zijn."));
dusuperobject.biblemap.put("b19_110_4", new dusuperobject(19,110,4,"De HEERE heeft gezworen, en het zal Hem niet berouwen: Gij zijt Priester in eeuwigheid, naar de ordening van Melchizedek."));
dusuperobject.biblemap.put("b19_110_5", new dusuperobject(19,110,5,"De HEERE is aan Uw rechterhand; Hij zal koningen verslaan ten dage Zijns toorns."));
dusuperobject.biblemap.put("b19_110_6", new dusuperobject(19,110,6,"Hij zal recht doen onder de heidenen; Hij zal het vol dode lichamen maken; Hij zal verslaan dengene, die het hoofd is over een groot land."));
dusuperobject.biblemap.put("b19_110_7", new dusuperobject(19,110,7,"Hij zal op den weg uit de beek drinken; daarom zal Hij het hoofd omhoog heffen."));
dusuperobject.biblemap.put("b19_111_1", new dusuperobject(19,111,1,"Hallelujah! Aleph. Ik zal den HEERE loven van ganser harte; Beth. In den raad en vergadering der oprechten."));
dusuperobject.biblemap.put("b19_111_2", new dusuperobject(19,111,2,"Gimel. De werken des HEEREN zijn groot; Daleth. zij worden gezocht van allen, die er lust in hebben."));
dusuperobject.biblemap.put("b19_111_3", new dusuperobject(19,111,3,"He. Zijn doen is majesteit en heerlijkheid; Vau. en zijn gerechtigheid bestaat in der eeuwigheid."));
dusuperobject.biblemap.put("b19_111_4", new dusuperobject(19,111,4,"Zain. Hij heeft Zijn wonderen een gedachtenis gemaakt; Cheth. de HEERE is genadig en barmhartig."));
dusuperobject.biblemap.put("b19_111_5", new dusuperobject(19,111,5,"Teth. Hij heeft degenen, die Hem vrezen, spijs gegeven; Jod. Hij gedenkt in der eeuwigheid aan Zijn verbond."));
dusuperobject.biblemap.put("b19_111_6", new dusuperobject(19,111,6,"Caph. Hij heeft de kracht Zijner werken Zijn volke bekend gemaakt; Lamed. hun gevende de erve der heidenen."));
dusuperobject.biblemap.put("b19_111_7", new dusuperobject(19,111,7,"Mem. De werken Zijner handen zijn waarheid en oordeel; Nun. al Zijn bevelen zijn getrouw."));
dusuperobject.biblemap.put("b19_111_8", new dusuperobject(19,111,8,"Samech. Zij zijn ondersteund voor altoos, en in eeuwigheid; Ain. zijnde gedaan in waarheid en oprechtigheid."));
dusuperobject.biblemap.put("b19_111_9", new dusuperobject(19,111,9,"Pe. Hij heeft Zijn volke verlossing gezonden; Tsade. Hij heeft Zijn verbond in eeuwigheid geboden; Koph. Zijn Naam is heilig en vreselijk."));
dusuperobject.biblemap.put("b19_111_10", new dusuperobject(19,111,10,"Resch. De vreze des HEEREN is het beginsel der wijsheid; Schin. allen, die ze doen, hebben goed verstand; Thau. Zijn lof bestaat tot in der eeuwigheid."));
dusuperobject.biblemap.put("b19_112_1", new dusuperobject(19,112,1,"Hallelujah! Aleph. Welgelukzalig is de man, die den HEERE vreest; Beth. die groten lust heeft in Zijn geboden."));
dusuperobject.biblemap.put("b19_112_2", new dusuperobject(19,112,2,"Gimel. Zijn zaad zal geweldig zijn op aarde; Daleth. het geslacht der oprechten zal gezegend worden."));
dusuperobject.biblemap.put("b19_112_3", new dusuperobject(19,112,3,"He. In zijn huis zal have en rijkdom wezen; Vau. en zijn gerechtigheid bestaat in eeuwigheid."));
dusuperobject.biblemap.put("b19_112_4", new dusuperobject(19,112,4,"Zain. Den oprechten gaat het licht op in de duisternis; Cheth. Hij is genadig, en barmhartig, en rechtvaardig."));
dusuperobject.biblemap.put("b19_112_5", new dusuperobject(19,112,5,"Teth. Wel dien man, die zich ontfermt en uitleent; Jod. hij beschikt zijn zaken met recht."));
dusuperobject.biblemap.put("b19_112_6", new dusuperobject(19,112,6,"Caph. Zekerlijk, hij zal in der eeuwigheid niet wankelen; Lamed. de rechtvaardige zal in eeuwige gedachtenis zijn."));
dusuperobject.biblemap.put("b19_112_7", new dusuperobject(19,112,7,"Mem. Hij zal voor geen kwaad gerucht vrezen; Nun. zijn hart is vast, betrouwende op den HEERE."));
dusuperobject.biblemap.put("b19_112_8", new dusuperobject(19,112,8,"Samech. Zijn hart, wel ondersteund zijnde, zal niet vrezen; Ain. totdat hij op zijn wederpartijen zie."));
dusuperobject.biblemap.put("b19_112_9", new dusuperobject(19,112,9,"Pe. Hij strooit uit, hij geeft den nooddruftige; Tsade. zijn gerechtigheid bestaat in eeuwigheid; Koph. zijn hoorn zal verhoogd worden in eer."));
dusuperobject.biblemap.put("b19_112_10", new dusuperobject(19,112,10,"Resch. De goddeloze zal het zien, en hij zal zich vertoornen; Schin. hij zal met zijn tanden knersen en smelten. Thau. de wens der goddelozen zal vergaan."));
dusuperobject.biblemap.put("b19_113_1", new dusuperobject(19,113,1,"Hallelujah! Looft, gij knechten des HEEREN! looft den Naam des HEEREN."));
dusuperobject.biblemap.put("b19_113_2", new dusuperobject(19,113,2,"De Naam des HEEREN zij geprezen, van nu aan tot in der eeuwigheid."));
dusuperobject.biblemap.put("b19_113_3", new dusuperobject(19,113,3,"Van den opgang der zon af tot haar nedergang, zij de Naam des HEEREN geloofd."));
dusuperobject.biblemap.put("b19_113_4", new dusuperobject(19,113,4,"De HEERE is hoog boven alle heidenen, boven de hemelen is Zijn heerlijkheid."));
dusuperobject.biblemap.put("b19_113_5", new dusuperobject(19,113,5,"Wie is gelijk de HEERE, onze God? Die zeer hoog woont."));
dusuperobject.biblemap.put("b19_113_6", new dusuperobject(19,113,6,"Die zeer laag ziet, in den hemel en op de aarde."));
dusuperobject.biblemap.put("b19_113_7", new dusuperobject(19,113,7,"Die den geringe uit het stof opricht, en den nooddruftige uit den drek verhoogt;"));
dusuperobject.biblemap.put("b19_113_8", new dusuperobject(19,113,8,"Om te doen zitten bij de prinsen, bij de prinsen Zijns volks."));
dusuperobject.biblemap.put("b19_113_9", new dusuperobject(19,113,9,"Die de onvruchtbare doet wonen met een huisgezin, een blijde moeder van kinderen. Hallelujah!"));
dusuperobject.biblemap.put("b19_114_1", new dusuperobject(19,114,1,"Toen Israel uit Egypte toog, het huis Jakobs van een volk, dat een vreemde taal had;"));
dusuperobject.biblemap.put("b19_114_2", new dusuperobject(19,114,2,"Zo werd Juda tot Zijn heiligdom, Israel Zijn volkomene heerschappij."));
dusuperobject.biblemap.put("b19_114_3", new dusuperobject(19,114,3,"De zee zag het, en vlood; de Jordaan keerde achterwaarts."));
dusuperobject.biblemap.put("b19_114_4", new dusuperobject(19,114,4,"De bergen sprongen als rammen, de heuvelen als lammeren."));
dusuperobject.biblemap.put("b19_114_5", new dusuperobject(19,114,5,"Wat was u, gij zee! dat gij vloodt? gij Jordaan! dat gij achterwaarts keerdet?"));
dusuperobject.biblemap.put("b19_114_6", new dusuperobject(19,114,6,"Gij bergen, dat gij opsprongt als rammen? gij heuvelen! als lammeren?"));
dusuperobject.biblemap.put("b19_114_7", new dusuperobject(19,114,7,"Beef, gij aarde! voor het aangezicht des Heeren, voor het aangezicht van den God Jakobs;"));
dusuperobject.biblemap.put("b19_114_8", new dusuperobject(19,114,8,"Die den rotssteen veranderde in een watervloed, den keisteen in een waterfontein."));
dusuperobject.biblemap.put("b19_115_1", new dusuperobject(19,115,1,"Niet ons, o HEERE! niet ons, maar Uw Naam geef eer, om Uwer goedertierenheid, om Uwer waarheid wil."));
dusuperobject.biblemap.put("b19_115_2", new dusuperobject(19,115,2,"Waarom zouden de heidenen zeggen: Waar is nu hun God?"));
dusuperobject.biblemap.put("b19_115_3", new dusuperobject(19,115,3,"Onze God is toch in den hemel, Hij doet al wat Hem behaagt."));
dusuperobject.biblemap.put("b19_115_4", new dusuperobject(19,115,4,"Hunlieder afgoden zijn zilver en goud, het werk van des mensen handen;"));
dusuperobject.biblemap.put("b19_115_5", new dusuperobject(19,115,5,"Zij hebben een mond, maar spreken niet; zij hebben ogen, maar zien niet;"));
dusuperobject.biblemap.put("b19_115_6", new dusuperobject(19,115,6,"Oren hebben zij, maar horen niet; zij hebben een neus, maar zij rieken niet;"));
dusuperobject.biblemap.put("b19_115_7", new dusuperobject(19,115,7,"Hun handen hebben zij, maar tasten niet; hun voeten, maar gaan niet; zij geven geen geluid door hun keel."));
dusuperobject.biblemap.put("b19_115_8", new dusuperobject(19,115,8,"Dat die hen maken hun gelijk worden, en al wie op hen vertrouwt."));
dusuperobject.biblemap.put("b19_115_9", new dusuperobject(19,115,9,"Israel! vertrouw gij op den HEERE; Hij is hun Hulp en hun Schild."));
dusuperobject.biblemap.put("b19_115_10", new dusuperobject(19,115,10,"Gij huis van Aaron! vertrouw op den HEERE; Hij is hun Hulp en hun Schild."));
dusuperobject.biblemap.put("b19_115_11", new dusuperobject(19,115,11,"Gijlieden, die den HEERE vreest! vertrouwt op den HEERE; Hij is hun Hulp en hun Schild."));
dusuperobject.biblemap.put("b19_115_12", new dusuperobject(19,115,12,"De HEERE is onzer gedachtig geweest, Hij zal zegenen; Hij zal het huis van Israel zegenen, Hij zal het huis van Aaron zegenen."));
dusuperobject.biblemap.put("b19_115_13", new dusuperobject(19,115,13,"Hij zal zegenen, die den HEERE vrezen, de kleinen met de groten."));
dusuperobject.biblemap.put("b19_115_14", new dusuperobject(19,115,14,"De HEERE zal den zegen over ulieden vermeerderen, over ulieden en over uw kinderen."));
dusuperobject.biblemap.put("b19_115_15", new dusuperobject(19,115,15,"Gijlieden zijt den HEERE gezegend, Die den hemel en de aarde gemaakt heeft."));
dusuperobject.biblemap.put("b19_115_16", new dusuperobject(19,115,16,"Aangaande den hemel, de hemel is des HEEREN; maar de aarde heeft Hij de mensenkinderen gegeven."));
dusuperobject.biblemap.put("b19_115_17", new dusuperobject(19,115,17,"De doden zullen den HEERE niet prijzen, noch die in de stilte nedergedaald zijn."));
dusuperobject.biblemap.put("b19_115_18", new dusuperobject(19,115,18,"Maar wij zullen den HEERE loven van nu aan tot in der eeuwigheid. Hallelujah!"));
dusuperobject.biblemap.put("b19_116_1", new dusuperobject(19,116,1,"Ik heb lief, want de HEERE hoort mijn stem, mijn smekingen;"));
dusuperobject.biblemap.put("b19_116_2", new dusuperobject(19,116,2,"Want Hij neigt Zijn oor tot mij; dies zal ik Hem in mijn dagen aanroepen."));
dusuperobject.biblemap.put("b19_116_3", new dusuperobject(19,116,3,"De banden des doods hadden mij omvangen, en de angsten der hel hadden mij getroffen; ik vond benauwdheid en droefenis."));
dusuperobject.biblemap.put("b19_116_4", new dusuperobject(19,116,4,"Maar ik riep den Naam des HEEREN aan, zeggende: Och HEERE! bevrijd mijn ziel."));
dusuperobject.biblemap.put("b19_116_5", new dusuperobject(19,116,5,"De HEERE is genadig en rechtvaardig, en onze God is ontfermende."));
dusuperobject.biblemap.put("b19_116_6", new dusuperobject(19,116,6,"De HEERE bewaart de eenvoudigen; ik was uitgeteerd, doch Hij heeft mij verlost."));
dusuperobject.biblemap.put("b19_116_7", new dusuperobject(19,116,7,"Mijn ziel! keer weder tot uw rust, want de HEERE heeft aan u welgedaan."));
dusuperobject.biblemap.put("b19_116_8", new dusuperobject(19,116,8,"Want Gij, HEERE! hebt mijn ziel gered van de dood, mijn ogen van tranen, mijn voet van aanstoot."));
dusuperobject.biblemap.put("b19_116_9", new dusuperobject(19,116,9,"Ik zal wandelen voor het aangezicht des HEEREN, in de landen der levenden."));
dusuperobject.biblemap.put("b19_116_10", new dusuperobject(19,116,10,"Ik heb geloofd, daarom sprak ik; ik ben zeer bedrukt geweest."));
dusuperobject.biblemap.put("b19_116_11", new dusuperobject(19,116,11,"Ik zeide in mijn haasten: Alle mensen zijn leugenaars."));
dusuperobject.biblemap.put("b19_116_12", new dusuperobject(19,116,12,"Wat zal ik den HEERE vergelden voor al Zijn weldaden aan mij bewezen?"));
dusuperobject.biblemap.put("b19_116_13", new dusuperobject(19,116,13,"Ik zal den beker der verlossingen opnemen, en den Naam des HEEREN aanroepen."));
dusuperobject.biblemap.put("b19_116_14", new dusuperobject(19,116,14,"Mijn geloften zal ik den HEERE betalen, nu, in de tegenwoordigheid van al Zijn volk."));
dusuperobject.biblemap.put("b19_116_15", new dusuperobject(19,116,15,"Kostelijk is in de ogen des HEEREN de dood Zijner gunstgenoten."));
dusuperobject.biblemap.put("b19_116_16", new dusuperobject(19,116,16,"Och, HEERE! zekerlijk ik ben Uw knecht, ik ben Uw knecht, een zoon Uwer dienstmaagd; Gij hebt mijn banden losgemaakt."));
dusuperobject.biblemap.put("b19_116_17", new dusuperobject(19,116,17,"Ik zal U offeren, offerande van dankzegging, en den Naam des HEEREN aanroepen."));
dusuperobject.biblemap.put("b19_116_18", new dusuperobject(19,116,18,"Mijn geloften zal ik den HEERE betalen, nu, in de tegenwoordigheid van al Zijn volk."));
dusuperobject.biblemap.put("b19_116_19", new dusuperobject(19,116,19,"In de voorhoven van het huis des HEEREN, in het midden van u, o Jeruzalem! Hallelujah!"));
dusuperobject.biblemap.put("b19_117_1", new dusuperobject(19,117,1,"Looft den HEERE, alle heidenen; prijst Hem, alle natien!"));
dusuperobject.biblemap.put("b19_117_2", new dusuperobject(19,117,2,"Want Zijn goedertierenheid is geweldig over ons, en de waarheid des HEEREN is in der eeuwigheid! Hallelujah!"));
dusuperobject.biblemap.put("b19_118_1", new dusuperobject(19,118,1,"Looft den HEERE, want Hij is goed; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_118_2", new dusuperobject(19,118,2,"Dat Israel nu zegge, dat Zijn goedertierenheid in der eeuwigheid is."));
dusuperobject.biblemap.put("b19_118_3", new dusuperobject(19,118,3,"Het huis van Aaron zegge nu, dat Zijn goedertierenheid in der eeuwigheid is."));
dusuperobject.biblemap.put("b19_118_4", new dusuperobject(19,118,4,"Dat degenen, die den HEERE vrezen, nu zeggen, dat Zijn goedertierenheid in der eeuwigheid is."));
dusuperobject.biblemap.put("b19_118_5", new dusuperobject(19,118,5,"Uit de benauwdheid heb ik den HEERE aangeroepen; de HEERE heeft mij verhoord, stellende mij in de ruimte."));
dusuperobject.biblemap.put("b19_118_6", new dusuperobject(19,118,6,"De HEERE is bij mij, ik zal niet vrezen; wat zal mij een mens doen?"));
dusuperobject.biblemap.put("b19_118_7", new dusuperobject(19,118,7,"De HEERE is bij mij onder degenen, die mij helpen; daarom zal ik mijn lust zien aan degenen, die mij haten."));
dusuperobject.biblemap.put("b19_118_8", new dusuperobject(19,118,8,"Het is beter tot den HEERE toevlucht te nemen, dan op den mens te vertrouwen."));
dusuperobject.biblemap.put("b19_118_9", new dusuperobject(19,118,9,"Het is beter tot den HEERE toevlucht te nemen, dan op prinsen te vertrouwen."));
dusuperobject.biblemap.put("b19_118_10", new dusuperobject(19,118,10,"Alle heidenen hadden mij omringd; het is in den Naam des HEEREN, dat ik ze verhouwen heb."));
dusuperobject.biblemap.put("b19_118_11", new dusuperobject(19,118,11,"Zij hadden mij omringd, ja, zij hadden mij omringd; het is in den Naam des HEEREN, dat ik ze verhouwen heb."));
dusuperobject.biblemap.put("b19_118_12", new dusuperobject(19,118,12,"Zij hadden mij omringd als bijen; zij zijn uitgeblust als een doornenvuur; het is in den Naam des HEEREN, dat ik ze verhouwen heb."));
dusuperobject.biblemap.put("b19_118_13", new dusuperobject(19,118,13,"Gij hadt mij zeer hard gestoten, tot vallens toe, maar de HEERE heeft mij geholpen."));
dusuperobject.biblemap.put("b19_118_14", new dusuperobject(19,118,14,"De HEERE is mijn Sterkte en Psalm, want Hij is mij tot heil geweest."));
dusuperobject.biblemap.put("b19_118_15", new dusuperobject(19,118,15,"In de tenten der rechtvaardigen is een stem des gejuichs en des heils; de rechterhand des HEEREN doet krachtige daden."));
dusuperobject.biblemap.put("b19_118_16", new dusuperobject(19,118,16,"De rechterhand des HEEREN is verhoogd; de rechterhand des HEEREN doet krachtige daden."));
dusuperobject.biblemap.put("b19_118_17", new dusuperobject(19,118,17,"Ik zal niet sterven, maar leven; en ik zal de werken des HEEREN vertellen."));
dusuperobject.biblemap.put("b19_118_18", new dusuperobject(19,118,18,"De HEERE heeft mij wel hard gekastijd; maar Hij heeft mij ter dood niet overgegeven."));
dusuperobject.biblemap.put("b19_118_19", new dusuperobject(19,118,19,"Doet mij de poorten der gerechtigheid open, ik zal daardoor ingaan, ik zal den HEERE loven."));
dusuperobject.biblemap.put("b19_118_20", new dusuperobject(19,118,20,"Dit is de poort des HEEREN, door dewelke de rechtvaardigen zullen ingaan."));
dusuperobject.biblemap.put("b19_118_21", new dusuperobject(19,118,21,"Ik zal U loven, omdat Gij mij verhoord hebt, en mij tot heil geweest zijt."));
dusuperobject.biblemap.put("b19_118_22", new dusuperobject(19,118,22,"De steen, dien de bouwlieden verworpen hadden, is tot een hoofd des hoeks geworden."));
dusuperobject.biblemap.put("b19_118_23", new dusuperobject(19,118,23,"Dit is van den HEERE geschied, en het is wonderlijk in onze ogen."));
dusuperobject.biblemap.put("b19_118_24", new dusuperobject(19,118,24,"Dit is de dag, dien de HEERE gemaakt heeft; laat ons op denzelven ons verheugen, en verblijd zijn."));
dusuperobject.biblemap.put("b19_118_25", new dusuperobject(19,118,25,"Och HEERE! geef nu heil; och HEERE! geef nu voorspoed."));
dusuperobject.biblemap.put("b19_118_26", new dusuperobject(19,118,26,"Gezegend zij hij, die daar komt in den Naam des HEEREN! Wij zegenen ulieden uit het huis des HEEREN."));
dusuperobject.biblemap.put("b19_118_27", new dusuperobject(19,118,27,"De HEERE is God, Die ons licht gegeven heeft. Bindt het feest offer met touwen tot aan de hoornen van het altaar."));
dusuperobject.biblemap.put("b19_118_28", new dusuperobject(19,118,28,"Gij zijt mijn God, daarom zal ik U loven; o mijn God! ik zal U verhogen."));
dusuperobject.biblemap.put("b19_118_29", new dusuperobject(19,118,29,"Loof den HEERE, want Hij is goed; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_119_1", new dusuperobject(19,119,1,"Aleph. Welgelukzalig zijn de oprechten van wandel, die in de wet des HEEREN gaan."));
dusuperobject.biblemap.put("b19_119_2", new dusuperobject(19,119,2,"Welgelukzalig zijn zij, die Zijn getuigenissen onderhouden, die Hem van ganser harte zoeken;"));
dusuperobject.biblemap.put("b19_119_3", new dusuperobject(19,119,3,"Ook geen onrecht werken, maar wandelen in Zijn wegen."));
dusuperobject.biblemap.put("b19_119_4", new dusuperobject(19,119,4,"HEERE! Gij hebt geboden, dat men Uw bevelen zeer bewaren zal."));
dusuperobject.biblemap.put("b19_119_5", new dusuperobject(19,119,5,"Och, dat mijn wegen gericht werden, om Uw inzettingen te bewaren!"));
dusuperobject.biblemap.put("b19_119_6", new dusuperobject(19,119,6,"Dan zou ik niet beschaamd worden, wanneer ik merken zou op al Uw geboden."));
dusuperobject.biblemap.put("b19_119_7", new dusuperobject(19,119,7,"Ik zal U loven in oprechtheid des harten, als ik de rechten Uwer gerechtigheid geleerd zal hebben."));
dusuperobject.biblemap.put("b19_119_8", new dusuperobject(19,119,8,"Ik zal Uw inzettingen bewaren; verlaat mij niet al te zeer."));
dusuperobject.biblemap.put("b19_119_9", new dusuperobject(19,119,9,"Beth. Waarmede zal de jongeling zijn pad zuiver houden? Als hij dat houdt naar Uw woord."));
dusuperobject.biblemap.put("b19_119_10", new dusuperobject(19,119,10,"Ik zoek U met mijn gehele hart, laat mij van Uw geboden niet afdwalen."));
dusuperobject.biblemap.put("b19_119_11", new dusuperobject(19,119,11,"Ik heb Uw rede in mijn hart verborgen, opdat ik tegen U niet zondigen zou."));
dusuperobject.biblemap.put("b19_119_12", new dusuperobject(19,119,12,"HEERE! Gij zijt gezegend; leer mij Uw inzettingen."));
dusuperobject.biblemap.put("b19_119_13", new dusuperobject(19,119,13,"Ik heb met mijn lippen verteld al de rechten Uws monds."));
dusuperobject.biblemap.put("b19_119_14", new dusuperobject(19,119,14,"Ik ben vrolijker in den weg Uwer getuigenissen, dan over allen rijkdom."));
dusuperobject.biblemap.put("b19_119_15", new dusuperobject(19,119,15,"Ik zal Uw bevelen overdenken, en op Uw paden letten."));
dusuperobject.biblemap.put("b19_119_16", new dusuperobject(19,119,16,"Ik zal mijzelven vermaken in Uw inzettingen; Uw woord zal ik niet vergeten."));
dusuperobject.biblemap.put("b19_119_17", new dusuperobject(19,119,17,"Gimel. Doe wel bij Uw knecht, dat ik leve en Uw woord beware."));
dusuperobject.biblemap.put("b19_119_18", new dusuperobject(19,119,18,"Ontdek mijn ogen, dat ik aanschouwe de wonderen van Uw wet."));
dusuperobject.biblemap.put("b19_119_19", new dusuperobject(19,119,19,"Ik ben een vreemdeling op de aarde, verberg Uw geboden voor mij niet."));
dusuperobject.biblemap.put("b19_119_20", new dusuperobject(19,119,20,"Mijn ziel is verbroken vanwege het verlangen naar Uw oordelen te aller tijd."));
dusuperobject.biblemap.put("b19_119_21", new dusuperobject(19,119,21,"Gij scheldt de vervloekte hovaardigen, die van Uw geboden afdwalen."));
dusuperobject.biblemap.put("b19_119_22", new dusuperobject(19,119,22,"Wentel van mij versmaadheid en verachting, want ik heb Uw getuigenissen onderhouden."));
dusuperobject.biblemap.put("b19_119_23", new dusuperobject(19,119,23,"Als zelfs de vorsten zittende tegen mij gesproken hebben, heeft Uw knecht Uw inzettingen betracht."));
dusuperobject.biblemap.put("b19_119_24", new dusuperobject(19,119,24,"Ook zijn Uw getuigenissen mijn vermakingen, en mijn raadslieden."));
dusuperobject.biblemap.put("b19_119_25", new dusuperobject(19,119,25,"Daleth. Mijn ziel kleeft aan het stof; maak mij levend naar Uw woord."));
dusuperobject.biblemap.put("b19_119_26", new dusuperobject(19,119,26,"Ik heb U mijn wegen verteld, en Gij hebt mij verhoord; leer mij Uw inzettingen."));
dusuperobject.biblemap.put("b19_119_27", new dusuperobject(19,119,27,"Geef mij den weg Uwer bevelen te verstaan, opdat ik Uw wonderen betrachte."));
dusuperobject.biblemap.put("b19_119_28", new dusuperobject(19,119,28,"Mijn ziel druipt weg van treurigheid; richt mij op naar Uw woord."));
dusuperobject.biblemap.put("b19_119_29", new dusuperobject(19,119,29,"Wend van mij den weg der valsheid, en verleen mij genadiglijk Uw wet."));
dusuperobject.biblemap.put("b19_119_30", new dusuperobject(19,119,30,"Ik heb verkoren den weg der waarheid, Uw rechten heb ik mij voorgesteld."));
dusuperobject.biblemap.put("b19_119_31", new dusuperobject(19,119,31,"Ik kleef vast aan Uw getuigenissen; o HEERE! beschaam mij niet."));
dusuperobject.biblemap.put("b19_119_32", new dusuperobject(19,119,32,"Ik zal den weg Uwer geboden lopen, als Gij mijn hart verwijd zult hebben."));
dusuperobject.biblemap.put("b19_119_33", new dusuperobject(19,119,33,"He. HEERE! leer mij den weg Uwer inzettingen, en ik zal hem houden ten einde toe."));
dusuperobject.biblemap.put("b19_119_34", new dusuperobject(19,119,34,"Geef mij het verstand, en ik zal Uw wet houden; ja, ik zal ze onderhouden met gansen harte."));
dusuperobject.biblemap.put("b19_119_35", new dusuperobject(19,119,35,"Doe mij treden op het pad Uwer geboden, want daarin heb ik lust."));
dusuperobject.biblemap.put("b19_119_36", new dusuperobject(19,119,36,"Neig mijn hart tot Uw getuigenissen, en niet tot gierigheid."));
dusuperobject.biblemap.put("b19_119_37", new dusuperobject(19,119,37,"Wend mijn ogen af, dat zij geen ijdelheid zien; maak mij levend door Uw wegen."));
dusuperobject.biblemap.put("b19_119_38", new dusuperobject(19,119,38,"Bevestig Uw toezeggingen aan Uw knecht, die Uw vreze toegedaan is."));
dusuperobject.biblemap.put("b19_119_39", new dusuperobject(19,119,39,"Wend mijn smaadheid af, die ik vreze, want Uw rechten zijn goed."));
dusuperobject.biblemap.put("b19_119_40", new dusuperobject(19,119,40,"Zie, ik heb een begeerte tot Uw bevelen; maak mij levend door Uw gerechtigheid."));
dusuperobject.biblemap.put("b19_119_41", new dusuperobject(19,119,41,"Vau. En dat mij Uw goedertierenheden overkomen, o HEERE! Uw heil, naar Uw toezegging;"));
dusuperobject.biblemap.put("b19_119_42", new dusuperobject(19,119,42,"Opdat ik mijn smader wat heb te antwoorden, want ik vertrouw op Uw woord."));
dusuperobject.biblemap.put("b19_119_43", new dusuperobject(19,119,43,"En ruk het woord der waarheid van mijn mond niet al te zeer, want ik hoop op Uw rechten."));
dusuperobject.biblemap.put("b19_119_44", new dusuperobject(19,119,44,"Zo zal ik Uw wet steeds onderhouden, eeuwiglijk en altoos."));
dusuperobject.biblemap.put("b19_119_45", new dusuperobject(19,119,45,"En ik zal wandelen in de ruimte, omdat ik Uw bevelen gezocht heb."));
dusuperobject.biblemap.put("b19_119_46", new dusuperobject(19,119,46,"Ook zal ik voor koningen spreken van Uw getuigenissen, en mij niet schamen."));
dusuperobject.biblemap.put("b19_119_47", new dusuperobject(19,119,47,"En ik zal mij vermaken in Uw geboden, die ik liefheb."));
dusuperobject.biblemap.put("b19_119_48", new dusuperobject(19,119,48,"En ik zal mijn handen opheffen naar Uw geboden, die ik liefheb, en ik zal Uw inzettingen betrachten."));
dusuperobject.biblemap.put("b19_119_49", new dusuperobject(19,119,49,"Zain. Gedenk des woords, tot Uw knecht gesproken, op hetwelk Gij mij hebt doen hopen."));
dusuperobject.biblemap.put("b19_119_50", new dusuperobject(19,119,50,"Dit is mijn troost in mijn ellende, want Uw toezegging heeft mij levend gemaakt."));
dusuperobject.biblemap.put("b19_119_51", new dusuperobject(19,119,51,"De hovaardigen hebben mij boven mate zeer bespot; nochtans ben ik van Uw wet niet geweken."));
dusuperobject.biblemap.put("b19_119_52", new dusuperobject(19,119,52,"Ik heb gedacht, o HEERE! aan Uw oordelen van ouds aan, en heb mij getroost."));
dusuperobject.biblemap.put("b19_119_53", new dusuperobject(19,119,53,"Grote beroering heeft mij bevangen vanwege de goddelozen, die Uw wet verlaten."));
dusuperobject.biblemap.put("b19_119_54", new dusuperobject(19,119,54,"Uw inzettingen zijn mij gezangen geweest, ter plaatse mijner vreemdelingschappen."));
dusuperobject.biblemap.put("b19_119_55", new dusuperobject(19,119,55,"HEERE! des nachts ben ik Uws Naams gedachtig geweest, en heb Uw wet bewaard."));
dusuperobject.biblemap.put("b19_119_56", new dusuperobject(19,119,56,"Dat is mij geschied, omdat ik Uw bevelen bewaard heb."));
dusuperobject.biblemap.put("b19_119_57", new dusuperobject(19,119,57,"Cheth. De HEERE is mijn deel, ik heb gezegd, dat ik Uw woorden zal bewaren."));
dusuperobject.biblemap.put("b19_119_58", new dusuperobject(19,119,58,"Ik heb Uw aanschijn ernstelijk gebeden van ganser harte, wees mij genadig naar Uw toezegging."));
dusuperobject.biblemap.put("b19_119_59", new dusuperobject(19,119,59,"Ik heb mijn wegen bedacht, en heb mijn voeten gekeerd tot Uw getuigenissen."));
dusuperobject.biblemap.put("b19_119_60", new dusuperobject(19,119,60,"Ik heb gehaast, en niet vertraagd Uw geboden te onderhouden."));
dusuperobject.biblemap.put("b19_119_61", new dusuperobject(19,119,61,"De goddeloze hopen hebben mij beroofd; nochtans heb ik Uw wet niet vergeten."));
dusuperobject.biblemap.put("b19_119_62", new dusuperobject(19,119,62,"Te middernacht sta ik op, om U te loven voor de rechten Uwer gerechtigheid."));
dusuperobject.biblemap.put("b19_119_63", new dusuperobject(19,119,63,"Ik ben een gezel van allen, die U vrezen, en van hen, die Uw bevelen onderhouden."));
dusuperobject.biblemap.put("b19_119_64", new dusuperobject(19,119,64,"HEERE! de aarde is vol van Uw goedertierenheid; leer mij Uw inzettingen."));
dusuperobject.biblemap.put("b19_119_65", new dusuperobject(19,119,65,"Teth. Gij hebt bij Uw knecht goed gedaan, HEERE, naar Uw woord."));
dusuperobject.biblemap.put("b19_119_66", new dusuperobject(19,119,66,"Leer mij een goeden zin en wetenschap, want ik heb aan Uw geboden geloofd."));
dusuperobject.biblemap.put("b19_119_67", new dusuperobject(19,119,67,"Eer ik verdrukt werd, dwaalde ik, maar nu onderhoud ik Uw woord."));
dusuperobject.biblemap.put("b19_119_68", new dusuperobject(19,119,68,"Gij zijt goed en goeddoende; leer mij Uw inzettingen."));
dusuperobject.biblemap.put("b19_119_69", new dusuperobject(19,119,69,"De hovaardigen hebben leugens tegen mij gestoffeerd; doch ik bewaar Uw bevelen van ganser harte."));
dusuperobject.biblemap.put("b19_119_70", new dusuperobject(19,119,70,"Hun hart is vet als smeer; maar ik heb vermaak in Uw wet."));
dusuperobject.biblemap.put("b19_119_71", new dusuperobject(19,119,71,"Het is mij goed, dat ik verdrukt ben geweest, opdat ik Uw inzettingen leerde."));
dusuperobject.biblemap.put("b19_119_72", new dusuperobject(19,119,72,"De wet Uws monds is mij beter, dan duizenden van goud of zilver."));
dusuperobject.biblemap.put("b19_119_73", new dusuperobject(19,119,73,"Jod. Uw handen hebben mij gemaakt, en bereid; maak mij verstandig, opdat ik Uw geboden lere."));
dusuperobject.biblemap.put("b19_119_74", new dusuperobject(19,119,74,"Die U vrezen, zullen mij aanzien, en zich verblijden, omdat ik op Uw woord gehoopt heb."));
dusuperobject.biblemap.put("b19_119_75", new dusuperobject(19,119,75,"Ik weet, HEERE! dat Uw gerichten de gerechtigheid zijn, en dat Gij mij uit getrouwheid verdrukt hebt."));
dusuperobject.biblemap.put("b19_119_76", new dusuperobject(19,119,76,"Laat toch Uw goedertierenheid zijn om mij te troosten, naar Uw toezegging aan Uw knecht."));
dusuperobject.biblemap.put("b19_119_77", new dusuperobject(19,119,77,"Laat mij Uw barmhartigheden overkomen, opdat ik leve, want Uw wet is al mijn vermaking."));
dusuperobject.biblemap.put("b19_119_78", new dusuperobject(19,119,78,"Laat de hovaardigen beschaamd worden, omdat zij mij met leugen nedergestoten hebben; doch ik betracht Uw geboden."));
dusuperobject.biblemap.put("b19_119_79", new dusuperobject(19,119,79,"Laat hen tot mij keren, die U vrezen, en die Uw getuigenissen kennen."));
dusuperobject.biblemap.put("b19_119_80", new dusuperobject(19,119,80,"Laat mijn hart oprecht zijn tot Uw inzettingen, opdat ik niet beschaamd worde."));
dusuperobject.biblemap.put("b19_119_81", new dusuperobject(19,119,81,"Caph. Mijn ziel is bezweken van verlangen naar Uw heil; op Uw woord heb ik gehoopt."));
dusuperobject.biblemap.put("b19_119_82", new dusuperobject(19,119,82,"Mijn ogen zijn bezweken van verlangen naar Uw toezegging, terwijl ik zeide: Wanneer zult Gij mij vertroosten?"));
dusuperobject.biblemap.put("b19_119_83", new dusuperobject(19,119,83,"Want ik ben geworden als een lederen zak in den rook; doch Uw inzettingen heb ik niet vergeten."));
dusuperobject.biblemap.put("b19_119_84", new dusuperobject(19,119,84,"Hoe vele zullen de dagen Uws knechts zijn? Wanneer zult Gij recht doen over mijn vervolgers?"));
dusuperobject.biblemap.put("b19_119_85", new dusuperobject(19,119,85,"De hovaardigen hebben mij putten gegraven, hetwelk niet is naar Uw wet."));
dusuperobject.biblemap.put("b19_119_86", new dusuperobject(19,119,86,"Al Uw geboden zijn waarheid; zij vervolgen mij met leugen, help mij."));
dusuperobject.biblemap.put("b19_119_87", new dusuperobject(19,119,87,"Zij hebben mij bijna vernietigd op de aarde, maar ik heb Uw bevelen niet verlaten."));
dusuperobject.biblemap.put("b19_119_88", new dusuperobject(19,119,88,"Maak mij levend naar Uw goedertierenheid, dan zal ik de getuigenis Uws monds onderhouden."));
dusuperobject.biblemap.put("b19_119_89", new dusuperobject(19,119,89,"Lamed. O HEERE! Uw woord bestaat in der eeuwigheid in de hemelen."));
dusuperobject.biblemap.put("b19_119_90", new dusuperobject(19,119,90,"Uw goedertierenheid is van geslacht tot geslacht; Gij hebt de aarde vastgemaakt, en zij blijft staan;"));
dusuperobject.biblemap.put("b19_119_91", new dusuperobject(19,119,91,"Naar Uw verordeningen blijven zij nog heden staan, want zij allen zijn Uw knechten."));
dusuperobject.biblemap.put("b19_119_92", new dusuperobject(19,119,92,"Indien Uw wet niet ware geweest al mijn vermaking, ik ware in mijn druk al lang vergaan."));
dusuperobject.biblemap.put("b19_119_93", new dusuperobject(19,119,93,"Ik zal Uw bevelen in der eeuwigheid niet vergeten, want door dezelve hebt Gij mij levend gemaakt."));
dusuperobject.biblemap.put("b19_119_94", new dusuperobject(19,119,94,"Ik ben Uw, behoud mij, want ik heb Uw bevelen gezocht."));
dusuperobject.biblemap.put("b19_119_95", new dusuperobject(19,119,95,"De goddelozen hebben op mij gewacht, om mij te doen vergaan; ik neem acht op Uw getuigenissen."));
dusuperobject.biblemap.put("b19_119_96", new dusuperobject(19,119,96,"In alle volmaaktheid heb ik een einde gezien; maar Uw gebod is zeer wijd."));
dusuperobject.biblemap.put("b19_119_97", new dusuperobject(19,119,97,"Mem. Hoe lief heb ik Uw wet! Zij is mijn betrachting den gansen dag."));
dusuperobject.biblemap.put("b19_119_98", new dusuperobject(19,119,98,"Zij maakt mij door Uw geboden wijzer, dan mijn vijanden zijn, want zij is in eeuwigheid bij mij."));
dusuperobject.biblemap.put("b19_119_99", new dusuperobject(19,119,99,"Ik ben verstandiger dan al mijn leraars, omdat Uw getuigenissen mijn betrachting zijn."));
dusuperobject.biblemap.put("b19_119_100", new dusuperobject(19,119,100,"Ik ben voorzichtiger dan de ouden, omdat ik Uw bevelen bewaard heb."));
dusuperobject.biblemap.put("b19_119_11", new dusuperobject(19,119,11,"Ik heb mijn voeten geweerd van alle kwade paden, opdat ik Uw woord zou onderhouden."));
dusuperobject.biblemap.put("b19_119_12", new dusuperobject(19,119,12,"Ik ben niet geweken van Uw rechten, want Gij hebt mij geleerd."));
dusuperobject.biblemap.put("b19_119_13", new dusuperobject(19,119,13,"Hoe zoet zijn Uw redenen mijn gehemelte geweest, meer dan honig mijn mond!"));
dusuperobject.biblemap.put("b19_119_14", new dusuperobject(19,119,14,"Uit Uw bevelen krijg ik verstand, daarom haat ik alle leugenpaden."));
dusuperobject.biblemap.put("b19_119_15", new dusuperobject(19,119,15,"Nun. Uw woord is een lamp voor mijn voet, en een licht voor mijn pad."));
dusuperobject.biblemap.put("b19_119_16", new dusuperobject(19,119,16,"Ik heb gezworen, en zal het bevestigen, dat ik onderhouden zal de rechten Uwer gerechtigheid."));
dusuperobject.biblemap.put("b19_119_17", new dusuperobject(19,119,17,"Ik ben gans zeer verdrukt, HEERE! maak mij levend naar Uw woord."));
dusuperobject.biblemap.put("b19_119_18", new dusuperobject(19,119,18,"Laat U toch, o HEERE! welgevallen de vrijwillige offeranden mijns monds, en leer mij Uw rechten."));
dusuperobject.biblemap.put("b19_119_19", new dusuperobject(19,119,19,"Mijn ziel is geduriglijk in mijn hand; nochtans vergeet ik Uw wet niet."));
dusuperobject.biblemap.put("b19_119_110", new dusuperobject(19,119,110,"De goddelozen hebben mij een strik gelegd; nochtans ben ik niet afgedwaald van Uw bevelen."));
dusuperobject.biblemap.put("b19_119_111", new dusuperobject(19,119,111,"Ik heb Uw getuigenissen genomen tot een eeuwige erve, want zij zijn mijns harten vrolijkheid."));
dusuperobject.biblemap.put("b19_119_112", new dusuperobject(19,119,112,"Ik heb mijn hart geneigd, om Uw inzettingen eeuwiglijk te doen, ten einde toe."));
dusuperobject.biblemap.put("b19_119_113", new dusuperobject(19,119,113,"Samech. Ik haat de kwade ranken, maar heb Uw wet lief."));
dusuperobject.biblemap.put("b19_119_114", new dusuperobject(19,119,114,"Gij zijt mijn Schuilplaats en mijn Schild; op Uw Woord heb ik gehoopt."));
dusuperobject.biblemap.put("b19_119_115", new dusuperobject(19,119,115,"Wijkt van mij, gij boosdoeners! dat ik de geboden mijns Gods moge bewaren."));
dusuperobject.biblemap.put("b19_119_116", new dusuperobject(19,119,116,"Ondersteun mij naar Uw toezegging, opdat ik leve; en laat mij niet beschaamd worden over mijn hope."));
dusuperobject.biblemap.put("b19_119_117", new dusuperobject(19,119,117,"Ondersteun mij, zo zal ik behouden zijn; dan zal ik mij steeds in Uw inzettingen vermaken."));
dusuperobject.biblemap.put("b19_119_118", new dusuperobject(19,119,118,"Gij vertreedt al degenen, die van Uw inzettingen afdwalen, want hun bedrog is leugen."));
dusuperobject.biblemap.put("b19_119_119", new dusuperobject(19,119,119,"Gij doet alle goddelozen der aarde weg als schuim, daarom heb ik Uw getuigenissen lief."));
dusuperobject.biblemap.put("b19_119_120", new dusuperobject(19,119,120,"Het haar mijns vleses is te berge gerezen van verschrikking voor U, en ik heb gevreesd voor Uw oordelen."));
dusuperobject.biblemap.put("b19_119_121", new dusuperobject(19,119,121,"Ain. Ik heb recht en gerechtigheid gedaan; geef mij niet over aan mijn onderdrukkers."));
dusuperobject.biblemap.put("b19_119_122", new dusuperobject(19,119,122,"Wees borg voor Uw knecht ten goede; laat de hovaardigen mij niet onderdrukken."));
dusuperobject.biblemap.put("b19_119_123", new dusuperobject(19,119,123,"Mijn ogen zijn bezweken van verlangen naar Uw heil, en naar de toezegging Uwer rechtvaardigheid."));
dusuperobject.biblemap.put("b19_119_124", new dusuperobject(19,119,124,"Doe bij Uw knecht naar Uw goedertierenheid, en leer mij Uw inzettingen."));
dusuperobject.biblemap.put("b19_119_125", new dusuperobject(19,119,125,"Ik ben Uw knecht, maak mij verstandig, en ik zal Uw getuigenissen kennen."));
dusuperobject.biblemap.put("b19_119_126", new dusuperobject(19,119,126,"Het is tijd voor den HEERE, dat Hij werke, want zij hebben Uw wet verbroken."));
dusuperobject.biblemap.put("b19_119_127", new dusuperobject(19,119,127,"Daarom heb ik Uw geboden lief, meer dan goud, ja, meer dan het fijnste goud."));
dusuperobject.biblemap.put("b19_119_128", new dusuperobject(19,119,128,"Daarom heb ik alle Uw bevelen, van alles, voor recht gehouden; maar alle valse pad heb ik gehaat."));
dusuperobject.biblemap.put("b19_119_129", new dusuperobject(19,119,129,"Pe. Uw getuigenissen zijn wonderbaar, daarom bewaart ze mijn ziel."));
dusuperobject.biblemap.put("b19_119_130", new dusuperobject(19,119,130,"De opening Uwer woorden geeft licht, de slechten verstandig makende."));
dusuperobject.biblemap.put("b19_119_131", new dusuperobject(19,119,131,"Ik heb mijn mond wijd opengedaan, en gehijgd, want ik heb verlangd naar Uw geboden."));
dusuperobject.biblemap.put("b19_119_132", new dusuperobject(19,119,132,"Zie mij aan, wees mij genadig, naar het recht aan degenen, die Uw Naam beminnen."));
dusuperobject.biblemap.put("b19_119_133", new dusuperobject(19,119,133,"Maak mijn voetstappen vast in Uw Woord, en laat geen ongerechtigheid over mij heersen."));
dusuperobject.biblemap.put("b19_119_134", new dusuperobject(19,119,134,"Verlos mij van des mensen overlast, en ik zal Uw bevelen onderhouden."));
dusuperobject.biblemap.put("b19_119_135", new dusuperobject(19,119,135,"Doe Uw aangezicht lichten over Uw knecht, en leer mij Uw inzettingen."));
dusuperobject.biblemap.put("b19_119_136", new dusuperobject(19,119,136,"Waterbeken vlieten af uit mijn ogen, omdat zij Uw wet niet onderhouden."));
dusuperobject.biblemap.put("b19_119_137", new dusuperobject(19,119,137,"Tsade. HEERE! Gij zijt rechtvaardig, en elkeen Uwer oordelen is recht."));
dusuperobject.biblemap.put("b19_119_138", new dusuperobject(19,119,138,"Gij hebt de gerechtigheid Uwer getuigenissen, en de waarheid hogelijk geboden."));
dusuperobject.biblemap.put("b19_119_139", new dusuperobject(19,119,139,"Mijn ijver heeft mij doen vergaan, omdat mijn wederpartijders Uw woorden vergeten hebben."));
dusuperobject.biblemap.put("b19_119_140", new dusuperobject(19,119,140,"Uw woord is zeer gelouterd, en Uw knecht heeft het lief."));
dusuperobject.biblemap.put("b19_119_141", new dusuperobject(19,119,141,"Ik ben klein en veracht, doch Uw bevelen vergeet ik niet."));
dusuperobject.biblemap.put("b19_119_142", new dusuperobject(19,119,142,"Uw gerechtigheid is gerechtigheid in eeuwigheid, en Uw wet is de waarheid."));
dusuperobject.biblemap.put("b19_119_143", new dusuperobject(19,119,143,"Benauwdheid en angst hebben mij getroffen, doch Uw geboden zijn mijn vermakingen."));
dusuperobject.biblemap.put("b19_119_144", new dusuperobject(19,119,144,"De gerechtigheid Uwer getuigenissen is in der eeuwigheid; doe ze mij verstaan, zo zal ik leven."));
dusuperobject.biblemap.put("b19_119_145", new dusuperobject(19,119,145,"Koph. Ik heb van ganser harte geroepen: verhoor mij, o HEERE! ik zal Uw inzettingen bewaren."));
dusuperobject.biblemap.put("b19_119_146", new dusuperobject(19,119,146,"Ik heb U aangeroepen, verlos mij, en ik zal Uw getuigenissen onderhouden."));
dusuperobject.biblemap.put("b19_119_147", new dusuperobject(19,119,147,"Ik ben de morgen schemering voorgekomen, en heb geschrei gemaakt; op Uw woord heb ik gehoopt."));
dusuperobject.biblemap.put("b19_119_148", new dusuperobject(19,119,148,"Mijn ogen komen de nacht waken voor, om Uw rede te betrachten."));
dusuperobject.biblemap.put("b19_119_149", new dusuperobject(19,119,149,"Hoor mijn stem naar Uw goedertierenheid, o HEERE! maak mij levend naar Uw recht."));
dusuperobject.biblemap.put("b19_119_150", new dusuperobject(19,119,150,"Die kwade praktijken najagen, genaken mij, zij wijken verre van Uw wet."));
dusuperobject.biblemap.put("b19_119_151", new dusuperobject(19,119,151,"Maar Gij, HEERE! zijt nabij, en al Uw geboden zijn waarheid."));
dusuperobject.biblemap.put("b19_119_152", new dusuperobject(19,119,152,"Van ouds heb ik geweten van Uw getuigenissen, dat Gij ze in eeuwigheid gegrond hebt."));
dusuperobject.biblemap.put("b19_119_153", new dusuperobject(19,119,153,"Resch. Zie mijn ellende aan, en help mij uit, want Uw wet heb ik niet vergeten."));
dusuperobject.biblemap.put("b19_119_154", new dusuperobject(19,119,154,"Twist mijn twistzaak, en verlos mij, maak mij levend, naar Uw toezegging."));
dusuperobject.biblemap.put("b19_119_155", new dusuperobject(19,119,155,"Het heil is verre van de goddelozen, want zij zoeken Uw inzettingen niet."));
dusuperobject.biblemap.put("b19_119_156", new dusuperobject(19,119,156,"HEERE! Uw barmhartigheden zijn vele; maak mij levend naar Uw rechten."));
dusuperobject.biblemap.put("b19_119_157", new dusuperobject(19,119,157,"Mijn vervolgers en mijn wederpartijders zijn vele, maar van Uw getuigenissen wijk ik niet."));
dusuperobject.biblemap.put("b19_119_158", new dusuperobject(19,119,158,"Ik heb gezien degenen, die trouwelooslijk handelen, en het verdroot mij, dat zij Uw woord niet onderhielden."));
dusuperobject.biblemap.put("b19_119_159", new dusuperobject(19,119,159,"Zie aan, dat ik Uw bevelen lief heb, o HEERE! maak mij levend naar Uw goedertierenheid."));
dusuperobject.biblemap.put("b19_119_160", new dusuperobject(19,119,160,"Het begin Uws woords is waarheid, en in der eeuwigheid is al het recht Uwer gerechtigheid."));
dusuperobject.biblemap.put("b19_119_161", new dusuperobject(19,119,161,"Schin. De vorsten hebben mij vervolgd zonder oorzaak; maar mijn hart heeft gevreesd voor Uw woord."));
dusuperobject.biblemap.put("b19_119_162", new dusuperobject(19,119,162,"Ik ben vrolijk over Uw toezegging, als een, die een groten buit vindt."));
dusuperobject.biblemap.put("b19_119_163", new dusuperobject(19,119,163,"Ik haat de valsheid, en heb er een gruwel van; maar Uw wet heb ik lief."));
dusuperobject.biblemap.put("b19_119_164", new dusuperobject(19,119,164,"Ik loof U zeven maal des daags, over de rechten Uwer gerechtigheid."));
dusuperobject.biblemap.put("b19_119_165", new dusuperobject(19,119,165,"Die Uw wet beminnen, hebben groten vrede, en zij hebben geen aanstoot."));
dusuperobject.biblemap.put("b19_119_166", new dusuperobject(19,119,166,"O HEERE! ik hoop op Uw heil, en doe Uw geboden."));
dusuperobject.biblemap.put("b19_119_167", new dusuperobject(19,119,167,"Mijn ziel onderhoudt Uw getuigenissen, en ik heb ze zeer lief."));
dusuperobject.biblemap.put("b19_119_168", new dusuperobject(19,119,168,"Ik onderhoud Uw bevelen en Uw getuigenissen, want al mijn wegen zijn voor U."));
dusuperobject.biblemap.put("b19_119_169", new dusuperobject(19,119,169,"Thau. O HEERE! laat mijn geschrei voor Uw aanschijn genaken, maak mij verstandig naar Uw woord."));
dusuperobject.biblemap.put("b19_119_170", new dusuperobject(19,119,170,"Laat mijn smeken voor Uw aanschijn komen, red mij naar Uw toezegging."));
dusuperobject.biblemap.put("b19_119_171", new dusuperobject(19,119,171,"Mijn lippen zullen Uw lof overvloediglijk uitstorten, als Gij mij Uw inzettingen zult geleerd hebben."));
dusuperobject.biblemap.put("b19_119_172", new dusuperobject(19,119,172,"Mijn tong zal spraak houden van Uw rede, want al Uw geboden zijn rechtvaardigheid."));
dusuperobject.biblemap.put("b19_119_173", new dusuperobject(19,119,173,"Laat Uw hand mij te hulp komen, want ik heb Uw bevelen verkoren."));
dusuperobject.biblemap.put("b19_119_174", new dusuperobject(19,119,174,"O HEERE! ik verlang naar Uw heil, en Uw wet is al mijn vermaking."));
dusuperobject.biblemap.put("b19_119_175", new dusuperobject(19,119,175,"Laat mijn ziel leven, en zij zal U loven, en laat Uw rechten mij helpen."));
dusuperobject.biblemap.put("b19_119_176", new dusuperobject(19,119,176,"Ik heb gedwaald als een verloren schaap; zoek Uw knecht, want Uw geboden heb ik niet vergeten."));
dusuperobject.biblemap.put("b19_120_1", new dusuperobject(19,120,1,"Een lied op Hammaaloth. Ik heb tot den HEERE geroepen in mijn benauwdheid, en Hij heeft mij verhoord."));
dusuperobject.biblemap.put("b19_120_2", new dusuperobject(19,120,2,"O HEERE! red mijn ziel van de valse lippen, van de bedriegelijke tong."));
dusuperobject.biblemap.put("b19_120_3", new dusuperobject(19,120,3,"Wat zal U de bedriegelijke tong geven, of wat zal zij U toevoegen?"));
dusuperobject.biblemap.put("b19_120_4", new dusuperobject(19,120,4,"Scherpe pijlen eens machtigen, mitsgaders gloeiende jeneverkolen."));
dusuperobject.biblemap.put("b19_120_5", new dusuperobject(19,120,5,"O, wee mij, dat ik een vreemdeling ben in Mesech, dat ik in de tenten Kedars wone."));
dusuperobject.biblemap.put("b19_120_6", new dusuperobject(19,120,6,"Mijn ziel heeft lang gewoond bij degenen, die den vrede haten."));
dusuperobject.biblemap.put("b19_120_7", new dusuperobject(19,120,7,"Ik ben vreedzaam; maar als ik spreek, zijn zij aan den oorlog."));
dusuperobject.biblemap.put("b19_121_1", new dusuperobject(19,121,1,"Een lied Hammaaloth. Ik hef mijn ogen op naar de bergen, van waar mijn hulp komen zal."));
dusuperobject.biblemap.put("b19_121_2", new dusuperobject(19,121,2,"Mijn hulp is van den HEERE, Die hemel en aarde gemaakt heeft."));
dusuperobject.biblemap.put("b19_121_3", new dusuperobject(19,121,3,"Hij zal uw voet niet laten wankelen; uw Bewaarder zal niet sluimeren."));
dusuperobject.biblemap.put("b19_121_4", new dusuperobject(19,121,4,"Ziet, de Bewaarder Israels zal niet sluimeren, noch slapen."));
dusuperobject.biblemap.put("b19_121_5", new dusuperobject(19,121,5,"De HEERE is uw Bewaarder, de HEERE is uw Schaduw, aan uw rechterhand."));
dusuperobject.biblemap.put("b19_121_6", new dusuperobject(19,121,6,"De zon zal u des daags niet steken, noch de maan des nachts."));
dusuperobject.biblemap.put("b19_121_7", new dusuperobject(19,121,7,"De HEERE zal u bewaren van alle kwaad; uw ziel zal Hij bewaren."));
dusuperobject.biblemap.put("b19_121_8", new dusuperobject(19,121,8,"De HEERE zal uw uitgang en uw ingang bewaren, van nu aan tot in der eeuwigheid."));
dusuperobject.biblemap.put("b19_122_1", new dusuperobject(19,122,1,"Een lied Hammaaloth, van David. Ik verblijd mij in degenen, die tot mij zeggen: Wij zullen in het huis des HEEREN gaan."));
dusuperobject.biblemap.put("b19_122_2", new dusuperobject(19,122,2,"Onze voeten zijn staande in uw poorten, o Jeruzalem!"));
dusuperobject.biblemap.put("b19_122_3", new dusuperobject(19,122,3,"Jeruzalem is gebouwd, als een stad, die wel samengevoegd is;"));
dusuperobject.biblemap.put("b19_122_4", new dusuperobject(19,122,4,"Waarheen de stammen opgaan, de stammen des HEEREN, tot de getuigenis Israels, om den Naam des HEEREN te danken."));
dusuperobject.biblemap.put("b19_122_5", new dusuperobject(19,122,5,"Want daar zijn de stoelen des gerichts gezet, de stoelen van het huis van David."));
dusuperobject.biblemap.put("b19_122_6", new dusuperobject(19,122,6,"Bidt om den vrede van Jeruzalem; wel moeten zij varen, die u beminnen."));
dusuperobject.biblemap.put("b19_122_7", new dusuperobject(19,122,7,"Vrede zij in uw vesting, welvaren in uw paleizen."));
dusuperobject.biblemap.put("b19_122_8", new dusuperobject(19,122,8,"Om mijner broederen en mijner vrienden wil, zal ik nu spreken, vrede zij in u!"));
dusuperobject.biblemap.put("b19_122_9", new dusuperobject(19,122,9,"Om des huizes des HEEREN, onzes Gods wil, zal ik het goede voor u zoeken."));
dusuperobject.biblemap.put("b19_123_1", new dusuperobject(19,123,1,"Een lied op Hammaaloth. Ik hef mijn ogen op tot U, Die in de hemelen zit."));
dusuperobject.biblemap.put("b19_123_2", new dusuperobject(19,123,2,"Zie, gelijk de ogen der knechten zijn op de hand hunner heren; gelijk de ogen der dienstmaagd zijn op de hand harer vrouw; alzo zijn onze ogen op den HEERE, onze God, totdat Hij ons genadig zij."));
dusuperobject.biblemap.put("b19_123_3", new dusuperobject(19,123,3,"Zijt ons genadig, o HEERE! zijt ons genadig, want wij zijn der verachting veel te zat."));
dusuperobject.biblemap.put("b19_123_4", new dusuperobject(19,123,4,"Onze ziel is veel te zat des spots der weelderigen, der verachting der hovaardigen."));
dusuperobject.biblemap.put("b19_124_1", new dusuperobject(19,124,1,"Een lied Hammaaloth, van David. Ten ware de HEERE, Die bij ons geweest is, zegge nu Israel,"));
dusuperobject.biblemap.put("b19_124_2", new dusuperobject(19,124,2,"Ten ware de HEERE, Die bij ons geweest is, als de mensen tegen ons opstonden;"));
dusuperobject.biblemap.put("b19_124_3", new dusuperobject(19,124,3,"Toen zouden zij ons levend verslonden hebben, als hun toorn tegen ons ontstak."));
dusuperobject.biblemap.put("b19_124_4", new dusuperobject(19,124,4,"Toen zouden ons de wateren overlopen hebben; een stroom zou over onze ziel gegaan zijn."));
dusuperobject.biblemap.put("b19_124_5", new dusuperobject(19,124,5,"Toen zouden de stoute wateren over onze ziel gegaan zijn."));
dusuperobject.biblemap.put("b19_124_6", new dusuperobject(19,124,6,"De HEERE zij geloofd, Die ons in hun tanden niet heeft overgegeven tot een roof."));
dusuperobject.biblemap.put("b19_124_7", new dusuperobject(19,124,7,"Onze ziel is ontkomen, als een vogel uit den strik der vogelvangers; de strik is gebroken, en wij zijn ontkomen."));
dusuperobject.biblemap.put("b19_124_8", new dusuperobject(19,124,8,"Onze hulp is in den Naam des HEEREN, Die hemel en aarde gemaakt heeft."));
dusuperobject.biblemap.put("b19_125_1", new dusuperobject(19,125,1,"Een lied Hammaaloth. Die op den HEERE vertrouwen, zijn als de berg Sion, die niet wankelt, maar blijft in eeuwigheid."));
dusuperobject.biblemap.put("b19_125_2", new dusuperobject(19,125,2,"Rondom Jeruzalem zijn bergen; alzo is de HEERE rondom Zijn volk, van nu aan tot in der eeuwigheid."));
dusuperobject.biblemap.put("b19_125_3", new dusuperobject(19,125,3,"Want de scepter der goddeloosheid zal niet rusten op het lot der rechtvaardigen; opdat de rechtvaardigen hun handen niet uitstrekken tot onrecht."));
dusuperobject.biblemap.put("b19_125_4", new dusuperobject(19,125,4,"HEERE! doe den goeden wel, en dengenen, die oprecht zijn in hun harten."));
dusuperobject.biblemap.put("b19_125_5", new dusuperobject(19,125,5,"Maar die zich neigen tot hun kromme wegen, die zal de HEERE weg doen gaan met de werkers der ongerechtigheid. Vrede zal over Israel zijn!"));
dusuperobject.biblemap.put("b19_126_1", new dusuperobject(19,126,1,"Een lied Hammaaloth. Als de HEERE de gevangenen Sions wederbracht, waren wij gelijk degenen, die dromen."));
dusuperobject.biblemap.put("b19_126_2", new dusuperobject(19,126,2,"Toen werd onze mond vervuld met lachen, en onze tong met gejuich; toen zeide men onder de heidenen: De HEERE heeft grote dingen aan dezen gedaan."));
dusuperobject.biblemap.put("b19_126_3", new dusuperobject(19,126,3,"De HEERE heeft grote dingen bij ons gedaan; dies zijn wij verblijd."));
dusuperobject.biblemap.put("b19_126_4", new dusuperobject(19,126,4,"O HEERE! wend onze gevangenis, gelijk waterstromen in het zuiden."));
dusuperobject.biblemap.put("b19_126_5", new dusuperobject(19,126,5,"Die met tranen zaaien, zullen met gejuich maaien."));
dusuperobject.biblemap.put("b19_126_6", new dusuperobject(19,126,6,"Die het zaad draagt, dat men zaaien zal, gaat al gaande en wenende; maar voorzeker zal hij met gejuich wederkomen, dragende zijn schoven."));
dusuperobject.biblemap.put("b19_127_1", new dusuperobject(19,127,1,"Een lied Hammaaloth, van Salomo. Zo de HEERE het huis niet bouwt, tevergeefs arbeiden deszelfs bouwlieden daaraan; zo de HEERE de stad niet bewaart, tevergeefs waakt de wachter."));
dusuperobject.biblemap.put("b19_127_2", new dusuperobject(19,127,2,"Het is tevergeefs, dat gijlieden vroeg opstaat, laat opblijft, eet brood der smarten; het is alzo, dat Hij het Zijn beminden als in den slaap geeft."));
dusuperobject.biblemap.put("b19_127_3", new dusuperobject(19,127,3,"Ziet, de kinderen zijn een erfdeel des HEEREN; des buiks vrucht is een beloning."));
dusuperobject.biblemap.put("b19_127_4", new dusuperobject(19,127,4,"Gelijk de pijlen zijn in de hand eens helds, zodanig zijn de zonen der jeugd."));
dusuperobject.biblemap.put("b19_127_5", new dusuperobject(19,127,5,"Welgelukzalig is de man, die zijn pijlkoker met dezelve gevuld heeft; zij zullen niet beschaamd worden, als zij met de vijanden spreken zullen in de poort."));
dusuperobject.biblemap.put("b19_128_1", new dusuperobject(19,128,1,"Een lied Hammaaloth. Welgelukzalig is een iegelijk, die den HEERE vreest, die in Zijn wegen wandelt."));
dusuperobject.biblemap.put("b19_128_2", new dusuperobject(19,128,2,"Want gij zult eten den arbeid uwer handen; welgelukzalig zult gij zijn, en het zal u welgaan."));
dusuperobject.biblemap.put("b19_128_3", new dusuperobject(19,128,3,"Uw huisvrouw zal wezen als een vruchtbare wijnstok aan de zijden van uw huis; uw kinderen als olijfplanten rondom uw tafel."));
dusuperobject.biblemap.put("b19_128_4", new dusuperobject(19,128,4,"Ziet, alzo zal zekerlijk die man gezegend worden, die den HEERE vreest."));
dusuperobject.biblemap.put("b19_128_5", new dusuperobject(19,128,5,"De HEERE zal u zegenen uit Sion, en gij zult het goede van Jeruzalem aanschouwen al de dagen uws levens;"));
dusuperobject.biblemap.put("b19_128_6", new dusuperobject(19,128,6,"En gij zult uw kindskinderen zien. Vrede over Israel!"));
dusuperobject.biblemap.put("b19_129_1", new dusuperobject(19,129,1,"Een lied Hammaaloth. Zij hebben mij dikwijls benauwd van mijn jeugd af, zegge nu Israel;"));
dusuperobject.biblemap.put("b19_129_2", new dusuperobject(19,129,2,"Zij hebben mij dikwijls van mijn jeugd af benauwd; evenwel hebben zij mij niet overmocht."));
dusuperobject.biblemap.put("b19_129_3", new dusuperobject(19,129,3,"Ploegers hebben op mijn rug geploegd; zij hebben hun voren lang getogen."));
dusuperobject.biblemap.put("b19_129_4", new dusuperobject(19,129,4,"De HEERE, Die rechtvaardig is, heeft de touwen der goddelozen afgehouwen."));
dusuperobject.biblemap.put("b19_129_5", new dusuperobject(19,129,5,"Laat hen beschaamd en achterwaarts gedreven worden, allen, die Sion haten."));
dusuperobject.biblemap.put("b19_129_6", new dusuperobject(19,129,6,"Laat hen worden als gras op de daken, hetwelk verdort, eer men het uittrekt;"));
dusuperobject.biblemap.put("b19_129_7", new dusuperobject(19,129,7,"Waarmede de maaier zijn hand niet vult, noch de garvenbinder zijn arm;"));
dusuperobject.biblemap.put("b19_129_8", new dusuperobject(19,129,8,"En die voorbijgaan, niet zeggen: De zegen des HEEREN zij bij u! Wij zegenen ulieden in den Naam des HEEREN."));
dusuperobject.biblemap.put("b19_130_1", new dusuperobject(19,130,1,"Een lied Hammaaloth. Uit de diepten roep ik tot U, o HEERE!"));
dusuperobject.biblemap.put("b19_130_2", new dusuperobject(19,130,2,"HEERE! hoor naar mijn stem; laat Uw oren opmerkende zijn op de stem mijner smekingen."));
dusuperobject.biblemap.put("b19_130_3", new dusuperobject(19,130,3,"Zo Gij, HEERE! de ongerechtigheden gadeslaat; HEERE! wie zal bestaan?"));
dusuperobject.biblemap.put("b19_130_4", new dusuperobject(19,130,4,"Maar bij U is vergeving, opdat Gij gevreesd wordt."));
dusuperobject.biblemap.put("b19_130_5", new dusuperobject(19,130,5,"Ik verwacht den HEERE; mijn ziel verwacht, en ik hoop op Zijn Woord."));
dusuperobject.biblemap.put("b19_130_6", new dusuperobject(19,130,6,"Mijn ziel wacht op den HEERE, meer dan de wachters op den morgen; de wachters op den morgen."));
dusuperobject.biblemap.put("b19_130_7", new dusuperobject(19,130,7,"Israel hope op den HEERE; want bij den HEERE is goedertierenheid, en bij Hem is veel verlossing."));
dusuperobject.biblemap.put("b19_130_8", new dusuperobject(19,130,8,"En Hij zal Israel verlossen van al zijn ongerechtigheden."));
dusuperobject.biblemap.put("b19_131_1", new dusuperobject(19,131,1,"Een lied Hammaaloth, van David. O HEERE! mijn hart is niet verheven, en mijn ogen zijn niet hoog; ook heb ik niet gewandeld in dingen mij te groot en te wonderlijk."));
dusuperobject.biblemap.put("b19_131_2", new dusuperobject(19,131,2,"Zo ik mijn ziel niet heb gezet en stil gehouden, gelijk een gespeend kind bij zijn moeder! Mijn ziel is als een gespeend kind in mij."));
dusuperobject.biblemap.put("b19_131_3", new dusuperobject(19,131,3,"Israel hope op den HEERE van nu aan tot in der eeuwigheid."));
dusuperobject.biblemap.put("b19_132_1", new dusuperobject(19,132,1,"Een lied Hammaaloth. O HEERE! gedenk aan David, aan al zijn lijden;"));
dusuperobject.biblemap.put("b19_132_2", new dusuperobject(19,132,2,"Dat hij den HEERE gezworen heeft, den Machtige Jakobs gelofte gedaan heeft, zeggende:"));
dusuperobject.biblemap.put("b19_132_3", new dusuperobject(19,132,3,"Zo ik in de tent mijns huizes inga, zo ik op de koets van mijn bed klimme!"));
dusuperobject.biblemap.put("b19_132_4", new dusuperobject(19,132,4,"Zo ik mijn ogen slaap geve, mijn oogleden sluimering;"));
dusuperobject.biblemap.put("b19_132_5", new dusuperobject(19,132,5,"Totdat ik voor den HEERE een plaats gevonden zal hebben, woningen voor den Machtige Jakobs!"));
dusuperobject.biblemap.put("b19_132_6", new dusuperobject(19,132,6,"Ziet, wij hebben van haar gehoord in Efratha; wij hebben haar gevonden in de velden van Jaar."));
dusuperobject.biblemap.put("b19_132_7", new dusuperobject(19,132,7,"Wij zullen in Zijn woningen ingaan, wij zullen ons nederbuigen voor de voetbank Zijner voeten."));
dusuperobject.biblemap.put("b19_132_8", new dusuperobject(19,132,8,"Sta op, HEERE! tot Uw rust, Gij en de ark Uwer sterkte!"));
dusuperobject.biblemap.put("b19_132_9", new dusuperobject(19,132,9,"Dat Uw priesters bekleed worden met gerechtigheid, en dat Uw gunstgenoten juichen."));
dusuperobject.biblemap.put("b19_132_10", new dusuperobject(19,132,10,"Weer het aangezicht Uws Gezalfden niet af, om Davids, Uws knechts wil."));
dusuperobject.biblemap.put("b19_132_11", new dusuperobject(19,132,11,"De HEERE heeft David de waarheid gezworen, waarvan Hij niet wijken zal, zeggende: Van de vrucht uws buiks zal Ik op uw troon zetten."));
dusuperobject.biblemap.put("b19_132_12", new dusuperobject(19,132,12,"Indien uw zonen Mijn verbond zullen houden, en Mijn getuigenissen, die Ik hun leren zal; zo zullen ook hun zonen tot in eeuwigheid op uw troon zitten."));
dusuperobject.biblemap.put("b19_132_13", new dusuperobject(19,132,13,"Want de HEERE heeft Sion verkoren, Hij heeft het begeerd tot Zijn woonplaats, zeggende:"));
dusuperobject.biblemap.put("b19_132_14", new dusuperobject(19,132,14,"Dit is Mijn rust tot in eeuwigheid, hier zal Ik wonen, want Ik heb ze begeerd."));
dusuperobject.biblemap.put("b19_132_15", new dusuperobject(19,132,15,"Ik zal haar kost rijkelijk zegenen, haar nooddruftigen zal Ik met brood verzadigen."));
dusuperobject.biblemap.put("b19_132_16", new dusuperobject(19,132,16,"En haar priesters zal Ik met heil bekleden, en haar gunstgenoten zullen zeer juichen."));
dusuperobject.biblemap.put("b19_132_17", new dusuperobject(19,132,17,"Daar zal Ik David een hoorn doen uitspruiten; Ik heb voor Mijn Gezalfde een lamp toegericht."));
dusuperobject.biblemap.put("b19_132_18", new dusuperobject(19,132,18,"Ik zal zijn vijanden met schaamte bekleden; maar op hem zal zijn kroon bloeien."));
dusuperobject.biblemap.put("b19_133_1", new dusuperobject(19,133,1,"Een lied Hammaaloth, van David. Ziet, hoe goed en hoe liefelijk is het, dat broeders ook samenwonen."));
dusuperobject.biblemap.put("b19_133_2", new dusuperobject(19,133,2,"Het is, gelijk de kostelijke olie op het hoofd, nederdalende op den baard, den baard van Aaron, die nederdaalt tot op den zoom zijner klederen."));
dusuperobject.biblemap.put("b19_133_3", new dusuperobject(19,133,3,"Het is gelijk de dauw van Hermon, en die nederdaalt op de bergen van Sion, want de HEERE gebiedt aldaar den zegen en het leven tot in der eeuwigheid."));
dusuperobject.biblemap.put("b19_134_1", new dusuperobject(19,134,1,"Een lied Hammaaloth. Ziet, looft den HEERE, alle gij knechten des HEEREN! gij, die allen nacht in het huis des HEEREN staat."));
dusuperobject.biblemap.put("b19_134_2", new dusuperobject(19,134,2,"Heft uw handen op naar het heiligdom, en looft den HEERE."));
dusuperobject.biblemap.put("b19_134_3", new dusuperobject(19,134,3,"De HEERE zegene u uit Sion, Hij, Die den hemel en de aarde gemaakt heeft."));
dusuperobject.biblemap.put("b19_135_1", new dusuperobject(19,135,1,"Hallelujah! Prijst den Naam des HEEREN, prijst Hem, gij knechten des HEEREN!"));
dusuperobject.biblemap.put("b19_135_2", new dusuperobject(19,135,2,"Gij, die staat in het huis des HEEREN, in de voorhoven van het huis onzes Gods!"));
dusuperobject.biblemap.put("b19_135_3", new dusuperobject(19,135,3,"Looft den HEERE, want de HEERE is goed; psalmzingt Zijn Naam, want Hij is liefelijk."));
dusuperobject.biblemap.put("b19_135_4", new dusuperobject(19,135,4,"Want de HEERE heeft Zich Jakob verkoren, Israel tot Zijn eigendom."));
dusuperobject.biblemap.put("b19_135_5", new dusuperobject(19,135,5,"Want ik weet, dat de HEERE groot is, en dat onze Heere boven alle goden is."));
dusuperobject.biblemap.put("b19_135_6", new dusuperobject(19,135,6,"Al wat den HEERE behaagt, doet Hij, in de hemelen, en op de aarde, in de zeeen en alle afgronden."));
dusuperobject.biblemap.put("b19_135_7", new dusuperobject(19,135,7,"Hij doet dampen opklimmen van het einde der aarde; Hij maakt de bliksemen met den regen; Hij brengt den wind uit Zijn schatkameren voort."));
dusuperobject.biblemap.put("b19_135_8", new dusuperobject(19,135,8,"Die de eerstgeborenen van Egypte sloeg, van den mens af tot het vee toe."));
dusuperobject.biblemap.put("b19_135_9", new dusuperobject(19,135,9,"Hij zond tekenen en wonderen in het midden van u, o Egypte! tegen Farao en tegen al zijn knechten."));
dusuperobject.biblemap.put("b19_135_10", new dusuperobject(19,135,10,"Die veel volken sloeg, en machtige koningen doodde;"));
dusuperobject.biblemap.put("b19_135_11", new dusuperobject(19,135,11,"Sihon, den koning der Amorieten, en Og, den koning van Basan, en al de koninkrijken van Kanaan,"));
dusuperobject.biblemap.put("b19_135_12", new dusuperobject(19,135,12,"En Hij gaf hun land ten erve, ten erve aan Zijn volk Israel."));
dusuperobject.biblemap.put("b19_135_13", new dusuperobject(19,135,13,"O HEERE! Uw Naam is in eeuwigheid; HEERE! Uw gedachtenis is van geslacht tot geslacht."));
dusuperobject.biblemap.put("b19_135_14", new dusuperobject(19,135,14,"Want de HEERE zal Zijn volk richten, en het zal Hem berouwen over Zijn knechten."));
dusuperobject.biblemap.put("b19_135_15", new dusuperobject(19,135,15,"De afgoden der heidenen zijn zilver en goud, een werk van mensenhanden."));
dusuperobject.biblemap.put("b19_135_16", new dusuperobject(19,135,16,"Zij hebben een mond, maar spreken niet; zij hebben ogen, maar zien niet;"));
dusuperobject.biblemap.put("b19_135_17", new dusuperobject(19,135,17,"Oren hebben zij, maar horen niet; ook is er geen adem in hun mond."));
dusuperobject.biblemap.put("b19_135_18", new dusuperobject(19,135,18,"Dat die ze maken, hun gelijk worden, en al wie op hen vertrouwt."));
dusuperobject.biblemap.put("b19_135_19", new dusuperobject(19,135,19,"Gij huis Israels! looft den HEERE; gij huis Aarons! looft den HEERE."));
dusuperobject.biblemap.put("b19_135_20", new dusuperobject(19,135,20,"Gij huis van Levi! looft den HEERE; gij die den HEERE vreest! looft den HEERE."));
dusuperobject.biblemap.put("b19_135_21", new dusuperobject(19,135,21,"Geloofd zij de HEERE uit Sion, Die te Jeruzalem woont. Hallelujah!"));
dusuperobject.biblemap.put("b19_136_1", new dusuperobject(19,136,1,"Looft den HEERE, want Hij is goed; want Zijn goedertierenheid is in der eeuwigheid;"));
dusuperobject.biblemap.put("b19_136_2", new dusuperobject(19,136,2,"Looft den God der goden; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_3", new dusuperobject(19,136,3,"Looft den Heere der heren; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_4", new dusuperobject(19,136,4,"Dien, Die alleen grote wonderen doet; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_5", new dusuperobject(19,136,5,"Dien, die de hemelen met verstand gemaakt heeft; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_6", new dusuperobject(19,136,6,"Dien, Die de aarde op het water uitgespannen heeft; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_7", new dusuperobject(19,136,7,"Dien, Die de grote lichten heeft gemaakt; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_8", new dusuperobject(19,136,8,"De zon tot heerschappij op den dag; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_9", new dusuperobject(19,136,9,"De maan en sterren tot heerschappij in den nacht; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_10", new dusuperobject(19,136,10,"Dien, Die de Egyptenaren geslagen heeft in hun eerstgeborenen; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_11", new dusuperobject(19,136,11,"En heeft Israel uit het midden van hen uitgebracht; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_12", new dusuperobject(19,136,12,"Met een sterke hand, en met een uitgestrekte arm; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_13", new dusuperobject(19,136,13,"Dien, Die de Schelfzee in delen deelde; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_14", new dusuperobject(19,136,14,"En voerde Israel door het midden van dezelve; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_15", new dusuperobject(19,136,15,"Hij heeft Farao met zijn heir gestort in de Schelfzee; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_16", new dusuperobject(19,136,16,"Die Zijn volk door de woestijn geleid heeft; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_17", new dusuperobject(19,136,17,"Die grote koningen geslagen heeft; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_18", new dusuperobject(19,136,18,"En heeft heerlijke koningen gedood; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_19", new dusuperobject(19,136,19,"Sihon, de Amorietischen koning; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_20", new dusuperobject(19,136,20,"En Og, den koning van Basan; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_21", new dusuperobject(19,136,21,"En heeft hun land ten erve gegeven; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_22", new dusuperobject(19,136,22,"Ten erve aan Zijn knecht Israel; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_23", new dusuperobject(19,136,23,"Die aan ons gedacht heeft in onze nederigheid; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_24", new dusuperobject(19,136,24,"En Hij heeft ons onzen tegenpartijders ontrukt; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_25", new dusuperobject(19,136,25,"Die allen vlees spijs geeft; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_136_26", new dusuperobject(19,136,26,"Looft den God des hemels; want Zijn goedertierenheid is in der eeuwigheid."));
dusuperobject.biblemap.put("b19_137_1", new dusuperobject(19,137,1,"Aan de rivieren van Babel, daar zaten wij, ook weenden wij, als wij gedachten aan Sion."));
dusuperobject.biblemap.put("b19_137_2", new dusuperobject(19,137,2,"Wij hebben onze harpen gehangen aan de wilgen, die daarin zijn."));
dusuperobject.biblemap.put("b19_137_3", new dusuperobject(19,137,3,"Als zij, die ons aldaar gevangen hielden, de woorden eens lieds van ons begeerden, en zij, die ons overhoop geworpen hadden, vreugd, zeggende: Zingt ons een van de liederen Sions;"));
dusuperobject.biblemap.put("b19_137_4", new dusuperobject(19,137,4,"Wij zeiden: Hoe zouden wij een lied des HEEREN zingen in een vreemd land?"));
dusuperobject.biblemap.put("b19_137_5", new dusuperobject(19,137,5,"Indien ik u vergeet, o Jeruzalem! zo vergete mijn rechterhand zichzelve!"));
dusuperobject.biblemap.put("b19_137_6", new dusuperobject(19,137,6,"Mijn tong kleve aan mijn gehemelte, zo ik aan u niet gedenke, zo ik Jeruzalem niet verheffe boven het hoogste mijner blijdschap!"));
dusuperobject.biblemap.put("b19_137_7", new dusuperobject(19,137,7,"HEERE! gedenk aan de kinderen van Edom, aan den dag van Jeruzalem; die daar zeiden: Ontbloot ze, ontbloot ze, tot haar fondament toe!"));
dusuperobject.biblemap.put("b19_137_8", new dusuperobject(19,137,8,"O dochter van Babel! die verwoest zult worden, welgelukzalig zal hij zijn, die u uw misdaad vergelden zal, die gij aan ons misdaan hebt."));
dusuperobject.biblemap.put("b19_137_9", new dusuperobject(19,137,9,"Welgelukzalig zal hij zijn, die uw kinderkens grijpen, en aan de steenrots verpletteren zal."));
dusuperobject.biblemap.put("b19_138_1", new dusuperobject(19,138,1,"Een psalm van David. Ik zal U loven met mijn gehele hart; in de tegenwoordigheid der goden zal ik U psalmzingen."));
dusuperobject.biblemap.put("b19_138_2", new dusuperobject(19,138,2,"Ik zal mij nederbuigen naar het paleis Uwer heiligheid, en ik zal Uw Naam loven, om Uw goedertierenheid en om Uw waarheid; want Gij hebt vanwege Uw gansen Naam Uw woord groot gemaakt."));
dusuperobject.biblemap.put("b19_138_3", new dusuperobject(19,138,3,"Ten dage, als ik riep, zo hebt Gij mij verhoord; Gij hebt mij versterkt met kracht in mijn ziel."));
dusuperobject.biblemap.put("b19_138_4", new dusuperobject(19,138,4,"Alle koningen der aarde zullen U, o HEERE! loven, wanneer zij gehoord zullen hebben de redenen Uws monds."));
dusuperobject.biblemap.put("b19_138_5", new dusuperobject(19,138,5,"En zij zullen zingen van de wegen des HEEREN, want de heerlijkheid des HEEREN is groot."));
dusuperobject.biblemap.put("b19_138_6", new dusuperobject(19,138,6,"Want de HEERE is hoog, nochtans ziet Hij de nederige aan, en den verhevene kent Hij van verre."));
dusuperobject.biblemap.put("b19_138_7", new dusuperobject(19,138,7,"Als ik wandel in het midden der benauwdheid, maakt Gij mij levend; Uw hand strekt Gij uit tegen den toorn mijner vijanden, en Uw rechterhand behoudt mij."));
dusuperobject.biblemap.put("b19_138_8", new dusuperobject(19,138,8,"De HEERE zal het voor mij voleinden; Uw goedertierenheid, HEERE! is in der eeuwigheid; en laat niet varen de werken Uwer handen."));
dusuperobject.biblemap.put("b19_139_1", new dusuperobject(19,139,1,"Een psalm van David, voor den opperzangmeester. HEERE! Gij doorgrondt en kent mij."));
dusuperobject.biblemap.put("b19_139_2", new dusuperobject(19,139,2,"Gij weet mijn zitten en mijn opstaan; Gij verstaat van verre mijn gedachten."));
dusuperobject.biblemap.put("b19_139_3", new dusuperobject(19,139,3,"Gij omringt mijn gaan en mijn liggen; en Gij zijt al mijn wegen gewend."));
dusuperobject.biblemap.put("b19_139_4", new dusuperobject(19,139,4,"Als er nog geen woord op mijn tong is, zie, HEERE! Gij weet het alles."));
dusuperobject.biblemap.put("b19_139_5", new dusuperobject(19,139,5,"Gij bezet mij van achteren en van voren, en Gij zet Uw hand op mij."));
dusuperobject.biblemap.put("b19_139_6", new dusuperobject(19,139,6,"De kennis is mij te wonderbaar, zij is hoog, ik kan er niet bij."));
dusuperobject.biblemap.put("b19_139_7", new dusuperobject(19,139,7,"Waar zou ik heengaan voor Uw Geest en waar zou ik heenvlieden voor Uw aangezicht?"));
dusuperobject.biblemap.put("b19_139_8", new dusuperobject(19,139,8,"Zo ik opvoer ten hemel, Gij zijt daar; of bedde ik mij in de hel, zie, Gij zijt daar."));
dusuperobject.biblemap.put("b19_139_9", new dusuperobject(19,139,9,"Nam ik vleugelen des dageraads, woonde ik aan het uiterste der zee;"));
dusuperobject.biblemap.put("b19_139_10", new dusuperobject(19,139,10,"Ook daar zou Uw hand mij geleiden, en Uw rechterhand zou mij houden."));
dusuperobject.biblemap.put("b19_139_11", new dusuperobject(19,139,11,"Indien ik zeide: De duisternis zal mij immers bedekken; dan is de nacht een licht om mij."));
dusuperobject.biblemap.put("b19_139_12", new dusuperobject(19,139,12,"Ook verduistert de duisternis voor U niet; maar de nacht licht als de dag; de duisternis is als het licht."));
dusuperobject.biblemap.put("b19_139_13", new dusuperobject(19,139,13,"Want Gij bezit mijn nieren; Gij hebt mij in mijner moeders buik bedekt."));
dusuperobject.biblemap.put("b19_139_14", new dusuperobject(19,139,14,"Ik loof U, omdat ik op een heel vreselijke wijze wonderbaarlijk gemaakt ben; wonderlijk zijn Uw werken! ook weet het mijn ziel zeer wel."));
dusuperobject.biblemap.put("b19_139_15", new dusuperobject(19,139,15,"Mijn gebeente was voor U niet verholen, als ik in het verborgene gemaakt ben, en als een borduursel gewrocht ben, in de nederste delen der aarde."));
dusuperobject.biblemap.put("b19_139_16", new dusuperobject(19,139,16,"Uw ogen hebben mijn ongevormden klomp gezien; en al deze dingen waren in Uw boek geschreven, de dagen als zij geformeerd zouden worden, toen nog geen van die was."));
dusuperobject.biblemap.put("b19_139_17", new dusuperobject(19,139,17,"Daarom, hoe kostelijk zijn mij, o God, Uw gedachten! hoe machtig veel zijn haar sommen!"));
dusuperobject.biblemap.put("b19_139_18", new dusuperobject(19,139,18,"Zoude ik ze tellen? Harer is meer, dan des zands; word ik wakker, zo ben ik nog bij U."));
dusuperobject.biblemap.put("b19_139_19", new dusuperobject(19,139,19,"O God! dat Gij den goddeloze ombracht! en gij, mannen des bloeds, wijkt van mij!"));
dusuperobject.biblemap.put("b19_139_20", new dusuperobject(19,139,20,"Die van U schandelijk spreken, en Uw vijanden ijdellijk verheffen."));
dusuperobject.biblemap.put("b19_139_21", new dusuperobject(19,139,21,"Zou ik niet haten HEERE! die U haten? en verdriet hebben in degenen, die tegen U opstaan?"));
dusuperobject.biblemap.put("b19_139_22", new dusuperobject(19,139,22,"Ik haat hen met volkomen haat, tot vijanden zijn zij mij."));
dusuperobject.biblemap.put("b19_139_23", new dusuperobject(19,139,23,"Doorgrond mij, o God! en ken mijn hart; beproef mij, en ken mijn gedachten."));
dusuperobject.biblemap.put("b19_139_24", new dusuperobject(19,139,24,"En zie, of bij mij een schadelijke weg zij; en leid mij op den eeuwigen weg."));
dusuperobject.biblemap.put("b19_140_1", new dusuperobject(19,140,1,"Een psalm van David, voor den opperzangmeester."));
dusuperobject.biblemap.put("b19_140_2", new dusuperobject(19,140,2,"Red mij, HEERE! van den kwaden mens; behoed mij voor den man alles gewelds;"));
dusuperobject.biblemap.put("b19_140_3", new dusuperobject(19,140,3,"Die veel kwaads in het hart denken, allen dag samenkomen om te oorlogen."));
dusuperobject.biblemap.put("b19_140_4", new dusuperobject(19,140,4,"Zij scherpen hun tong, als een slang; heet addervergift is onder hun lippen. Sela."));
dusuperobject.biblemap.put("b19_140_5", new dusuperobject(19,140,5,"Bewaar mij, HEERE! van de handen des goddelozen; behoed mij van den man alles gewelds; van hen, die mijn voeten denken weg te stoten."));
dusuperobject.biblemap.put("b19_140_6", new dusuperobject(19,140,6,"De hovaardigen hebben mij een strik verborgen, en koorden; zij hebben een net uitgespreid aan de zijde des wegs; valstrikken hebben zij mij gezet. Sela."));
dusuperobject.biblemap.put("b19_140_7", new dusuperobject(19,140,7,"Ik heb tot den HEERE gezegd: Gij zijt mijn God; neem ter ore, o HEERE! de stem mijner smekingen."));
dusuperobject.biblemap.put("b19_140_8", new dusuperobject(19,140,8,"HEERE, Heere, Sterkte mijns heils! Gij hebt mijn hoofd bedekt ten dage der wapening."));
dusuperobject.biblemap.put("b19_140_9", new dusuperobject(19,140,9,"Geef, HEERE! de begeerten des goddelozen niet; bevorder zijn kwaad voornemen niet; zij zouden zich verheffen. Sela."));
dusuperobject.biblemap.put("b19_140_10", new dusuperobject(19,140,10,"Aangaande het hoofd dergenen, die mij omringen, de overlast hunner lippen overdekke hen."));
dusuperobject.biblemap.put("b19_140_11", new dusuperobject(19,140,11,"Vurige kolen moeten op hen geschud worden; Hij doe hen vallen in het vuur, in diepe kuilen, dat zij niet weder opstaan."));
dusuperobject.biblemap.put("b19_140_12", new dusuperobject(19,140,12,"Een man van kwade tong zal op de aarde niet bevestigd worden; een boos man des gewelds, dien zal men jagen, totdat hij geheel verdreven is."));
dusuperobject.biblemap.put("b19_140_13", new dusuperobject(19,140,13,"Ik weet, dat de HEERE de rechtzaak des ellendigen, en het recht der nooddruftigen zal uitvoeren. [ (Psalms 140:14) Gewisselijk, de rechtvaardigen zullen Uw Naam loven; de oprechten zullen voor Uw aangezicht blijven. ]"));
dusuperobject.biblemap.put("b19_141_1", new dusuperobject(19,141,1,"Een psalm van David. HEERE! ik roep U aan, haast U tot mij; neem mijn stem ter ore, als ik tot U roep."));
dusuperobject.biblemap.put("b19_141_2", new dusuperobject(19,141,2,"Mijn gebed worde gesteld als reukwerk voor Uw aangezicht, de opheffing mijner handen als het avondoffer."));
dusuperobject.biblemap.put("b19_141_3", new dusuperobject(19,141,3,"HEERE! zet een wacht voor mijn mond, behoed de deur mijner lippen."));
dusuperobject.biblemap.put("b19_141_4", new dusuperobject(19,141,4,"Neig mijn hart niet tot een kwade zaak, om enigen handel in goddeloosheid te handelen, met mannen, die ongerechtigheid werken; en dat ik niet ete van hun lekkernijen."));
dusuperobject.biblemap.put("b19_141_5", new dusuperobject(19,141,5,"De rechtvaardige sla mij, het zal weldadigheid zijn; en hij bestraffe mij, het zal olie des hoofds zijn, het zal mijn hoofd niet breken; want nog zal ook mijn gebed voor hen zijn in hun tegenspoeden."));
dusuperobject.biblemap.put("b19_141_6", new dusuperobject(19,141,6,"Hun rechters zijn aan de zijde der steenrots vrijgelaten geweest, en hebben gehoord mijn redenen, dat zij aangenaam waren."));
dusuperobject.biblemap.put("b19_141_7", new dusuperobject(19,141,7,"Onze beenderen zijn verstrooid aan den mond des grafs, gelijk of iemand op de aarde iets gekloofd en verdeeld had."));
dusuperobject.biblemap.put("b19_141_8", new dusuperobject(19,141,8,"Doch op U zijn mijn ogen, HEERE, Heere! op U betrouw ik, ontbloot mijn ziel niet."));
dusuperobject.biblemap.put("b19_141_9", new dusuperobject(19,141,9,"Bewaar mij voor het geweld des striks, dien zij mij gelegd hebben, en voor de valstrikken van de werkers der ongerechtigheid."));
dusuperobject.biblemap.put("b19_141_10", new dusuperobject(19,141,10,"Dat de goddelozen elk in zijn garen vallen, te zamen, totdat ik zal zijn voorbijgegaan."));
dusuperobject.biblemap.put("b19_142_1", new dusuperobject(19,142,1,"Een onderwijzing van David, een gebed, als hij in de spelonk was."));
dusuperobject.biblemap.put("b19_142_2", new dusuperobject(19,142,2,"Ik riep met mijn stem tot den HEERE; ik smeekte tot den HEERE met mijn stem."));
dusuperobject.biblemap.put("b19_142_3", new dusuperobject(19,142,3,"Ik stortte mijn klacht uit voor Zijn aangezicht; ik gaf te kennen voor Zijn aangezicht mijn benauwdheid."));
dusuperobject.biblemap.put("b19_142_4", new dusuperobject(19,142,4,"Als mijn geest in mij overstelpt was, zo hebt Gij mijn pad gekend. Zij hebben mij een strik verborgen op den weg, dien ik gaan zou."));
dusuperobject.biblemap.put("b19_142_5", new dusuperobject(19,142,5,"Ik zag uit ter rechterhand, en ziet, zo was er niemand, die mij kende, er was geen ontvlieden voor mij; niemand zorgde voor mijn ziel."));
dusuperobject.biblemap.put("b19_142_6", new dusuperobject(19,142,6,"Tot U riep ik, o HEERE! ik zeide: Gij zijt mijn Toevlucht, mijn Deel in het land der levenden."));
dusuperobject.biblemap.put("b19_142_7", new dusuperobject(19,142,7,"Let op mijn geschrei, want ik ben zeer uitgeteerd; red mij van mijn vervolgers, want zij zijn machtiger dan ik. [ (Psalms 142:8) Voer mijn ziel uit de gevangenis, om Uw Naam te loven; de rechtvaardigen zullen mij omringen, wanneer Gij wel bij mij zult gedaan hebben. ]"));
dusuperobject.biblemap.put("b19_143_1", new dusuperobject(19,143,1,"Een psalm van David. O HEERE! hoor mijn gebed, neig de oren tot mijn smekingen; verhoor mij naar Uw waarheid, naar Uw gerechtigheid."));
dusuperobject.biblemap.put("b19_143_2", new dusuperobject(19,143,2,"En ga niet in het gericht met Uw knecht; want niemand, die leeft, zal voor Uw aangezicht rechtvaardig zijn."));
dusuperobject.biblemap.put("b19_143_3", new dusuperobject(19,143,3,"Want de vijand vervolgt mijn ziel, hij vertreedt mijn leven ter aarde; hij legt mij in duisternissen, als degenen, die over lang dood zijn."));
dusuperobject.biblemap.put("b19_143_4", new dusuperobject(19,143,4,"Daarom wordt mijn geest overstelpt in mij, mijn hart is verbaasd in het midden van mij."));
dusuperobject.biblemap.put("b19_143_5", new dusuperobject(19,143,5,"Ik gedenk aan de dagen van ouds; ik overleg al Uw daden; ik spreek bij mijzelven van de werken Uwer handen."));
dusuperobject.biblemap.put("b19_143_6", new dusuperobject(19,143,6,"Ik breid mijn handen uit tot U; mijn ziel is voor U als een dorstig land. Sela."));
dusuperobject.biblemap.put("b19_143_7", new dusuperobject(19,143,7,"Verhoor mij haastelijk, HEERE! mijn geest bezwijkt; verberg Uw aangezicht niet van mij, want ik zou gelijk worden dengenen, die in den kuil dalen."));
dusuperobject.biblemap.put("b19_143_8", new dusuperobject(19,143,8,"Doe mij Uw goedertierenheid in den morgenstond horen, want ik betrouw op U; maak mij bekend den weg, dien ik te gaan heb, want ik hef mijn ziel tot U op."));
dusuperobject.biblemap.put("b19_143_9", new dusuperobject(19,143,9,"Red mij, HEERE! van mijn vijanden; bij U schuil ik."));
dusuperobject.biblemap.put("b19_143_10", new dusuperobject(19,143,10,"Leer mij Uw welbehagen doen, want Gij zijt mijn God! Uw goede Geest geleide mij in een effen land."));
dusuperobject.biblemap.put("b19_143_11", new dusuperobject(19,143,11,"O HEERE! maak mij levend, om Uws Naams wil; voer mijn ziel uit de benauwdheid, om Uw gerechtigheid."));
dusuperobject.biblemap.put("b19_143_12", new dusuperobject(19,143,12,"En roei mijn vijanden uit, om Uw goedertierenheid, en breng hen om, allen, die mijn ziel beangstigen; want ik ben Uw knecht."));
dusuperobject.biblemap.put("b19_144_1", new dusuperobject(19,144,1,"Een psalm van David. Gezegend zij de HEERE, mijn Rotssteen, Die mijn handen onderwijst ten strijde, mijn vingeren ten oorlog;"));
dusuperobject.biblemap.put("b19_144_2", new dusuperobject(19,144,2,"Mijn Goedertierenheid en mijn Burg, mijn Hoog Vertrek en mijn Bevrijder voor mij, mijn Schild, en op Wien ik mij betrouwe; Die mijn volk aan mij onderwerpt!"));
dusuperobject.biblemap.put("b19_144_3", new dusuperobject(19,144,3,"O HEERE! wat is de mens, dat Gij hem kent, het kind des mensen, dat Gij het acht?"));
dusuperobject.biblemap.put("b19_144_4", new dusuperobject(19,144,4,"De mens is der ijdelheid gelijk; zijn dagen zijn als een voorbijgaande schaduw."));
dusuperobject.biblemap.put("b19_144_5", new dusuperobject(19,144,5,"Neig Uw hemelen, HEERE! en daal neder; raak de bergen aan, dat zij roken."));
dusuperobject.biblemap.put("b19_144_6", new dusuperobject(19,144,6,"Bliksem bliksem, en verstrooi hen; zend Uw pijlen uit, en verdoe hen."));
dusuperobject.biblemap.put("b19_144_7", new dusuperobject(19,144,7,"Steek Uw handen van de hoogte uit; ontzet mij, en ruk mij uit de grote wateren, uit de hand der vreemden;"));
dusuperobject.biblemap.put("b19_144_8", new dusuperobject(19,144,8,"Welker mond leugen spreekt, en hun rechterhand is een rechterhand der valsheid."));
dusuperobject.biblemap.put("b19_144_9", new dusuperobject(19,144,9,"O God! ik zal U een nieuw lied zingen; met de luit en het tiensnarig instrument zal ik U psalmzingen."));
dusuperobject.biblemap.put("b19_144_10", new dusuperobject(19,144,10,"Gij, die den koningen overwinning geeft, Die Zijn knecht David ontzet van het boze zwaard;"));
dusuperobject.biblemap.put("b19_144_11", new dusuperobject(19,144,11,"Ontzet mij en red mij van de hand der vreemden, welker mond leugen spreekt, en hun rechterhand is een rechterhand der valsheid;"));
dusuperobject.biblemap.put("b19_144_12", new dusuperobject(19,144,12,"Opdat onze zonen zijn als planten, welke groot geworden zijn in hun jeugd; onze dochter als hoekstenen, uitgehouwen naar de gelijkenis van een paleis."));
dusuperobject.biblemap.put("b19_144_13", new dusuperobject(19,144,13,"Dat onze winkelen vol zijnde, den enen voorraad na den anderen uitgeven; dat onze kudden bij duizenden werpen, ja, bij tienduizenden op onze hoeven vermenigvuldigen."));
dusuperobject.biblemap.put("b19_144_14", new dusuperobject(19,144,14,"Dat onze ossen wel geladen zijn; dat geen inbreuk, noch uitval, noch gekrijs zij op onze straten."));
dusuperobject.biblemap.put("b19_144_15", new dusuperobject(19,144,15,"Welgelukzalig is het volk, dien het alzo gaat; welgelukzalig is het volk, wiens God de HEERE is."));
dusuperobject.biblemap.put("b19_145_1", new dusuperobject(19,145,1,"Een lofzang van David. Aleph. O mijn God, Gij Koning! ik zal U verhogen, en Uw Naam loven in eeuwigheid en altoos."));
dusuperobject.biblemap.put("b19_145_2", new dusuperobject(19,145,2,"Beth. Te allen dage zal ik U loven, en Uw Naam prijzen in eeuwigheid en altoos."));
dusuperobject.biblemap.put("b19_145_3", new dusuperobject(19,145,3,"Gimel. De HEERE is groot en zeer te prijzen, en Zijn grootheid is ondoorgrondelijk."));
dusuperobject.biblemap.put("b19_145_4", new dusuperobject(19,145,4,"Daleth. Geslacht aan geslacht zal Uw werken roemen; en zij zullen Uw mogendheden verkondigen."));
dusuperobject.biblemap.put("b19_145_5", new dusuperobject(19,145,5,"He. Ik zal uitspreken de heerlijkheid der eer Uwer majesteit, en Uw wonderlijke daden."));
dusuperobject.biblemap.put("b19_145_6", new dusuperobject(19,145,6,"Vau. En zij zullen vermelden de kracht Uwer vreselijke daden; en Uw grootheid, die zal ik vertellen."));
dusuperobject.biblemap.put("b19_145_7", new dusuperobject(19,145,7,"Zain. Zij zullen de gedachtenis der grootheid Uwer goedheid overvloediglijk uitstorten, en zij zullen Uw gerechtigheid met gejuich verkondigen."));
dusuperobject.biblemap.put("b19_145_8", new dusuperobject(19,145,8,"Cheth. Genadig en barmhartig is de HEERE, lankmoedig en groot van goedertierenheid."));
dusuperobject.biblemap.put("b19_145_9", new dusuperobject(19,145,9,"Teth. De HEERE is aan allen goed, en Zijn barmhartigheden zijn over al Zijn werken."));
dusuperobject.biblemap.put("b19_145_10", new dusuperobject(19,145,10,"Jod. Al Uw werken, HEERE, zullen U loven, en Uw gunstgenoten zullen U zegenen."));
dusuperobject.biblemap.put("b19_145_11", new dusuperobject(19,145,11,"Caph. Zij zullen de heerlijkheid Uws Koninkrijks vermelden, en Uw mogendheid zullen zij uitspreken."));
dusuperobject.biblemap.put("b19_145_12", new dusuperobject(19,145,12,"Lamed. Om de mensenkinderen bekend te maken Zijn mogendheden, en de eer der heerlijkheid Zijns Koninkrijks."));
dusuperobject.biblemap.put("b19_145_13", new dusuperobject(19,145,13,"Mem. Uw Koninkrijk is een Koninkrijk van alle eeuwen, en Uw heerschappij is in alle geslacht en geslacht."));
dusuperobject.biblemap.put("b19_145_14", new dusuperobject(19,145,14,"Samech. De HEERE ondersteunt allen, die vallen, en Hij richt op alle gebogenen."));
dusuperobject.biblemap.put("b19_145_15", new dusuperobject(19,145,15,"Ain. Aller ogen wachten op U; en Gij geeft hun hun spijs te zijner tijd."));
dusuperobject.biblemap.put("b19_145_16", new dusuperobject(19,145,16,"Pe. Gij doet Uw hand open, en verzadigt al wat er leeft, naar Uw welbehagen."));
dusuperobject.biblemap.put("b19_145_17", new dusuperobject(19,145,17,"Tsade. De HEERE is rechtvaardig in al Zijn wegen, en goedertieren in al Zijn werken."));
dusuperobject.biblemap.put("b19_145_18", new dusuperobject(19,145,18,"Koph. De HEERE is nabij allen, die Hem aanroepen, allen, die Hem aanroepen in der waarheid."));
dusuperobject.biblemap.put("b19_145_19", new dusuperobject(19,145,19,"Resch. Hij doet het welbehagen dergenen, die Hem vrezen, en Hij hoort hun geroep, en verlost hen."));
dusuperobject.biblemap.put("b19_145_20", new dusuperobject(19,145,20,"Schin. De HEERE bewaart al degenen, die Hem liefhebben; maar Hij verdelgt alle goddelozen."));
dusuperobject.biblemap.put("b19_145_21", new dusuperobject(19,145,21,"Thau. Mijn mond zal den prijs des HEEREN uitspreken, en alle vlees zal Zijn heiligen Naam loven in der eeuwigheid en altoos."));
dusuperobject.biblemap.put("b19_146_1", new dusuperobject(19,146,1,"Hallelujah! O mijn ziel! prijs den HEERE."));
dusuperobject.biblemap.put("b19_146_2", new dusuperobject(19,146,2,"Ik zal den HEERE prijzen in mijn leven; ik zal mijn God psalmzingen, terwijl ik nog ben."));
dusuperobject.biblemap.put("b19_146_3", new dusuperobject(19,146,3,"Vertrouwt niet op prinsen, op des mensen kind, bij hetwelk geen heil is."));
dusuperobject.biblemap.put("b19_146_4", new dusuperobject(19,146,4,"Zijn geest gaat uit, hij keert wederom tot zijn aarde; te dienzelfden dage vergaan zijn aanslagen."));
dusuperobject.biblemap.put("b19_146_5", new dusuperobject(19,146,5,"Welgelukzalig is hij, die den God Jakobs tot zijn Hulp heeft, wiens verwachting op den HEERE, zijn God is;"));
dusuperobject.biblemap.put("b19_146_6", new dusuperobject(19,146,6,"Die den hemel en de aarde gemaakt heeft, de zee en al wat in dezelve is; Die trouwe houdt in der eeuwigheid."));
dusuperobject.biblemap.put("b19_146_7", new dusuperobject(19,146,7,"Die den verdrukte recht doet, Die den hongerige brood geeft; de HEERE maakt de gevangenen los."));
dusuperobject.biblemap.put("b19_146_8", new dusuperobject(19,146,8,"De HEERE opent de ogen der blinden; de HEERE richt de gebogenen op; de HEERE heeft de rechtvaardigen lief."));
dusuperobject.biblemap.put("b19_146_9", new dusuperobject(19,146,9,"De HEERE bewaart de vreemdelingen; Hij houdt den wees en de weduwe staande; maar der goddelozen weg keert Hij om."));
dusuperobject.biblemap.put("b19_146_10", new dusuperobject(19,146,10,"De HEERE zal in eeuwigheid regeren; uw God, o Sion! is van geslacht tot geslacht. Hallelujah!"));
dusuperobject.biblemap.put("b19_147_1", new dusuperobject(19,147,1,"Looft den HEERE, want onzen God te psalmzingen is goed, dewijl Hij liefelijk is; de lof is betamelijk."));
dusuperobject.biblemap.put("b19_147_2", new dusuperobject(19,147,2,"De HEERE bouwt Jeruzalem; Hij vergadert Israels verdrevenen."));
dusuperobject.biblemap.put("b19_147_3", new dusuperobject(19,147,3,"Hij geneest de gebrokenen van hart, en Hij verbindt hen in hun smarten."));
dusuperobject.biblemap.put("b19_147_4", new dusuperobject(19,147,4,"Hij telt het getal der sterren; Hij noemt ze allen bij namen."));
dusuperobject.biblemap.put("b19_147_5", new dusuperobject(19,147,5,"Onze Heere is groot en van veel kracht; Zijns verstands is geen getal."));
dusuperobject.biblemap.put("b19_147_6", new dusuperobject(19,147,6,"De HEERE houdt de zachtmoedigen staande; de goddelozen vernedert Hij, tot de aarde toe."));
dusuperobject.biblemap.put("b19_147_7", new dusuperobject(19,147,7,"Zingt den HEERE bij beurte met dankzegging; psalmzingt onzen God op de harp."));
dusuperobject.biblemap.put("b19_147_8", new dusuperobject(19,147,8,"Die de hemelen met wolken bedekt, Die voor de aarde regen bereidt; Die het gras op de bergen doet uitspruiten;"));
dusuperobject.biblemap.put("b19_147_9", new dusuperobject(19,147,9,"Die het vee zijn voeder geeft; aan de jonge raven, als zij roepen."));
dusuperobject.biblemap.put("b19_147_10", new dusuperobject(19,147,10,"Hij heeft geen lust aan de sterkte des paards; Hij heeft geen welgevallen aan de benen des mans."));
dusuperobject.biblemap.put("b19_147_11", new dusuperobject(19,147,11,"De HEERE heeft een welgevallen aan hen, die Hem vrezen, die op Zijn goedertierenheid hopen."));
dusuperobject.biblemap.put("b19_147_12", new dusuperobject(19,147,12,"O Jeruzalem! roem den HEERE; o Sion! loof uw God."));
dusuperobject.biblemap.put("b19_147_13", new dusuperobject(19,147,13,"Want Hij maakt de grendelen uwer poorten sterk; Hij zegent uw kinderen binnen in u."));
dusuperobject.biblemap.put("b19_147_14", new dusuperobject(19,147,14,"Die uw landpalen in vrede stelt; Hij verzadigt u met het vette der tarwe."));
dusuperobject.biblemap.put("b19_147_15", new dusuperobject(19,147,15,"Hij zendt Zijn bevel op aarde; Zijn woord loopt zeer snel."));
dusuperobject.biblemap.put("b19_147_16", new dusuperobject(19,147,16,"Hij geeft sneeuw als wol; Hij strooit den rijm als as."));
dusuperobject.biblemap.put("b19_147_17", new dusuperobject(19,147,17,"Hij werpt Zijn ijs heen als stukken; wie zou bestaan voor Zijn koude?"));
dusuperobject.biblemap.put("b19_147_18", new dusuperobject(19,147,18,"Hij zendt Zijn woord, en doet ze smelten; Hij doet Zijn wind waaien, de wateren vloeien henen."));
dusuperobject.biblemap.put("b19_147_19", new dusuperobject(19,147,19,"Hij maakt Jakob Zijn woorden bekend, Israel Zijn inzettingen en Zijn rechten."));
dusuperobject.biblemap.put("b19_147_20", new dusuperobject(19,147,20,"Alzo heeft Hij geen volk gedaan; en Zijn rechten, die kennen zij niet. Hallelujah!"));
dusuperobject.biblemap.put("b19_148_1", new dusuperobject(19,148,1,"Hallelujah! Looft den HEERE uit de hemelen; looft Hem in de hoogste plaatsen!"));
dusuperobject.biblemap.put("b19_148_2", new dusuperobject(19,148,2,"Looft Hem, al Zijn engelen! Looft Hem, al Zijn heirscharen!"));
dusuperobject.biblemap.put("b19_148_3", new dusuperobject(19,148,3,"Looft Hem, zon en maan! Looft Hem, alle gij lichtende sterren!"));
dusuperobject.biblemap.put("b19_148_4", new dusuperobject(19,148,4,"Looft Hem, gij hemelen der hemelen! en gij wateren, die boven de hemelen zijt!"));
dusuperobject.biblemap.put("b19_148_5", new dusuperobject(19,148,5,"Dat zij den Naam des HEEREN loven; want als Hij het beval, zo werden zij geschapen."));
dusuperobject.biblemap.put("b19_148_6", new dusuperobject(19,148,6,"En Hij heeft ze bevestigd voor altoos in eeuwigheid; Hij heeft hun een orde gegeven, die geen van hen zal overtreden."));
dusuperobject.biblemap.put("b19_148_7", new dusuperobject(19,148,7,"Looft den HEERE, van de aarde; gij walvissen en alle afgronden!"));
dusuperobject.biblemap.put("b19_148_8", new dusuperobject(19,148,8,"Vuur en hagel, sneeuw en damp; gij stormwind, die Zijn woord doet!"));
dusuperobject.biblemap.put("b19_148_9", new dusuperobject(19,148,9,"Gij bergen en alle heuvelen; vruchtbomen en alle cederbomen!"));
dusuperobject.biblemap.put("b19_148_10", new dusuperobject(19,148,10,"Het wild gedierte en alle vee; kruipend gedierte en gevleugeld gevogelte!"));
dusuperobject.biblemap.put("b19_148_11", new dusuperobject(19,148,11,"Gij koningen der aarde, en alle volken, gij vorsten, en alle rechters der aarde!"));
dusuperobject.biblemap.put("b19_148_12", new dusuperobject(19,148,12,"Jongelingen en ook maagden; gij ouden met de jongen!"));
dusuperobject.biblemap.put("b19_148_13", new dusuperobject(19,148,13,"Dat zij den Naam des HEEREN loven; want Zijn Naam alleen is hoog verheven; Zijn majesteit is over de aarde en den hemel."));
dusuperobject.biblemap.put("b19_148_14", new dusuperobject(19,148,14,"En Hij heeft den hoorn Zijns volks verhoogd, den roem al Zijner gunstgenoten, der kinderen Israels, des volks, dat nabij Hem is. Hallelujah!"));
dusuperobject.biblemap.put("b19_149_1", new dusuperobject(19,149,1,"Hallelujah! Zingt den HEERE een nieuw lied; Zijn lof zij in de gemeente Zijner gunstgenoten."));
dusuperobject.biblemap.put("b19_149_2", new dusuperobject(19,149,2,"Dat Israel zich verblijde in Dengene, Die hem gemaakt heeft; dat de kinderen Sions zich verheugen over hun Koning."));
dusuperobject.biblemap.put("b19_149_3", new dusuperobject(19,149,3,"Dat zij Zijn Naam loven op de fluit; dat zij Hem psalmzingen op de trommel en harp."));
dusuperobject.biblemap.put("b19_149_4", new dusuperobject(19,149,4,"Want de HEERE heeft een welgevallen aan Zijn volk; Hij zal de zachtmoedigen versieren met heil."));
dusuperobject.biblemap.put("b19_149_5", new dusuperobject(19,149,5,"Dat Zijn gunstgenoten van vreugde opspringen, om die eer; dat zij juichen op hun legers."));
dusuperobject.biblemap.put("b19_149_6", new dusuperobject(19,149,6,"De verheffingen Gods zullen in hun keel zijn; en een tweesnijdend zwaard in hun hand;"));
dusuperobject.biblemap.put("b19_149_7", new dusuperobject(19,149,7,"Om wraak te doen over de heidenen, en bestraffingen over de volken;"));
dusuperobject.biblemap.put("b19_149_8", new dusuperobject(19,149,8,"Om hun koningen te binden met ketenen, en hun achtbaren met ijzeren boeien;"));
dusuperobject.biblemap.put("b19_149_9", new dusuperobject(19,149,9,"Om het beschreven recht over hen te doen. Dit zal de heerlijkheid van al Zijn gunstgenoten zijn. Hallelujah!"));
dusuperobject.biblemap.put("b19_150_1", new dusuperobject(19,150,1,"Hallelujah! Looft God in Zijn heiligdom; looft Hem in het uitspansel Zijner sterkte!"));
dusuperobject.biblemap.put("b19_150_2", new dusuperobject(19,150,2,"Looft Hem vanwege Zijn mogendheden; looft Hem naar de menigvuldigheid Zijner grootheid!"));
dusuperobject.biblemap.put("b19_150_3", new dusuperobject(19,150,3,"Looft Hem met geklank der bazuin; looft Hem met de luit en met de harp!"));
dusuperobject.biblemap.put("b19_150_4", new dusuperobject(19,150,4,"Looft Hem met de trommel en fluit; looft Hem met snarenspel en orgel!"));
dusuperobject.biblemap.put("b19_150_5", new dusuperobject(19,150,5,"Looft Hem met hel klinkende cimbalen; looft Hem met cimbalen van vreugdegeluid!"));
dusuperobject.biblemap.put("b19_150_6", new dusuperobject(19,150,6,"Alles, wat adem heeft, love den HEERE! Hallelujah!"));

}

}